INSERT INTO movies VALUES('2425','Citizen Kane',1941,'["USA"]','["Drama","Mystery"]',119,'Newspaper magnate, Charles Foster Kane is taken from his mother as a boy and made the ward of a rich industrialist. As a result, every well-meaning, tyrannical or self-destructive move he makes for the rest of his life appears in some way to be a reaction to that deeply wounding event.','bw',1,15,'tt0033467','/sav0jxhqiH0bPr2vZFU0Kjt2nZL.jpg','/ruF3Lmd4A8MHbnEBE6lxPMbsHGL.jpg');
INSERT INTO movies VALUES('7704','Vertigo',1958,'["USA"]','["Thriller","Drama","Mystery"]',128,'A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend''s wife, all the while becoming dangerously obsessed with her.','col',2,426,'tt0052357','/15uOEfqBNTVtDUT7hGBVCka0rZz.jpg','/5zKeHHFYfuyH0KFR7h3IYnOHL7v.jpg');
INSERT INTO movies VALUES('10165','2001: A Space Odyssey',1968,'["UK","USA"]','["Science Fiction"]',139,'Humanity finds a mysterious object buried beneath the lunar surface and sets off to find its origins with the help of HAL 9000, the world''s most advanced super computer.','col',3,62,'tt0062622','/ve72VxNqjGM69Uky4WTo2bK6rfq.jpg','/w5IDXtifKntw0ajv2co7jFlTQDM.jpg');
INSERT INTO movies VALUES('5929','Tokyo Story',1953,'["Japan"]','["Drama"]',134,'The elderly Shukishi and his wife, Tomi, take the long journey from their small seaside village to visit their adult children in Tokyo. Their elder son, Koichi, a doctor, and their daughter, Shige, a hairdresser, don''t have much time to spend with their aged parents, and so it falls to Noriko, the widow of their younger son who was killed in the war, to keep her in-laws company.','bw',4,18148,'tt0046438','/g2YbTYKpY7N2yDSk7BfXZ18I5QV.jpg','/jLq0ol1f0ZKXni9R9GsPBcyPrNN.jpg');
INSERT INTO movies VALUES('2077','Rules of the Game, The',1939,'["France"]','["Drama","Comedy"]',113,'A weekend at a marquis’ country château lays bare some ugly truths about a group of haut bourgeois acquaintances.','bw',5,776,'tt0031885','/8JOzt7uFZyshcuzCBmYU6CDJL4D.jpg','/lxNG1eGsfY8yOeTSk66B5hrv6pZ.jpg');
INSERT INTO movies VALUES('11414','Godfather, The',1972,'["USA"]','["Drama","Crime"]',175,'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.','col',6,238,'tt0068646','/3bhkrj58Vtu7enYsRolD1fZdja1.jpg','/tmU7GeKVybMWFButWEGl2M4GeiP.jpg');
INSERT INTO movies VALUES('8883','8½',1963,'["Italy"]','["Drama"]',135,'Guido Anselmi, a film director, finds himself creatively barren at the peak of his career. Urged by his doctors to rest, Anselmi heads for a luxurious resort, but a sorry group gathers—his producer, staff, actors, wife, mistress, and relatives—each one begging him to get on with the show. In retreat from their dependency, he fantasizes about past women and dreams of his childhood.','bw',7,422,'tt0056801','/tMWvzPsvpmlklcPVjVLpUWgZHua.jpg','/hiXMQiwpa0fqPJxWLSMWTbpiWn8.jpg');
INSERT INTO movies VALUES('1514','Sunrise',1927,'["USA"]','["Romance","Drama","Crime"]',110,'A married farmer falls under the spell of a slatternly woman from the city, who tries to convince him to drown his wife.','bw',8,631,'tt0018455','/oj8ZW8jKXBSs8F1e5iWsTUeXSJW.jpg','/hKrrCigPFmhv1bg5IJl9nzjEaN4.jpg');
INSERT INTO movies VALUES('6866','Searchers, The',1956,'["USA"]','["Western"]',119,'As a Civil War veteran spends years searching for a young niece captured by Indians, his motivation becomes increasingly questionable.','col',9,3114,'tt0049730','/jLBmgW0epNzJ1N9uzaVCjbyT94v.jpg','/aQIoKc8PHE0MVEBMz2fXAQnosYK.jpg');
INSERT INTO movies VALUES('6207','Seven Samurai',1954,'["Japan"]','["Drama","Action"]',200,'A samurai answers a village''s request for protection after he falls on hard times. The town needs protection from bandits, so the samurai gathers six others to help him teach the people how to defend themselves, and the villagers provide the soldiers with food.','bw',10,346,'tt0047478','/8OKmBV5BUFzmozIC3pPWKHy17kx.jpg','/qvZ91FwMq6O47VViAr8vZNQz3WI.jpg');
INSERT INTO movies VALUES('5535','Singin'' in the Rain',1952,'["USA"]','["Musical","Dance","Comedy"]',102,'In 1927 Hollywood, a silent film production company and cast make a difficult transition to sound.','col',11,872,'tt0045152','/w03EiJVHP8Un77boQeE7hg9DVdU.jpg','/mxf8hJJkHTCqZP3m4o8E1TtwHHs.jpg');
INSERT INTO movies VALUES('18521','Jeanne Dielman, 23 Quai du Commerce, 1080 Bruxelles',1975,'["Belgium","France"]','["Drama","Avant","Garde"]',201,'A lonely widowed housewife does her daily chores and takes care of her apartment where she lives with her teenage son, and turns the occasional trick to make ends meet. Slowly, her ritualized daily routines begin to fall apart.','col',12,44012,'tt0073198','/yeL8c24oBUQSdms8f7GmRvx3DIZ.jpg','/iIcEswHTHaQOChtSIoylfNGjVz5.jpg');
INSERT INTO movies VALUES('13082','Apocalypse Now',1979,'["USA"]','["War","Drama","Adventure"]',150,'At the height of the Vietnam war, Captain Benjamin Willard is sent on a dangerous mission that, officially, "does not exist, nor will it ever exist." His goal is to locate - and eliminate - a mysterious Green Beret Colonel named Walter Kurtz, who has been leading his personal army on illegal guerrilla missions into enemy territory.','col',13,28,'tt0078788','/gQB8Y5RCMkv2zwzFHbUJX3kAhvA.jpg','/8viWxsL4lwmQZB8QHOCHwMvBGXd.jpg');
INSERT INTO movies VALUES('12567','Taxi Driver',1976,'["USA"]','["Drama","Crime"]',113,'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action.','col',14,103,'tt0075314','/ekstpH614fwDX8DUln1a2Opz0N8.jpg','/6aoyUbvu0419XLKLIMoH0TkEicH.jpg');
INSERT INTO movies VALUES('4377','Bicycle Thieves',1948,'["Italy"]','["Drama"]',89,'Unemployed Antonio is elated when he finally finds work hanging posters around war-torn Rome. However on his first day, his bicycle—essential to his work—gets stolen. His job is doomed unless he can find the thief. With the help of his son, Antonio combs the city, becoming desperate for justice.','bw',15,5156,'tt0040522','/rLpveWO1hTNYF9LUZJZgTdq5nyf.jpg','/kTUUiKGKrdRhJsCcYT3Ivtfuuzh.jpg');
INSERT INTO movies VALUES('9827','Persona',1966,'["Sweden"]','["Drama"]',83,'A young nurse, Alma, is put in charge of Elisabeth Vogler: an actress who is seemingly healthy in all respects, but will not talk. As they spend time together, Alma speaks to Elisabeth constantly, never receiving any answer. The time they spend together only strengthens the crushing realization that one does not exist.','bw',16,797,'tt0060827','/oTHFti7jXEhw6EJhFPrIiQMcRiQ.jpg','/sj2aZDetPE8RoOCAm5QJitCNfLr.jpg');
INSERT INTO movies VALUES('20090','In the Mood for Love',2000,'["Hong Kong","France"]','["Romance","Drama"]',97,'In Hong Kong of 1962, Mrs. Chan and Mr. Chow, a journalist, move into neighbouring apartments on the same day. Their encounters are formal and polite—until a discovery about their respective spouses creates an intimate bond between them.','col',17,843,'tt0118694','/iYypPT4bhqXfq1b6EnmxvRt6b2Y.jpg','/n4GJFGzsc7NinI1VeGDXIcQjtU2.jpg');
INSERT INTO movies VALUES('1167','Passion of Joan of Arc, The',1928,'["France"]','["History","Drama","Biography"]',110,'A classic of the silent age, this film tells the story of the doomed but ultimately canonized 15th-century teenage warrior. On trial for claiming she''d spoken to God, Jeanne d''Arc is subjected to inhumane treatment and scare tactics at the hands of church court officials. Initially bullied into changing her story, Jeanne eventually opts for what she sees as the truth. Her punishment, a famously brutal execution, earns her perpetual martyrdom.','bw',18,780,'tt0019254','/8OYGtQlO8k9PcOm49apV62eVJQo.jpg','/A1mteOfKdvK5er2sD5i02Qw3CWz.jpg');
INSERT INTO movies VALUES('7764','Breathless',1960,'["France"]','["Romance","Drama","Crime"]',89,'A small-time thief steals a car and impulsively murders a motorcycle policeman. Wanted by the authorities, he attempts to persuade a girl to run away to Italy with him.','bw',19,269,'tt0053472','/9Wx0Wdn2EOqeCZU4SP6tlS3LOml.jpg','/5VGmkeXybclhOqBaLprigVG9Ucz.jpg');
INSERT INTO movies VALUES('839','Atalante, L''',1934,'["France"]','["Romance","Drama"]',89,'Capricious small-town girl Juliette and barge captain Jean marry after a whirlwind courtship, and she comes to live aboard his boat, L''Atalante. As they make their way down the Seine, Jean grows weary of Juliette''s flirtations with his all-male crew, and Juliette longs to escape the monotony of the boat and experience the excitement of a big city. When she steals away to Paris by herself, her husband begins to think their marriage was a mistake.','bw',20,43904,'tt0024844','/sDkQyZnFvHdnp5ZP21RG4teLiDy.jpg','/eooCQusEINqdpTMBkECHluyurW9.jpg');
INSERT INTO movies VALUES('1216','Battleship Potemkin',1925,'["USSR"]','["War","History"]',71,'A dramatized account of a great Russian naval mutiny and a resultant public demonstration, showing support, which brought on a police massacre. The film had an incredible impact on the development of cinema and is a masterful example of montage editing.','bw',21,643,'tt0015648','/tjnaRiHUsxBADaOwrQpnTnjHVwi.jpg','/uzr65Z3xDCjuMW7fw8Whm5curr7.jpg');
INSERT INTO movies VALUES('18517','Man with a Movie Camera, The',1929,'["USSR"]','["Documentary","Avant","Garde"]',80,'A cameraman wanders around with a camera slung over his shoulder, documenting urban life with dazzling inventiveness.','bw',22,26317,'tt0019760','/vJgAdgJWX54v0oXfIvhwjlZnmgn.jpg','/byRNEm1QwfQC1Mn0K4gLM2fIfWO.jpg');
INSERT INTO movies VALUES('12499','Mirror',1975,'["USSR"]','["Drama","Biography"]',107,'A dying man in his forties recalls his childhood, his mother, the war and personal moments that tell of and juxtapose pivotal moments in Soviet history with daily life.','col-bw',23,1396,'tt0072443','/AttDP5OEsMxtHPPN7Z92p2Ntnmd.jpg','/eSZZiDs6Y6dIt5BFNi1Sg3vvSVS.jpg');
INSERT INTO movies VALUES('4843','Rashomon',1950,'["Japan"]','["Drama","Crime","Mystery"]',88,'Brimming with action while incisively examining the nature of truth, "Rashomon" is perhaps the finest film ever to investigate the philosophy of justice. Through an ingenious use of camera and flashbacks, Kurosawa reveals the complexities of human nature as four people recount different versions of the story of a man''s murder and the rape of his wife.','bw',24,548,'tt0042876','/vL7Xw04nFMHwnvXRFCmYYAzMUvY.jpg','/zyO6j74DKMWfp5snWg6Hwo0T3Mz.jpg');
INSERT INTO movies VALUES('285','City Lights',1931,'["USA"]','["Romance","Comedy"]',86,'In this sound-era silent film, a tramp falls in love with a beautiful blind flower seller.','bw',25,901,'tt0021749','/bXNvzjULc9jrOVhGfjcc64uKZmZ.jpg','/n0Cju2Eu3VyrUFl32thblHFWznA.jpg');
INSERT INTO movies VALUES('7825','400 Blows, The',1959,'["France"]','["Drama"]',99,'For young Parisian boy Antoine Doinel, life is one difficult situation after another. Surrounded by inconsiderate adults, including his neglectful parents, Antoine spends his days with his best friend, Rene, trying to plan for a better life. When one of their schemes goes awry, Antoine ends up in trouble with the law, leading to even more conflicts with unsympathetic authority figures.','bw',26,147,'tt0053198','/12PuU23kkDLvTd0nb8hMlE3oShB.jpg','/cy7ymUaMEWRoig7LWXpfzaaw2vv.jpg');
INSERT INTO movies VALUES('9636','Andrei Rublev',1966,'["USSR"]','["History","Biography"]',185,'An expansive Russian drama, this film focuses on the life of revered religious icon painter Andrei Rublev. Drifting from place to place in a tumultuous era, the peace-seeking monk eventually gains a reputation for his art. But after Rublev witnesses a brutal battle and unintentionally becomes involved, he takes a vow of silence and spends time away from his work. As he begins to ease his troubled soul, he takes steps towards becoming a painter once again.','col-bw',27,895,'tt0060107','/910xRIUmNJrWH2hkQifBJtoPp5R.jpg','/fKa8Jy2ge1O0IU6zZXnJ2sxUzdU.jpg');
INSERT INTO movies VALUES('8209','Psycho',1960,'["USA"]','["Thriller","Horror"]',109,'When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.','bw',28,539,'tt0054215','/yz4QVqPx3h1hD1DfqqQkCq3rmxW.jpg','/uif5fUshJrXyyDzfpzp1DLw3N0S.jpg');
INSERT INTO movies VALUES('9644','Au hasard Balthazar',1966,'["France"]','["Drama"]',95,'The story of a donkey Balthazar as he is passed from owner to owner, some kind and some cruel but all with motivations beyond his understanding. Balthazar, whose life parallels that of his first keeper, Marie, is truly a beast of burden, suffering the sins of humankind. But despite his powerlessness, he accepts his fate nobly.','bw',29,20108,'tt0060138','/jcFxAppupS7KMjzLZZgKYLFnjpp.jpg','/7LPz7NEYtLXcV44j0kRLLkZ54yH.jpg');
INSERT INTO movies VALUES('20595','Mulholland Dr.',2001,'["France","USA"]','["Mystery","Drama","Thriller"]',147,'Blonde Betty Elms has only just arrived in Hollywood to become a movie star when she meets an enigmatic brunette with amnesia. Meanwhile, as the two set off to solve the second woman''s identity, filmmaker Adam Kesher runs into ominous trouble while casting his latest project.','col',30,1018,'tt0166924','/tVxGt7uffLVhIIcwuldXOMpFBPX.jpg','/y1giivdsGLyo1LCvlsL6mLKyTZ7.jpg');
INSERT INTO movies VALUES('11963','Godfather Part II, The',1974,'["USA"]','["Drama","Crime"]',200,'In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.','col',31,240,'tt0071562','/hek3koDUyRQk7FIhPXsa6mT2Zc3.jpg','/kGzFbGhp99zva6oZODW5atUtnqi.jpg');
INSERT INTO movies VALUES('7966','Some Like it Hot',1959,'["USA"]','["Comedy","Romance"]',121,'Two musicians witness a mob hit and struggle to find a way out of the city before they are found by the gangsters. Their only opportunity is to join an all-girl band as they leave on a tour. To make their getaway they must first disguise themselves as women, then keep their identities secret and deal with the problems this brings - such as an attractive bandmate and a very determined suitor.','bw',32,239,'tt0053291','/hVIKyTK13AvOGv7ICmJjK44DTzp.jpg','/5zTwAcnI3zCJ0mucPPnoBtkSWEV.jpg');
INSERT INTO movies VALUES('6482','Ordet',1955,'["Denmark"]','["Religious","Drama"]',125,'The three sons of devout Danish farmer Morten have widely disparate religious beliefs. Youngest son Anders shares his father''s religion, but eldest son Mikkel has lost his faith, while middle child Johannes has become delusional and proclaims that he is Jesus Christ himself. When Mikkel''s wife, Inger goes into a difficult childbirth, everyone''s beliefs are put to the test.','bw',33,48035,'tt0048452','/e3oh96Zrqdaku8DoD10pXZHLZoU.jpg','/62pTb3zkfE2860lIqQFlxQ5tUEL.jpg');
INSERT INTO movies VALUES('8151','Dolce vita, La',1960,'["Italy"]','["Drama"]',175,'Episodic journey of journalist Marcello who struggles to find his place in the world, torn between the allure of Rome''s elite social scene and the stifling domesticity offered by his girlfriend, all the while searching for a way to become a serious writer.','bw',34,439,'tt0053779','/11hMHhThUb53fHoDDyn5LUsw0Z.jpg','/zPbu0CFnAT2kYfbGWjgZBTajmzi.jpg');
INSERT INTO movies VALUES('13548','Raging Bull',1980,'["USA"]','["Drama","Biography","Sport"]',129,'The life of boxer Jake LaMotta, whose violence and temper that led him to the top in the ring destroyed his life outside of it.','bw',35,1578,'tt0081398','/snwFkbVGnRX9dcswxDPSBBEsN9r.jpg','/tvNuhRlpRozDgsX1zR9gQ2aHv1X.jpg');
INSERT INTO movies VALUES('6473','Night of the Hunter, The',1955,'["USA"]','["Drama","Crime","Thriller"]',92,'In the Deep South, a serial-killing preacher hunts two young children who know the whereabouts of a stash of money.','bw',36,3112,'tt0048424','/rBka0nFWiHxabHRLr0KfIA8Yiaq.jpg','/hWPUvQQJMxHpcHfQ9Cp8ekiDDp5.jpg');
INSERT INTO movies VALUES('8150','Avventura, L''',1960,'["Italy","France"]','["Drama","Mystery","Romance"]',145,'Claudia and Anna join Anna''s lover, Sandro, on a boat trip to a remote volcanic island. When Anna goes missing, a search is launched. In the meantime, Sandro and Claudia become involved in a romance despite Anna''s disappearance, though the relationship suffers from guilt and tension.','bw',37,5165,'tt0053619','/waQPqPYLouGJXDYGqXmpyLN4PLA.jpg','/nJT9XUVgvjWwZ1xhUt890V1uiwW.jpg');
INSERT INTO movies VALUES('2673','Casablanca',1942,'["USA"]','["War","Romance","Drama"]',102,'In Casablanca, Morocco in December 1941, a cynical American expatriate meets a former lover, with unforeseen complications.','bw',38,289,'tt0034583','/5K7cOHoay2mZusSLezBOY0Qxh8a.jpg','/wOfzdzC0QZyhUIlyjeMuUYSb8Ax.jpg');
INSERT INTO movies VALUES('6175','Rear Window',1954,'["USA"]','["Thriller","Mystery"]',112,'A wheelchair-bound photographer spies on his neighbors from his apartment window and becomes convinced one of them has committed murder.','col',39,567,'tt0047396','/ILVF0eJxHMddjxeQhswFtpMtqx.jpg','/zGs5tZOlvc9cprdcU6kDOVNpujf.jpg');
INSERT INTO movies VALUES('10075','Playtime',1967,'["France"]','["Comedy"]',108,'Clumsy Monsieur Hulot finds himself perplexed by the intimidating complexity of a gadget-filled Paris. He attempts to meet with a business contact but soon becomes lost. His roundabout journey parallels that of an American tourist, and as they weave through the inventive urban environment, they intermittently meet, developing an interest in one another. They eventually get together at a chaotic restaurant, along with several other quirky characters.','col',40,10227,'tt0062136','/kQOrS0DLUXYsqPMedM2G6NJcJBq.jpg','/bHLheROiecNGjVjgj22B5vRqbrK.jpg');
INSERT INTO movies VALUES('13928','Blade Runner',1982,'["USA"]','["Science Fiction","Thriller","Drama"]',118,'In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.','col',41,78,'tt0083658','/63N9uy8nd9j7Eog2axPQ8lbr3Wj.jpg','/wfQTVBIQj1wJUe0jV3OZ4zOivIO.jpg');
INSERT INTO movies VALUES('8925','Contempt',1963,'["France","Italy"]','["Drama"]',103,'A philistine in the art film business, Jeremy Prokosch is a producer unhappy with the work of his director. Prokosch has hired Fritz Lang to direct an adaptation of "The Odyssey," but when it seems that the legendary filmmaker is making a picture destined to bomb at the box office, he brings in a screenwriter to energize the script. The professional intersects with the personal when a rift develops between the writer and his wife.','col',42,266,'tt0057345','/kNElbRcp4Qz6wmJ9kH5vdY004Hq.jpg','/eRt6jqwUBhl4oCpEYXJP1irqwjU.jpg');
INSERT INTO movies VALUES('12142','Barry Lyndon',1975,'["UK"]','["Drama"]',183,'An Irish rogue uses his cunning and wit to work his way up the social classes of 18th century England, transforming himself from the humble Redmond Barry into the noble Barry Lyndon.','col',43,3175,'tt0072684','/dOJtBSyI30wWc08UmyEKLsu4Rfk.jpg','/ef6SvWbSfCFlKodJZqpIaTvsRRP.jpg');
INSERT INTO movies VALUES('6484','Pather Panchali',1955,'["India"]','["Drama"]',112,'Impoverished priest Harihar Ray, dreaming of a better life for himself and his family, leaves his rural Bengal village in search of work.','bw',44,5801,'tt0048473','/2pZR9zmUzsblDLE5ndBe57ScqIi.jpg','/ibJuTdFmYGOiiUzJ5HzHU4EAuf1.jpg');
INSERT INTO movies VALUES('7693','Touch of Evil',1958,'["USA"]','["Thriller","Crime"]',108,'When a car bomb explodes on the American side of the U.S./Mexico border, Mexican drug enforcement agent Miguel Vargas begins his investigation, along with American police captain Hank Quinlan. When Vargas begins to suspect that Quinlan and his shady partner, Menzies, are planting evidence to frame an innocent man, his investigations into their possible corruption quickly put himself and his new bride, Susie, in jeopardy.','bw',45,1480,'tt0052311','/1pvRgmfBaoMczIJBOi9gCOZ4FMC.jpg','/vZBHQfRbBZNsFbqw3B6MQPOa8S6.jpg');
INSERT INTO movies VALUES('4879','Sunset Blvd.',1950,'["USA"]','["Drama"]',110,'A hack screenwriter writes a screenplay for a former silent film star who has faded into Hollywood obscurity.','bw',46,599,'tt0043014','/sC4Dpmn87oz9AuxZ15Lmip0Ftgr.jpg','/p47ihFj4A7EpBjmPHdTj4ipyq1S.jpg');
INSERT INTO movies VALUES('13280','Stalker',1979,'["USSR"]','["Science Fiction","Mystery"]',160,'Near a gray and unnamed city is the Zone, a place guarded by barbed wire and soldiers, and where the normal laws of physics are victim to frequent anomalies. A stalker guides two men into the Zone, specifically to an area in which deep-seated desires are granted.','col-bw',47,1398,'tt0079944','/rem87AyEochEuhn9VvAGoMQpigz.jpg','/6yrbWzzrPp7pwz6zHdifspJk8t3.jpg');
INSERT INTO movies VALUES('18810','Close-Up',1990,'["Iran"]','["Documentary","Drama","Crime"]',98,'This fiction-documentary hybrid uses a sensational real-life event—the arrest of a young man on charges that he fraudulently impersonated the well-known filmmaker Mohsen Makhmalbaf—as the basis for a stunning, multilayered investigation into movies, identity, artistic creation, and existence, in which the real people from the case play themselves.','col',48,30017,'tt0100234','/m9HG2N9ZKCmNN9qOHJTNyy18wn3.jpg','/3t1qZqP1e17wQshpPKSqII1OogM.jpg');
INSERT INTO movies VALUES('8722','Lawrence of Arabia',1962,'["UK"]','["War","Biography","Adventure"]',216,'The story of British officer T.E. Lawrence''s mission to aid the Arab tribes in their revolt against the Ottoman Empire during the First World War. Lawrence becomes a flamboyant, messianic figure in the cause of Arab unity but his psychological instability threatens to undermine his achievements.','col',49,947,'tt0056172','/AiAm0EtDvyGqNpVoieRw4u65vD1.jpg','/mx2jS5Kaa5rmaldEFzKeKpDN9Q2.jpg');
INSERT INTO movies VALUES('560','General, The',1926,'["USA"]','["Comedy","Adventure"]',74,'During America’s Civil War, Union spies steal engineer Johnny Gray''s beloved locomotive, ''The General''—with Johnnie''s lady love aboard an attached boxcar—and he single-handedly must do all in his power to both get The General back and to rescue Annabelle.','bw',50,961,'tt0017925','/nIp4gIXogCjfB1QABNsWwa9gSca.jpg','/h68ilwiTesb5wmDgy2mHYkVuOBP.jpg');
INSERT INTO movies VALUES('20025','Beau travail',1999,'["France"]','["Drama"]',92,'Foreign Legion officer Galoup recalls his once glorious life, training troops in the Gulf of Djibouti. His existence there was happy, strict and regimented, until the arrival of a promising young recruit, Sentain, plants the seeds of jealousy in Galoup''s mind.','col',51,14626,'tt0209933','/m3FaQ55Ywk0oUBDrBVarHOcXZw6.jpg','/3CMT4APmiXBuFn3NYUZVGoA4knF.jpg');
INSERT INTO movies VALUES('1020','Modern Times',1936,'["USA"]','["Comedy","Romance"]',89,'A bumbling tramp desires to build a home with a young woman, yet is thwarted time and time again by his lack of experience and habit of being in the wrong place at the wrong time..','bw',52,3082,'tt0027977','/uEMekS25hwXrCJOZZ3NKMGcAFJo.jpg','/kSlO1pHpwQfPQdgVPr7dJiJNtJ8.jpg');
INSERT INTO movies VALUES('18527','Late Spring',1949,'["Japan"]','["Drama"]',108,'Noriko is perfectly happy living at home with her widowed father, Shukichi, and has no plans to marry -- that is, until her aunt Masa convinces Shukichi that unless he marries off his 27-year-old daughter soon, she will likely remain alone for the rest of her life. When Noriko resists Masa''s matchmaking, Shukichi is forced to deceive his daughter and sacrifice his own happiness to do what he believes is right.','bw',53,20530,'tt0041154','/iNtRSY2AGjW1VDXDR79bKsNUdus.jpg','/mWRJfzYCQc1j8VYp3sRrwQIoJEo.jpg');
INSERT INTO movies VALUES('914','M',1931,'["Germany"]','["Thriller","Drama","Crime"]',99,'In this classic German thriller, Hans Beckert, a serial killer who preys on children, becomes the focus of a massive Berlin police manhunt. Beckert''s heinous crimes are so repellant and disruptive to city life that he is even targeted by others in the seedy underworld network. With both cops and criminals in pursuit, the murderer soon realizes that people are on his trail, sending him into a tense, panicked attempt to escape justice.','bw',54,832,'tt0022100','/slsS6jT6SXjcTPOrsFcLIrHboXA.jpg','/r8Un26Y8GhcIdtmVZVnUOccnHaj.jpg');
INSERT INTO movies VALUES('4606','Third Man, The',1949,'["UK"]','["Mystery","Thriller"]',104,'In postwar Vienna, Austria, Holly Martins, a writer of pulp Westerns, arrives penniless as a guest of his childhood chum Harry Lime, only to learn he has died. Martins develops a conspiracy theory after learning of a "third man" present at the time of Harry''s death, running into interference from British officer Major Calloway, and falling head-over-heels for Harry''s grief-stricken lover, Anna.','bw',55,1092,'tt0041959','/oIF3l7Dxp7Eyye10BNyM611wtKa.jpg','/l2iY1AgqQ8dEa3FtWkN5TQ5aVbU.jpg');
INSERT INTO movies VALUES('7921','North by Northwest',1959,'["USA"]','["Thriller","Spy","Romance"]',136,'Advertising man Roger Thornhill is mistaken for a spy, triggering a deadly cross-country chase.','col',56,213,'tt0053125','/i3g0KIoXYx5RvyVaraYx9n2LCli.jpg','/OR8oloCZ3klJtB7Y0i8pSqWw5a.jpg');
INSERT INTO movies VALUES('5942','Ugetsu monogatari',1953,'["Japan"]','["Drama"]',96,'In 16th century Japan, peasants Genjuro and Tobei sell their earthenware pots to a group of soldiers in a nearby village, in defiance of a local sage''s warning against seeking to profit from warfare. Genjuro''s pursuit of both riches and the mysterious Lady Wakasa, as well as Tobei''s desire to become a samurai, run the risk of destroying both themselves and their wives, Miyagi and Ohama.','bw',57,14696,'tt0046478','/7Kk1ZsrAul2Lg7Pe45XOcUf2ARQ.jpg','/iB1tCWl4MKl6OO1kMBD5LxM5BmJ.jpg');
INSERT INTO movies VALUES('9166','Battle of Algiers, The',1966,'["Italy","Algeria"]','["War","Political","Drama"]',121,'Tracing the struggle of the Algerian Front de Liberation Nationale to gain freedom from French colonial rule as seen through the eyes of Ali from his start as a petty thief to his rise to prominence in the organisation and capture by the French in 1957. The film traces the rebels'' struggle and the increasingly extreme measures taken by the French government to quell the revolt.','bw',58,17295,'tt0058946','/Df9SP4FgPMrIQBw5WOGtSi3fnT.jpg','/d67dUXkwVnmyNlIVRu7ctpsE1U7.jpg');
INSERT INTO movies VALUES('8036','Apartment, The',1960,'["USA"]','["Drama","Comedy"]',125,'Bud Baxter is a minor clerk in a huge New York insurance company, until he discovers a quick way to climb the corporate ladder. He lends out his apartment to the executives as a place to take their mistresses. Although he often has to deal with the aftermath of their visits, one night he''s left with a major problem to solve.','bw',59,284,'tt0053604','/hhSRt1KKfRT0yEhEtRW3qp31JFU.jpg','/vRTKNKNWLZ22fAgPa5kY8wT2b1F.jpg');
INSERT INTO movies VALUES('604','Grande illusion, La',1937,'["France"]','["Prison","Drama","War"]',117,'A group of French soldiers, including the patrician Captain de Boeldieu and the working-class Lieutenant Maréchal, grapple with their own class differences after being captured and held in a World War I German prison camp. When the men are transferred to a high-security fortress, they must concoct a plan to escape beneath the watchful eye of aristocratic German officer von Rauffenstein, who has formed an unexpected bond with de Boeldieu.','bw',60,777,'tt0028950','/lWg41zE0FVixkNsFgxnlRyvDYv9.jpg','/yNraM35Vsga5x54whRh7BvQ9afm.jpg');
INSERT INTO movies VALUES('7343','Wild Strawberries',1957,'["Sweden"]','["Drama"]',90,'Crotchety retired doctor Isak Borg travels from Stockholm to Lund, Sweden, with his pregnant and unhappy daughter-in-law, Marianne, in order to receive an honorary degree from his alma mater. Along the way, they encounter a series of hitchhikers, each of whom causes the elderly doctor to muse upon the pleasures and failures of his own life. These include the vivacious young Sara, a dead ringer for the doctor''s own first love.','bw',61,614,'tt0050986','/iyTD2QnySNMPUPE3IedZQipSWfz.jpg','/BBVAUchYvkmPThVIqipgAfabfl.jpg');
INSERT INTO movies VALUES('14232','Fanny and Alexander',1982,'["Sweden"]','["Drama"]',189,'As children in the loving Ekdahl family, Fanny and Alexander enjoy a happy life with their parents, who run a theater company. After their father dies unexpectedly, however, the siblings end up in a joyless home when their mother, Emilie, marries a stern bishop. The bleak situation gradually grows worse as the bishop becomes more controlling, but dedicated relatives make a valiant attempt to aid Emilie, Fanny and Alexander.','col',62,5961,'tt0083922','/q8jlA3Wc1Z987hNKRFA44g5OugC.jpg','/jVzoKlWUpsKV3y5oLafLQhEvgX6.jpg');
INSERT INTO movies VALUES('16501','GoodFellas',1990,'["USA"]','["Drama","Crime"]',146,'The true story of Henry Hill, a half-Irish, half-Sicilian Brooklyn kid who is adopted by neighbourhood gangsters at an early age and climbs the ranks of a Mafia family under the guidance of Jimmy Conway.','col',63,769,'tt0099685','/aKuFiU82s5ISJpGZp7YkIr3kCUd.jpg','/sw7mordbZxgITU877yTpZCud90M.jpg');
INSERT INTO movies VALUES('14967','Shoah',1985,'["France"]','["Documentary","War","History"]',566,'Director Claude Lanzmann spent 11 years on this sprawling documentary about the Holocaust, conducting his own interviews and refusing to use a single frame of archival footage. Dividing Holocaust witnesses into three categories – survivors, bystanders, and perpetrators – Lanzmann presents testimonies from survivors of the Chelmno concentration camp, an Auschwitz escapee, and witnesses of the Warsaw Ghetto Uprising, as well as a chilling report of gas chambers from an SS officer at Treblinka.','col',64,42044,'tt0090015','/yvwF7dfSCybFcBOklUzKpE46bHM.jpg','/4cVWQvHupI3jlSricUUdMeA4y8h.jpg');
INSERT INTO movies VALUES('7945','Rio Bravo',1959,'["USA"]','["Western"]',141,'The sheriff of a small town in southwest Texas must keep custody of a murderer whose brother, a powerful rancher, is trying to help him escape. After a friend is killed trying to muster support for him, he and his deputies must find a way to hold out against the rancher''s hired guns until the marshal arrives. In the meantime, matters are complicated by the presence of a young gunslinger - and a mysterious beauty who just came in on the last stagecoach.','col',65,301,'tt0053221','/4gI4KKmoi0d3yfsF71YU3S0I5t8.jpg','/cPDKIvdYJ4TLT3KU0fpGDVpdhfd.jpg');
INSERT INTO movies VALUES('9331','Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb',1964,'["UK","USA"]','["War","Comedy"]',93,'After the insane General Jack D. Ripper initiates a nuclear strike on the Soviet Union, a war room full of politicians, generals and a Russian diplomat all frantically try to stop the nuclear strike.','bw',66,935,'tt0057012','/7SixLzxcqezkZEYU8pcHZgbkmjp.jpg','/sTp8K0SfcC2RQef1Tu160z3niHO.jpg');
INSERT INTO movies VALUES('9519','Pierrot le fou',1965,'["France","Italy"]','["Drama","Crime","Romance"]',110,'Pierrot escapes his boring society and travels from Paris to the Mediterranean Sea with Marianne, a girl chased by hit-men from Algeria. They lead an unorthodox life, always on the run.','col',67,2786,'tt0059592','/i124H6iQB4CawrgFW9aZaZs7OBO.jpg','/goXrXOu33pUYzYlEnZH6oRVn4g.jpg');
INSERT INTO movies VALUES('5910','Journey to Italy',1954,'["Italy"]','["Romance","Drama"]',97,'This deceptively simple tale of a bored English couple travelling to Italy to find a buyer for a house inherited from an uncle is transformed by Roberto Rossellini into a passionate story of cruelty and cynicism as their marriage disintegrates around them.','bw',68,2748,'tt0046511','/tjli2Rjwkn8fivuynxwthnnEzeo.jpg','/5SDqKj8AfUazPqXvOCDL1nmE8Zb.jpg');
INSERT INTO movies VALUES('10351','Once Upon a Time in the West',1968,'["Italy","USA"]','["Western"]',165,'As the railroad builders advance unstoppably through the Arizona desert on their way to the sea, Jill arrives in the small town of Flagstone with the intention of starting a new life.','col',69,335,'tt0064116','/qbYgqOczabWNn2XKwgMtVrntD6P.jpg','/vmryZ1Bkko8P2utNaJeO2Yo2Bx4.jpg');
INSERT INTO movies VALUES('11929','Chinatown',1974,'["USA"]','["Mystery","Crime"]',131,'Private eye Jake Gittes lives off of the murky moral climate of sunbaked, pre-World War II Southern California. Hired by a beautiful socialite to investigate her husband''s extra-marital affair, Gittes is swept into a maelstrom of double dealings and deadly deceits, uncovering a web of personal and political scandals that come crashing together.','col',70,829,'tt0071315','/mQJz8J4naOA7RmCtypTPjgXZIMY.jpg','/bsoAg22remHKL5O0xJH0m9DX6Pu.jpg');
INSERT INTO movies VALUES('16146','Do the Right Thing',1989,'["USA"]','["Drama","Comedy"]',120,'Salvatore "Sal" Fragione is the Italian owner of a pizzeria in Brooklyn. A neighborhood local, Buggin'' Out, becomes upset when he sees that the pizzeria''s Wall of Fame exhibits only Italian actors. Buggin'' Out believes a pizzeria in a black neighborhood should showcase black actors, but Sal disagrees. The wall becomes a symbol of racism and hate to Buggin'' Out and to other people in the neighborhood, and tensions rise.','col',71,925,'tt0097216','/63rmSDPahrH7C1gEFYzRuIBAN9W.jpg','/leT6tupwfYea4T0zYBafP73gXj9.jpg');
INSERT INTO movies VALUES('1000','Metropolis',1927,'["Germany"]','["Fantasy","Science Fiction","Drama"]',153,'In a futuristic city sharply divided between the rich and the poor, the son of the city''s mastermind meets a prophet who predicts the coming of a savior to mediate their differences.','bw',72,19,'tt0017136','/pxbGZewX327IbTvrCVRJgcLJTSQ.jpg','/r8pUcom5Mw8igtBpj3AHSAUvH0R.jpg');
INSERT INTO movies VALUES('6109','Strada, La',1954,'["Italy"]','["Drama"]',115,'When Gelsomina, a naïve young woman, is purchased from her impoverished mother by brutish circus strongman Zampanò to be his wife and partner, she loyally endures her husband''s coldness and abuse as they travel the Italian countryside performing together. Soon Zampanò must deal with his jealousy and conflicted feelings about Gelsomina when she finds a kindred spirit in Il Matto, the carefree circus fool, and contemplates leaving Zampanò.','bw',73,405,'tt0047528','/xyisVfPrNybDieMp1nbCv6iBtdV.jpg','/5Pl47mB0Jnrg4oHoO0sVdJ6WMRL.jpg');
INSERT INTO movies VALUES('12122','Woman Under the Influence, A',1974,'["USA"]','["Drama"]',155,'Mabel Longhetti, desperate and lonely, is married to a Los Angeles municipal construction worker, Nick. Increasingly unstable, especially in the company of others, she craves happiness, but her extremely volatile behavior convinces Nick that she poses a danger to their family and decides to commit her to an institution for six months. Alone with a trio of kids to raise on his own, he awaits her return, which holds more than a few surprises.','col',74,29845,'tt0072417','/6EJ4JoTxnH1QmGTE9pPzgtW1cLW.jpg','/uOLcJJYZ3hbFSrKQPDaLhrYnjUv.jpg');
INSERT INTO movies VALUES('3379','Enfants du paradis, Les',1945,'["France"]','["Romance","Drama"]',195,'Nathalie falls for Baptiste Debureau, a mime. But his heart is set on Garance, who is also coveted by Frederick Lemaitre and the Count of Montray.','bw',75,2457,'tt0037674','/yiy9stl1jjVhW44ypkWMFDT8Ix3.jpg','/59kBgtfbhh1dalgjGvFhDL98jN.jpg');
INSERT INTO movies VALUES('9002','Leopard, The',1963,'["Italy","France"]','["History","Drama"]',186,'As Garibaldi''s troops begin the unification of Italy in the 1860s, an aristocratic Sicilian family grudgingly adapts to the sweeping social changes undermining their way of life. Proud but pragmatic Prince Don Fabrizio Salina allows his war hero nephew, Tancredi, to marry Angelica, the beautiful daughter of gauche, bourgeois Don Calogero, in order to maintain the family''s accustomed level of comfort and political clout.','col',76,1040,'tt0057091','/riSUxwoK3xjkOgy6YJSvPhi7cO6.jpg','/myikoqu8Z2gtE7TaBgk9r6fB9MF.jpg');
INSERT INTO movies VALUES('11889','Amarcord',1973,'["Italy"]','["Drama","Comedy"]',127,'In an Italian seaside town, young Titta gets into trouble with his friends and watches various local eccentrics as they engage in often absurd behavior. Frequently clashing with his stern father and defended by his doting mother, Titta witnesses the actions of a wide range of characters, from his extended family to Fascist loyalists to sensual women, with certain moments shifting into fantastical scenarios.','col',77,7857,'tt0071129','/kS7i093sQpkLTawUEdgf4HVOHSc.jpg','/iFQzlUmO5QmMPcSHHDdfd522x33.jpg');
INSERT INTO movies VALUES('6785','Man Escaped, A',1956,'["France"]','["Prison","Drama"]',102,'A captured French Resistance fighter during World War II engineers a daunting escape from prison.','bw',78,15244,'tt0049902','/mKA9ZGfPYQEu6k8uhVTGptBDX9a.jpg','/yEbJs6ZLURFgAFvS8EeNrYovYHa.jpg');
INSERT INTO movies VALUES('17944','Pulp Fiction',1994,'["USA"]','["Drama","Crime","Comedy"]',154,'A burger-loving hit man, his philosophical partner, a drug-addled gangster''s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.','col',79,680,'tt0110912','/d5iIlFn5s0ImszYzBPb8JPIfbXD.jpg','/suaEOtk1N1sgg2MTM7oZd2cfVp3.jpg');
INSERT INTO movies VALUES('10719','Wild Bunch, The',1969,'["USA"]','["Western","Action"]',135,'An aging group of outlaws look for one last big score as the "traditional" American West is disappearing around them.','col',80,576,'tt0065214','/8j9yEC3xjy1PJDSizIbaxcHaSph.jpg','/3VOMg5qurrIGoZrg3cfbxhEW5Ye.jpg');
INSERT INTO movies VALUES('3697','It''s a Wonderful Life',1946,'["USA"]','["Fantasy","Drama","Family"]',129,'A holiday favourite for generations...  George Bailey has spent his entire life giving to the people of Bedford Falls.  All that prevents rich skinflint Mr. Potter from taking over the entire town is George''s modest building and loan company.  But on Christmas Eve the business''s $8,000 is lost and George''s troubles begin.','bw',81,1585,'tt0038650','/mV3VcmMJN6Zwahj42dy9WwPUyRI.jpg','/ch3lDc4xQ9MpsNEpnRhvR8PIxxK.jpg');
INSERT INTO movies VALUES('7262','Seventh Seal, The',1957,'["Sweden"]','["Fantasy","Drama"]',96,'When disillusioned Swedish knight Antonius Block returns home from the Crusades to find his country in the grips of the Black Death, he challenges Death to a chess match for his life. Tormented by the belief that God does not exist, Block sets off on a journey, meeting up with traveling players Jof and his wife, Mia, and becoming determined to evade Death long enough to commit one redemptive act while he still lives.','bw',82,490,'tt0050976','/j6z3c6dGXtPHUATJX8J7Y70mM1S.jpg','/6s2BqtDvp1BMiP70zCDU5OW6hMy.jpg');
INSERT INTO movies VALUES('11216','Conformist, The',1970,'["Italy","France","West Germany"]','["Political","Drama"]',107,'A weak-willed Italian man becomes a fascist flunky who goes abroad to arrange the assassination of his old teacher, now a political dissident.','col',83,8416,'tt0065571','/7nmAUY7bSbiGXH3bbFu3Q3SJ1Xr.jpg','/xKhnjQA5wrAUaopEKegdKD3Yi26.jpg');
INSERT INTO movies VALUES('6197','Sansho the Bailiff',1954,'["Japan"]','["Drama"]',125,'In medieval Japan, a woman and his children journey to find the family''s patriarch, who was exiled years before.','bw',84,20532,'tt0047445','/ffMCNNYiTCdkhMQoNSX17urqWiz.jpg','/175gL8LrNt9QfKwLzWn179AYvo.jpg');
INSERT INTO movies VALUES('2759','Magnificent Ambersons, The',1942,'["USA"]','["Drama"]',88,'The spoiled young heir to the decaying Amberson fortune comes between his widowed mother and the man she has always loved.','bw',85,965,'tt0035015','/4QvsFW2cRY20GVpMQNcG406YVxP.jpg','/rn7M9za8zr1gm5HqJKW8Qk6azeM.jpg');
INSERT INTO movies VALUES('13567','Shining, The',1980,'["USA","UK"]','["Horror","Drama"]',142,'Jack Torrance accepts a caretaker job at the Overlook Hotel, where he, along with his wife Wendy and their son Danny, must live isolated from the rest of the world for the winter. But they aren''t prepared for the madness that lurks within.','col',86,694,'tt0081505','/nRj5511mZdTl4saWEPoj9QroTIu.jpg','/mmd1HnuvAzFc4iuVJcnBrhDNEKr.jpg');
INSERT INTO movies VALUES('15074','Blue Velvet',1986,'["USA"]','["Mystery","Crime","Drama"]',120,'Clean-cut Jeffrey Beaumont realizes his hometown is not so normal when he discovers a human ear in a field, the investigation soon catapulting him toward a disturbed nightclub singer and a drug-addicted sadist.','col',87,793,'tt0090756','/7hlgzJXLgyECS1mk3LSN3E72l5N.jpg','/vB5hoogPuLO5Hpbb63c8yFB7WPf.jpg');
INSERT INTO movies VALUES('8577','Viridiana',1961,'["Spain"]','["Drama"]',90,'Viridiana is preparing to start her life as a nun when she is sent, somewhat unwillingly, to visit her aging uncle, Don Jaime. He supports her; but the two have met only once. Jaime thinks Viridiana resembles his dead wife. Viridiana has secretly despised this man all her life and finds her worst fears proven when Jaime grows determined to seduce his pure niece. Viridiana becomes undone as her uncle upends the plans she had made to join the convent.','bw',88,4497,'tt0055601','/yFnUCrPY3ffjkqOkOupLro3sO7X.jpg','/vRRnLUJpwPyPd8W0GrFpmHBnc9R.jpg');
INSERT INTO movies VALUES('7930','Pickpocket',1959,'["France"]','["Drama","Crime"]',75,'Michel takes up pickpocketing on a lark and is arrested soon after. His mother dies shortly after his release, and despite the objections of his only friend, Jacques, and his mother''s neighbor Jeanne, Michel teams up with a couple of petty thieves in order to improve his craft. With a police inspector keeping an eye on him, Michel also tries to get a straight job, but the temptation to steal is hard to resist.','bw',89,690,'tt0053168','/kxpvceDv9fhFc4OAs82fmdzu17Y.jpg','/l3N6BtcVwXp6rJAUOpcb8ooyE9c.jpg');
INSERT INTO movies VALUES('12265','Nashville',1975,'["USA"]','["Drama","Music"]',160,'The intersecting stories of twenty-four characters—from country star to wannabe to reporter to waitress—connect to the music business in Nashville, Tennessee.','col',90,3121,'tt0073440','/twl4ovyjb8muFKvZmcCDzPR0hy1.jpg','/2mSkRoxHisjTgh6NPZfkp1IeZ2Y.jpg');
INSERT INTO movies VALUES('8742','Man Who Shot Liberty Valance, The',1962,'["USA"]','["Western"]',119,'A senator, who became famous for killing a notorious outlaw, returns for the funeral of an old friend and tells the truth about his deed.','bw',91,11697,'tt0056217','/4C1R0LEivLjbv3swAzJfzh0tzXl.jpg','/h1vBJ0uN4QCbBb5WVKxmtfTrHoY.jpg');
INSERT INTO movies VALUES('12223','Jaws',1975,'["USA"]','["Horror","Thriller","Adventure"]',124,'When the seaside community of Amity finds itself under attack by a dangerous great white shark, the town''s chief of police, a young marine biologist, and a grizzled hunter embark on a desperate quest to destroy the beast before it strikes again.','col',92,578,'tt0073195','/lxM6kqilAdpdhqUl2biYp5frUxE.jpg','/Ugn7ekAwY8FtaBjRBlbkt0zom2.jpg');
INSERT INTO movies VALUES('593','Gold Rush, The',1925,'["USA"]','["Comedy","Adventure","Family"]',82,'A gold prospector in Alaska struggles to survive the elements and win the heart of a dance hall girl.','bw',93,962,'tt0015864','/eQRFo1qwRREYwj47Yoe1PisgOle.jpg','/hZHeDPQGNKN9NN9GuW7qVbM2tDx.jpg');
INSERT INTO movies VALUES('18510','Gertrud',1964,'["Denmark"]','["Drama"]',116,'Hopeless romantic Gertrud inhabits a turn-of-the-century milieu of artists and musicians, where she pursues an idealized notion of love that will always elude her. She abandons her distinguished husband and embraces an affair with a young concert pianist, who falls short of her desire for lasting affection. When an old lover returns to her life, fresh disappointments follow, and Gertrud must try to come to terms with reality.','bw',94,34181,'tt0058138','/bF8Z8Cntr7GRDI5qYGsaOwy7c8Q.jpg','/9g3D4uqDYeukbSGckW8khR4G93C.jpg');
INSERT INTO movies VALUES('18531','Jetée, La',1962,'["France"]','["Science Fiction","Drama","Short"]',27,'A man is sent back and forth and in and out of time in an experiment that attempts to unravel the fate and the solution to the problems of a post-apocalyptic world during the aftermath of WW3. The experiment results in him getting caught up in a perpetual reminiscence of past events that are recreated on an airport’s viewing pier.','bw',95,662,'tt0056119','/sqbvjbJRzTduUj4lVm2FmPkqJkS.jpg','/qNbl3TFwxIm0fyFqQ1iRxzs4hb7.jpg');
INSERT INTO movies VALUES('18518','Sans soleil',1983,'["France"]','["Avant","Garde","Documentary"]',100,'A woman narrates the thoughts of a world traveler, meditations on time and memory expressed in words and images from places as far-flung as Japan, Guinea-Bissau, Iceland, and San Francisco.','col',96,1563,'tt0084628','/2ZmVbnecEeGoZCimxMhpY0Nz7eh.jpg','/lns7roobSPQQTF54oSPzkT3qH1q.jpg');
INSERT INTO movies VALUES('8627','Cléo from 5 to 7',1962,'["France"]','["Drama"]',90,'Agnès Varda eloquently captures Paris in the sixties with this real-time portrait of a singer set adrift in the city as she awaits test results of a biopsy. A chronicle of the minutes of one woman’s life, Cléo from 5 to 7 is a spirited mix of vivid vérité and melodrama, featuring a score by Michel Legrand and cameos by Jean-Luc Godard and Anna Karina.','bw',97,499,'tt0055852','/oelBStY4xpguaplRv15P3Za7Xsr.jpg','/f16KEgTwVuEu7lieRzWIWGGbg3M.jpg');
INSERT INTO movies VALUES('8441','Jules et Jim',1962,'["France"]','["Romance","Drama"]',104,'In the carefree days before World War I, introverted Austrian author Jules strikes up a friendship with the exuberant Frenchman Jim and both men fall for the impulsive and beautiful Catherine.','bw',98,1628,'tt0055032','/kuFjZlcZhQFDtIjuI3GQJjsQG03.jpg','/1dSopaBgvxYinmhaCOsLoZSeWD3.jpg');
INSERT INTO movies VALUES('18632','Meshes of the Afternoon',1943,'["USA"]','["Short","Avant","Garde","Fantasy"]',15,'A woman returning home falls asleep and has vivid dreams that may or may not be happening in reality. Through repetitive images and complete mismatching of the objective view of time and space, her dark inner desires play out on-screen.','bw',99,27040,'tt0036154','/yHjEjRU81RcxKFNU5hhiPYMzlsu.jpg','/moyP2UVY4WPI6Y051dPqoxCYua2.jpg');
INSERT INTO movies VALUES('19792','Sátántangó',1994,'["Hungary","Germany","Switzerland"]','["Drama"]',439,'Inhabitants of a small village in Hungary deal with the effects of the fall of Communism. The town''s source of revenue, a factory, has closed, and the locals, who include a doctor and three couples, await a cash payment offered in the wake of the shuttering. Irimias, a villager thought to be dead, returns and, unbeknownst to the locals, is a police informant. In a scheme, he persuades the villagers to form a commune with him.','bw',100,31414,'tt0111341','/y38z0v4HJ12MHiKddLEoFlvPiBt.jpg','/5a4Gmk2HNeefI4Rmwdmbyoy79oy.jpg');
INSERT INTO movies VALUES('1373','Sherlock Jr.',1924,'["USA"]','["Fantasy","Comedy"]',45,'A film projectionist longs to be a detective, and puts his meagre skills to work when he is framed by a rival for stealing his girlfriend''s father''s pocketwatch.','bw',101,992,'tt0015324','/1G9r3rqtbFAQuyWKOZm4Y5J5s7Q.jpg','/dRKCNvOjXkRTIA3D3KAve7GRu4k.jpg');
INSERT INTO movies VALUES('2857','To Be or Not to Be',1942,'["USA"]','["War","Comedy"]',99,'During the Nazi occupation of Poland, an acting troupe becomes embroiled in a Polish soldier''s efforts to track down a German spy.','bw',102,198,'tt0035446','/dDQRpEoyjHT4fzw9cNklIvZuXYg.jpg','/p69ybBV94wSmyCGE2y2pH9U86l0.jpg');
INSERT INTO movies VALUES('5687','Madame de...',1953,'["France","Italy"]','["Romance","Drama"]',105,'In France of the late 19th century, the wife of a wealthy general, the Countess Louise, sells the earrings her husband gave her on their wedding day to pay off debts; she claims to have lost them. Her husband quickly learns of the deceit, which is the beginning of many tragic misunderstandings, all involving the earrings, the general, the countess, & her new lover, the Italian Baron Donati.','bw',103,27030,'tt0046022','/hwjrojY8NEkWNvS9AIQKSlhGNrU.jpg','/msQMXYEBHQ7zPVu0TPEm7wUSGHQ.jpg');
INSERT INTO movies VALUES('11883','Fear Eats the Soul',1974,'["West Germany"]','["Romance","Drama"]',94,'Emmi Kurowski, a cleaning lady, is lonely in her old age. Her husband died years ago, and her grown children offer little companionship. One night she goes to a bar frequented by Arab immigrants and strikes up a friendship with middle-aged mechanic Ali. Their relationship soon develops into something more, and Emmi''s family and neighbors criticize their spontaneous marriage. Soon Emmi and Ali are forced to confront their own insecurities about their future.','col',104,216,'tt0071141','/5Oru4v8tRUN90JUuM6BNDJoetLt.jpg','/ih2q5hoclUTICLxMzV31vxgpCzR.jpg');
INSERT INTO movies VALUES('11768','Mother and the Whore, The',1973,'["France"]','["Drama"]',210,'Aimless young Alexandre juggles his relationships with his girlfriend, Marie, and a casual lover named Veronika. Marie becomes increasingly jealous of Alexandre''s fling with Veronika and as the trio continues their unsustainable affair, the emotional stakes get higher, leading to conflict and unhappiness.','bw',105,48693,'tt0070359','/yAZIYAq75aqIHc8hxG33TaMszTH.jpg','/6HdPZCIM9RhKC5NcgjWlldo11a5.jpg');
INSERT INTO movies VALUES('11210','Clockwork Orange, A',1971,'["UK"]','["Science Fiction","Crime","Drama"]',137,'In a near-future Britain, young Alexander DeLarge and his pals get their kicks beating and raping anyone they please. When not destroying the lives of others, Alex swoons to the music of Beethoven. The state, eager to crack down on juvenile crime, gives an incarcerated Alex the option to undergo an invasive procedure that''ll rob him of all personal agency. In a time when conscience is a commodity, can Alex change his tune?','col',106,185,'tt0066921','/4sHeTAp65WrSSuc05nRBKddhBxO.jpg','/yIonSXf1jdNihhK8PssxO6KCIfz.jpg');
INSERT INTO movies VALUES('11082','Aguirre, the Wrath of God',1972,'["West Germany"]','["History","Drama","Adventure"]',94,'A few decades after the destruction of the Inca Empire, a Spanish expedition led by the infamous Aguirre leaves the mountains of Peru and goes down the Amazon River in search of the lost city of El Dorado. When great difficulties arise, Aguirre’s men start to wonder whether their quest will lead them to prosperity or certain death.','col',107,2000,'tt0068182','/e5hNOS2uwIvPCNSyIOkpmtm6HEM.jpg','/zKakF2CHjm85bFaeyM9LeB2Ssz3.jpg');
INSERT INTO movies VALUES('5408','Ikiru',1952,'["Japan"]','["Drama"]',143,'Kanji Watanabe is a middle-aged man who has worked in the same monotonous bureaucratic position for decades. Learning he has cancer, he starts to look for the meaning of his life.','bw',108,3782,'tt0044741','/dgNTS4EQDDVfkzJI5msKuHu2Ei3.jpg','/yn6DvHSEXE8Ao3QaNlELpqeSOqx.jpg');
INSERT INTO movies VALUES('8450','Last Year at Marienbad',1961,'["France","Italy"]','["Drama","Mystery","Avant","Garde"]',94,'In a strange and isolated chateau, a man becomes acquainted with a woman and insists that they have met before.','bw',109,4024,'tt0054632','/tizZ7JnXRFMvoNegu2CtM2ab9E7.jpg','/pQu3nfTeH0BckzJymAxaVnrMFut.jpg');
INSERT INTO movies VALUES('12595','Annie Hall',1977,'["USA"]','["Romance","Comedy"]',94,'New York comedian Alvy Singer falls in love with the ditsy Annie Hall.','col',110,703,'tt0075686','/jj46Biz1WYQZoVZfXxeT9u4XRrS.jpg','/8n9dYsTbXTykzm2Nuy7R2ftapXQ.jpg');
INSERT INTO movies VALUES('14788','Come and See',1985,'["USSR"]','["War","Drama","History"]',136,'The invasion of a village in Byelorussia by German forces sends young Florya into the forest to join the weary Resistance fighters, against his family''s wishes. There he meets a girl, Glasha, who accompanies him back to his village. On returning home, Florya finds his family and fellow peasants massacred. His continued survival amidst the brutal debris of war becomes increasingly nightmarish, a battle between despair and hope.','col',111,25237,'tt0091251','/qNbMsKVzigERgJUbwf8pKyZogpb.jpg','/6C1U0cKK5zGjyUSwNc5GLSVCr7Y.jpg');
INSERT INTO movies VALUES('11827','Spirit of the Beehive, The',1973,'["Spain"]','["Drama"]',95,'In 1940, in the immediate aftermath of the Spanish Civil War, a young girl living on the Castilian plain is haunted after attending a screening of James Whale''s 1931 film Frankenstein and hearing from her sister that the monster is not dead, instead existing as a spirit inhabiting a nearby barn.','col',112,4495,'tt0070040','/p2wx4EWasQaPGxnbS2IsW74ewVN.jpg','/4vbL72K9uVaMLhnvmdg1So7kqex.jpg');
INSERT INTO movies VALUES('619','Greed',1924,'["USA"]','["Drama"]',140,'A lottery win of $5,000 forever changes the lives of a miner turned dentist and his wife.','bw',113,1405,'tt0015881','/zT8XclM0tX5nVsnU3Idsn2Nzdo5.jpg','/zc5vjonSbXUUazuQSi0R2bUfWNP.jpg');
INSERT INTO movies VALUES('17895','Piano, The',1993,'["New Zealand","Australia","France"]','["Drama","Romance"]',121,'A mute Scottish woman arrives in colonial New Zealand for an arranged marriage. Her husband refuses to move her beloved piano, giving it to neighbor George Baines, who agrees to return the piano in exchange for lessons. As desire swirls around the duo, the wilderness consumes the European enclave.','col',114,713,'tt0107822','/rx8RKXn8OtuS6lqloYsjyrGOUp4.jpg','/c2O99arhWcuLexMHiuRfSuDMpYm.jpg');
INSERT INTO movies VALUES('18562','Brighter Summer Day, A',1991,'["Taiwan","South Korea"]','["Crime","Romance","Drama"]',237,'A boy experiences first love, friendships and injustices growing up in 1960s Taiwan.','col',115,15804,'tt0101985','/rDZ2mNQkZrnSzHPLQ7SzhzgCSoj.jpg','/qMMaTIUTxCcRRrwgNsna8EUAd1z.jpg');
INSERT INTO movies VALUES('14602','Once Upon a Time in America',1984,'["Italy","USA"]','["Drama","Crime"]',229,'A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.','col',116,311,'tt0087843','/i0enkzsL5dPeneWnjl1fCWm6L7k.jpg','/uPYa165sraN2c8gZBM9C47g3JoU.jpg');
INSERT INTO movies VALUES('2125','Wizard of Oz, The',1939,'["USA"]','["Musical","Fantasy","Family"]',101,'Young Dorothy finds herself in a magical world where she makes friends with a lion, a scarecrow and a tin man as they make their way along the yellow brick road to talk with the Wizard and ask for the things they miss most in their lives. The Wicked Witch of the West is the only thing that could stop them.','col-bw',117,630,'tt0032138','/pfAZFD7I2hxW9HCChTuAzsdE6UX.jpg','/qCU097AXMPAsmpVK4j9kzMTxt2d.jpg');
INSERT INTO movies VALUES('20247','Yi Yi',2000,'["Taiwan","Japan"]','["Drama"]',173,'Each member of a family in Taipei asks hard questions about life''s meaning as they live through everyday quandaries. NJ is morose: his brother owes him money, his mother is in a coma, his wife suffers a spiritual crisis when she finds her life a blank and his business partners make bad decisions.','col',118,25538,'tt0244316','/hTPkCpK9SLGDMXRbUwzoep0MxOx.jpg','/tAwgmXKnQ6WVczwcIq5LKFr0LDb.jpg');
INSERT INTO movies VALUES('7857','Hiroshima mon amour',1959,'["France","Japan"]','["Drama"]',91,'The deep conversation between a Japanese architect and a French actress forms the basis of this celebrated French film, considered one of the vanguard productions of the French New Wave. Set in Hiroshima after the end of World War II, the couple -- lovers turned friends -- recount, over many hours, previous romances and life experiences. The two intertwine their stories about the past with pondering the devastation wrought by the atomic bomb dropped on the city.','bw',119,5544,'tt0052893','/adLWFW0JC8f3wjhnfBnHlf85Poh.jpg','/nHmxbmwGmbY6p5i5Soal4ZJNrTq.jpg');
INSERT INTO movies VALUES('4270','Red Shoes, The',1948,'["UK"]','["Dance","Musical","Drama"]',133,'In this classic drama, Vicky Page is an aspiring ballerina torn between her dedication to dance and her desire to love. While her imperious instructor, Boris Lermontov, urges to her to forget anything but ballet, Vicky begins to fall for the charming young composer Julian Craster. Eventually Vicky, under great emotional stress, must choose to pursue either her art or her romance, a decision that carries serious consequences.','col',120,19542,'tt0040725','/5NuMQd17KZx0lCxedJoIuFnt7li.jpg','/cSbBSHHiy849SUhyTW6FX4Dbj43.jpg');
INSERT INTO movies VALUES('11674','Don''t Look Now',1973,'["UK"]','["Mystery","Thriller"]',110,'While grieving a terrible loss, a married couple meet two mysterious sisters, one of whom gives them a message sent from the afterlife.','col',121,931,'tt0069995','/ivWsU3QtcstImCTOjItsH0SAbNn.jpg','/ncR3qobdIDYEAI1DqKmJQbHE8YA.jpg');
INSERT INTO movies VALUES('183','Bringing Up Baby',1938,'["USA"]','["Romance","Comedy"]',102,'David Huxley is waiting to get a bone he needs for his museum collection. Through a series of strange circumstances, he meets Susan Vance, and the duo have a series of misadventures which include a leopard called Baby.','bw',122,900,'tt0029947','/vTNNOtemaYmtx3k2NpsLMRJKEwZ.jpg','/fzJgCQh2NBnUYlms8EGyr4bPNz3.jpg');
INSERT INTO movies VALUES('729','Intolerance',1916,'["USA"]','["History","Drama"]',178,'The story of a poor young woman, separated by prejudice from her husband and baby, is interwoven with tales of intolerance from throughout history.','bw',123,3059,'tt0006864','/lJCabs4TMOsKfnl0BmA5Hf16Ezb.jpg','/5s5Vau1tCvoQaaTTTGk4Qux8CcH.jpg');
INSERT INTO movies VALUES('9657','Blow-Up',1966,'["Italy","UK"]','["Mystery","Drama"]',111,'A successful mod photographer in London whose world is bounded by fashion, pop music, marijuana, and easy sex, feels his life is boring and despairing. But in the course of a single day he unknowingly captures a death on film.','col',124,1052,'tt0060176','/iVtUdWsT6Ed2DK762zZxjaQAdHy.jpg','/1TOB9YhatqxIj5IMIZmnrwdL7AL.jpg');
INSERT INTO movies VALUES('3643','Day in the Country, A',1936,'["France"]','["Romance","Drama","Short"]',40,'The family of a Parisian shop-owner spends a day in the country. The daughter falls in love with a man at the inn, where they spend the day.','bw',125,43878,'tt0028445','/r490HjrQJrYXJp1zkzbflwEIegT.jpg','/pOyo0alLklzMIeOkdFpooqQPh13.jpg');
INSERT INTO movies VALUES('8657','Eclisse, L''',1962,'["Italy","France"]','["Drama","Romance"]',126,'This romantic drama by Michelangelo Antonioni follows the love life of Vittoria, a beautiful literary translator living in Rome. After splitting from her writer boyfriend, Riccardo, Vittoria meets Piero, a lively stockbroker, on the hectic floor of the Roman stock exchange. Though Vittoria and Piero begin a relationship, it is not one without difficulties, and their commitment to one another is tested during an eclipse.','bw',126,21135,'tt0056736','/oXoe0Fp92Yw3mMJ9Vq0hPlaMELg.jpg','/n6hmnEqU9W4jcVxCU00S4XJ5ecw.jpg');
INSERT INTO movies VALUES('4216','Letter from an Unknown Woman',1948,'["USA"]','["Romance","Drama"]',90,'A pianist about to flee from a duel receives a letter from a woman he cannot remember. As she tells the story of her lifelong love for him, he is forced to reinterpret his own past.','bw',127,946,'tt0040536','/gRGRW7DKyK8qBtKJTWguULMGbHG.jpg','/bikeKYkgSW697DaaJaUe2WpaJHM.jpg');
INSERT INTO movies VALUES('3780','Matter of Life and Death, A',1946,'["UK"]','["Romance","Fantasy","Comedy"]',104,'When a young RAF pilot miraculously survives bailing out of his aeroplane without a parachute, he falls in love with an American radio operator. But the officials in the other world realise their mistake and dispatch an angel to collect him.','col-bw',128,28162,'tt0038733','/H74LWKnhOeIFSk9gNjBcPjIov3.jpg','/1uIRgcVllUKAWRCmM5XaV0cPZm0.jpg');
INSERT INTO movies VALUES('9024','Vivre sa vie',1962,'["France"]','["Drama"]',85,'Twelve episodic tales in the life of a Parisian woman and her slow descent into prostitution.','bw',129,1626,'tt0056663','/A0BjScjASfMFgyGI5sU0CwfKh3l.jpg','/qqkQ4tA3n7zWNnKx8CUczdVNTTc.jpg');
INSERT INTO movies VALUES('3740','Notorious',1946,'["USA"]','["Romance","Thriller","Mystery"]',101,'In order to help bring Nazis to justice, U.S. government agent T.R. Devlin recruits Alicia Huberman, the American daughter of a convicted German war criminal, as a spy. As they begin to fall for one another, Alicia is instructed to win the affections of Alexander Sebastian, a Nazi hiding out in Brazil. When Sebastian becomes serious about his relationship with Alicia, the stakes get higher, and Devlin must watch her slip further undercover.','bw',130,303,'tt0038787','/yUjKnpColooH88BFQJwwgNOQ56N.jpg','/9K8MWPiEVNV1FkxiVTV0HuZvNfa.jpg');
INSERT INTO movies VALUES('13071','Alien',1979,'["USA"]','["Science Fiction","Horror"]',117,'During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.','col',131,348,'tt0078748','/vfrQk5IPloGg1v9Rzbh2Eg3VGyM.jpg','/hdHIjZxq3SWFqpAz4NFhdbud0iz.jpg');
INSERT INTO movies VALUES('7870','Imitation of Life',1959,'["USA"]','["Drama","Romance"]',124,'In 1940s New York, a white widow who dreams of being on Broadway has a chance encounter with a black single mother, who becomes her maid.','col',132,34148,'tt0052918','/xt3cUn7lsjpaGuB279A4v8zAYRn.jpg','/9Q4w0Q8r1Svi9JKHEFq4TrLwOm7.jpg');
INSERT INTO movies VALUES('4640','All About Eve',1950,'["USA"]','["Drama"]',138,'From the moment she glimpses her idol at the stage door, Eve Harrington is determined to take the reins of power away from the great actress Margo Channing. Eve maneuvers her way into Margo''s Broadway role, becomes a sensation and even causes turmoil in the lives of Margo''s director boyfriend, her playwright and his wife. Only the cynical drama critic sees through Eve, admiring her audacity and perfect pattern of deceit.','bw',133,705,'tt0042192','/6numIZH6uR3NlJgY9m7nGH0jhs.jpg','/zbi0Ib6FSUHlUu3nC0t3Mzkm5D4.jpg');
INSERT INTO movies VALUES('3729','My Darling Clementine',1946,'["USA"]','["Western"]',97,'Wyatt Earp and his brothers Morgan and Virgil ride into Tombstone and leave brother James in charge of their cattle herd. On their return they find their cattle stolen and James dead. Wyatt takes on the job of town marshal, making his brothers deputies, and vows to stay in Tombstone until James'' killers are found. He soon runs into the brooding, coughing, hard-drinking Doc Holliday as well as the sullen and vicious Clanton clan. Wyatt discovers the owner of a trinket stolen from James'' dead body and the stage is set for the Earps'' long-awaited revenge.','bw',135,3088,'tt0038762','/o7G5klSt9i8LQZdUNvrWUJbbxAO.jpg','/lLuecnrjjj9p4h1mjeTtpk6jXGp.jpg');
INSERT INTO movies VALUES('13966','E.T. The Extra-Terrestrial',1982,'["USA"]','["Science Fiction","Family"]',115,'An alien is left behind on Earth and saved by the 10-year-old Elliot who decides to keep him hidden in his home. While a task force hunts for the extra-terrestrial, Elliot, his brother, and his little sister Gertie form an emotional bond with their new friend, and try to help him find his way home.','col',136,601,'tt0083866','/an0nD6uq6byfxXCfk6lQBzdL2J1.jpg','/9Kg322bGsEbmp94LjCCVGz3cpNw.jpg');
INSERT INTO movies VALUES('20834','Spirited Away',2001,'["Japan"]','["Animated","Adventure","Fantasy"]',124,'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.','col',137,129,'tt0245429','/39wmItIWsg5sZMyRUHLkWBcuVCM.jpg','/mSDsSDwaP3E7dEfUPWy4J0djt4O.jpg');
INSERT INTO movies VALUES('8666','Exterminating Angel, The',1962,'["Mexico"]','["Drama","Fantasy","Mystery"]',95,'After a lavish dinner party, the guests find themselves mysteriously unable to leave the room.','bw',138,29264,'tt0056732','/dqaeUgLOWFbpEkEKzwAZgAcZMMO.jpg','/mI7hfScSb8NAWC09viymxCzWZIq.jpg');
INSERT INTO movies VALUES('4786','Olvidados, Los',1950,'["Mexico"]','["Drama","Crime"]',88,'A group of juvenile delinquents live a violent, criminal life in the festering slums of Mexico City, among them the young Pedro, whose morality is gradually corrupted and destroyed by the others.','bw',139,800,'tt0042804','/3bdfN2gosYSxpHBAXPkAhxkUJFr.jpg','/b4VAgPHGL33OA5QNZCYi0jU5Nma.jpg');
INSERT INTO movies VALUES('2237','His Girl Friday',1940,'["USA"]','["Romance","Comedy"]',92,'Walter Burns is an irresistibly conniving newspaper publisher desperate to woo back his paper’s star reporter, who also happens to be his estranged wife. She’s threatening to quit and settle down with a new beau, but, as Walter knows, she has a weakness: she can’t resist a juicy scoop.','bw',140,3085,'tt0032599','/da95rurNghmKWmraPyqP6IsnAt1.jpg','/rtoov3RgTji1xtWh3rdwMr7jkq0.jpg');
INSERT INTO movies VALUES('9731','Gospel According to St. Matthew, The',1964,'["Italy","France"]','["Religious","Drama"]',135,'This biblical drama from the Catholic Marxist director focuses on the teachings of Jesus, including the parables that reflect their revolutionary nature. As Jesus travels along the coast of the Sea of Galilee, he gradually gathers more followers, leading him into direct conflict with the authorities.','bw',141,24192,'tt0058715','/oifi2CQkKbb6Y2x6J5K6CjaKab9.jpg','/iz7xP1INmMTAfRKaToWVmXrrE1P.jpg');
INSERT INTO movies VALUES('18509','Céline and Julie Go Boating',1974,'["France"]','["Fantasy","Drama","Avant","Garde"]',192,'A mysteriously linked pair of young women find their daily lives pre-empted by a strange boudoir melodrama that plays itself out in a hallucinatory parallel reality. An undisputed classic of the French New Wave, Jacques Rivette’s Celine and Julie Go Boating is a delightful movie about the spiritual journey of a pair of young women, told with a playful approach to the cinematic form. A masterpiece of cinematic creativity, Rivette, the same mind behind 1969’s L’amour fou, effortlessly draws the viewer into the whimsical world of the titular protagonists.','col',142,27019,'tt0071381','/ijpehUwH4XFNFm8UcYHpRQVRQUF.jpg','/iEwxg0FVToElOEE2hD5do5iBQzg.jpg');
INSERT INTO movies VALUES('1968','Gone with the Wind',1939,'["USA"]','["History","Romance","Drama"]',222,'The spoiled daughter of a Georgia plantation owner conducts a tumultuous romance with a cynical profiteer during the American Civil War and Reconstruction Era.','col',143,770,'tt0031381','/lNz2Ow0wGCAvzckW7EOjE03KcYv.jpg','/ft8WRF2xqEwwGWa59naDUybKTAx.jpg');
INSERT INTO movies VALUES('12699','Killer of Sheep',1977,'["USA"]','["Drama"]',83,'An African-American man working at a slaughterhouse in the Watts area of Los Angeles leads a dissatisfied and listless existence.','bw',144,27432,'tt0076263','/p5U8FiIoIHmVf1nLr6XDbqbby3w.jpg','/r763vsubExGcDJypctYuLLJmhB.jpg');
INSERT INTO movies VALUES('12270','One Flew Over the Cuckoo''s Nest',1975,'["USA"]','["Drama"]',133,'A petty criminal fakes insanity to serve his sentence in a mental ward rather than prison. He soon finds himself as a leader to the other patients—and an enemy to the cruel, domineering nurse who runs the ward.','col',145,510,'tt0073486','/3jcbDmRFiQ83drXNOvRDeKHxS0C.jpg','/oje9d0EXQyQcxsqHQor4xFVGjrd.jpg');
INSERT INTO movies VALUES('18569','Daisies',1966,'["Czechoslovakia"]','["Drama","Comedy","Avant Garde"]',76,'Two teenage girls embark on a series of destructive pranks in which they consume and destroy the world around them.','col-bw',146,46919,'tt0060959','/8sxMhdn3i1Pn8OlGCBBjr9rjP1y.jpg','/bvzfStfrucfLeuxVz8MDidXSEee.jpg');
INSERT INTO movies VALUES('1101','Nosferatu',1922,'["Germany"]','["Horror"]',84,'The mysterious Count Orlok summons Thomas Hutter to his remote Transylvanian castle in the mountains.','bw',147,653,'tt0013442','/kEkXNEzDZxBEvWV4Ou16tNuCH1C.jpg','/cA9iGtvjRGJHzDBfrq48l0eyCvA.jpg');
INSERT INTO movies VALUES('9134','Umbrellas of Cherbourg, The',1964,'["France","Germany"]','["Romance","Musical","Drama"]',91,'This simple romantic tragedy begins in 1957. Guy Foucher, a 20-year-old French auto mechanic, has fallen in love with 17-year-old Geneviève Emery, an employee in her widowed mother''s chic but financially embattled umbrella shop. On the evening before Guy is to leave for a two-year tour of combat in Algeria, he and Geneviève make love. She becomes pregnant and must choose between waiting for Guy''s return or accepting an offer of marriage from a wealthy diamond merchant.','col',148,5967,'tt0058450','/tAgTf64XKK5ir7w5C7dnB53jWWG.jpg','/czfbhgM0cjFqPt4ARofDKgRHCyj.jpg');
INSERT INTO movies VALUES('1659','Chien andalou, Un',1928,'["France"]','["Short","Fantasy","Avant","Garde"]',16,'Un Chien Andalou is an European avant-garde surrealist film, a collaboration between director Luis Buñuel and Salvador Dali.','bw',149,626,'tt0020530','/e4NcFlKkyTBN9ZtBuK4RUiEzouw.jpg','/jQywhaFDVLPlFw864Bgw5eNtWfi.jpg');
INSERT INTO movies VALUES('11937','Conversation, The',1974,'["USA"]','["Thriller","Drama","Crime"]',113,'Surveillance expert Harry Caul is hired by a mysterious client''s brusque aide to tail a young couple. Tracking the pair through San Francisco''s Union Square, Caul and his associate Stan manage to record a cryptic conversation between them. Tormented by memories of a previous case that ended badly, Caul becomes obsessed with the resulting tape, trying to determine if the couple is in danger.','col',150,592,'tt0071360','/leZtiWJXHEp2x7jVW7djhcSboSJ.jpg','/fVJZYpzVTKo0vXmar9NnRMV0Qcn.jpg');
INSERT INTO movies VALUES('11059','Wanda',1970,'["USA"]','["Drama","Crime"]',105,'After a string of abusive relationships, Wanda abandons her family and seeks solace in the company of a petty criminal.','col',151,80560,'tt0067961','/izuJ7cUhcihFnTpfsdSnkMCHsRQ.jpg','/bL1etbhvRGhHhpjbwzHZbXNwM5R.jpg');
INSERT INTO movies VALUES('14273','Argent, L''',1983,'["France","Switzerland"]','["Drama","Crime"]',90,'A forged 500-franc note is passed from person to person and shop to shop, until it falls into the hands of a genuine innocent who doesn''t see it for what it is—which will have devastating consequences on his life.','col',152,42112,'tt0085180','/z3H4dNLpEYJ340KI29bLn8unUX6.jpg','/a62YSsCwYd5EyzB5EbaeX2FmM4m.jpg');
INSERT INTO movies VALUES('12821','Days of Heaven',1978,'["USA"]','["Romance","Drama"]',95,'In 1916, a Chicago steel worker accidentally kills his supervisor and flees to the Texas panhandle with his girlfriend and little sister to work harvesting wheat in the fields of a stoic farmer.','col',153,16642,'tt0077405','/siE1XQ544MLO27geLYDbUDy3oTt.jpg','/9Upbup1xrQuTDbspIh9aytEH5xA.jpg');
INSERT INTO movies VALUES('3496','Rome, Open City',1945,'["Italy"]','["War","Drama"]',105,'During the Nazi occupation of Rome in 1944, the leader of the Resistance is chased by the Nazis as he seeks refuge and a way to escape.','bw',154,307,'tt0038890','/ijGV4v8JxgbNzgEhqKdzHdaZn8a.jpg','/cztYhbawTjK9m8lFBd97Yl5Zd8r.jpg');
INSERT INTO movies VALUES('1645','Trouble in Paradise',1932,'["USA"]','["Romance","Comedy"]',83,'Thief Gaston Monescu and pickpocket Lily are partners in crime and love. Working for perfume company executive Mariette Colet, the two crooks decide to combine their criminal talents to rob their employer. Under the alias of Monsieur Laval, Gaston uses his position as Mariette''s personal secretary to become closer to her. However, he takes things too far when he actually falls in love with Mariette, and has to choose between her and Lily.','bw',155,195,'tt0023622','/FBxuoLRD3Biyul14unT5m3PYNS.jpg','/hgI7hZ4vMDEdp6t1A9kmnl2wtzA.jpg');
INSERT INTO movies VALUES('9730','Good, the Bad and the Ugly, The',1966,'["Italy","Spain"]','["Western","Action"]',161,'While the Civil War rages on between the Union and the Confederacy, three men – a quiet loner, a ruthless hitman, and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.','col',156,429,'tt0060196','/bX2xnavhMYjWDoZp1VM6VnU1xwe.jpg','/x4biAVdPVCghBlsVIzB6NmbghIz.jpg');
INSERT INTO movies VALUES('16982','Chungking Express',1994,'["Hong Kong"]','["Romance","Drama"]',104,'Two melancholic Hong Kong policemen fall in love: one with a mysterious underworld figure, the other with a beautiful and ethereal server at a late-night restaurant.','col',157,11104,'tt0109424','/43I9DcNoCzpyzK8JCkJYpHqHqGG.jpg','/8e6avmXiqurj5LHkmdHBq6rc5jm.jpg');
INSERT INTO movies VALUES('12779','Star Wars',1977,'["USA"]','["Science Fiction","Fantasy","Adventure"]',121,'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.','col',158,11,'tt0076759','/6FfCtAuVAW8XJjZ7eWeLibRLWTw.jpg','/4qCqAdHcNKeAHcK8tJ8wNJZa9cx.jpg');
INSERT INTO movies VALUES('13210','Manhattan',1979,'["USA"]','["Romance","Comedy"]',96,'Manhattan explores how the life of a middle-aged television writer dating a teenage girl is further complicated when he falls in love with his best friend''s mistress.','bw',159,696,'tt0079522','/k4eT3EvfxW1L9Wmt04UqJqCvCR6.jpg','/odXPsc6GyLlAHa64orhAkpmYNLU.jpg');
INSERT INTO movies VALUES('17783','My Neighbour Totoro',1988,'["Japan"]','["Fantasy","Family","Animated"]',86,'Two sisters move to the country with their father in order to be closer to their hospitalized mother, and discover the surrounding trees are inhabited by Totoros, magical spirits of the forest. When the youngest runs away from home, the older sister seeks help from the spirits to find her.','col',160,8392,'tt0096283','/rtGDOeG9LzoerkDGZF9dnVeLppL.jpg','/fxYazFVeOCHpHwuqGuiqcCTw162.jpg');
INSERT INTO movies VALUES('25851','There Will Be Blood',2007,'["USA"]','["Drama"]',158,'Ruthless silver miner, turned oil prospector, Daniel Plainview, moves to oil-rich California. Using his son to project a trustworthy, family-man image, Plainview cons local landowners into selling him their valuable properties for a pittance. However, local preacher Eli Sunday suspects Plainview''s motives and intentions, starting a slow-burning feud that threatens both their lives.','col',161,7345,'tt0469494','/fa0RDkAlCec0STeMNAhPaF89q6U.jpg','/8LRcCJjbQI552BMCuGgYqph8USS.jpg');
INSERT INTO movies VALUES('22451','Tropical Malady',2004,'["Thailand","France","Germany","Italy"]','["Drama","Fantasy","Romance"]',118,'The passionate relationship between two men with unusual consequences. The film is divided in two parts. The first half charts the modest attraction between two men in the sunny, relaxing countryside and the second half charts the confusion and terror of an unknown menace lurking deep within the jungle shadows.','col',162,11534,'tt0381668','/9WJ8ZSZp2NC7jSvweFLskldpzzg.jpg','/6JPh7zM1CYJVytBT8BTyUoOzevA.jpg');
INSERT INTO movies VALUES('11146','Cries and Whispers',1972,'["Sweden"]','["Drama"]',106,'As Agnes slowly dies of cancer, her sisters are so deeply immersed in their own psychic pains that they can''t offer her the support she needs. Maria is wracked with guilt at her husband''s attempted suicide, caused by his discovery of her extramarital affair. The self-loathing, suicidal Karin seems to regard her sister with revulsion. Only Anna, the deeply religious maid who lost her young child, seems able to offer Agnes solace and empathy.','col',163,10238,'tt0069467','/a1bMgB09YDvvRN9SitCclUYragr.jpg','/xmLgdb0yDBXa7Dlo3aCzjhjCkuE.jpg');
INSERT INTO movies VALUES('12275','Passenger, The',1975,'["Italy"]','["Drama"]',119,'David Locke is a world-weary American journalist who has been sent to cover a conflict in northern Africa, but he makes little progress with the story. When he discovers the body of a stranger who looks similar to him, Locke assumes the dead man''s identity. However, he soon finds out that the man was an arms dealer, leading Locke into dangerous situations. Aided by a beautiful woman, Locke attempts to avoid both the police and criminals out to get him.','col',164,9652,'tt0073580','/rYfnOaYYgAuoI8R0JiAV72jAESS.jpg','/xSMY8Qsoq6BRXsHuaQiNie0S8b.jpg');
INSERT INTO movies VALUES('11623','Badlands',1973,'["USA"]','["Drama","Crime"]',95,'An impressionable teenage girl from a dead-end town and her older greaser boyfriend embark on a killing spree in the South Dakota badlands.','col',165,3133,'tt0069762','/z81rBzHNgiNLean2JTGHgxjJ8nq.jpg','/5rp9Jydh9RxrvVBW2lr27B8NYiT.jpg');
INSERT INTO movies VALUES('823','Âge d''or, L''',1930,'["France"]','["Drama","Avant","Garde","Experimental"]',63,'The film consists of a series of tightly interlinked vignettes, the most sustained of which details the story of a man and a woman who are passionately in love. Their attempts to consummate their passion are constantly thwarted, by their families, by the Church and bourgeois society in general.','bw',166,5729,'tt0021577','/q3OH9Yk3hOE5uYEK55ASjEtsPfE.jpg','/9sm4hWWjbLVVRhsokPaa1toqHe7.jpg');
INSERT INTO movies VALUES('12851','Deer Hunter, The',1978,'["USA"]','["War","Drama"]',183,'A group of working-class friends decide to enlist in the Army during the Vietnam War and finds it to be hellish chaos -- not the noble venture they imagined. Before they left, Steven married his pregnant girlfriend -- and Michael and Nick were in love with the same woman. But all three are different men upon their return.','col',167,11778,'tt0077416','/bbGtogDZOg09bm42KIpCXUXICkh.jpg','/a5zBQfXmLk3qqRYF7AioWpiAxk2.jpg');
INSERT INTO movies VALUES('12088','Texas Chain Saw Massacre, The',1974,'["USA"]','["Horror","Thriller"]',83,'Five friends head out to rural Texas to visit the grave of a grandfather. On the way they stumble across what appears to be a deserted house, only to discover something sinister within. Something armed with a chainsaw.','col',169,30497,'tt0072271','/9s8uSm5K1W0vhGPHv2icM6SFib8.jpg','/1I1cFIKnXEdaOfN4597Y91oNXyo.jpg');
INSERT INTO movies VALUES('3835','Double Indemnity',1944,'["USA"]','["Mystery","Crime","Drama"]',106,'A rich woman and a calculating insurance agent plot to kill her unsuspecting husband after he signs a double indemnity policy. Against a backdrop of distinctly Californian settings, the partners in crime plan the perfect murder to collect the insurance, which pays double if the death is accidental.','bw',170,996,'tt0036775','/kkfKLeOTo7RjS9TxHKpknlL7huS.jpg','/byQdu1nzQLI9t1VeoP1xuQfru3L.jpg');
INSERT INTO movies VALUES('440','Duck Soup',1933,'["USA"]','["Comedy"]',70,'Rufus T. Firefly is named president/dictator of bankrupt Freedonia and declares war on neighboring Sylvania over the love of wealthy Mrs. Teasdale.','bw',171,3063,'tt0023969','/31t63plEGKHhYuuCpC9bFWO9SBS.jpg','/dLE6mHjABhAcT6iQCM5CiJmyIts.jpg');
INSERT INTO movies VALUES('11168','Discreet Charm of the Bourgeoisie, The',1972,'["France"]','["Fantasy","Drama","Comedy"]',100,'In Luis Buñuel’s deliciously satiric masterpiece, an upper-class sextet sits down to dinner but never eats, their attempts continually thwarted by a vaudevillian mixture of events both actual and imagined.','col',172,4593,'tt0068361','/zN4ILX2x64PvT2jIOAHXxCOi5WA.jpg','/ujfVlfO1jhcsUbi8gZssFE8Cmef.jpg');
INSERT INTO movies VALUES('20842','Touki Bouki',1973,'["Senegal"]','["Drama"]',85,'A cowherd with a skull-mounted motorcycle and a university student meet in Dakar; put off by life in Senegal, they plan to make money in Paris.  Screened at the Cannes Film Festival in 1973, Mambéty’s film tells the story of Mory (Magaye Niang), a cow herder and Anta (Myriam Niang), a student, attempting to break free from their situation of circumstance. Steadily raising petty cash in order to save to go to Paris and leave their old lives behind, the film is a pertinent study of contemporary Senegal, which boasts an important narrative as well as a revolutionary approach to filmmaking.','col',173,77771,'tt0070820','/952OPsNzmHKnMUF0unwZAV4smXQ.jpg','/7DlEixaKiNJyK0tHri0AEUAQrk8.jpg');
INSERT INTO movies VALUES('2089','Stagecoach',1939,'["USA"]','["Western","Adventure","Drama"]',96,'A group of people traveling on a stagecoach find their journey complicated by the threat of Geronimo, and learn something about each other in the process.','bw',174,995,'tt0031971','/b4RUzWOalyPbUu66TT147b5iR0M.jpg','/7SYNEG50fKODsTP6h9phYM3BueV.jpg');
INSERT INTO movies VALUES('10377','Rosemary''s Baby',1968,'["USA"]','["Thriller","Horror","Drama"]',136,'A young couple, Rosemary and Guy, moves into an infamous New York apartment building, known by frightening legends and mysterious events, with the purpose of starting a family.','col',175,805,'tt0063522','/nclYFGpVzfbiORO5ELVVdxzt9Vg.jpg','/sDNpacyIpSL8YRNkVR4qOmteXBX.jpg');
INSERT INTO movies VALUES('2061','Only Angels Have Wings',1939,'["USA"]','["Drama","Adventure","Romance"]',121,'A traveling performer arrives at a remote South American port town where the head of an air freight service must risk his pilots'' lives to earn a major contract.','bw',176,43832,'tt0031762','/lqcwiWancAkjtAQPHr9V3SfJjBM.jpg','/wq7KVxUAYH06cHuReBcV0Sx2kFv.jpg');
INSERT INTO movies VALUES('447','Earth',1930,'["USSR"]','["Drama"]',75,'Vasyl, a member of the Komsomol, with the help of a local party organization, gets a tractor and plows private boundaries "on kulak fields". However, this enthusiasm will cost him dearly.','bw',177,46594,'tt0021571','/zGyLXrIXP1DvlEgCGMDokxjL513.jpg','/5EHNInARZmBhOnwl3kiDfhCYTvC.jpg');
INSERT INTO movies VALUES('1867','Colour of Pomegranates, The',1969,'["USSR"]','["Biography","History","Avant","Garde"]',80,'The life of the revered 18th-century Armenian poet and musician Sayat-Nova. Portraying events in the life of the artist from childhood up to his death, the movie addresses in particular his relationships with women, including his muse. The production tells Sayat-Nova''s dramatic story by using both his poems and largely still camerawork, creating a work hailed as revolutionary by Mikhail Vartanov.','col',178,26302,'tt0063555','/rMUbQf7RgsYgQ47AFf1wpoSt4dX.jpg','/wod7lsydb5ZANWowDElxAbAT4Q5.jpg');
INSERT INTO movies VALUES('3370','Brief Encounter',1945,'["UK"]','["Romance","Drama"]',85,'Returning home from a shopping trip to a nearby town, bored suburban housewife Laura Jesson is thrown by happenstance into an acquaintance with virtuous doctor Alec Harvey. Their casual friendship soon develops during their weekly visits into something more emotionally fulfilling than either expected, and they must wrestle with the potential havoc their deepening relationship would have on their lives and the lives of those they love.','bw',179,851,'tt0037558','/jC9EwLJcGhYMSQAHu2LxkKN5v7O.jpg','/vKvoOlhhaZCsiGQDvaZQqyGq1oA.jpg');
INSERT INTO movies VALUES('8903','Birds, The',1963,'["USA"]','["Drama","Horror","Mystery"]',119,'Thousands of birds flock into a seaside town and terrorize the residents in a series of deadly attacks.','col',180,571,'tt0056869','/ADoJaT1s9Jlcfx3Tw2MIZ1BMxo.jpg','/q2XxGMCO8Zey8YDrvQGi8P8ns5F.jpg');
INSERT INTO movies VALUES('45042','Portrait of a Lady on Fire',2019,'["France"]','["Drama","Romance"]',121,'On an isolated island in Brittany at the end of the eighteenth century, a female painter is obliged to paint a wedding portrait of a young woman.','col',181,531428,'tt8613070','/2LquGwEhbg3soxSCs9VNyh5VJd9.jpg','/foFq1RZWQIgFuCQ0nyYccywjFyX.jpg');
INSERT INTO movies VALUES('5198','River, The',1951,'["France","India","USA"]','["Romance","Drama"]',99,'Director Jean Renoir’s entrancing first color feature—shot entirely on location in India—is a visual tour de force. Based on the novel by Rumer Godden, the film eloquently contrasts the growing pains of three young women with the immutability of the Bengal river around which their daily lives unfold. Enriched by Renoir’s subtle understanding and appreciation for India and its people, The River gracefully explores the fragile connections between transitory emotions and everlasting creation.','col',182,45218,'tt0043972','/rC1k4xkffb5sdQlktiP2TyiBxT2.jpg','/6Kbxbod1DxLk4lMBnkp2J49Ygva.jpg');
INSERT INTO movies VALUES('9800','Mouchette',1967,'["France"]','["Drama"]',80,'A young girl living in the French countryside suffers constant indignities at the hand of alcoholism and her fellow man.','bw',183,1561,'tt0061996','/1p1kf7qx26GM2uppZeidZFm88On.jpg','/qTA4fbVJIe9WuRH4z3FV0vdgQl5.jpg');
INSERT INTO movies VALUES('14730','Ran',1985,'["France","Japan"]','["War","History","Drama"]',161,'With Ran, legendary director Akira Kurosawa reimagines Shakespeare''s King Lear as a singular historical epic set in sixteenth-century Japan. Majestic in scope, the film is Kurosawa''s late-life masterpiece, a profound examination of the folly of war and the crumbling of one family under the weight of betrayal, greed, and the insatiable thirst for power.','col',184,11645,'tt0089881','/jQnUtWaHYfqnXPOIf77K7Ycqk4M.jpg','/8wdxa4JgiAXvITgqkra1W0Dpii5.jpg');
INSERT INTO movies VALUES('6099','Johnny Guitar',1954,'["USA"]','["Western","Drama"]',110,'On the outskirts of town, the hard-nosed Vienna owns a saloon frequented by the undesirables of the region, including Dancin'' Kid and his gang. Another patron of Vienna''s establishment is Johnny Guitar, a former gunslinger and her lover. When a heist is pulled in town that results in a man''s death, Emma Small, Vienna''s rival, rallies the townsfolk to take revenge on Vienna''s saloon – even without proof of her wrongdoing.','col',185,26596,'tt0047136','/bap37yOCwcR9x4YDsNUaSo9nIp9.jpg','/yiglnLtYEH6UGY1qFy4zacixCXf.jpg');
INSERT INTO movies VALUES('9672','Chimes at Midnight',1965,'["Switzerland","Spain"]','["History","Drama","Comedy"]',115,'Henry IV usurps the English throne, sets in motion the factious War of the Roses and now faces a rebellion led by Northumberland scion Hotspur. Henry''s heir, Prince Hal, is a ne''er-do-well carouser who drinks and causes mischief with his low-class friends, especially his rotund father figure, John Falstaff. To redeem his title, Hal may have to choose between allegiance to his real father and loyalty to his friend.','bw',186,986,'tt0059012','/5Fjxyz3u2Zdco4WeuC3wQ6O5tYQ.jpg','/atMZwFMnbTEvOpGOh9zFob2yt9T.jpg');
INSERT INTO movies VALUES('1679','Vampyr',1932,'["Germany","France"]','["Fantasy","Horror"]',73,'A traveller arrives at a countryside inn seemingly beckoned by haunted forces. His growing acquaintance with the family living there soon opens up a network of associations between the dead and the living, which pulls him into an unsettling mystery. At its core: the troubled, chaste daughter Gisèle.','bw',187,779,'tt0023649','/yt3JS5JSoZseSohYkhs6FLU9B0O.jpg','/rg3hBiQbDet8uNQkgfbpk7306p8.jpg');
INSERT INTO movies VALUES('8445','Notte, La',1961,'["Italy","France"]','["Drama"]',120,'A day in the life of an unfaithful married couple and their steadily deteriorating relationship in Milan.','bw',188,41050,'tt0054130','/oMXUmRs774wKN4MpGLKtMSslgq5.jpg','/p7xReCSm4lSmStrQdHWVuLEdL2Q.jpg');
INSERT INTO movies VALUES('4005','Out of the Past',1947,'["USA"]','["Crime","Drama","Mystery"]',97,'Jeff Bailey seems to be a mundane gas station owner in remote Bridgeport, California. He is dating local girl Ann Miller and lives a quiet life. But Jeff has a secret past, and when a mysterious stranger arrives in town, Jeff is forced to return to the dark world he had tried to escape.','bw',189,678,'tt0039689','/xkP7PHExdCDzcBemGaiZCk6oCtZ.jpg','/y5piuei6sm2D8QI8CETZzboY1AZ.jpg');
INSERT INTO movies VALUES('31066','Tree of Life, The',2011,'["USA"]','["Drama"]',139,'The impressionistic story of a Texas family in the 1950s. The film follows the life journey of the eldest son, Jack, through the innocence of childhood to his disillusioned adult years as he tries to reconcile a complicated relationship with his father. Jack finds himself a lost soul in the modern world, seeking answers to the origins and meaning of life while questioning the existence of faith.','col',190,8967,'tt0478304','/l8cwuB5WJSoj4uMAsnzuHBOMaSJ.jpg','/krDjqWqLAewVYiU8fDQLHO7gPmf.jpg');
INSERT INTO movies VALUES('18511','Spring in a Small Town',1948,'["China"]','["Romance","Drama"]',85,'A married couple living in a desolate small town in post-WWII China are paid a surprise visit by an old friend of the husband''s.','bw',191,21058,'tt0189219','/r4CDZsZsOY2YXHjiVq9AnAo4CHx.jpg','/cr5fnofjFTKoUwgbyHzeZdkYMz4.jpg');
INSERT INTO movies VALUES('3606','Black Narcissus',1947,'["UK"]','["Drama","Religious"]',99,'A group of Anglican nuns, led by Sister Clodagh, are sent to a mountain in the Himalayas. The climate in the region is hostile and the nuns are housed in an odd old palace. They work to establish a school and a hospital, but slowly their focus shifts. Sister Ruth falls for a government worker, Mr. Dean, and begins to question her vow of celibacy. As Sister Ruth obsesses over Mr. Dean, Sister Clodagh becomes immersed in her own memories of love.','col',192,16391,'tt0039192','/37TXnILqURzYqpFjLY5qzLgEF0n.jpg','/hAyWibhJjMHyWXrMVX8N2MrEqF8.jpg');
INSERT INTO movies VALUES('1074','Napoléon',1927,'["France"]','["War","History","Biography"]',235,'A biopic of Napoleon Bonaparte, tracing the Corsican''s career from his schooldays (where a snowball fight is staged like a military campaign) to his flight from Corsica, through the French Revolution (where a real storm is intercut with a political storm) and the Terror, culminating in his triumphant invasion of Italy in 1797.','bw',193,42536,'tt0018192','/zGupJ1ZO07BWco8YGjBHk90hYWh.jpg','/aZ6YMH5OjY1IYSlREtVmmcHqgQf.jpg');
INSERT INTO movies VALUES('8224','Rocco and His Brothers',1960,'["Italy","France"]','["Drama"]',180,'When a impoverished widow’s family moves to the big city, two of her five sons become romantic rivals with deadly results.','bw',194,8422,'tt0054248','/pngL8AraChIDOiWnKF2o3S9kJzJ.jpg','/oc7FZ5DFRYa7wMm1q20yqljmSsm.jpg');
INSERT INTO movies VALUES('3746','Paisan',1946,'["Italy"]','["War","Drama"]',120,'Six vignettes follow the Allied invasion from July 1943 to winter 1944, from Sicily north to Venice.','bw',195,8429,'tt0038823','/r5IGAFASCXmp8m51vUbER3WwVcB.jpg','/zNjp6eolIcpGx11tDbE5eekeHEG.jpg');
INSERT INTO movies VALUES('12297','Salò, or the 120 Days of Sodom',1975,'["Italy","France"]','["Drama","Political","Horror"]',117,'Four corrupted fascist libertines round up 9 teenage boys and girls and subject them to 120 days of sadistic physical, mental and sexual torture.','col',196,5336,'tt0073650','/xnaDdiRfZlJaTf6JRc4in40eaeI.jpg','/agwkvkJTJrpRlheTn1Qe1qEgJh4.jpg');
INSERT INTO movies VALUES('18566','City of Sadness, A',1989,'["Taiwan","Hong Kong"]','["Political","Drama"]',157,'The story of a family embroiled in the "White Terror", mainland China''s political repression that was wrought on the Taiwanese people by the Kuomintang government in the late 1940s.','col',197,49982,'tt0096908','/7XstBzqWHRCaFk8v5TB3syuE11X.jpg','/fClREI48zqOyESHlP5SZAgFfp3k.jpg');
INSERT INTO movies VALUES('15016','Vagabond',1985,'["France"]','["Drama"]',105,'Mona Bergeron is dead, her frozen body found in a ditch in the French countryside. From this, the film flashes back to the weeks leading up to her death. Through these flashbacks, Mona gradually declines as she travels from place to place, taking odd jobs and staying with whomever will offer her a place to sleep. Mona is fiercely independent, craving freedom over comfort, but it is this desire to be free that will eventually lead to her demise.','col',198,44018,'tt0089960','/2KFfwiPct1hwqi9dkKqoom0BenC.jpg','/tKsFh8qpYyi2AMg5O8QTVdChm4k.jpg');
INSERT INTO movies VALUES('2501','Lady Eve, The',1941,'["USA"]','["Romance","Comedy"]',94,'It''s no accident when wealthy Charles falls for Jean. Jean is a con artist with her sights set on Charles'' fortune. Matters complicate when Jean starts falling for her mark. When Charles suspects Jean is a gold digger, he dumps her. Jean, fixated on revenge and still pining for the millionaire, devises a plan to get back in Charles'' life. With love and payback on her mind, she re-introduces herself to Charles, this time as an aristocrat named Lady Eve Sidwich.','bw',199,3086,'tt0033804','/lJYD3CMgKtv12hazSHc7xt3i2uq.jpg','/mNQm9BVRBVoGsZFHIrtNERJj5WK.jpg');
INSERT INTO movies VALUES('7200','Nights of Cabiria',1957,'["Italy","France"]','["Drama"]',110,'Rome, 1957. A woman, Cabiria, is robbed and left to drown by her boyfriend, Giorgio. Rescued, she resumes her life and tries her best to find happiness in a cynical world. Even when she thinks her struggles are over and she has found happiness and contentment, things may not be what they seem.','bw',200,19426,'tt0050783','/xF4oCG3PLNbcrtPZbqB3BtkIbKg.jpg','/9yepEBnQNcKzWWyHdUiX8Mnqc6U.jpg');
INSERT INTO movies VALUES('14606','Paris, Texas',1984,'["USA"]','["Drama"]',150,'A man wanders out of the desert not knowing who he is. His brother finds him, and helps to pull his memory back of the life he led before he walked out on his family and disappeared four years earlier.','col',201,655,'tt0087884','/7G6ea5djDvCxfqfoMAX8479T4UB.jpg','/moTOuNKnM2phZCYPF49Y1Hb7WJj.jpg');
INSERT INTO movies VALUES('786','King Kong',1933,'["USA"]','["Fantasy","Adventure","Horror"]',103,'Adventurous filmmaker Carl Denham sets out to produce a motion picture unlike anything the world has seen before. Alongside his leading lady Ann Darrow and his first mate Jack Driscoll, they arrive on an island and discover a legendary creature said to be neither beast nor man. Denham captures the monster to be displayed on Broadway as King Kong, the eighth wonder of the world.','bw',202,244,'tt0024216','/lHlnxKL5GbgRibyRFI7n1Ey850i.jpg','/7hDdW3C17pi4MdSeYXs8bwIVA78.jpg');
INSERT INTO movies VALUES('6147','On the Waterfront',1954,'["USA"]','["Drama","Crime"]',108,'A dim-witted yet kind-hearted boxer, Terry Malloy, who failed to succeed unintentionally lures a man to his death after being tricked by a criminal called Johnny Friendly whose men pick of every man who has the courage to speak up to their crimes. As he works on the waterfronts that Friendly owns, he is sent to a church meeting run by a good preacher about how to deal with the problem and runs into the dead man’s sister. Slowly, he falls in love with her and begins to feel guilt about his crime.','bw',203,654,'tt0047296','/fKjLZy9W8VxMOp5OoyWojmLVCQw.jpg','/pxkQAIhC7LXN5s5B23lnvCMgva5.jpg');
INSERT INTO movies VALUES('830','Last Laugh, The',1924,'["Germany"]','["Drama"]',77,'An aging doorman, after being fired from his prestigious job at a luxurious hotel is forced to face the scorn of his friends, neighbours and society.','bw',204,5991,'tt0015064','/7Y6Dxr3oYt1w7ew70YNdLLDYEjk.jpg','/sTyt7e2PB5nfY02reL1iZUYPbly.jpg');
INSERT INTO movies VALUES('19276','News from Home',1976,'["Belgium","France","West Germany"]','["Documentary"]',85,'Belgian filmmaker Chantal Akerman lives in New York. Filmed images of the City accompany texts of Akerman''s loving mother back home in Brussels. The City comes more and more to the front while the words of the mother, read by Akerman herself, gradually fade away.','col',205,86814,'tt0076452','/nWqWaEySdo8hAKJsd1IS9mdnZpF.jpg','/A37wxjHIy75UhpAi5K0p8iFRQgC.jpg');
INSERT INTO movies VALUES('12624','Close Encounters of the Third Kind',1977,'["USA"]','["Science Fiction","Adventure"]',135,'After an encounter with UFOs, an electricity linesman feels undeniably drawn to an isolated area in the wilderness where something spectacular is about to happen.','col',206,840,'tt0075860','/4zfedS25uMAhgm6YQhc9bhKHbLl.jpg','/u9ZLyLvqHY5VDjn0Rs4LKAklsAV.jpg');
INSERT INTO movies VALUES('13840','Raiders of the Lost Ark',1981,'["USA"]','["Adventure","Action"]',115,'When Dr. Indiana Jones – the tweed-suited professor who just happens to be a celebrated archaeologist – is hired by the government to locate the legendary Ark of the Covenant, he finds himself up against the entire Nazi regime.','col',207,85,'tt0082971','/ceG9VzoRAVGwivFU403Wc3AHRys.jpg','/c7Mjuip0jfHLY7x8ZSEriRj45cu.jpg');
INSERT INTO movies VALUES('20474','Gleaners & I, The',2000,'["France"]','["Documentary"]',82,'Varda focuses her eye on gleaners: those who scour already-reaped fields for the odd potato or turnip. Her investigation leads from forgotten corners of the French countryside to off-hours at the green markets of Paris, following those who insist on finding a use for that which society has cast off, whether out of necessity or activism.','col',208,44379,'tt0247380','/6IdCTKi4Eu7i897jpe59wIDGCri.jpg','/yvafnYvrxnwD3MrXcc18sUrkHqU.jpg');
INSERT INTO movies VALUES('3013','Life and Death of Colonel Blimp, The',1943,'["UK"]','["War","Drama","Comedy"]',163,'General Candy, who''s overseeing an English squad in 1943, is a veteran leader who doesn''t have the respect of the men he''s training and is considered out-of-touch with what''s needed to win the war. But it wasn''t always this way. Flashing back to his early career in the Boer War and World War I, we see a dashing young officer whose life has been shaped by three different women, and by a lasting friendship with a German soldier.','col',209,25037,'tt0036112','/kgyd5uyndsXiLYKlVgH0sm7Jfkv.jpg','/diR9qmgQGzY4VjG07YPoaVY2A1e.jpg');
INSERT INTO movies VALUES('11225','Death in Venice',1971,'["Italy"]','["Drama"]',130,'Composer Gustav von Aschenbach travels to Venice for health reasons. There, he becomes obsessed with the stunning beauty of an adolescent Polish boy named Tadzio who is staying with his family at the same Grand Hôtel des Bains on the Lido as Aschenbach.','col',210,6619,'tt0067445','/s81SuFBSqY8T5Lrn5R8ucX8LKxi.jpg','/tyWnJeMatQGLsiLfLsxBV0pp9nk.jpg');
INSERT INTO movies VALUES('14129','Thing, The',1982,'["USA"]','["Science Fiction","Action","Horror"]',108,'A team of American scientists investigate the empty, destroyed base of their Norwegian counterparts in Antarctica, only to discover a terrifying life force that can take the form of its prey.','col',211,1091,'tt0084787','/tzGY49kseSE9QAKk47uuDGwnSCu.jpg','/jaO8WurWoUBE55nskqtFqPZFFaO.jpg');
INSERT INTO movies VALUES('18523','Wavelength',1967,'["Canada","USA"]','["Avant","Garde"]',45,'Wavelength consists of almost no action, and what action does occur is largely elided. If the film could be said to have a conventional plot, this would presumably refer to the three “character” scenes. In the first scene two people enter a room, chat briefly, and listen to “Strawberry Fields Forever” on the radio. Later, a man (played by filmmaker Hollis Frampton) enters inexplicably and dies on the floor. And last, the female owner of the apartment is heard and seen on the phone, speaking, with strange calm, about the dead man in her apartment whom she has never seen before.','col',212,88421,'tt0127354','/EJrUlzZ7kTrCP3czxqtb5dfS5i.jpg','/sqb6J9GohKpqoeTLsG0pgP7AXg7.jpg');
INSERT INTO movies VALUES('16056','Wings of Desire',1987,'["West Germany","France"]','["Fantasy","Drama"]',130,'Two angels, Damiel and Cassiel, glide through the streets of Berlin, observing the bustling population, providing invisible rays of hope to the distressed but never interacting with them. When Damiel falls in love with lonely trapeze artist Marion, the angel longs to experience life in the physical world, and finds -- with some words of wisdom from actor Peter Falk -- that it might be possible for him to take human form.','col-bw',213,144,'tt0093191','/iZQs2vUeCzvS1KfZJ6uYNCGJBBV.jpg','/7TlGXrB4WQ3wbpOCUQnBXseCuOl.jpg');
INSERT INTO movies VALUES('2229','Great Dictator, The',1940,'["USA"]','["War","Comedy","Political"]',128,'Dictator Adenoid Hynkel tries to expand his empire while a poor Jewish barber tries to avoid persecution from Hynkel''s regime.','bw',214,914,'tt0032553','/1QpO9wo7JWecZ4NiBuu625FiY1j.jpg','/c8Pi8F1FzpNebtgXcSjC9nWCdSW.jpg');
INSERT INTO movies VALUES('11549','Solaris',1972,'["USSR"]','["Science Fiction","Drama","Mystery"]',165,'A psychologist is sent to a space station orbiting a planet called Solaris to investigate the death of a doctor and the mental problems of cosmonauts on the station. He soon discovers that the water on the planet is a type of brain which brings out repressed memories and obsessions.','col-bw',215,593,'tt0069293','/uER8n2iitx8Tek6v0wXeF5lMGXp.jpg','/qjPhauZx2vOi3gNKsQfJZHeGemB.jpg');
INSERT INTO movies VALUES('41063','Moonlight',2016,'["USA"]','["Drama"]',111,'The tender, heartbreaking story of a young man’s struggle to find himself, told across three defining chapters in his life as he experiences the ecstasy, pain, and beauty of falling in love, while grappling with his own sexuality.','col',216,376867,'tt4975722','/4911T5FbJ9eD2Faz5Z8cT3SUhU3.jpg','/jm1oD3eB08LImSwL1LrzF9AJQ5b.jpg');
INSERT INTO movies VALUES('1794','Zero for Conduct',1933,'["France"]','["Short","Drama"]',41,'In a repressive boarding school with rigid rules of behavior, four boys decide to rebel against the director on a celebration day.','bw',217,44494,'tt0024803','/oQcGB9BGj9LPTWcEdij47McotKY.jpg','/sitnDiKuFXNmR2sIzBqBj4bQVLQ.jpg');
INSERT INTO movies VALUES('10585','Kes',1969,'["UK"]','["Drama"]',113,'Bullied at school and ignored and abused at home by his indifferent mother and older brother, Billy Casper, a 15-year-old working-class Yorkshire boy, tames and trains his pet kestrel falcon whom he names Kes. Helped and encouraged by his English teacher and his fellow students, Billy finally finds a positive purpose to his unhappy existence—until tragedy strikes.','col',218,13384,'tt0064541','/r1FMq75irhsQBVGjXhPU4xA9SDo.jpg','/eWvxOS5g67B1b46Cff9TlYuJleY.jpg');
INSERT INTO movies VALUES('16963','Breaking the Waves',1996,'["Denmark","Sweden","France","Netherlands","Norway","Iceland","Spain"]','["Romance","Drama"]',156,'In a small and conservative Scottish village, a woman''s paralytic husband convinces her to have extramarital intercourse so she can tell him about it and give him a reason for living.','col',219,145,'tt0115751','/dQWMcdHXUOSHtr7ypOCa5T79JMS.jpg','/yCxuILdReGFK948mfUOAX75xb5Z.jpg');
INSERT INTO movies VALUES('10045','Samouraï, Le',1967,'["France","Italy"]','["Crime","Drama"]',101,'After carrying out a flawlessly planned hit, Jef Costello, a contract killer with samurai instincts, finds himself caught between a persistent police investigator and a ruthless employer, and not even his armor of fedora and trench coat can protect him.','col',220,5511,'tt0062229','/5Fa6o5nfUPEatQ9b3OwEvdEdR7T.jpg','/znLq5iyuMVvHwDdgZf6HyVUNjWB.jpg');
INSERT INTO movies VALUES('2228','Grapes of Wrath, The',1940,'["USA"]','["Drama"]',129,'Tom Joad returns to his home after a jail sentence to find his family kicked out of their farm due to foreclosure. He catches up with them on his Uncle’s farm, and joins them the next day as they head for California and a new life... Hopefully.','bw',221,596,'tt0032551','/eUcxMVBIA0Jg8l1RGUqycrc3eIQ.jpg','/7UTQCis1B8oWNjIMzQq57LPqma2.jpg');
INSERT INTO movies VALUES('5576','Umberto D.',1952,'["Italy"]','["Drama"]',89,'When elderly pensioner Umberto Domenico Ferrari returns to his boarding house from a protest calling for a hike in old-age pensions, his landlady demands her 15,000-lire rent by the end of the month or he and his small dog will be turned out onto the street. Unable to get the money in time, Umberto fakes illness to get sent to a hospital, giving his beloved dog to the landlady''s pregnant and abandoned maid for temporary safekeeping.','bw',222,833,'tt0045274','/5I7SYsNQmZRZpQ2MAarIQYU9vaX.jpg','/oHL7gjqFgxHiwm45hqj4Xou9Odg.jpg');
INSERT INTO movies VALUES('19880','Magnolia',1999,'["USA"]','["Drama"]',188,'An epic mosaic of many interrelated characters in search of happiness, forgiveness, and meaning in the San Fernando Valley.','col-bw',223,334,'tt0175880','/uq2u8HgtLFJkjNq2kHb2jvipIPT.jpg','/kCUBMsmMRxlDA55qAleFnbJ1reQ.jpg');
INSERT INTO movies VALUES('5434','Life of Oharu, The',1952,'["Japan"]','["Drama"]',146,'In Edo Period Japan, a noblewoman''s banishment for her love affair with a lowly page signals the beginning of her inexorable fall.','bw',224,43364,'tt0045112','/mhHZvr0FmgGTtFL8aRYHp4X0Hs2.jpg','/ArIUSupyRV3hYiq7VOXlZU8KIVJ.jpg');
INSERT INTO movies VALUES('14765','Brazil',1985,'["UK"]','["Science Fiction","Fantasy"]',131,'Low-level bureaucrat Sam Lowry escapes the monotony of his day-to-day life through a recurring daydream of himself as a virtuous hero saving a beautiful damsel. Investigating a case that led to the wrongful arrest and eventual death of an innocent man instead of wanted terrorist Harry Tuttle, he meets the woman from his daydream, and in trying to help her gets caught in a web of mistaken identities, mindless bureaucracy and lies.','col',225,68,'tt0088846','/d0PibPzCK4fVikjoD1PqHovbvkt.jpg','/ziRWOYnl6e2JUaHYmFLR1kfcECM.jpg');
INSERT INTO movies VALUES('19764','Where is the Friend''s House?',1987,'["Iran"]','["Drama"]',85,'An 8 year old boy must return his friend''s notebook he took by mistake, lest his friend be punished by expulsion from school.','col',226,49964,'tt0093342','/aU9WdjwfKTiBsiIh9Vgjr4onhnD.jpg','/nUZuknTYxL7K0iwxjevf5F0Hrzi.jpg');
INSERT INTO movies VALUES('5499','Quiet Man, The',1952,'["USA"]','["Romance","Drama","Comedy"]',129,'An American man returns to the village of his birth in Ireland, where he finds love and conflict.','col',227,3109,'tt0045061','/u3B1hVKHE56yBRoxF3Nk9uxHdYN.jpg','/wUETmGLEmVT00iAIjAeZwSdjMxH.jpg');
INSERT INTO movies VALUES('2590','Sullivan''s Travels',1941,'["USA"]','["Romance","Comedy"]',91,'Successful movie director John L. Sullivan, convinced he won''t be able to film his ambitious masterpiece until he has suffered, dons a hobo disguise and sets off on a journey, aiming to "know trouble" first-hand. When all he finds is a train ride back to Hollywood and a beautiful blonde companion, he redoubles his efforts, managing to land himself in more trouble than he bargained for when he loses his memory and ends up a prisoner on a chain gang.','bw',228,16305,'tt0034240','/z5cqIM0ysVjkCmaDfyTQnlozdIp.jpg','/7E4b9mXU9psvGbqCbI0aGEGI1oO.jpg');
INSERT INTO movies VALUES('14569','Love Streams',1984,'["USA"]','["Drama"]',141,'Two closely-bound, emotionally wounded siblings reunite after years apart.','col',229,52109,'tt0087644','/ik9iQolv2LaGOBU3GNAfmd3MrP8.jpg','/t1gh4IcbwWNZi3sgER6kYeOoHWE.jpg');
INSERT INTO movies VALUES('18530','Black God, White Devil',1964,'["Brazil"]','["Political","Drama","Crime"]',110,'Wanted for killing his boss, Manuel flees with his wife Rosa  to the sertão, the barren landscape of Northern Brazil. Thrust into a primordial violent region, Manuel and Rosa come under the influence and control of a series of frightening figures.','bw',230,67612,'tt0058006','/itnCM79n9BrGL5lsBY1B5EPIqlW.jpg','/hrY61sfdd2tGB6hMeOlk75wEI7g.jpg');
INSERT INTO movies VALUES('18513','Travelling Players, The',1975,'["Greece"]','["Political","Drama"]',230,'This expansive Greek drama follows a troupe of theater actors as they perform around their country during World War II. While the production that they put on is entitled "Golfo the Shepherdess," the thespians end up echoing scenes from classic Greek tales in their own lives, as Elektra plots revenge on her mother for the death of her father, and seeks help from her brother, Orestes, a young anti-fascist rebel.','col',231,689,'tt0073800','/o7e7bhYVYVJGCnxRqcvnYBeQ5dZ.jpg','/dyZ1pUMTpwX4skeq0BfeGkdTtvV.jpg');
INSERT INTO movies VALUES('20778','House is Black, The',1963,'["Iran"]','["Documentary","Short"]',20,'Set in a leper colony in the north of Iran, The House is Black juxtaposes "ugliness," of which there is much in the world as stated in the opening scenes, with religion and gratitude.','bw',232,44065,'tt0336693','/eFIpxjYOMLoN5BBjy4McT7rBKmr.jpg','/xhJh3xfSbRNSzqzs2ynsDsX4Sbd.jpg');
INSERT INTO movies VALUES('18519','Germany, Year Zero',1948,'["Italy","West Germany"]','["War","Drama"]',74,'In the ruins of post-WWII Berlin, a twelve-year-old boy is left to his own devices in order to help provide for his family.','bw',233,8016,'tt0039417','/sdxegsjrrvujXvv2GLPENyDlWDI.jpg','/vblx2TkQFrBrEORsEssizgEqakT.jpg');
INSERT INTO movies VALUES('9452','Red Desert',1964,'["Italy","France"]','["Drama"]',118,'In an industrializing Italian town, a married woman, rendered mentally unstable after a traffic accident, drifts into an affair with a friend of her husband.','col',234,26638,'tt0058003','/rGcTVdyhaGzMxPPRVApXre6F7SD.jpg','/xe43LKesFXjQgP4W1s2juf7Tb4t.jpg');
INSERT INTO movies VALUES('11318','McCabe & Mrs. Miller',1971,'["USA"]','["Western","Drama"]',121,'A gambler and a prostitute become business partners in a remote Old West mining town, and their enterprise thrives until a large corporation arrives on the scene.','col',235,29005,'tt0067411','/s08TlP0kKcpK50XZhg9oL7aGpbz.jpg','/aycQMGPRA8LrNWPziPfj1quH5Qp.jpg');
INSERT INTO movies VALUES('341','Crowd, The',1928,'["USA"]','["Drama"]',104,'John, an ambitious but undisciplined New York City office worker, meets and marries Mary. They start a family, struggle to cope with marital stress, financial setbacks, and tragedy, all while lost amid the anonymous, pitiless throngs of the big city.','bw',236,3061,'tt0018806','/jftzHLCZLE2DOLQWY0mENOIPjxc.jpg','/8ezQueOrGZyViNqdQcxOIaGIP2v.jpg');
INSERT INTO movies VALUES('19432','Matrix, The',1999,'["USA","Australia"]','["Science Fiction","Action","Adventure"]',136,'Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.','col',237,603,'tt0133093','/f89U3ADr1oiB1s9GkdPOEpXUk5H.jpg','/ncEsesgOJDNrTUED89hYbA117wo.jpg');
INSERT INTO movies VALUES('7367','Ashes and Diamonds',1958,'["Poland"]','["War","Drama","Political"]',96,'A young academy soldier, Maciek Chelmicki, is ordered to shoot the secretary of the KW PPR. A coincidence causes him to kill someone else. Meeting face to face with his victim, he gets a shock. He faces the necessity of repeating the assassination.  He meets Krystyna, a girl working as a barmaid in the restaurant of the "Monopol" hotel. His affection for her makes him even more aware of the senselessness of killing at the end of the war. Loyalty to the oath he took, and thus the obligation to obey the order, tips the scales.','bw',238,5055,'tt0052080','/nE8aqRvVnRQEqskiarnFhdJdk8g.jpg','/1QlZ3Kge4bCH01V3VibxckeVIiu.jpg');
INSERT INTO movies VALUES('8602','Autumn Afternoon, An',1962,'["Japan"]','["Drama"]',115,'Shuhei Hirayama is a widower with a 24-year-old daughter. Gradually, he comes to realize that she should not be obliged to look after him for the rest of his life, so he arranges a marriage for her.','col',239,50759,'tt0056444','/4RtWkqywkzxonlnGBwv4RpSw4Rb.jpg','/r9cWPx9W8ObmMIBdbBce9bUXZhq.jpg');
INSERT INTO movies VALUES('18532','Memories of Underdevelopment',1968,'["Cuba"]','["Political","Romance","Drama"]',97,'In the aftermath of the Bay of Pigs incident, Sergio chooses to stay behind in Cuba while his wife and family escape to neighboring Miami. Alone in a brave new world, Sergio observes the constant threat of foreign invasion while chasing young women all over Havana. He finally meets Elena, a young virgin girl he seeks to mould into the image of his ex-wife, but at what cost to himself?','bw',240,47576,'tt0063291','/av7zEHpOyzmm86VPRa68zOLaBqf.jpg','/mE58wQKaXb09zjrGrCVjWrkp7Xn.jpg');
INSERT INTO movies VALUES('10918','Performance',1970,'["UK"]','["Drama","Crime"]',105,'In underworld terms, Chas Devlin is a ''performer,'' a gangster with a talent for violence and intimidation. Turner is a reclusive rock superstar. When Chas and Turner meet, their worlds collide—and the impact is both exotic and explosive.','col',241,26606,'tt0066214','/wfEY1Bz6bCJ49lmBg7mt2AmAaRq.jpg','/7D8De14MRwDCU6IWyR2xTUxV6pl.jpg');
INSERT INTO movies VALUES('45041','Parasite',2019,'["South Korea"]','["Comedy","Drama","Thriller"]',132,'All unemployed, Ki-taek''s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.','col',242,496243,'tt6751668','/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg','/hiKmpZMGZsrkA3cdce8a7Dpos1j.jpg');
INSERT INTO movies VALUES('12862','Eraserhead',1977,'["USA"]','["Horror","Fantasy","Science Fiction"]',85,'First time father Henry Spencer tries to survive his industrial environment, his angry girlfriend, and the unbearable screams of his newly born mutant child. David Lynch arrived on the scene in 1977, almost like a mystical UFO gracing the landscape of LA with its enigmatic radiance. His inaugural work, "Eraserhead" (1977), stood out as a cinematic anomaly, painting a surreal narrative of a young man navigating a dystopian, industrialized America, grappling not only with his tumultuous home life but also contending with an irate girlfriend and a mutant child.','bw',243,985,'tt0074486','/mxveW3mGVc0DzLdOmtkZsgd7c3B.jpg','/ApB0mF2d5Oqioi3yxjuogiotSLI.jpg');
INSERT INTO movies VALUES('3698','Ivan the Terrible, Part 2',1946,'["USSR"]','["History","Drama","Biography"]',88,'This is the second part of a projected three-part epic biopic of Russian Czar Ivan Grozny, undertaken by Soviet film-maker Sergei Eisenstein at the behest of Josef Stalin.  Production of the epic was stopped before the third part could be filmed, due to producer dissatisfaction with Eisenstein''s introducing forbidden experimental filming techniques into the material, more evident in this part than the first part.  As it was, this second part was banned from showings until after the deaths of both Eisenstein and Stalin, and a change of attitude by the subsequent heads of the Soviet government.  In this part, as Ivan the Terrible attempts to consolidate his power by establishing a personal army, his political rivals, the Russian boyars, plot to assassinate him.','col-bw',244,43118,'tt0051790','/9VufNqHN0EIkZAsJIv5vDYIitPo.jpg','/5XpnHNpXOGUr9B20JUeKGNBRTud.jpg');
INSERT INTO movies VALUES('5632','Band Wagon, The',1953,'["USA"]','["Musical","Dance","Comedy"]',112,'A Broadway artiste turns a faded film star''s comeback vehicle into an artsy flop.','col',245,29376,'tt0045537','/5CvUmTWK46rShfgLmw7LuKF2fYL.jpg','/bPDR1GR4Bh8EdKQKKfudQpL14kD.jpg');
INSERT INTO movies VALUES('3601','Best Years of Our Lives, The',1946,'["USA"]','["War","Drama"]',172,'It''s the hope that sustains the spirit of every GI: the dream of the day when he will finally return home. For three WWII veterans, the day has arrived. But for each man, the dream is about to become a nightmare.','bw',246,887,'tt0036868','/gd5EoAU4MM57sW3vlWxJ0NMM8cV.jpg','/nCl5KzxUs4rVVlAdixDf4r5AbbZ.jpg');
