INSERT INTO movies VALUES('19377','Thin Red Line, The',1998,'["USA"]','["War","Drama"]',170,'The story of a group of men, an Army Rifle company called C-for-Charlie, who change, suffer, and ultimately make essential discoveries about themselves during the fierce World War II battle of Guadalcanal. It follows their journey, from the surprise of an unopposed landing, through the bloody and exhausting battles that follow, to the ultimate departure of those who survived.','col',248,8741,'tt0120863','/seMydAaoxQP6F0xbE1jOcTmn5Jr.jpg','/nBBu3nP7uvBAGmock4gOMXdrdrA.jpg');
INSERT INTO movies VALUES('3243','Meet Me in St. Louis',1944,'["USA"]','["Musical","Family","Drama"]',113,'The life of a St. Louis family in the year before the 1904 St. Louis World''s Fair.','col',249,909,'tt0037059','/ekVeUvG81pidsv2LMtWf5yYcNbq.jpg','/fQ93o3wVSIe0dXMLTVTBHoqWwew.jpg');
INSERT INTO movies VALUES('4760','In a Lonely Place',1950,'["USA"]','["Drama","Mystery"]',91,'An aspiring actress begins to suspect that her temperamental and mentally impaired boyfriend is a murderer.','bw',250,17057,'tt0042593','/mR72XsO7EQu3uH8TeqPxMd9V8mW.jpg','/hS9rKTtgYUBn26QTrLYUh8P07Yg.jpg');
INSERT INTO movies VALUES('2998','Ivan the Terrible, Part 1',1944,'["USSR"]','["History","Drama","Biography"]',96,'Set during the early part of his reign, Ivan faces betrayal from the aristocracy and even his closest friends as he seeks to unite the Russian people.  Sergei Eisenstein''s final film, this is the first part of a three-part biopic of Tsar Ivan IV of  Russia, which was never completed due to the producer''s dissatisfaction with Eisenstein''s attempts to use forbidden experimental filming techniques and excessive cost overruns.  The second part was completed but not released for a decade after Eisenstein''s death and a change of heart in the USSR government toward his work; the third part was only in its earliest stage of filming when shooting was stopped altogether.','bw',251,9797,'tt0037824','/rzFWfdq6CXLCnlfXTTZs9W9dMR2.jpg','/ohn9zA2dUbVuo4ajx32Em97qvMr.jpg');
INSERT INTO movies VALUES('21602','Eternal Sunshine of the Spotless Mind',2004,'["USA"]','["Romance","Drama","Comedy"]',108,'Joel Barish, heartbroken that his girlfriend underwent a procedure to erase him from her memory, decides to do the same. However, as he watches his memories of her fade away, he realises that he still loves her, and may be too late to correct his mistake.','col',252,38,'tt0338013','/5MwkWH9tYHv3mV9OdYTMR5qreIz.jpg','/jz9Kep0xWjiA6QDHSsd43ASxNfj.jpg');
INSERT INTO movies VALUES('18769','Big Lebowski, The',1998,'["USA","UK"]','["Comedy","Crime"]',113,'Jeffrey ''The Dude'' Lebowski, a Los Angeles slacker who only wants to bowl and drink White Russians, is mistaken for another Jeffrey Lebowski, a wheelchair-bound millionaire, and finds himself dragged into a strange series of events involving nihilists, adult film producers, ferrets, errant toes, and large sums of money.','col',253,115,'tt0118715','/3bv6WAp6BSxxYvB5ozKFUYuRA8C.jpg','/nevS6wjzCxZESvmjJZqdyZ3RNQ6.jpg');
