INSERT INTO movies VALUES('15322','Green Ray, The',1986,'["France"]','["Romance","Drama"]',99,'A lonely Parisian woman comes to terms with her isolation and anxieties during a long summer vacation.','col',255,54898,'tt0091830','/aYC5smQFaKpBrgJ3XsJ0aAmiD1A.jpg','/nQVphLwp5U1KuldenW5vvHQvtc7.jpg');
INSERT INTO movies VALUES('9928','Belle de jour',1967,'["France","Italy"]','["Drama"]',100,'Beautiful young housewife Séverine Serizy cannot reconcile her masochistic fantasies with her everyday life alongside dutiful husband Pierre. When her lovestruck friend Henri mentions a secretive high-class brothel run by Madame Anais, Séverine begins to work there during the day under the name Belle de Jour. But when one of her clients grows possessive, she must try to go back to her normal life.','col',256,649,'tt0061395','/enq7agj0TPCVpSLCGWehrYHB5tB.jpg','/ny6tm550dgayBvGtDTtLPV1UBPs.jpg');
INSERT INTO movies VALUES('4706','Diary of a Country Priest',1951,'["France"]','["Religious","Drama"]',120,'An inexperienced, sickly priest shows up in the rural French community of Ambricourt, where he joins the community''s clergy. But the locals don''t take kindly to the priest, and his ascetic ways and unsociable demeanor make him an outcast. During Bible studies at the nearby girls school, he is continually mocked by his students. Then his attempt to intervene in a family feud backfires into a scandal. His failures, compounded with his declining health, begin to erode his faith.','bw',257,43376,'tt0042619','/mft7ZJqHxUyFaLL3ZYXX1MN2Gro.jpg','/luytZGyalDVIBy2jDk51EKV45T8.jpg');
INSERT INTO movies VALUES('4269','Red River',1948,'["USA"]','["Western"]',133,'Headstrong Thomas Dunson starts a thriving Texas cattle ranch with the help of his faithful trail hand, Groot, and his protégé, Matthew Garth, an orphan Dunson took under his wing when Matt was a boy. In need of money following the Civil War, Dunson and Matt lead a cattle drive to Missouri, where they will get a better price than locally, but the crotchety older man and his willful young partner begin to butt heads on the exhausting journey.','bw',258,3089,'tt0040724','/jyNTsAzrIWB441OtvfbgKtx1kFS.jpg','/lao4uGoHBwlhFYMigkF7Zwo8CoD.jpg');
