INSERT INTO movies VALUES('9998','Graduate, The',1967,'["USA"]','["Romance","Drama","Comedy"]',105,'Benjamin, a recent college graduate very worried about his future, finds himself in a love triangle with an older woman and her daughter.','col',260,37247,'tt0061722','/qtVvdSsm2hvau6ItLe4gWdFKe2M.jpg','/5OqXwHDlYSMCdqoQBXtgv130GhI.jpg');
INSERT INTO movies VALUES('15786','Cinema Paradiso',1988,'["Italy","France"]','["Drama"]',155,'A filmmaker recalls his childhood, when he fell in love with the movies at his village''s theater and formed a deep friendship with the theater''s projectionist.','col',261,11216,'tt0095765','/8SRUfRUi6x4O68n0VCbDNRa6iGL.jpg','/zoVeIgKzGJzpdG6Gwnr7iOYfIMU.jpg');
