INSERT INTO movies VALUES('30294','Uncle Boonmee Who Can Recall His Past Lives',2010,'["Thailand","UK","France","Germany","Spain","Netherlands"]','["Drama","Fantasy"]',113,'Suffering from acute kidney failure, Boonmee has chosen to spend his final days surrounded by his loved ones in the countryside. Surprisingly, the ghost of his deceased wife appears to care for him, and his long lost son returns home in a non-human form. Contemplating the reasons for his illness, Boonmee treks through the jungle with his family to a mysterious hilltop cave—the birthplace of his first life.','col',263,38368,'tt1588895','/iZinYNVaBLg3pj4e8IXwvfXAtrI.jpg','/6KvTXWweemPG4wK3XCFsCPxKZp1.jpg');
INSERT INTO movies VALUES('17365','Heat',1995,'["USA"]','["Thriller","Drama","Crime"]',174,'Obsessive master thief Neil McCauley leads a top-notch crew on various daring heists throughout Los Angeles while determined detective Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.','col',264,949,'tt0113277','/umSVjVdbVwtx5ryCA2QXL44Durm.jpg','/xKsnZDERG1dk95wuZ5q9iks3OL3.jpg');
INSERT INTO movies VALUES('210','Cabinet of Dr. Caligari, The',1920,'["Germany"]','["Horror","Fantasy"]',69,'Francis, a young man, recalls in his memory the horrible experiences he and his fiancée Jane recently went through. Francis and his friend Alan visit The Cabinet of Dr. Caligari, an exhibit where the mysterious doctor shows the somnambulist Cesare, and awakens him for some moments from his death-like sleep.','bw',265,234,'tt0010323','/myK9DeIsXWGKgUTZyGXg2IfFk0W.jpg','/ujaUJzloLboGsFSQfo8QZrnHMCQ.jpg');
INSERT INTO movies VALUES('4329','Treasure of the Sierra Madre, The',1948,'["USA"]','["Adventure","Drama"]',124,'Fred C. Dobbs and Bob Curtin, both down on their luck in Tampico, Mexico in 1925, meet up with a grizzled prospector named Howard and decide to join with him in search of gold in the wilds of central Mexico. Through enormous difficulties, they eventually succeed in finding gold, but bandits, the elements, and most especially greed threaten to turn their success into disaster.','bw',266,3090,'tt0040897','/pWcst7zVbi8Z8W6GFrdNE7HHRxL.jpg','/sj5R5SGor3YMFBuabMj8gPbyBmh.jpg');
INSERT INTO movies VALUES('4489','Kind Hearts and Coronets',1949,'["UK"]','["Comedy","Crime"]',106,'When his mother eloped with an Italian opera singer, Louis Mazzini was cut off from her aristocratic family. After the family refuses to let her be buried in the family mausoleum, Louis avenges his mother''s death by attempting to murder every family member who stands between himself and the family fortune. But when he finds himself torn between his longtime love and the widow of one of his victims, his plans go awry.','bw',267,11898,'tt0041546','/eBvpyRjD3DcCsWgdV6Y9oqPS7dO.jpg','/psDC2NgH2nj1mFeoMY2PwLkVBRv.jpg');
INSERT INTO movies VALUES('18056','Schindler''s List',1993,'["USA"]','["War","History","Drama"]',195,'The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.','col-bw',268,424,'tt0108052','/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg','/3f92DMBTFqr3wgXpfxzrb0qv8nG.jpg');
INSERT INTO movies VALUES('17211','Fargo',1996,'["USA"]','["Drama","Crime","Comedy"]',98,'Jerry, a small-town Minnesota car salesman is bursting at the seams with debt... but he''s got a plan. He''s going to hire two thugs to kidnap his wife in a scheme to collect a hefty ransom from his wealthy father-in-law. It''s going to be a snap and nobody''s going to get hurt... until people start dying. Enter Police Chief Marge, a coffee-drinking, parka-wearing - and extremely pregnant - investigator who''ll stop at nothing to get her man. And if you think her small-time investigative skills will give the crooks a run for their ransom... you betcha!','col',269,275,'tt0116282','/rt7cpEr1uP6RTZykBFhBTcRaKvG.jpg','/747dgDfL5d8esobk7h4odaOFhUq.jpg');
INSERT INTO movies VALUES('11682','Exorcist, The',1973,'["USA"]','["Horror"]',122,'When a charming 12-year-old girl takes on the characteristics and voices of others, doctors say there is nothing they can do. As people begin to die, the girl''s mother realizes her daughter has been possessed by the devil--and that her daughter''s only possible hope lies with two priests and the ancient rite of demonic exorcism.','col',270,9552,'tt0070047','/5x0CeVHJI8tcDx8tUUwYHQSNILq.jpg','/huC0x1don81NMreSGx4ITkrv9aG.jpg');
INSERT INTO movies VALUES('19590','Eyes Wide Shut',1999,'["USA","UK"]','["Drama","Mystery","Thriller"]',159,'After Dr. Bill Harford''s wife, Alice, admits to having sexual fantasies about a man she met, Bill becomes obsessed with having a sexual encounter. He discovers an underground sexual group and attends one of their meetings -- and quickly discovers that he is in over his head.','col',271,345,'tt0120663','/knEIz1eNGl5MQDbrEAVWA7iRqF9.jpg','/AklO85uUDAL3O7iSOtFGfqT3w8n.jpg');
