INSERT INTO movies VALUES('18951','Taste of Cherry',1997,'["Iran"]','["Drama"]',99,'A middle-aged Tehranian man, Mr. Badii is intent on killing himself and seeks someone to bury him after his demise. Driving around the city, the seemingly well-to-do Badii meets with numerous people, including a Muslim student, asking them to take on the job, but initially he has little luck. Eventually, Badii finds a man who is up for the task because he needs the money, but his new associate soon tries to talk him out of committing suicide.','col',273,30020,'tt0120265','/u6GYH4HyR0BVwpqFuTOc2g4KB1L.jpg','/1NEsPzxmiucxRxvaly7UHMYIANj.jpg');
INSERT INTO movies VALUES('18579','F for Fake',1973,'["France","Iran","West Germany"]','["Documentary","Avant","Garde"]',89,'Documents the lives of infamous fakers Elmyr de Hory and Clifford Irving. De Hory, who later committed suicide to avoid more prison time, made his name by selling forged works of art by painters like Picasso and Matisse. Irving was infamous for writing a fake autobiography of Howard Hughes. Welles moves between documentary and fiction as he examines the fundamental elements of fraud and the people who commit fraud at the expense of others.','col',274,43003,'tt0072962','/fVeIDxS73CrosoeVOaefQuCUGZg.jpg','/oUnmsXgySUgadPXdFqaEU8RTObC.jpg');
INSERT INTO movies VALUES('20439','Ciénaga, La',2001,'["Argentina","France","Spain"]','["Drama","Comedy"]',103,'The life of two women and their families in a small provincial town of Salta, Argentina.','col',275,58429,'tt0240419','/fcgRKfCRudyWggyHIT9LOPgU3qW.jpg','/7IpUXbKHWA1Xt4jCwnP3A2YFPC3.jpg');
INSERT INTO movies VALUES('16799','Three Colours: Blue',1993,'["France","Poland","Switzerland"]','["Drama"]',100,'The wife of a famous composer survives a car accident that kills her husband and daughter. Now alone, she shakes off her old identity and explores her newfound freedom but finds that she is unbreakably bound to other humans, including her husband’s mistress, whose existence she never suspected.','col',276,108,'tt0108394','/33wsWxzsNstI8N7dvuwzFmj1qBd.jpg','/s9rWmLANsVlSV4XmuC0IUcseGzO.jpg');
