INSERT INTO movies VALUES('18551','Story of the Last Chrysanthemums, The',1939,'["Japan"]','["Romance","Drama"]',148,'In late 19th century Tokyo, Kikunosuke Onoue, the adopted son of a legendary actor, himself an actor specializing in female roles, discovers that he is only praised for his acting due to his status as his father''s heir. Devastated by this, he turns to Otoku, a servant of his family, for comfort, and they fall in love. Kikunosuke becomes determined to leave home and develop as an actor on his own merits, and Otoku faithfully follows him.','bw',278,46069,'tt0032156','/m43EBVmYBiNC2RtcMUAag4IWsZS.jpg','/jl8Te0ZZXxO6iBuQmZgZSZqqCnd.jpg');
INSERT INTO movies VALUES('7295','Sweet Smell of Success',1957,'["USA"]','["Drama"]',96,'New York City newspaper writer J.J. Hunsecker holds considerable sway over public opinion with his Broadway column, but one thing that he can''t control is his younger sister, Susan, who is in a relationship with aspiring jazz guitarist Steve Dallas. Hunsecker strongly disapproves of the romance and recruits publicist Sidney Falco to find a way to split the couple, no matter how ruthless the method.','bw',279,976,'tt0051036','/akzvV8JasNrgEl5iAP9K6zPHGJe.jpg','/6L1Co3uRWuoaqDxpWvGDvgXms7T.jpg');
