INSERT INTO movies VALUES('17331','Groundhog Day',1993,'["USA"]','["Romance","Fantasy","Comedy"]',103,'A narcissistic TV weatherman, along with his attractive-but-distant producer, and his mawkish cameraman, is sent to report on Groundhog Day in the small town of Punxsutawney, where he finds himself repeating the same day over and over.','col',281,137,'tt0107048','/gCgt1WARPZaXnq523ySQEUKinCs.jpg','/ttBydD0SynC0TMkW3AcnmsySkLp.jpg');
INSERT INTO movies VALUES('2931','Day of Wrath',1943,'["Denmark"]','["Drama"]',110,'In a Danish village in the early 1600s, a young woman named Anne, whose mother was thought to be a witch, develops sympathy toward an old woman, Marte, who is accused of witchcraft. The intervention of Anne''s older but kindly husband, Pastor Absalon saved her mother -- but now, urged on by his overbearing mother, he refuses to help Marte. When Absalon''s son returns home and is attracted to Anne, it''s a matter of time before her family destiny catches up with her.','bw',282,41391,'tt0036506','/jEOqbGLFo8fxHHgYoZVTMVYMoQG.jpg','/8OYSiDLuSiNA8XcCC9F7MZ80lpw.jpg');
INSERT INTO movies VALUES('1158','Pandora''s Box',1929,'["Germany"]','["Drama","Crime","Romance"]',133,'Lulu is a young woman so beautiful and alluring that few can resist her siren charms. The men drawn into her web include respectable newspaper publisher Dr. Ludwig Schön, his musical producer son Alwa, circus performer Rodrigo Quast, and seedy old Schigolch. When Lulu''s charms inevitably lead to tragedy, the downward spiral encompasses them all.','bw',283,905,'tt0018737','/xw5KFcTBYyvu4IzQY5ErgBQ73Eq.jpg','/Aq4jIoMMqQSebtB3HnP5iRQ23ai.jpg');
INSERT INTO movies VALUES('21978','Goodbye, Dragon Inn',2003,'["Taiwan"]','["Drama","Comedy"]',82,'On a dark and rainy night, a historic and regal Taipei cinema sees its final film: 1967 martial arts feature "Dragon Inn". As the film plays, the lives of the theater''s various employees and patrons intersect, and two ghostly actors arrive to mourn the passing of an era.','col',284,56616,'tt0377556','/js1uTY2FuKspVRQWLudFkEteFI5.jpg','/f3gZKziPXMGmbNxoU2mnRrylPv7.jpg');
INSERT INTO movies VALUES('20473','Ascent, The',1976,'["USSR"]','["War","Drama"]',111,'Two Soviet partisans leave their starving band to get supplies from a nearby farm. The Germans have reached the farm first, so the pair must go on a journey deep into occupied territory, a voyage that will also take them deep into their souls.','bw',285,50183,'tt0075404','/nbGyTnH1TREKgZXLxEJNnDVohYC.jpg','/A2IJUMyMJZCowjWq32GWqLcEmg9.jpg');
INSERT INTO movies VALUES('7309','Throne of Blood',1957,'["Japan"]','["Drama","War"]',110,'Returning to their lord''s castle, samurai warriors Washizu and Miki are waylaid by a spirit who predicts their futures. When the first part of the spirit''s prophecy comes true, Washizu''s scheming wife, Asaji, presses him to speed up the rest of the spirit''s prophecy by murdering his lord and usurping his place. Director Akira Kurosawa''s resetting of William Shakespeare''s "Macbeth" in feudal Japan is one of his most acclaimed films.','bw',286,3777,'tt0050613','/zaZFMNxJST0TtPd68yF7fNt1he8.jpg','/aliPMgGiHu8hnnNS5thAjExr3j1.jpg');
INSERT INTO movies VALUES('6282','All That Heaven Allows',1955,'["USA"]','["Romance","Drama"]',89,'Two different social classes collide when Cary Scott, a wealthy upper-class widow, falls in love with her much younger and down-to-earth gardener, prompting disapproval and criticism from her children and country club friends.','col',287,43316,'tt0047811','/kgTJagk03a6zvJxwOUDf6L9qkct.jpg','/zi7AjheNhXdlmORg3kqrFXYrBuA.jpg');
