INSERT INTO movies VALUES('17981','Three Colours: Red',1994,'["France","Switzerland","Poland"]','["Drama"]',99,'Valentine, a student model in Geneva, struggles with a possessive boyfriend and a troubled family. When she runs over a dog, she discovers that its owner, a retired judge, is illegally wiretapping and eavesdropping on his neighbors'' phone calls. Although Valentine is outraged, she develops a strange bond with the judge – and as the two become closer, she finds herself caught in the middle of events that could change her life.','col',289,110,'tt0111495','/JHmsBiX1tjCKqAul1lzC20WcAW.jpg','/A9IY3j3Hwf4Q8Q9w5QxSQPYSvCu.jpg');
INSERT INTO movies VALUES('18540','India Song',1975,'["France"]','["Drama","Fantasy","Romance"]',120,'In 1937 Calcutta, the wife of the French ambassador takes on many lovers.','col',290,85927,'tt0073166','/jUogZJ4zNrLTNr8sei75touASi8.jpg','/oPGZyKNjgRDOsZAtqu7ikdJfAQW.jpg');
INSERT INTO movies VALUES('7223','Paths of Glory',1957,'["USA"]','["War","Drama"]',86,'A commanding officer defends three scapegoats on trial for a failed offensive that occurred within the French Army in 1916.','bw',291,975,'tt0050825','/p7OHwomA8UOhe3EhckF2IetBTh9.jpg','/354kfjVb96mtFALMhBE6jzHGiA2.jpg');
INSERT INTO movies VALUES('14752','Back to the Future',1985,'["USA"]','["Science Fiction","Comedy"]',116,'Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents'' first meeting and attracting his mother''s romantic interest. Marty must repair the damage to history by rekindling his parents'' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.','col',292,105,'tt0088763','/fNOH9f1aA7XRTzl1sAOx9iF553Q.jpg','/5bzPWQ2dFUl2aZKkp7ILJVVkRed.jpg');
INSERT INTO movies VALUES('19653','All About My Mother',1999,'["Spain","France"]','["Drama","Comedy"]',101,'Following the tragic death of her teenage son, Manuela travels from Madrid to Barcelona in an attempt to contact the long-estranged father the boy never knew. She reunites with an old friend, an outspoken transgender sex worker, and befriends a troubled actress and a pregnant, HIV-positive nun.','col',293,99,'tt0185125','/hjQhzhkGYXPNM96k0mOgob6HMmn.jpg','/tilClWjFZeUTGJu0pxgF72fvUmN.jpg');
INSERT INTO movies VALUES('3603','Big Sleep, The',1946,'["USA"]','["Mystery","Crime"]',114,'Private Investigator Philip Marlowe is hired by wealthy General Sternwood regarding a matter involving his youngest daughter Carmen. Before the complex case is over, Marlowe sees murder, blackmail, deception, and what might be love.','bw',294,910,'tt0038355','/lraHo9D8c0YWfxsKqT5P5sVqMKN.jpg','/yxMgxS0NlmkG5RhatQE8MUjxT2C.jpg');
INSERT INTO movies VALUES('18557','Army of Shadows',1969,'["France","Italy"]','["War","Drama"]',140,'Betrayed by an informant, Philippe Gerbier finds himself trapped in a torturous Nazi prison camp. Though Gerbier escapes to rejoin the Resistance in occupied Marseilles, France, and exacts his revenge on the informant, he must continue a quiet, seemingly endless battle against the Nazis in an atmosphere of tension, paranoia and distrust.','col',295,15383,'tt0064040','/aqNZWM9bspt8zaDvVRIRiWxRVJ7.jpg','/4gtktI4SGUpiHQlUvXO6zWm5G5P.jpg');
INSERT INTO movies VALUES('18960','Happy Together',1997,'["Hong Kong"]','["Romance","Drama"]',97,'A gay couple from Hong Kong takes a trip to Argentina in search of a new beginning but instead begins drifting even further apart.','col',296,18329,'tt0118845','/kO4KjUkQOfWSBw06Bdl7m6AlEP7.jpg','/7DlBcw1zBhr1cHGJzB9i0n1V3i6.jpg');
INSERT INTO movies VALUES('15816','Distant Voices, Still Lives',1988,'["UK"]','["Drama"]',85,'Siblings Maisie and Tony, along with their mother, gather for their sister Eileen''s wedding. It is a joyous occasion, but through flashbacks, it becomes clear that the family was not always happy. Their father was physically abusive to his wife and left the children emotionally traumatized. As a result, the children have grown into unhappy adults, looking for love they didn''t receive when they were young.','col',297,41799,'tt0095037','/nFUyQm41PlZuIvi3LYNVVoVio8K.jpg','/aix01AG7io9RENJt2hrdE66dZFk.jpg');
