INSERT INTO movies VALUES('20765','Floating Clouds',1955,'["Japan"]','["Romance","Drama"]',123,'A married Japanese forester during WWII is sent to Indochina to manage forests. He meets a young Japanese typist and promises to leave his wife. He doesn''t and after the war, she turns up and the affair resumes.','bw',299,77285,'tt0048757','/qOxyc8KvdLZutKYEgqPkScQL4cv.jpg','/mP1nyyj9TJWPuu8gdWWwGjnDfgC.jpg');
INSERT INTO movies VALUES('15293','Sacrifice, The',1986,'["France","Sweden"]','["Drama"]',145,'Alexander, a journalist, philosopher and retired actor, celebrates a birthday with friends and family when it is announced that nuclear war has begun.','col',300,24657,'tt0091670','/8JMh27z075ZHbFE85XYkdXF2QkK.jpg','/bkL2f7KgePtzMXWHBm4oGK7NIs7.jpg');
INSERT INTO movies VALUES('5827','Mr. Hulot''s Holiday',1953,'["France"]','["Comedy"]',86,'Monsieur Hulot, Jacques Tati’s endearing clown, takes a holiday at a seaside resort, where his presence provokes one catastrophe after another. Tati’s masterpiece of gentle slapstick is a series of effortlessly well-choreographed sight gags involving dogs, boats, and firecrackers; it was the first entry in the Hulot series and the film that launched its maker to international stardom.','bw',301,778,'tt0046487','/r4F4tsU0Ajeh9ZYUkWOJSYmioj7.jpg','/qi7PmFSlCXVAwqlvdiN2ZrlxJGj.jpg');
INSERT INTO movies VALUES('18346','Unforgiven',1992,'["USA"]','["Western"]',127,'William Munny is a retired, once-ruthless killer turned gentle widower and hog farmer. To help support his two motherless children, he accepts one last bounty-hunter mission to find the men who brutalized a prostitute. Joined by his former partner and a cocky greenhorn, he takes on a corrupt sheriff.','col',302,33,'tt0105695','/54roTwbX9fltg85zjsmrooXAs12.jpg','/5zkrI7P70j8C03ThBOvrEG6VF8M.jpg');
INSERT INTO movies VALUES('7589','Music Room, The',1958,'["India"]','["Drama"]',95,'A wealthy landlord lives a decadent life with his wife and son. His passion – his wife would calls it his addiction – is music, and he spends a great deal of his fortune on concerts held for the locals in his magnificent music room. He feels threatened by his neighbour, a commoner who has attained riches through business dealings. His passion for music and quest for social respect are his undoing, as he sacrifices his family and wealth trying to retain it.','bw',303,822,'tt0051792','/ggpHGix3OPgIpvIaoojAQ125XJO.jpg','/gLe36kc0Qbe0JIkVKEGvy7hvAwO.jpg');
INSERT INTO movies VALUES('19791','Terra em Transe',1967,'["Brazil"]','["Drama","Political"]',106,'Eldorado, a fictitious country in America, is sparkling with the internal struggle for political power. In the eye of this social convulsion, the jaded journalist Paulo Martins opposes two equally corrupt political candidates: a pseudopopulist and a conservative. In this context, Paulo is torn between the madness of the elite and the blind submission of the masses. But, in this complex tropical reality, nothing really is what it seems to be.','bw',304,67062,'tt0062352','/kuBU2eGzZyCBYxChYBUGbyTQ052.jpg','/xCSzJsUmgd61nXjxoslbWOgOlbY.jpg');
INSERT INTO movies VALUES('1073','Nanook of the North',1922,'["USA"]','["Documentary"]',79,'This pioneering documentary film depicts the lives of the indigenous Inuit people of Canada''s northern Quebec region. Although the production contains some fictional elements, it vividly shows how its resourceful subjects survive in such a harsh climate, revealing how they construct their igloo homes and find food by hunting and fishing. The film also captures the beautiful, if unforgiving, frozen landscape of the Great White North, far removed from conventional civilization.','bw',305,669,'tt0013427','/9WAboi1QbKu41WkyGxQVNpXwwxx.jpg','/f8wJyERoBQgmptrue3xhMkC1Mjq.jpg');
INSERT INTO movies VALUES('18520','Charulata',1964,'["India"]','["Romance","Drama"]',117,'In 1870s India, Charulata is an isolated, artistically inclined woman who sees little of her busy journalist husband, Bhupati. Realizing that his wife is alienated and unhappy, he convinces his cousin, Amal, to spend time with Charulata and nourish her creative impulses. Amal is a fledgling poet himself, and he and Charulata bond over their shared love of art. But over time a sexual attraction develops, with heartbreaking results.  Preserved by the Academy Film Archive in partnership with The Film Foundation and Merchant and Ivory Foundation in 1996.','bw',306,35790,'tt0057935','/4kznHLoJGN3OBZunQvZwy26it8z.jpg','/brR9IQgWt01b4Am3CyOckUU0m3u.jpg');
