INSERT INTO movies VALUES('10251','Faces',1968,'["USA"]','["Drama"]',130,'Middle-aged suburban husband Richard abruptly tells his wife, Maria, that he wants a divorce. As Richard takes up with a younger woman, Maria enjoys a night on the town with her friends and meets a younger man. As the couple and those around them confront a seemingly futile search for what they''ve lost -- love, excitement, passion -- this classic American independent film explores themes of aging and alienation.','bw',308,753,'tt0062952','/qTkhxFQ0o6DEtTtPXkv4IA5M90J.jpg','/wVpZAFqzcXKlHw3Dx85EpnG9vvW.jpg');
INSERT INTO movies VALUES('3988','Monsieur Verdoux',1947,'["USA"]','["Crime","Comedy"]',123,'The film is about an unemployed banker, Henri Verdoux, and his sociopathic methods of attaining income. While being both loyal and competent in his work, Verdoux has been laid-off. To make money for his wife and child, he marries wealthy widows and then murders them. His crime spree eventually works against him when two particular widows break his normal routine.','bw',309,30588,'tt0039631','/mUPXIinTQsBdLlDaWiSl7GwQXVs.jpg','/pXAudXOkmQSiI6sFQyEfkibQxZp.jpg');
