INSERT INTO movies VALUES('31036','Separation, A',2011,'["Iran","France","Australia"]','["Drama"]',123,'A married couple are faced with a difficult decision - to improve the life of their child by moving to another country or to stay in Iran and look after a deteriorating parent who has Alzheimer''s disease.','col',311,60243,'tt1832382','/wQVvASmpm8jGhJBQU20OkoMcNzi.jpg','/kcXBa2ru0PXcGI8U3JiInsG6FRR.jpg');
INSERT INTO movies VALUES('14402','Videodrome',1983,'["Canada"]','["Horror","Science Fiction"]',90,'As the president of a trashy TV channel, Max Renn is desperate for new programming to attract viewers. When he happens upon "Videodrome," a TV show dedicated to gratuitous torture and punishment, Max sees a potential hit and broadcasts the show on his channel. However, after his girlfriend auditions for the show and never returns, Max investigates the truth behind Videodrome and discovers that the graphic violence may not be as fake as he thought.','col',312,837,'tt0086541','/qqqkiZSU9EBGZ1KiDmfn07S7qvv.jpg','/kIQszOniJOd1ULFUfdk4yDR0W5c.jpg');
