INSERT INTO movies VALUES('3597','Belle et la bête, La',1946,'["France"]','["Fantasy"]',95,'The story of a gentle-hearted beast in love with a simple and beautiful girl. She is drawn to the repellent but strangely fascinating Beast, who tests her fidelity by giving her a key, telling her that if she doesn''t return it to him by a specific time, he will die of grief. She is unable to return the key on time, but it is revealed that the Beast is the genuinely handsome one. A simple tale of tragic love that turns into a surreal vision of death, desire, and beauty.','bw',322,648,'tt0038348','/iYSe3yrkma0e1B0wWPXgr8w5sDN.jpg','/2Ae0iV2HR3Raoras8G40MjBtJnn.jpg');
