INSERT INTO movies VALUES('10451','Young Girls of Rochefort, The',1967,'["France"]','["Musical","Dance","Comedy"]',124,'Delphine and Solange are two sisters living in Rochefort. Delphine is a dancing teacher and Solange composes and teaches the piano. Maxence is a poetand a painter. He is doing his military service. Simon owns a music shop, he left Paris one month ago to come back where he fell in love 10 years ago. They are looking for love, looking for each other, without being aware that their ideal partner is very close...','col',326,2433,'tt0062873','/jtxhyGaYhurH6KsjvP1jV3dDypz.jpg','/9x3yIrAJOkYSs0SBKcGCQlwPSNm.jpg');
