INSERT INTO movies VALUES('13397','Empire Strikes Back, The',1980,'["USA"]','["Science Fiction","Fantasy","Adventure"]',124,'The epic saga continues as Luke Skywalker, in hopes of defeating the evil Galactic Empire, learns the ways of the Jedi from aging master Yoda. But Darth Vader is more determined than ever to capture Luke. Meanwhile, rebel leader Princess Leia, cocky Han Solo, Chewbacca, and droids C-3PO and R2-D2 are thrown into various stages of capture, betrayal and despair.','col',333,1891,'tt0080684','/nNAeTmF4CtdSgMDplXTDPOpYzsX.jpg','/aJCtkxLLzkk1pECehVjKHA2lBgw.jpg');
