INSERT INTO movies VALUES('14431','Amadeus',1984,'["USA"]','["Musical","Biography","Drama"]',158,'Wolfgang Amadeus Mozart is a remarkably talented young Viennese composer who unwittingly finds a fierce rival in the disciplined and determined Antonio Salieri. Resenting Mozart for both his hedonistic lifestyle and his undeniable talent, the highly religious Salieri is gradually consumed by his jealousy and becomes obsessed with Mozart''s downfall, leading to a devious scheme that has dire consequences for both men.','col',337,279,'tt0086879','/1n5VUlCqgmVax1adxGZm8oCFaKc.jpg','/4i3Amppd6eW5Qkhjv4gdHk3CCoE.jpg');
