INSERT INTO movies VALUES('23309','Tie Xi Qu: West of the Tracks',2003,'["China"]','["Documentary"]',551,'A detailed look at the gradual decline of Shenyang’s industrial Tiexi district, an area that was once a vibrant example of China’s socialist economy. But industry is changing, and the factories of Tiexi are closing. Director Wang Bing introduces us to some of the workers affected by the closures, and to their families.','col',339,86282,'tt0389448','/hRH0ToR9tgCtNpyzOpqzYv1G47W.jpg','/5tfv0pRaGv7UV81gPsnoIbCQTyP.jpg');
