INSERT INTO movies VALUES('5583','Wages of Fear, The',1953,'["France","Italy"]','["Thriller","Adventure","Action"]',105,'In a run-down South American town, four men are paid to drive trucks loaded with nitroglycerin into the jungle through to the oil field. Friendships are tested and rivalries develop as they embark upon the perilous journey.','bw',341,204,'tt0046268','/d1VEnsFO7YcEc5gRqKXu2Bq2MMJ.jpg','/sdNPipjZoOJFuTBwH8EyEb5dsKv.jpg');
INSERT INTO movies VALUES('6421','Kiss Me Deadly',1955,'["USA"]','["Crime","Thriller","Drama"]',106,'One evening, Hammer gives a ride to Christina, an attractive hitchhiker on a lonely country road, who has escaped from the nearby lunatic asylum. Thugs waylay them and force his car to crash. When Hammer returns to semi-consciousness, he hears Christina being tortured until she dies. Hammer, both for vengeance and in hopes that "something big" is behind it all, decides to pursue the case.','bw',342,18030,'tt0048261','/z7me91nrpWLHY1mZOB2v20cK0zY.jpg','/oWWNJNRMY5Ni1QlPfc370AIAYN3.jpg');
INSERT INTO movies VALUES('10618','Midnight Cowboy',1969,'["USA"]','["Drama"]',113,'Joe Buck is a wide-eyed hustler from Texas hoping to score big with wealthy New York City women; he finds a companion in Enrico "Ratso" Rizzo, an ailing swindler with a bum leg and a quixotic fantasy of escaping to Florida.','col',343,3116,'tt0064665','/f7YLzOxwWzeEdo7RhAlPSBTYa8.jpg','/yTIvOi9x7C9vTbzfG4GqMoh9MaZ.jpg');
