INSERT INTO movies VALUES('12181','Dog Day Afternoon',1975,'["USA"]','["Drama","Crime"]',125,'Based on the true story of would-be Brooklyn bank robbers John Wojtowicz and Salvatore Naturile. Sonny and Sal attempt a bank heist which quickly turns sour and escalates into a hostage situation and stand-off with the police. As Sonny''s motives for the robbery are slowly revealed and things become more complicated, the heist turns into a media circus.','col',353,968,'tt0072890','/mavrhr0ig2aCRR8d48yaxtD5aMQ.jpg','/m10uqk0HI5JcITAbxNJIIiGA8HP.jpg');
