INSERT INTO movies VALUES('932','Make Way for Tomorrow',1937,'["USA"]','["Drama"]',92,'At a family reunion, the Cooper clan find that their parents'' home is being foreclosed. "Temporarily," Ma moves in with son George''s family, Pa with daughter Cora. But the parents are like sand in the gears of their middle-aged children''s well regulated households. Can the old folks take matters into their own hands?','bw',363,41059,'tt0029192','/zPl6TfnIIJzdPXk9g6QPwFwTIt.jpg','/uTuki1I358DNICtDqeiQT9xml2c.jpg');
