INSERT INTO movies VALUES('18104','Silence of the Lambs, The',1991,'["USA"]','["Crime","Drama","Thriller"]',118,'Clarice Starling is a top student at the FBI''s training academy.  Jack Crawford wants Clarice to interview Dr. Hannibal Lecter, a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism.  Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.','col',375,274,'tt0102926','/uS9m8OBk1A8eM9I042bx8XXpqAq.jpg','/aYcnDyLMnpKce1FOYUpZrXtgUye.jpg');
