INSERT INTO movies VALUES('12466','Killing of a Chinese Bookie, The',1976,'["USA"]','["Drama","Crime"]',109,'Cosmo Vittelli, the proprietor of a sleazy, low-rent Hollywood cabaret, has a real affection for the women who strip in his peepshows and the staff who keep up his dingy establishment. He also has a major gambling problem that has gotten him in trouble before. When Cosmo loses big-time at an underground casino run by mobster Mort, he isn''t able to pay up. Mort then offers Cosmo the chance to pay back his debt by knocking off a pesky, Mafia-protected bookie.','col',380,32040,'tt0074749','/clQgmbmBOxvA2NepvijoL7YUCvr.jpg','/71oqZMM6dgKvi1WQztOoUHSzDdZ.jpg');
