INSERT INTO movies VALUES('10286','Hour of the Furnaces, The',1968,'["Argentina"]','["Political","Documentary","History"]',260,'An impassioned three-part documentary of the liberation struggle waged throughout Latin America, using Argentina as a historical example of the imperialist exploitation of the continent. Part I: Neo-Colonialism and Violence is a historical, geographic, and economic analysis of Argentina. Part II: An Act For Liberation examines the ten-year reign of Juan Perón (1945-55) and the activities of the Peronist movement after his fall from power. Part III: Violence and Liberation studies the role of violence in the national liberation process and constitutes a call for action.','bw',387,89681,'tt0063084','/oLLEiLXk2yRV4dIXUlgCVZKsN0t.jpg','/dsfRpw40D5XBDaVEZlojGkxyd6S.jpg');
