INSERT INTO movies VALUES('22462','Limite',1931,'["Brazil"]','["Drama"]',114,'Adrift in the vast expanse of the ocean, a solitary boat carries three castaways—a man and two women. Stranded and devoid of any glimmer of rescue, they find solace in recounting the tales of their lives to one another. As they delve into their personal narratives, reminiscing about the circumstances that led them to this desolate predicament, they navigate through the depths of three distinct destinies. Bound by the confines of their shared space, every aspect of their existence becomes a boundary, underscoring their plight.','bw',392,8353,'tt0022080','/niPtTQV4zuzWZl4xvKNGJYpHLDu.jpg','/vyJSwV80dzj2WI1i6zZ68MDIo57.jpg');
