INSERT INTO movies VALUES('12729','Opening Night',1977,'["USA"]','["Drama"]',144,'Actress Myrtle Gordon is a functioning alcoholic who is a few days from the opening night of her latest play, concerning a woman distraught about aging. One night a car kills one of Myrtle''s fans who is chasing her limousine in an attempt to get the star''s attention. Myrtle internalizes the accident and goes on a spiritual quest, but fails to finds the answers she is after. As opening night inches closer and closer, fragile Myrtle must find a way to make the show go on.','col',400,33665,'tt0079672','/7NYSr8Z6xiW4zZqOBf3BTee1TRM.jpg','/hUmJiftJixa6IlUjkBkfSiHNSL6.jpg');
