INSERT INTO movies VALUES('12785','Suspiria',1977,'["Italy"]','["Horror"]',92,'An American newcomer to a prestigious German ballet academy comes to realize that the school is a front for something sinister amid a series of grisly murders.','col',402,11906,'tt0076786','/5ya8jTbNZTrCFUx9OwpNBjCivXY.jpg','/j7rl2LphIbC88FppTfwJ5Gxj9kX.jpg');
INSERT INTO movies VALUES('21438','Dogville',2003,'["Denmark","Sweden","France","UK","Germany","Finland","Italy","Netherlands","Norway"]','["Drama"]',177,'A mysterious woman named Grace hides in a small mountain town from criminals who pursue her. The town is two-faced and offers to harbor Grace as long as she can make it worth their effort, so Grace works hard under the employ of various townspeople to win their favor. Tensions flare, however, and Grace''s status as a helpless outsider provokes vicious contempt and abuse from the citizens of Dogville.','col',403,553,'tt0276919','/lraVawavIXh5geMlVjpzCw9TGwR.jpg','/r3xsFBD1VTUusk393bBc7SsDUJe.jpg');
INSERT INTO movies VALUES('18628','Flowers of St. Francis, The',1950,'["Italy"]','["Religious","Drama"]',83,'In a series of simple and joyous vignettes, director Roberto Rossellini and co-writer Federico Fellini lovingly convey the universal teachings of the People’s Saint: humility, compassion, faith, and sacrifice. Gorgeously photographed to evoke the medieval paintings of Saint Francis’s time, and cast with monks from the Nocera Inferiore Monastery, The Flowers of St. Francis is a timeless and moving portrait of the search for spiritual enlightenment.','bw',404,56518,'tt0042477','/4db6zjmJK4D5gEzQ0V5JTkRo0X5.jpg','/fWTGjRzX78oZNGYauR2RfOXbUX3.jpg');
INSERT INTO movies VALUES('133','Birth of a Nation, The',1915,'["USA"]','["War","History","Drama"]',187,'Two families, abolitionist Northerners the Stonemans and Southern landowners the Camerons, intertwine. When Confederate colonel Ben Cameron is captured in battle, nurse Elsie Stoneman petitions for his pardon. In Reconstruction-era South Carolina, Cameron founds the Ku Klux Klan, battling Elsie''s congressman father and his African-American protégé, Silas Lynch.','bw',405,618,'tt0004972','/pNpOXpQI5GSUfiWypubYtMh9928.jpg','/4H4RAeeykpi0ijvu3wYgV346y06.jpg');
