INSERT INTO movies VALUES('7862','Eyes Without a Face',1960,'["France","Italy"]','["Horror","Drama","Thriller"]',88,'Dr. Génessier is riddled with guilt after an accident that he caused disfigures the face of his daughter, the once beautiful Christiane, who outsiders believe is dead. Dr. Génessier, along with accomplice and laboratory assistant Louise, kidnaps young women and brings them to the Génessier mansion. After rendering his victims unconscious, Dr. Génessier removes their faces and attempts to graft them on to Christiane''s.','bw',409,31417,'tt0053459','/8y7Z9Gvcq52uOlJlUWyn2epGGRd.jpg','/m9c23iVQk7oh6CwhiOjDYwLzniu.jpg');
INSERT INTO movies VALUES('1423','Snow White and the Seven Dwarfs',1937,'["USA"]','["Animated","Family","Fantasy"]',83,'A beautiful girl, Snow White, takes refuge in the forest in the house of seven dwarfs to hide from her stepmother, the wicked Queen. The Queen is jealous because she wants to be known as "the fairest in the land," and Snow White''s beauty surpasses her own.','col',410,408,'tt0029583','/yJSMnMBtcHSub75p1dmdyqnQloa.jpg','/wmSxNVGZOV1A51Yx6ChDXk3NVVi.jpg');
