INSERT INTO movies VALUES('5141','Miracle in Milan',1951,'["Italy"]','["Fantasy","Drama","Comedy"]',95,'Once upon a time an old woman discovers a baby in her cabbage patch. She brings up the child and, when she dies, the boy, Toto, enters an orphanage. Toto leaves the orphanage a happy young man, and looks for work in post-war Milan. He ends up with the homeless and organizes them to build a shanty town in a vacant lot. The squatters discover oil in the land and Toto sees a vision of the old woman who gives him a magic dove that will grant him anything he wishes.','bw',416,43379,'tt0043809','/9l47FSwRvu0IETKjDVpZ2INbqvI.jpg','/5gb8ARaLFTY9ckPxnQw6cFi6ggL.jpg');
INSERT INTO movies VALUES('2210','Fantasia',1940,'["USA"]','["Fantasy","Family","Animated"]',120,'Walt Disney''s timeless masterpiece is an extravaganza of sight and sound! See the music come to life, hear the pictures burst into song and experience the excitement that is Fantasia over and over again.','col',417,756,'tt0032455','/5m9njnidjR0syG2gpVPVgcEMB2X.jpg','/lyzI5uFJC2E7sIYCCdaU0oZkDw2.jpg');
INSERT INTO movies VALUES('21404','Lost in Translation',2003,'["USA","Japan"]','["Romance","Drama","Comedy"]',102,'Two lost souls visiting Tokyo -- the young, neglected wife of a photographer and a washed-up movie star shooting a TV commercial -- find an odd solace and pensive freedom to be real in each other''s company, away from their lives in America.','col',418,153,'tt0335266','/wkSzJs7oMf8MIr9CQVICsvRfwA7.jpg','/45He7gApNQyDbqCDjxew9BnHzjf.jpg');
INSERT INTO movies VALUES('18525','Chelsea Girls',1966,'["USA"]','["Drama","Avant","Garde"]',210,'Lacking a formal narrative, Warhol''s mammoth film follows various residents of the Chelsea Hotel in 1966 New York City. The film was intended to be screened via dual projector set-up.','col-bw',419,1686,'tt0061465','/dsFEyAmWFBJFIgnCxCuJad5cSgw.jpg','/9i1N6gpYeSUFaYCNQUtmisPMo3v.jpg');
INSERT INTO movies VALUES('9851','Salvatore Giuliano',1962,'["Italy"]','["Drama","Crime","History"]',125,'Sicilian bandit Salvatore Giuliano''s bullet-riddled corpse is found facedown in a courtyard in Castelvetrano, a handgun and rifle by his side. Local and international press descend upon the scene, hoping to crack open the true story behind the death of this young man, who, at the age of twenty-seven, had already become Italy’s most wanted criminal and celebrated hero.','bw',420,27523,'tt0055399','/uaFTCD0y2MEccTFyHOHj6IrwyZ.jpg','/d3pyIqXlKSJy8LfJ983PUhrYbC2.jpg');
INSERT INTO movies VALUES('5107','Plaisir, Le',1952,'["France"]','["Romance","Drama"]',97,'Three stories about the pleasure. The first one is about a man hiding his age behind a mask to keep going to balls and fancying women - pleasure and youth. Then comes the long tale of Mme Tellier taking her girls (whores) to the country for attending her niece''s communion - pleasure and purity. And lastly, Jean the painter falling in love with his model - pleasure and death.','bw',421,43360,'tt0045034','/qxJAam675KDRIrT5KMYMOMVHBqQ.jpg','/ceVcrZeak4gfbtGUnAUpWIzeiFR.jpg');
INSERT INTO movies VALUES('177','Bride of Frankenstein',1935,'["USA"]','["Horror","Science Fiction"]',75,'Dr. Pretorius, a deranged scientist, forces Henry Frankenstein to help him create a companion for the monster.','bw',422,229,'tt0026138','/5241zUwe7rC17MNc2QpCBKKdp1N.jpg','/haPU3dCyYUTRN34ceyJrX4DAjZq.jpg');
INSERT INTO movies VALUES('33476','Holy Motors',2012,'["France","Germany"]','["Drama","Fantasy"]',115,'We follow 24 hours in the life of a being moving from life to life like a cold and solitary assassin moving from hit to hit. In each of these interwoven lives, the being possesses an entirely distinct identity: sometimes a man, sometimes a woman, sometimes youthful, sometimes old. By turns murderer, beggar, company chairman, monstrous creature, worker, family man.','col',423,103328,'tt2076220','/4Rs81LASk8MambcydxQvQGRojFO.jpg','/595brdDzszMJmqe8e76jMGXg3Qw.jpg');
INSERT INTO movies VALUES('5050','Europa ''51',1952,'["Italy"]','["Drama"]',113,'A wealthy, self-absorbed Rome socialite is racked by guilt over the death of her young son. As a way of dealing with her grief and finding meaning in her life, she decides to devote her time and money to the city’s poor and sick. Her newfound, single-minded activism leads to conflicts with her husband and questions about her sanity.','bw',424,41464,'tt0043511','/hw9MEW5kslyRwpJp8AgpIlBxtmr.jpg','/yo48a0FPvHwMDLKsnhQAIbkWVpH.jpg');
INSERT INTO movies VALUES('9264','Bonheur, Le',1965,'["France"]','["Drama"]',79,'A young husband and father, perfectly content with his life, falls in love with another woman.','col',425,53023,'tt0058985','/r6UYog9MruOe4X71AS57EhuJrFq.jpg','/wPliKFiYaUEYCWWIIFW9mxjiz0G.jpg');
INSERT INTO movies VALUES('6222','Star is Born, A',1954,'["USA"]','["Musical","Drama"]',154,'A movie star helps a young singer-actress find fame, even as age and alcoholism send his own career into a downward spiral.','col',426,3111,'tt0047522','/zpg2SzpYhZk1D1seDfIIlwaqAxT.jpg','/AlvKqnxlkWWYE6ngRLOWfYY3QuI.jpg');
