INSERT INTO movies VALUES('12353','All the President''s Men',1976,'["USA"]','["Political","Drama","History"]',138,'During the 1972 elections, two reporters'' investigation sheds light on the controversial Watergate scandal that compels President Nixon to resign from his post.','col',429,891,'tt0074119','/cPtSHR7D2WGsDBfnC5DxV927hKn.jpg','/qvLjTAwwQTcAiYXxnGaXctlqUJ6.jpg');
INSERT INTO movies VALUES('18548','Shadows of Our Forgotten Ancestors',1964,'["USSR"]','["Romance","Drama","History"]',97,'In a Carpathian village, Ivan falls in love with Marichka, the daughter of his father''s killer. When tragedy befalls her, his grief lasts months; finally he rejoins the colorful life around him, marrying Palagna. She wants children but his mind stays on his lost love. To recapture his attention, Palagna tries sorcery, and in the process comes under the spell of the sorcerer, publicly humiliating Ivan, who then fights the sorcerer. The lively rhythms of village life, the work and the holidays, the pageant and revelry of weddings and funerals, the change of seasons, and nature''s beauty give proportion to Ivan''s tragedy.','col',430,26782,'tt0058642','/9oSZTeejmx80tIBVSqYzJpFhjkI.jpg','/nxU3neMRMLrLYq50No3OM1yYix6.jpg');
INSERT INTO movies VALUES('1338','Scarlet Empress, The',1934,'["USA"]','["History","Drama","Biography"]',110,'During the 18th century, German noblewoman Sophia Frederica, who would later become Catherine the Great, travels to Moscow to marry the dimwitted Grand Duke Peter, the heir to the Russian throne. Their arranged marriage proves to be loveless, and Catherine takes many lovers, including the handsome Count Alexei, and bears a son. When the unstable Peter eventually ascends to the throne, Catherine plots to oust him from power.','bw',432,31527,'tt0025746','/lCoyv38br7T4hFPJF0OnfAGuzbp.jpg','/v1lSv9nNeuAC1rmc5pEdR8keUOJ.jpg');
INSERT INTO movies VALUES('16405','Angel at My Table, An',1990,'["New Zealand","Australia","UK","USA"]','["Drama","Biography"]',158,'Based on the autobiographical work of New Zealand writer Janet Frame, this production depicts the author at various stage of her life. Afflicted with mental and emotional issues, Frame grows up in an impoverished family and experiences numerous tragedies while still in her youth, including the deaths of two of her siblings. Portrayed as an adult by Kerry Fox, Frame finds acclaim for her writing while still in a mental institution, and her success helps her move on with her life.','col',433,2891,'tt0099040','/sDICHxQRDkS4TvIDcUgO9URJxu1.jpg','/2V0BWE7WJWP627Yivsnfx4uKUCp.jpg');
INSERT INTO movies VALUES('20515','Flowers of Shanghai',1998,'["Taiwan"]','["Drama"]',130,'At the end of the 19th century, Shanghai is divided into several foreign concessions. In the British concession, a number of luxurious “flower houses” are reserved for the male elite of the city. Since Chinese dignitaries are not allowed to frequent brothels, these establishments are the only ones that these men can visit. They form a self-contained world, with its own rites, traditions and even its own language. The men don’t only visit the houses to frequent the courtesans but also to dine, smoke opium, play mahjong and relax. The women working there are known as the “flowers of Shanghai”.','col',434,45935,'tt0156587','/9N3TdNbr5pyT69M5cHODmfc4zTs.jpg','/bQNVVCZYfV5SebyLhc002mfZwLY.jpg');
INSERT INTO movies VALUES('8874','Winter Light',1963,'["Sweden"]','["Religious","Drama"]',80,'A Swedish pastor fails a loving woman, a suicidal fisherman and God.','bw',435,29455,'tt0057358','/wDxrEssdjFWYwIZLbr06RQNcg1q.jpg','/tis6nrWakUsuG6Jwdm4yESfTU0o.jpg');
INSERT INTO movies VALUES('332','Crime of Monsieur Lange, The',1936,'["France"]','["Drama","Crime","Comedy"]',90,'A man and a woman arrive in a cafe-hotel near the Belgian frontier. The customers recognize the man from the police''s description: his name is Amedee Lange, and he murdered somebody in Paris. Lange was an employee in a printing works. His boss was a real bastard, swindling every one, seducing female workers... One day he fled to avoid facing his creditors, and the workers set up a cooperative to go on working. What then made Lange a killer?','bw',436,52677,'tt0027478','/60hxomQqqzJTxo64QFEvvesOQCl.jpg','/k9UBAuSLZq9ACLzGStRYDKDU2uu.jpg');
INSERT INTO movies VALUES('8758','Ivan''s Childhood',1962,'["USSR"]','["War","Drama"]',94,'In WW2, twelve year old Soviet orphan Ivan Bondarev works for the Soviet army as a scout behind the German lines and strikes a friendship with three sympathetic Soviet officers.','bw',437,31442,'tt0056111','/vmRWSLP1DE9WTta0hfzIafJ0dID.jpg','/h81gVvHitMCp5ZmLyFUjHX4zjd6.jpg');
INSERT INTO movies VALUES('1748','Wind, The',1928,'["USA"]','["Drama"]',88,'When Letty Mason relocates to West Texas, she finds herself unsettled by the ever-present wind and sand. Arriving at her new home at the ranch of her cousin, Beverly, she receives a surprisingly cold welcome from his wife, Cora. Soon tensions in the family and unwanted attention from a trio of suitors leave Letty increasingly disturbed.','bw',438,31416,'tt0019585','/iW16HdJtw9qEDd84nI7cF9VDrK9.jpg','/mieB1ghpEBgTdGiYvewlLPN24jZ.jpg');
INSERT INTO movies VALUES('11749','Long Goodbye, The',1973,'["USA"]','["Drama","Crime"]',112,'In 1970s Hollywood, Detective Philip Marlowe tries to help a friend who is accused of murdering his wife.','col',439,1847,'tt0070334','/oBhUK54yBJ0aH6u9zCzSV5iV7OP.jpg','/fMsvyKj7BrcK5ko4r9x6EuTC21M.jpg');
INSERT INTO movies VALUES('6366','French Cancan',1955,'["France","Italy"]','["Musical","Drama","Comedy"]',102,'Nineteenth-century Paris comes vibrantly alive in Jean Renoir’s exhilarating tale of the opening of the world-renowned Moulin Rouge. Jean Gabin plays the wily impresario Danglard, who makes the cancan all the rage while juggling the love of two beautiful women—an Egyptian belly-dancer and a naive working girl turned cancan star.','col',440,45213,'tt0046998','/slIF5i3Mz03I90sqoxj7Xteutyb.jpg','/e5CicKXDVyRsIvbucdAeuCfrLwl.jpg');
INSERT INTO movies VALUES('8318','Accattone',1961,'["Italy"]','["Drama"]',120,'A pimp with no other means to provide for himself finds his life spiralling out of control when his prostitute is sent to prison.','bw',441,12491,'tt0054599','/113ts2Bmm5CZ3YJMwfCU9XGFCAf.jpg','/rJSCS5EP9JGjNECa5hEB9Bsibjf.jpg');
INSERT INTO movies VALUES('10294','If….',1968,'["UK"]','["Drama","Crime"]',111,'In an English boys'' boarding school, social hierarchy reigns supreme and power remains in the hands of distanced and ineffectual teachers and callously vicious prefects in the Upper Sixth. Three Lower Sixth students, Wallace, Johnny and leader Mick Travis decide on a shocking course of action to redress the balance of privilege once and for all.','col-bw',442,14794,'tt0063850','/3yOtehzchZobaMVth4gutUHmKc6.jpg','/6GZ4KgKv6rZ1zbBxGSOUHkW1HE5.jpg');
INSERT INTO movies VALUES('8434','Innocents, The',1961,'["UK"]','["Horror","Thriller"]',100,'A young governess for two children becomes convinced that the house and grounds are haunted by ghosts and that the children are being possessed.','bw',443,16372,'tt0055018','/idqvLBmlEHUITMnQ0EJ6Yb5TpVw.jpg','/oog0DJtSuPnWoSTYM7cKmAFbeuU.jpg');
INSERT INTO movies VALUES('18090','Shawshank Redemption, The',1994,'["USA"]','["Prison","Drama"]',142,'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.','col',444,278,'tt0111161','/9cqNxx0GxF0bflZmeSMuL5tnGzr.jpg','/kXfqcdQKsToO0OUXHcrrNCHDBzO.jpg');
INSERT INTO movies VALUES('20822','Région centrale, La',1971,'["Canada"]','["Avant","Garde","Documentary"]',180,'A 1971 experimental Canadian film directed by Michael Snow. Shot in the Canadian mountains over a period of 24 hours using a robotic arm.','col',445,90041,'tt0130232','/cAh9pLrFq9CRb51nDNo4BRctOCv.jpg','/aE0jHzjYoPRUjbM7P0iAg57PkKH.jpg');
INSERT INTO movies VALUES('19412','Festen',1998,'["Denmark"]','["Drama"]',105,'A grandiose party to celebrate a sixtieth birthday unleashes a family drama with all the lies that conceal horrendous secrets. The eldest son, Christian, stages a showdown with the popular pater familias; his provocative, moving after-dinner speech dislodges all the masks, which finally fall completely as the father-son conflict intensifies and the bewildered guests look on.','col',446,309,'tt0154420','/2LRzNq41yrY8EjCnD1S8sCCPvKk.jpg','/pGsYE6Ps04BJ38IK3VbtsKYHn6B.jpg');
INSERT INTO movies VALUES('5435','Limelight',1952,'["USA"]','["Drama","Comedy"]',145,'A fading music hall comedian tries to help a despondent ballet dancer learn to walk and to again feel confident about life.','bw',447,28971,'tt0044837','/tDD11x3ZWCXXXwdpbGEU9uU4kh1.jpg','/q5vgDhmDS4EoYWrk9f9nqYZGDOw.jpg');
INSERT INTO movies VALUES('14271','Koyaanisqatsi',1982,'["USA"]','["Documentary"]',87,'Takes us to locations all around the US and shows us the heavy toll that modern technology is having on humans and the earth. The visual tone poem contains neither dialogue nor a vocalized narration: its tone is set by the juxtaposition of images and the exceptional music by Philip Glass.','col',448,11314,'tt0085809','/6zCNciRcob8lwuydVXgq0esla8L.jpg','/oGtp5hemsXxaghPBRvu2uMpTpwB.jpg');
INSERT INTO movies VALUES('19815','Trip to the Moon, A',1902,'["France"]','["Science Fiction","Short","Adventure"]',14,'Professor Barbenfouillis and five of his colleagues from the Academy of Astronomy travel to the Moon aboard a rocket propelled by a giant cannon. Once on the lunar surface, the bold explorers face the many perils hidden in the caves of the mysterious planet.','bw',449,775,'tt0000417','/9o0v5LLFk51nyTBHZSre6OB37n2.jpg','/jeC1kzwWnZTuXl7xF4E5D70BD8c.jpg');
INSERT INTO movies VALUES('8239','Shoot the Piano Player',1960,'["France"]','["Drama","Crime","Thriller"]',81,'Charlie is a former classical pianist who has changed his name and now plays jazz in a grimy Paris bar. When Charlie''s brothers, Richard and Chico, surface and ask for Charlie''s help while on the run from gangsters they have scammed, he aids their escape. Soon Charlie and Lena, a waitress at the same bar, face trouble when the gangsters arrive, looking for his brothers.','bw',450,1818,'tt0054389','/9hFy8LJshKYvW5vzguEhvgphIHJ.jpg','/kgAZX0WXLuK6YYQ6lKN2UdF1Tho.jpg');
INSERT INTO movies VALUES('22464','Twenty Years Later',1984,'["Brazil"]','["Documentary"]',119,'Eduardo Coutinho was filming a movie with the same name in the Northeast of Brazil, in 1964, when there came the military coup. He had to interrupt the project, and came back to it in 1981, looking for the same places and people, showing what had ocurred since then, and trying to gather a family whose patriarch, a political leader fighting for rights of country people, had been murdered.','col-bw',451,86320,'tt0134402','/5YFzScDgpNbmWBITFVrLVP5rsWA.jpg','/f8zh7tSRsp4h3tGaD6ZRRWANXSX.jpg');
