INSERT INTO movies VALUES('16613','Paris is Burning',1990,'["USA"]','["Documentary"]',78,'Where does voguing come from, and what, exactly, is throwing shade? This landmark documentary provides a vibrant snapshot of the 1980s through the eyes of New York City''s African American and Latinx Harlem drag-ball scene. Made over seven years, PARIS IS BURNING offers an intimate portrait of rival fashion "houses," from fierce contests for trophies to house mothers offering sustenance in a world rampant with homophobia, transphobia, racism, AIDS, and poverty. Featuring legendary voguers, drag queens, and trans women — including Willi Ninja, Pepper LaBeija, Dorian Corey, and Venus Xtravaganza.','col',459,31225,'tt0100332','/3P1CqwwCqgwETklacItjUmNR2tf.jpg','/8yJg7SOv0hbuOYhFwq3FW8GajuM.jpg');
INSERT INTO movies VALUES('20228','Songs from the Second Floor',2000,'["Sweden","Norway","Denmark","France"]','["Comedy","Drama"]',98,'A monumental traffic jam serves as the backdrop for the lives of the inhabitants of a Swedish city.','col',460,34070,'tt0120263','/heW06kNneH6nL59h4ZoaODYXFmY.jpg','/ynXVuylP8upazjz8lrqb1PEMkdR.jpg');
