INSERT INTO movies VALUES('12676','Harlan County, U.S.A.',1976,'["USA"]','["Documentary"]',103,'This film documents the coal miners'' strike against the Brookside Mine of the Eastover Mining Company in Harlan County, Kentucky in June, 1973. Eastovers refusal to sign a contract (when the miners joined with the United Mine Workers of America) led to the strike, which lasted more than a year and included violent battles between gun-toting company thugs/scabs and the picketing miners and their supportive women-folk. Director Barbara Kopple puts the strike into perspective by giving us some background on the historical plight of the miners and some history of the UMWA.','col',468,33324,'tt0074605','/ellKxaweJC09DShpyvMESZZW9cO.jpg','/pVspyFNl8uE8jAoY3C973XkjTgB.jpg');
