INSERT INTO movies VALUES('7001','Bridge on the River Kwai, The',1957,'["UK"]','["War","Drama","Action"]',161,'The classic story of English POWs in Burma forced to build a bridge to aid the war effort of their Japanese captors. British and American intelligence officers conspire to blow up the structure, but Col. Nicholson, the commander who supervised the bridge''s construction, has acquired a sense of pride in his creation and tries to foil their plans.','col',498,826,'tt0050212','/7paXMt2e3Tr5dLmEZOGgFEn2Vo7.jpg','/liZhDhrrNVX8IK4TaeaFodzMamy.jpg');
