INSERT INTO movies VALUES('13214','Monty Python''s Life of Brian',1979,'["UK"]','["Religious","Comedy"]',93,'Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he''s not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python''s signature absurdity, the tale finds Brian''s life paralleling Biblical lore, albeit with many more laughs.','col',505,583,'tt0079470','/lSSA64WF0M0BXnjwr2quMh6shCl.jpg','/bSkJttePygyoEzUlKqKbpIokmJC.jpg');
INSERT INTO movies VALUES('19789','Vampires, Les',1915,'["France"]','["Action","Adventure","Crime"]',421,'Paris is prey to an invisible terror against which the police can do nothing: a sinister organization that sows chaos and death. The intrepid journalist Philippe Guérande and his partner embark on a long crusade to put an end to the crimes of the Great Vampire and Irma Vep, his dangerous accomplice. (A ten episode movie serial.)','bw',506,29082,'tt0006206','/8jO0Zmd468zS9WRLHpwsKUowZAX.jpg','/oaiVvkTYroYhLPIDd2Xcry72QAB.jpg');
INSERT INTO movies VALUES('8843','To Kill a Mockingbird',1962,'["USA"]','["Drama","Crime"]',129,'Scout Finch, 6, and her older brother Jem live in sleepy Maycomb, Alabama, spending much of their time with their friend Dill and spying on their reclusive and mysterious neighbor, Boo Radley. When Atticus, their widowed father and a respected lawyer, defends a black man named Tom Robinson against fabricated rape charges, the trial and tangent events expose the children to evils of racism and stereotyping.','bw',507,595,'tt0056592','/oe88ZKHH1g0HWl7oReFpHTIryiJ.jpg','/mbJIERhLu25fyZb8DQIq1JN3AOR.jpg');
INSERT INTO movies VALUES('22245','Oldboy',2003,'["South Korea"]','["Action","Mystery","Thriller"]',120,'With no clue how he came to be imprisoned, drugged and tortured for 15 years, a desperate businessman seeks revenge on his captors.','col',508,670,'tt0364569','/pWDtjs568ZfOTMbURQBYuT4Qxka.jpg','/fY3vRg4JbqUyP4wNzThutkCdUeS.jpg');
INSERT INTO movies VALUES('18325','Twin Peaks: Fire Walk with Me',1992,'["USA","France"]','["Drama","Horror","Mystery"]',134,'In the questionable town of Deer Meadow, Washington, FBI Agent Desmond inexplicably disappears while hunting for the man who murdered a teen girl. The killer is never apprehended, and, after experiencing dark visions and supernatural encounters, Agent Dale Cooper chillingly predicts that the culprit will claim another life. Meanwhile, in the more cozy town of Twin Peaks, hedonistic beauty Laura Palmer hangs with lowlifes and seems destined for a grisly fate.','col',509,1923,'tt0105665','/mxsGXqetGnirf99qapYd5MMY1VL.jpg','/g5G19q0xgkzWEvfcGo1KcL8nQOk.jpg');
INSERT INTO movies VALUES('24870','Inland Empire',2006,'["USA","France","Poland"]','["Drama","Mystery","Thriller"]',180,'An actress’s perception of reality becomes increasingly distorted as she finds herself falling for her co-star in a remake of an unfinished Polish production that was supposedly cursed.','col',510,1730,'tt0460829','/kaBOzVlMZXVcHGxfPC7hw5N1L7J.jpg','/qyePa65qZVnuYWivTBXkHV9aI3A.jpg');
INSERT INTO movies VALUES('18762','Boogie Nights',1997,'["USA"]','["Drama"]',155,'Set in 1977, back when sex was safe, pleasure was a business and business was booming, idealistic porn producer Jack Horner aspires to elevate his craft to an art form. Horner discovers Eddie Adams, a hot young talent working as a busboy in a nightclub, and welcomes him into the extended family of movie-makers, misfits and hangers-on that are always around. Adams'' rise from nobody to a celebrity adult entertainer is meteoric, and soon the whole world seems to know his porn alter ego, "Dirk Diggler". Now, when disco and drugs are in vogue, fashion is in flux and the party never seems to stop, Adams'' dreams of turning sex into stardom are about to collide with cold, hard reality.','col',511,4995,'tt0118749','/wnE24UPCPQsQnbBOu4zVE2qaDNm.jpg','/uC54rlRdLMZ46fnrz5SoVYleNyv.jpg');
INSERT INTO movies VALUES('17038','Crash',1996,'["Canada"]','["Drama"]',100,'After getting into a serious car accident, a TV director discovers an underground sub-culture of scarred, omnisexual car-crash victims who use car accidents and the raw sexual energy they produce to try to rejuvenate his sex life with his wife.','col',512,884,'tt0115964','/gpai5oUFyFGLHOCsYTvVMqlbY7A.jpg','/li7EvrNoX5MoqK4WQXONsSUDjH1.jpg');
INSERT INTO movies VALUES('15810','Dead Ringers',1988,'["Canada"]','["Thriller","Horror","Drama"]',115,'Elliot, a successful gynecologist, works at the same practice as his identical twin, Beverly. Elliot is attracted to many of his patients and has affairs with them. When he inevitably loses interest, he will give the woman over to Beverly, the meeker of the two, without the woman knowing the difference. Beverly falls hard for one of the patients, Claire, but when she inadvertently deceives him, he slips into a state of madness.','col',513,9540,'tt0094964','/ofXwDfM8uYAaftD7cBPcIWdCpMn.jpg','/n3QtJ6tqE0fnf4Qaxb0iujBk0lH.jpg');
INSERT INTO movies VALUES('12188','Enigma of Kaspar Hauser, The',1974,'["West Germany"]','["Biography","Drama"]',110,'The film follows Kaspar Hauser (Bruno S.), who lived the first seventeen years of his life chained in a tiny cellar with only a toy horse to occupy his time, devoid of all human contact except for a man who wears a black overcoat and top hat who feeds him.','col',514,11710,'tt0071691','/z1rBBE8NWociDQClr8y6Onv1X62.jpg','/9zYXDMmhBKTbCbImJclf9hEbqZC.jpg');
INSERT INTO movies VALUES('10517','Damned, The',1969,'["Italy","West Germany"]','["War","Drama"]',155,'In the early days of Nazi Germany, a powerful noble family must adjust to life under the new dictatorship regime.','col',515,41876,'tt0064118','/hgUw52rwePsQ5oU7ahbYZySGrrO.jpg','/cM5Uevzpju12Vu4Hx3fOQpfBRR7.jpg');
INSERT INTO movies VALUES('24845','Pan''s Labyrinth',2006,'["Spain","Mexico","USA"]','["Drama","Fantasy","Thriller"]',120,'Living with her tyrannical stepfather in a new home with her pregnant mother, 10-year-old Ofelia feels alone until she explores a decaying labyrinth guarded by a mysterious faun who claims to know her destiny. If she wishes to return to her real father, Ofelia must complete three terrifying tasks.','col',516,1417,'tt0457430','/7PurMm0gUOJZ8Uk0oyuZlt1CKfJ.jpg','/o0IWa75BXyXryNDVqw0xoXZzy1J.jpg');
INSERT INTO movies VALUES('19760','And Life Goes On...',1992,'["Iran"]','["Drama"]',108,'After the earthquake of Guilan, a film director and his son travel to the devastated area to search for the actors from the movie the director made there a few years previously. In their search, they see how people who have lost everything in the earthquake still have hope and try to live life to the fullest.','col',517,83761,'tt0105888','/100CuZjqxtcbDvZ5qPsoi1VEU5n.jpg','/omju98cbCjs8YJfkeMaaCH35ohX.jpg');
INSERT INTO movies VALUES('9675','Closely Watched Trains',1966,'["Czechoslovakia"]','["Drama","Comedy"]',89,'At a village railway station in occupied Czechoslovakia, a bumbling dispatcher’s apprentice longs to liberate himself from his virginity. Oblivious to the war and the resistance that surrounds him, this young man embarks on a journey of sexual awakening and self-discovery, encountering a universe of frustration, eroticism, and adventure within his sleepy backwater depot.','bw',518,789,'tt0060802','/1FMBXil0P8Xyl1KRWbXbUGn6JCC.jpg','/eD1ztHEgCsexPrdciDBhhvxHLQs.jpg');
INSERT INTO movies VALUES('11885','Alice in the Cities',1974,'["West Germany"]','["Drama"]',110,'German journalist Philip Winter has a case of writer’s block when trying to write an article about the United States. He decides to return to Germany, and while trying to book a flight, encounters a German woman and her nine year old daughter Alice doing the same. The three become friends (almost out of necessity) and while the mother asks Winter to mind Alice temporarily, it quickly becomes apparent that Alice will be his responsibility for longer than he expected.','bw',519,2204,'tt0069687','/lw22wORmENkTZHGXI6bKmAIHxjO.jpg','/jZjkYpLtJbV0o5EpaEwCBgyezLi.jpg');
INSERT INTO movies VALUES('18095','Short Cuts',1993,'["USA"]','["Drama"]',189,'Many loosely connected characters cross paths in this film, based on the stories of Raymond Carver. Waitress Doreen Piggot accidentally runs into a boy with her car. Soon after walking away, the child lapses into a coma. While at the hospital, the boy''s grandfather tells his son, Howard, about his past affairs. Meanwhile, a baker starts harassing the family when they fail to pick up the boy''s birthday cake.','col',520,695,'tt0108122','/nAEBc3g9bHAcF9whKFMfIxHxVwn.jpg','/a0OjGWE9ru1OlKLBujbz3mAYYxU.jpg');
INSERT INTO movies VALUES('8431','Hustler, The',1961,'["USA"]','["Drama","Sport"]',135,'Fast Eddie Felson is a small-time pool hustler with a lot of talent but a self-destructive attitude. His bravado causes him to challenge the legendary Minnesota Fats to a high-stakes match.','bw',521,990,'tt0054997','/snItsSViawjaadW9mlWUmGwR41R.jpg','/1aspiiXDHVizaCYTNaWwRQSmXCh.jpg');
INSERT INTO movies VALUES('21664','Princess Mononoke',1997,'["Japan"]','["Animated","Adventure","Fantasy"]',134,'Ashitaka, a prince of the disappearing Emishi people, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.','col',522,128,'tt0119698','/cMYCDADoLKLbB83g4WnJegaZimC.jpg','/sXV0NVLtyEsOdaEXnMcRGwUhIi0.jpg');
INSERT INTO movies VALUES('25821','No Country for Old Men',2007,'["USA"]','["Crime","Drama","Thriller"]',122,'Llewelyn Moss stumbles upon dead bodies, $2 million and a hoard of heroin in a Texas desert, but methodical killer Anton Chigurh comes looking for it, with local sheriff Ed Tom Bell hot on his trail. The roles of prey and predator blur as the violent pursuit of money and justice collide.','col',523,6977,'tt0477348','/bj1v6YKF8yHqA489VFfnQvOJpnc.jpg','/bQeuzbFtizthHztHpWW0Yw0ntHO.jpg');
INSERT INTO movies VALUES('15813','Die Hard',1988,'["USA"]','["Thriller","Action"]',131,'NYPD cop John McClane''s plan to reconcile with his estranged wife is thrown for a serious loop when, minutes after he arrives at her office, the entire building is overtaken by a group of terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.','col',524,562,'tt0095016','/yFihWxQcmqcaBR31QM6Y8gT6aYV.jpg','/oIwfoUFfWfESn0Y8u8jv9lc8li1.jpg');
INSERT INTO movies VALUES('3325','To Have and Have Not',1944,'["USA"]','["Romance","Drama","Adventure"]',100,'A Martinique charter boat skipper gets mixed up with the underground French resistance operatives during WWII.','bw',525,22584,'tt0037382','/jLOmQ6yHWSKZDrJ2CMuSrXE3t3J.jpg','/7ZuOjLr5yQUG5qCXGQjyDQEqx29.jpg');
