INSERT INTO movies VALUES('16798','Blue',1993,'["UK","Japan"]','["Documentary","Drama","Biography"]',79,'Against a plain, unchanging blue screen, a densely interwoven soundtrack of voices, sound effects and music attempt to convey a portrait of Derek Jarman''s experiences with AIDS, both literally and allegorically, together with an exploration of the meanings associated with the colour blue.','col',527,94794,'tt0106438','/4ktqO8EvVE7NS3NuykukophhNtl.jpg','/nAUBENJ7KO7OBCY1LaPYpzJANJx.jpg');
