INSERT INTO movies VALUES('16851','Age of Innocence, The',1993,'["USA"]','["Romance","Drama"]',133,'In 19th century New York high society, a young lawyer falls in love with a woman separated from her husband, while he is engaged to the woman''s cousin.','col',530,10436,'tt0106226','/5Tuyt26v7qNR8Cl3m7ZRx36rduf.jpg','/Auf7Fbf2BW2h32vrNwgEb7uJJhi.jpg');
INSERT INTO movies VALUES('6613','Aparajito',1956,'["India"]','["Drama"]',108,'Aparajito picks up where the first film leaves off, with Apu and his family having moved away from the country to live in the bustling holy city of Varanasi (then known as Benares). As Apu progresses from wide-eyed child to intellectually curious teenager, eventually studying in Kolkata, we witness his academic and moral education, as well as the growing complexity of his relationship with his mother. This tenderly expressive, often heart-wrenching film, which won three top prizes at the Venice Film Festival, including the Golden Lion, not only extends but also spiritually deepens the tale of Apu.  Preserved by the Academy Film Archive in 1996.','bw',531,897,'tt0048956','/qvR2Qs42WHwCEcuwhQnterU3gVY.jpg','/qDEZmaaAGhEso6kvB5kk1CROPwG.jpg');
INSERT INTO movies VALUES('19892','Rosetta',1999,'["Belgium","France"]','["Drama"]',94,'Young, impulsive Rosetta lives a hard and stressful life as she struggles to support herself and her alcoholic mother. Refusing all charity, she is desperate to maintain a dignified job.','col',532,11489,'tt0200071','/zdWX3mNm9rzEU9f363y0NPehFrS.jpg','/uydYoYfnCbPWxNAG6VFbYwso3bB.jpg');
INSERT INTO movies VALUES('6953','12 Angry Men',1957,'["USA"]','["Drama"]',95,'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors'' prejudices and preconceptions about the trial, the accused, and each other.','bw',533,389,'tt0050083','/ow3wq89wM8qd5X7hWKxiRfsFf9C.jpg','/qqHQsStV6exghCM7zbObuYBiYxw.jpg');
INSERT INTO movies VALUES('6347','East of Eden',1955,'["USA"]','["Drama"]',115,'In the Salinas Valley in and around World War I, Cal Trask feels he must compete against overwhelming odds with his brother for the love of their father. Cal is frustrated at every turn, from his reaction to the war, how to get ahead in business and in life, and how to relate to his estranged mother.','col',534,220,'tt0048028','/xv1MZVIop0SQqwLUymgE5eb2LFl.jpg','/u7i1XtbOubq0xwRy2Zbgmox6g9W.jpg');
INSERT INTO movies VALUES('28','Alexander Nevsky',1938,'["USSR"]','["War","History","Biography"]',107,'When German knights invade Russia, Prince Alexander Nevsky must rally his people to resist the formidable force. After the Teutonic soldiers take over an eastern Russian city, Alexander stages his stand at Novgorod, where a major battle is fought on the ice of frozen Lake Chudskoe. While Alexander leads his outnumbered troops, two of their number, Vasili and Gavrilo, begin a contest of bravery to win the hand of a local maiden.','bw',535,10235,'tt0029850','/lsTJYStIsnddwioD1L4FEmwj4Cx.jpg','/izg3sL4nJwehVsUy1mn1sLOmvuK.jpg');
INSERT INTO movies VALUES('10076','Point Blank',1967,'["USA"]','["Crime","Drama","Thriller"]',92,'After being double-crossed and left for dead, a mysterious man named Walker single-mindedly tries to retrieve the rather inconsequential sum of money that was stolen from him.','col',536,26039,'tt0062138','/5wzZipiC0THdgPpViVV5OqDj3Xr.jpg','/dmzzE3U9Lmyz5kYxnDBxtTfQwr0.jpg');
INSERT INTO movies VALUES('19713','Fight Club',1999,'["USA","Germany"]','["Drama"]',139,'A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground "fight clubs" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.','col',537,550,'tt0137523','/pB8BM7pdSp6B6Ih7QZ4DrQ3PmJK.jpg','/hZkgoQYus5vegHoetLkCJzb17zJ.jpg');
INSERT INTO movies VALUES('938','Man of Aran',1934,'["UK"]','["Documentary"]',77,'A documentary on the life of the people of  the Aran Islands, who were believed to contain the essence of the ancient Irish life, represented by a pure uncorrupted peasant existence centred around the struggle between man and his hostile but magnificent surroundings. A blend of documentary and fictional narrative, the film captures the everyday trials of life on Ireland''s unforgiving Aran Islands.','bw',538,47684,'tt0025456','/eho7XznZ3trCUGziNaPvKN70hbx.jpg','/xcVYow0RZZv4KCHLk32r7vuR5Xm.jpg');
