INSERT INTO movies VALUES('18605','Je, tu, il, elle',1974,'["Belgium"]','["Drama"]',85,'A woman suffers a subdued psychological breakdown in the wake of a devastating breakup.','bw',540,93934,'tt0071690','/4arnTs41WSLWsnENWdljFKo0pu1.jpg','/xzfR4D9G1YpZylwCnBqBznZNkMg.jpg');
INSERT INTO movies VALUES('31805','Nostalgia for the Light',2010,'["France","Germany","Chile","Spain"]','["Documentary"]',90,'In Chile''s Atacama Desert, astronomers peer deep into the cosmos in search for answers concerning the origins of life. Nearby, a group of women sift through the sand searching for body parts of loved ones, dumped unceremoniously by Pinochet''s regime.','col',541,72721,'tt1556190','/62dxABTMRYgrMwK8nUvXzTITcR.jpg','/tCKmhgt72QgfbyDb3S6FL6m9Wd3.jpg');
