INSERT INTO movies VALUES('15163','Hannah and Her Sisters',1986,'["USA"]','["Drama","Comedy","Romance"]',106,'Between two Thanksgivings, Hannah''s husband falls in love with her sister Lee, while her hypochondriac ex-husband rekindles his relationship with her sister Holly.','col',543,5143,'tt0091167','/gARgIRb2QFRFVrsziwWE389u1pK.jpg','/jx6jUMCLhRWB05ngVjaGxPpLq5x.jpg');
INSERT INTO movies VALUES('36514','Boyhood',2014,'["USA"]','["Drama"]',165,'The film tells a story of a divorced couple trying to raise their young son. The story follows the boy for twelve years, from first grade at age 6 through 12th grade at age 17-18, and examines his relationship with his parents as he grows.','col',544,85350,'tt1065073','/2BvtvDUyxiMJ4dmKfiQf4qdOHQN.jpg','/qRwkMMZhQRKM4uDaXpd2XbZZmkE.jpg');
INSERT INTO movies VALUES('5226','Strangers on a Train',1951,'["USA"]','["Thriller","Drama","Crime"]',101,'Two strangers meet on a train. They’ve never met before. Both of whom have someone they’d like to murder. So, they swap murders. A psychopath shares this concept with tennis star Guy Haines, whose wife refuses to get a divorce. He agrees, thinking it is a joke. But now his wife is dead, Haines finds himself a prime suspect and the man wants Guy to kill his father.','bw',545,845,'tt0044079','/ihC083U7ef56Ui4x0P0dobojrZ1.jpg','/hAoTBCNBVafAoiilh4gtqqyhi8V.jpg');
INSERT INTO movies VALUES('12279','Picnic at Hanging Rock',1975,'["Australia"]','["Mystery","Drama"]',110,'In the early 1900s, Miranda attends a girls boarding school in Australia. One Valentine''s Day, the school''s typically strict headmistress treats the girls to a picnic field trip to an unusual but scenic volcanic formation called Hanging Rock. Despite rules against it, Miranda and several other girls venture off. It''s not until the end of the day that the faculty realizes the girls and one of the teachers have disappeared mysteriously.','col',546,11020,'tt0073540','/7BAXwmFN4pZDNb9N6kzmAAwdssi.jpg','/41Mlaj6wfjlF4wQaVH0tjfDXvMi.jpg');
INSERT INTO movies VALUES('14674','Terminator, The',1984,'["USA"]','["Science Fiction","Action"]',107,'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the "Terminator" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?','col',547,218,'tt0088247','/qvktm0BHcnmDpul4Hz01GIazWPr.jpg','/xqTmPBNTcSwyIM6jFZl2Ph8O1k4.jpg');
INSERT INTO movies VALUES('20824','Russian Ark',2002,'["Russia","Germany","Japan","Canada","Finland","Denmark"]','["Drama","Fantasy","History"]',99,'A ghost and a French marquis wander through the Winter Palace in St Petersburg, encountering scenes from many different periods of its history.','col',548,16646,'tt0318034','/7NhwiUZHBajpKC2xcGcpFhMJ07k.jpg','/lLQgQy1nX3qocg83BLTCz1911R4.jpg');
INSERT INTO movies VALUES('20518','Devil, Probably, The',1977,'["France"]','["Drama"]',95,'A group of disillusioned young Parisians look for satisfaction in political activism, religion, romance, music, and drugs.','col',549,32097,'tt0075938','/8y00J2rVtxHntKMukkkzsYKQORe.jpg','/aY3ipX4JHwrpFSCZcE49OZHi2OR.jpg');
INSERT INTO movies VALUES('20126','Wind Will Carry Us, The',1999,'["France","Iran"]','["Drama"]',118,'Irreverent city engineer Behzad comes to a rural Kurdish village in Iran to keep vigil for a dying relative. In the meanwhile the film follows his efforts to fit in with the local community and how he changes his own attitudes as a result.','col',550,43423,'tt0209463','/zGFailx3ZZmPLYvJ4VdodJ53zlq.jpg','/b9UPNXGV7mEUmLejR8caJIJijow.jpg');
INSERT INTO movies VALUES('9566','Sound of Music, The',1965,'["USA"]','["Musical","Drama","Family"]',174,'In the years before the Second World War, a tomboyish postulant at an Austrian abbey is hired as a governess in the home of a widowed naval captain with seven children, and brings a new love of life and music into the home.','col',551,15121,'tt0059742','/oqiKacmJ7OwAlXIRTtxnXxdEZYx.jpg','/m5n1nguLC3pTJLPKhN5Ek0aNT6E.jpg');
INSERT INTO movies VALUES('17358','Haine, La',1995,'["France"]','["Drama","Crime"]',98,'After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Saïd, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.','bw',552,406,'tt0113247','/kZ48vGGgH0dWNGOAhWRLoe1jOLN.jpg','/viGCwLxupyoaLsa6hrnu1gYrB0B.jpg');
INSERT INTO movies VALUES('27195','WALL-E',2008,'["USA"]','["Animated","Adventure","Science Fiction"]',98,'What if mankind had to leave Earth and somebody forgot to turn the last robot off? After hundreds of years doing what he was built for, WALL•E discovers a new purpose in life when he meets a sleek search robot named EVE. EVE comes to realize that WALL•E has inadvertently stumbled upon the key to the planet''s future, and races back to space to report to the humans. Meanwhile, WALL•E chases EVE across the galaxy and sets into motion one of the most imaginative adventures ever brought to the big screen.','col',553,10681,'tt0910970','/hbhFnRzzg6ZDmm8YAmxBnQpQIPh.jpg','/fK5ssgvtI43z19FoWigdlqgpLRE.jpg');
INSERT INTO movies VALUES('17084','Dead Man',1995,'["USA","Germany"]','["Western","Drama"]',121,'A fatally wounded white man is found by an outcast Native American who prepares him for the afterlife.','bw',554,922,'tt0112817','/dOvHDs2jlMYL1dMfbFabEwyBNWg.jpg','/9Kfi1QDVGbMzzi06n8c6A789odL.jpg');
INSERT INTO movies VALUES('2992','I Walked with a Zombie',1943,'["USA"]','["Horror","Drama","Fantasy"]',69,'A nurse in the Caribbean turns to voodoo in hopes of curing her patient, a mindless woman whose husband she''s fallen in love with.','bw',555,27130,'tt0036027','/uoyBR8XNxPQRojujtczfG1qJezY.jpg','/bCyK6eETwA6kzxLxDDuwJ3l7Wdw.jpg');
INSERT INTO movies VALUES('21062','Punch-Drunk Love',2002,'["USA"]','["Romance","Drama","Comedy"]',95,'A socially awkward and volatile small business owner meets the love of his life after being threatened by a gang of scammers.','col',556,8051,'tt0272338','/vT2CXIsVKoGl0DZ8USwLWzEFznI.jpg','/l9WzjwHwF7I2DwCtK8DXVQExGjH.jpg');
INSERT INTO movies VALUES('10803','Fellini Satyricon',1969,'["Italy"]','["History","Drama"]',129,'After his young lover, Gitone, leaves him for another man, Encolpio decides to kill himself, but a sudden earthquake destroys his home before he has a chance to do so. Now wandering around Rome in the time of Nero, Encolpio encounters one bizarre and surreal scene after another.','col',557,11163,'tt0064940','/83urUMl04GtwuuGIFpezqzi7n6m.jpg','/t0OjVi2Iv2CSMq68sGPd09GQb3k.jpg');
INSERT INTO movies VALUES('18076','Se7en',1995,'["USA"]','["Thriller","Mystery","Drama"]',127,'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the "seven deadly sins" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer''s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.','col',558,807,'tt0114369','/6yoghtyTpznpBik8EngEmJskVUO.jpg','/dYjZ27hDw2QFaEIfzbNGwW0IkV9.jpg');
INSERT INTO movies VALUES('2131','Young Mr. Lincoln',1939,'["USA"]','["Political","Biography","Drama"]',100,'In this dramatized account of his early law career in Illinois, Abraham Lincoln is born into a modest log cabin, where he is encouraged by his first love, Ann Rutledge, to pursue law. Following her tragic death, Lincoln establishes a law practice in Springfield, where he meets a young Mary Todd. Lincoln''s law skills are put to the test when he takes on the difficult task of defending two brothers who have been accused of murder.','bw',559,43838,'tt0032155','/gVHbi2AZfWsZB10FJcwaFV59kIo.jpg','/buGNPL2zNGjPirZTMT3DwwkVdw1.jpg');
INSERT INTO movies VALUES('18524','Yellow Earth',1984,'["China"]','["Drama","Political"]',89,'During WWII, a member of Mao Zedong''s communist army is sent to a rural area of China to collect the region''s folk songs for propagandistic purposes.','col',560,92990,'tt0087433','/7cFQRw99d2pztDouSqFcl6Kqf9m.jpg','/tq4D8eICdEXdJtre2bHnjl9K1Yy.jpg');
INSERT INTO movies VALUES('9202','Doctor Zhivago',1965,'["USA"]','["War","Romance","Drama"]',197,'The life of a Russian physician and poet who, although married to another, falls in love with a political activist''s wife and experiences hardship during World War I and then the October Revolution.','col',561,907,'tt0059113','/r0Iv2BiCFYDnzc6uU1q3AJ56igT.jpg','/y3sPNxqVBIt97EZX568OpAWBpcl.jpg');
INSERT INTO movies VALUES('161','Blue Angel, The',1930,'["Germany"]','["Drama"]',103,'Prim professor Immanuel Rath finds some of his students ogling racy photos of cabaret performer Lola Lola and visits a local club, The Blue Angel, in an attempt to catch them there. Seeing Lola perform, the teacher is filled with lust, eventually resigning his position at the school to marry the young woman. However, his marriage to a coquette -- whose job is to entice men -- proves to be more difficult than Rath imagined.','bw',562,228,'tt0020697','/3FStCU5ipNGmwASfHVP282IO39z.jpg','/vzkueeO7XwkziTDla4ncF6H4laQ.jpg');
INSERT INTO movies VALUES('20973','Morvern Callar',2002,'["UK","Canada"]','["Drama"]',97,'After her boyfriend commits suicide, a young woman attempts to use the unpublished manuscript of a novel and a sum of money he left behind to reinvent her life.','col',563,18602,'tt0300214','/qcX86XKhPH4Q02OcKv4cnbrmFOn.jpg','/6DFmcjeIxlaBC7uhQpw6YnkPpzQ.jpg');
INSERT INTO movies VALUES('24111','Sambizanga',1972,'["Angola","France"]','["Drama"]',97,'Domingos is a member of an African liberation movement, arrested by the Portuguese secret police, after bloody events in Angola. His wife goes from a prison station to another, trying in vain to find out where he is.','col',564,87392,'tt0069214','/isnDnTWjOE9EJqsKXvCwZQrIkeE.jpg','/2mI4KyQsqwsWqXKupLhRXQ6sTDL.jpg');
INSERT INTO movies VALUES('1707','Wedding March, The',1928,'["USA"]','["Drama"]',113,'A young impoverished aristocrat falls in love with an inn-keeper''s daughter, but has to marry money.','bw',565,42537,'tt0019558','/ej61Px6QKN1lTbkU9b1kqEHnWEW.jpg','/9ser9RnKEFh8XL1Q6S7b2nJH31B.jpg');
INSERT INTO movies VALUES('23445','Brokeback Mountain',2005,'["USA","Canada"]','["Romance","Drama"]',134,'Rodeo cowboy Jack and ranch hand Ennis are hired as sheepherders in 1963 Wyoming. One night on Brokeback Mountain, they spark a physical relationship. Though Ennis marries his longtime sweetheart and Jack marries a fellow rodeo rider, they keep up their tortured, sporadic love affair for 20 years.','col',566,142,'tt0388795','/5UZ283LuT8ClE4Iqw3u4gGZizab.jpg','/vArZOJCRavxiKqdXPn74VdQwn7d.jpg');
INSERT INTO movies VALUES('2051','Ninotchka',1939,'["USA"]','["Romance","Comedy"]',110,'A stern Russian woman sent to Paris on official business finds herself attracted to a man who represents everything she is supposed to detest.','bw',567,1859,'tt0031725','/v4MkgNqZyodYwBDNbZ64MF9tVEL.jpg','/tlTuiruOW5kK8lhzct1FYrQogOy.jpg');
INSERT INTO movies VALUES('11254','French Connection, The',1971,'["USA"]','["Crime","Action","Drama"]',104,'Tough narcotics detective ''Popeye'' Doyle is in hot pursuit of a suave French drug dealer who may be the key to a huge heroin-smuggling operation.','col',568,1051,'tt0067116','/pH4saPwMjhnVGwmSH6RkMaHrt3s.jpg','/AsaW2VwcArvQmYjf2wsDjqWEn6f.jpg');
INSERT INTO movies VALUES('24677','Children of Men',2006,'["USA","UK"]','["Drama","Science Fiction","Thriller"]',109,'In 2027, in a chaotic world in which humans can no longer procreate, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea, where her child''s birth may help scientists save the future of humankind.','col',569,9693,'tt0206634','/k9IAS4TehZFcKi4HVByxZNPfqex.jpg','/7cW7zHpDdl9fgaRXI5qAglV247P.jpg');
INSERT INTO movies VALUES('13474','Kagemusha',1980,'["Japan"]','["War","Drama","History"]',159,'Akira Kurosawa''s lauded feudal epic presents the tale of a petty thief who is recruited to impersonate Shingen, an aging warlord, in order to avoid attacks by competing clans. When Shingen dies, his generals reluctantly agree to have the impostor take over as the powerful ruler. He soon begins to appreciate life as Shingen, but his commitment to the role is tested when he must lead his troops into battle against the forces of a rival warlord.','col',570,11953,'tt0080979','/ag3sgXg27j8NTaIbWoODIFiikfw.jpg','/lkivVsolS6RPCuy8wgHvixGRJcE.jpg');
INSERT INTO movies VALUES('10497','Butch Cassidy and the Sundance Kid',1969,'["USA"]','["Western"]',112,'In late 1890s Wyoming, Butch Cassidy is the affable, clever and talkative leader of the outlaw Hole in the Wall Gang. His closest companion is the laconic dead-shot Sundance Kid. As the west rapidly becomes civilized, the law finally catches up to Butch, Sundance and their gang.  Chased doggedly by a special posse, the two decide to make their way to South America in hopes of evading their pursuers once and for all.  Preserved by the Academy Film Archive in partnership with Twentieth Century Fox Film Corporation in 1998.','col',571,642,'tt0064115','/gFmmykF1Ym3OGzENo50nZQaD1dx.jpg','/C6jcUqld8M6hZQmzBxgwHuQ4qT.jpg');
INSERT INTO movies VALUES('1556','Testament of Dr. Mabuse, The',1933,'["Germany"]','["Thriller","Mystery","Crime"]',120,'After a detective is assaulted by thugs and placed in an asylum run by Professor Baum, he observes the professor''s preoccupation with another patient, the criminal genius Dr. Mabuse the hypnotist. When Mabuse''s notes are found to be connected with a rash of recent crimes, Commissioner Lohmann must determine how Mabuse is communicating with the criminals, despite conflicting reports on the doctor''s whereabouts, and capture him for good.','bw',572,12206,'tt0023563','/tc2ET7j6X066VCjdHblSwLr8sEz.jpg','/hqOlD3inB1U8GRIsAKQp5kDhj6H.jpg');
INSERT INTO movies VALUES('3057','Shadow of a Doubt',1943,'["USA"]','["Thriller"]',108,'Just when Charlotte ‘Charlie’ Newton, is feeling especially frustrated by the lack of excitement in her small town in California, she receives wonderful news: Her uncle and namesake, Charlie Oakley, is coming to visit. However, as secrets about him come to the fore, Charlotte’s admiration turns into suspicion.','bw',573,21734,'tt0036342','/ptyWagbWE8jSGyV2tGEzAdVbRCj.jpg','/AuCrQyv2WZfbZcWOfim3ifXZ7zv.jpg');
INSERT INTO movies VALUES('2675','Cat People',1942,'["USA"]','["Thriller","Horror","Mystery"]',73,'A Serbian émigré in Manhattan believes that, because of an ancient curse, any physical intimacy with the man she loves will turn her into a feline predator.','bw',574,25508,'tt0034587','/zSNTDd5Q6No5BmY39Zp5BVgl8XE.jpg','/dAE4x4BgauvsRkErmLg1L05LNAV.jpg');
INSERT INTO movies VALUES('33531','Master, The',2012,'["USA"]','["Drama"]',144,'Freddie, a volatile, heavy-drinking veteran who suffers from post-traumatic stress disorder, finds some semblance of a family when he stumbles onto the ship of Lancaster Dodd, the charismatic leader of a new "religion" he forms after World War II.','col',575,68722,'tt1560747','/tvhE7TWGzLPgN82bBDuX1XtH5oE.jpg','/s4EIxjPG3BEmo6TWkCXkJQZM4zY.jpg');
INSERT INTO movies VALUES('12789','That Obscure Object of Desire',1977,'["France","Spain"]','["Drama"]',103,'After dumping a bucket of water on a beautiful young woman from the window of a train car, wealthy Frenchman Mathieu, regales his fellow passengers with the story of the dysfunctional relationship between himself and the young woman in question, a fiery 19-year-old flamenco dancer named Conchita. What follows is a tale of cruelty, depravity and lies -- the very building blocks of love.','col',576,5781,'tt0075824','/9iUdC4dftkjYSBUJq5DAxC6WqB9.jpg','/cdKjKrls7ItSxqAe6j0Jz7EdKuN.jpg');
INSERT INTO movies VALUES('3224','Laura',1944,'["USA"]','["Mystery","Romance","Thriller"]',85,'A police detective falls in love with the woman whose murder he''s investigating.','bw',577,1939,'tt0037008','/j0zEiFFrdbZnMXqD3piOtZBJeNB.jpg','/9r20ZZDnUymGFlVPHKV2euTPTxk.jpg');
INSERT INTO movies VALUES('13789','Mad Max 2',1981,'["Australia"]','["Action","Adventure","Science Fiction"]',96,'Max Rockatansky returns as the heroic loner who drives the dusty roads of a postapocalyptic Australian Outback in an unending search for gasoline. Arrayed against him and the other scraggly defendants of a fuel-depot encampment are the bizarre warriors commanded by the charismatic Lord Humungus, a violent leader whose scruples are as barren as the surrounding landscape.','col',578,8810,'tt0082694','/dhVekfpaCW3QavAwGYbaQig87Xc.jpg','/jEuwsmFS8JPzkDIhRL3B2BVYbU4.jpg');
INSERT INTO movies VALUES('1084','Night at the Opera, A',1935,'["USA"]','["Comedy","Musical"]',96,'The Marx Brothers take on high society and the opera world to bring two lovers together. A sly business manager and two wacky friends of two opera singers help them achieve success while humiliating their stuffy and snobbish enemies.','bw',579,37719,'tt0026778','/A4YDGfJwaG7aMxDVrVJsOHJ7ufK.jpg','/3Ks9mqYpReb69av3RaHFJq4yhZ9.jpg');
INSERT INTO movies VALUES('16933','Barton Fink',1991,'["USA"]','["Drama","Comedy"]',117,'A renowned New York playwright is enticed to California to write for the movies and discovers the hellish truth of Hollywood.','col',580,290,'tt0101410','/hazd5nnOvjYEYYM6cSXFM3avTht.jpg','/5IbE8joIeUUowIVC2TNsyAd0nFv.jpg');
INSERT INTO movies VALUES('10532','Easy Rider',1969,'["USA"]','["Drama"]',94,'Wyatt and Billy, two Harley-riding hippies, complete a drug deal in Southern California and decide to travel cross-country in search of spiritual truth.','col',581,624,'tt0064276','/mmGEB6ly9OG8SYVfvAoa6QqHNvN.jpg','/66nV6EJgNpGeNQ5Ad2yXtkAtE4D.jpg');
INSERT INTO movies VALUES('13090','Being There',1979,'["USA"]','["Drama","Comedy"]',130,'A simple-minded gardener named Chance has spent all his life in the Washington D.C. house of an old man. When the man dies, Chance is put out on the street with no knowledge of the world except what he has learned from television.','col',582,10322,'tt0078841','/3RO3jbCKEey2T9bYFkYt9xpwen9.jpg','/gkyYZSevVI6zbGrLDmSo9Im88Qv.jpg');
INSERT INTO movies VALUES('9064','Silence, The',1963,'["Sweden"]','["Drama"]',96,'Traveling through an unnamed European country on the brink of war, sickly, intellectual Ester, her sister Anna and Anna''s young son, Johan, check into a near-empty hotel. A basic inability to communicate among the three seems only to worsen during their stay. Anna provokes her sister by enjoying a dalliance with a local man, while the boy, left to himself, has a series of enigmatic encounters that heighten the growing air of isolation.','bw',583,11506,'tt0057611','/y6bApeoTg2A0h4NzBy4aiuOToAm.jpg','/mNpd8763X64KKGXnrdnBHdON9np.jpg');
INSERT INTO movies VALUES('18688','Land Without Bread',1933,'["Spain"]','["Documentary","Short","Drama"]',28,'An exploration —manipulated and staged— of life in Las Hurdes, in the province of Cáceres, in Extremadura, Spain, as it was in 1932. Insalubrity, misery and lack of opportunities provoke the emigration of young people and the solitude of those who remain in the desolation of one of the poorest and least developed Spanish regions at that time. (Silent short, voiced in 1937 and 1996.)','bw',584,91,'tt0023037','/iQM715v277SIw66Y1bJ1KiK5WNx.jpg','/aaRbO3m3L3yVg2L73QLYvgP23hj.jpg');
INSERT INTO movies VALUES('20840','Tale of Tales',1979,'["USSR"]','["Animated","Short"]',29,'Skazka Skazok (Tale of Tales) is a 27-minute animated short film, considered the masterpiece of influential Russian animator Yuri Norstein. Told in a non-narrative style by free association, the film employs various techniques including puppets, cut-outs, and traditional cell animation. Using classical music and ''30s jazz tunes instead of dialogue.','col',585,36079,'tt0079986','/lxikoDWKr9LeQsbHUbNzm8kgElm.jpg','/xeZmlPCQs8tNH5CAoznrNUb492L.jpg');
INSERT INTO movies VALUES('12891','Halloween',1978,'["USA"]','["Horror","Thriller"]',93,'Fifteen years after murdering his sister on Halloween Night 1963, Michael Myers escapes from a mental hospital and returns to the small town of Haddonfield, Illinois to kill again.','col',586,948,'tt0077651','/wijlZ3HaYMvlDTPqJoTCWKFkCPU.jpg','/aRka9neADW1M0Zf9lF8kW2jEgXe.jpg');
INSERT INTO movies VALUES('9848','Taking of Power by Louis XIV, The',1966,'["France"]','["Drama","Biography","History"]',100,'Cardinal Mazarin dies, leaving a power vacuum in which the young Louis asserts his intention to govern as well as rule. Mazarin''s fiscal advisor, Colbert, warns against Fouquet, the Superintendant who has been systematically looting the treasury and wants to be prime minister. Fouquet believes Louis will soon tire of exercizing power and overplays his hand by offering a bribe to Louis'' mistress to be his ally. She reports this to the king who arrests Fouquet. Louis and Colbert design a brilliant strategy to keep merchants making money, nobles in debt, the urban poor working and fed, and peasants untaxed.','col',587,69912,'tt0060860','/1cwIWZFiJc10CSb8aElC9FtpTx7.jpg','/z7Wq5zsMLZGZ90QIy2yTbmouOSi.jpg');
INSERT INTO movies VALUES('6632','Bigger Than Life',1956,'["USA"]','["Drama"]',95,'A friendly, successful suburban teacher and father grows dangerously addicted to cortisone, resulting in his transformation into a household despot.','col',588,26036,'tt0049010','/nC3J5B2lkWDLm7Q7C26AVFzqJLV.jpg','/6el4eCIe56b6yRUvHDyZgI1pQPB.jpg');
INSERT INTO movies VALUES('5716','Gentlemen Prefer Blondes',1953,'["USA"]','["Romance","Musical","Comedy"]',91,'Lorelei Lee is a beautiful showgirl engaged to be married to the wealthy Gus Esmond, much to the disapproval of Gus'' rich father, Esmond Sr., who thinks that Lorelei is just after his money. When Lorelei goes on a cruise accompanied only by her best friend, Dorothy Shaw, Esmond Sr. hires Ernie Malone, a private detective, to follow her and report any questionable behavior that would disqualify her from the marriage.','col',589,759,'tt0045810','/fDozhst5HVJJcd3BM8ZOsKniO7Q.jpg','/xORxfun2s1Gn43nPbYkMpQZZ9sK.jpg');
INSERT INTO movies VALUES('12436','Grey Gardens',1975,'["USA"]','["Documentary","Comedy"]',95,'Edie Bouvier Beale and her mother, Edith, two aging, eccentric relatives of Jackie Kennedy Onassis, are the sole inhabitants of a Long Island estate. The women reveal themselves to be misfits with outsized, engaging personalities. Much of the conversation is centered on their pasts, as mother and daughter now rarely leave home.','col',590,17346,'tt0073076','/10E3nqmmoeqU2pvGuFbPeYSPhgs.jpg','/eN7TJ9aASBxvBKS3ALkyWUEUFG7.jpg');
INSERT INTO movies VALUES('9131','Bande à part',1964,'["France"]','["Crime","Drama","Romance"]',95,'Cinephile slackers Franz and Arthur spend their days mimicking the antiheroes of Hollywood noirs and Westerns while pursuing the lovely Odile. The misfit trio upends convention at every turn, be it through choreographed dances in cafés or frolicsome romps through the Louvre. Eventually, their romantic view of outlaws pushes them to plan their own heist, but their inexperience may send them out in a blaze of glory -- which could be just what they want.','bw',591,8073,'tt0057869','/9oqyj79xmcypxLajJdefOtrYx64.jpg','/voWtzUp5MZTcDMVxZVeNmj4Lm8j.jpg');
INSERT INTO movies VALUES('14133','Tootsie',1982,'["USA"]','["Comedy","Romance"]',116,'When struggling, out of work actor Michael Dorsey secretly adopts a female alter ego - Dorothy Michaels - in order to land a part in a daytime drama, he unwittingly becomes a feminist icon and ends up in a romantic pickle.','col',592,9576,'tt0084805','/x9cBsqf64j8e5a8PwThT3I6sHFK.jpg','/pPMbp8hNviXiPNIEW98tDxxuzOs.jpg');
INSERT INTO movies VALUES('25870','Colossal Youth',2006,'["France","Portugal","Switzerland"]','["Drama"]',155,'After the Portuguese government demolishes his slum and relocates him to a housing project on the outskirts of Lisbon, 75-year-old Cape Verde immigrant Ventura wanders between his new and old homes, reconnecting with people from his past.','col',593,82404,'tt0460480','/41LOj8qcfMvV7DrxnPOZ6bKo4VF.jpg',NULL);
INSERT INTO movies VALUES('20425','Lord of the Rings: The Fellowship of the Ring, The',2001,'["New Zealand","USA"]','["Fantasy","Adventure"]',178,'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.','col',594,120,'tt0120737','/6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg','/x2RS3uTcsJJ9IfjNPcgDmukoEcQ.jpg');
INSERT INTO movies VALUES('17525','Jurassic Park',1993,'["USA"]','["Science Fiction","Adventure","Action"]',127,'A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.','col',595,329,'tt0107290','/oU7Oq2kFAAlGqbU4VoAE36g4hoI.jpg','/79bJL9ydAMYVltuNTt4VhxORqIz.jpg');
INSERT INTO movies VALUES('19795','D''Est',1993,'["Belgium","France","Portugal"]','["Documentary"]',107,'Scenes of life in Eastern Europe after the collapse of the Eastern Bloc.','col',596,104739,'tt0106642','/o5Qi0fiB2xteF3T1E4VK6q3l5VX.jpg','/eGzhtDCzwUlRdxsDmQSRCrzxgfv.jpg');
INSERT INTO movies VALUES('1358','Seven Chances',1925,'["USA"]','["Romance","Comedy"]',56,'Struggling stockbroker Jimmie Shannon learns that, if he gets married by 7 p.m. on his 27th birthday -- which is today -- he''ll inherit $7 million from an eccentric relative.','bw',597,32600,'tt0016332','/fH9woIxzqVtyv6S711vSVlS12eA.jpg','/lAs4jD1XzsHnU4bkJcO2U2UkUFa.jpg');
INSERT INTO movies VALUES('9059','Servant, The',1963,'["UK"]','["Drama"]',115,'Hugo Barrett is a servant in the Chelsea home of indolent aristocrat Tony. All seems to go well until the playboy’s girlfriend Susan takes a dislike to the efficient employee. Then Barrett persuades Tony to hire his sister Vera as a live-in maid, and matters take another turn for the worse…','bw',598,42987,'tt0057490','/pRa4og93BeOoMCt6oWuPCwu5Coo.jpg','/sZrOJYzzF94vZ5dYMbQghceAwk.jpg');
INSERT INTO movies VALUES('9526','Repulsion',1965,'["UK"]','["Drama","Horror","Thriller"]',105,'Beautiful young manicurist Carole suffers from androphobia (the pathological fear of interaction with men). When her sister and roommate, Helen, leaves their London flat to go on an Italian holiday with her married boyfriend, Carole withdraws into her apartment. She begins to experience frightful hallucinations, her fear gradually mutating into madness.','bw',599,11481,'tt0059646','/dtyCKEPLqv9wxyVazL4b843vtUb.jpg','/5rbPwIdEZTyLTkpAgvGdacgCr7T.jpg');
INSERT INTO movies VALUES('11398','Fellini''s Roma',1972,'["Italy"]','["Drama","Comedy"]',128,'A virtually plotless, gaudy, impressionistic portrait of Rome through the eyes of one of its most famous citizens.','col',600,11035,'tt0069191','/rqK75R3tTz2iWU0AQ6tLz3KMOU1.jpg','/egXQVgcyNPYh1eL10uTlj4JmuNh.jpg');
INSERT INTO movies VALUES('20128','Crouching Tiger, Hidden Dragon',2000,'["Taiwan","Hong Kong","USA","China"]','["Drama","Adventure","Action"]',120,'Two warriors in pursuit of a stolen sword and a notorious fugitive are led to an impetuous, physically-skilled, teenage nobleman''s daughter, who is at a crossroads in her life.','col',601,146,'tt0190332','/iNDVBFNz4XyYzM9Lwip6atSTFqf.jpg','/3fmdCISiTXmRdZMdGd6b0GemRUa.jpg');
INSERT INTO movies VALUES('8688','Hatari!',1962,'["USA"]','["Drama","Action","Adventure"]',157,'A female wildlife photographer arrives on an East African reservation where a group of men trap wild animals for zoos and circuses.','col',602,11385,'tt0056059','/fT1Ht8PSM5cFKmejrnufWvpXAPk.jpg','/fqRGoUOta2bYcAx3tyTvIbDIVzf.jpg');
INSERT INTO movies VALUES('17628','Long Day Closes, The',1992,'["UK"]','["Drama"]',83,'Bud is a lonely and quiet boy whose moments of solace occur when he sits in rapture at the local cinema, watching towering and iconic figures on the movie screen. The movies give Bud the strength to get through another day as he deals with his oppressive school environment and his burgeoning homosexuality.','col',603,49956,'tt0104753','/4cbgr67H4qV2RHqeFqlf4hMIl1Y.jpg','/vz5tQrBKspCuOQjbh2yi0ch2b0J.jpg');
INSERT INTO movies VALUES('12746','Providence',1977,'["France","Switzerland"]','["Drama"]',110,'On the eve of his 78th birthday, the ailing, alcoholic writer Clive Langham spends a painful and sleepless night mentally composing and recomposing scenes for a novel in which characters based on his own family are shaped by his fantasies and memories, alongside his caustic commentary on their behaviour.','col',604,54140,'tt0076574','/QUJfGGPg3LLIQGymrDIuAMFsV7.jpg','/kU6M85V1WSG09LrtRZc1qF4883F.jpg');
INSERT INTO movies VALUES('23433','West Indies',1979,'["France","Algeria","Mauritania"]','["Drama","Musical"]',110,'Aboard a giant slave ship in an abandoned Citroën factory, the history of the West Indies is traced through several centuries of French oppression. The ship becomes a stage for the people to tell stories via song and dance—from their enslavement to their displacement in Metropolitan France.','col',605,271858,'tt0080125','/2UjSnPwValu1k03iS01ngz0z1MS.jpg','/fxHzWHbTp6G4qjg9KKO9c0A2ig4.jpg');
INSERT INTO movies VALUES('18233','Terminator 2: Judgment Day',1991,'["USA"]','["Science Fiction","Action"]',136,'Set ten years after the events of the original, James Cameron’s classic sci-fi action flick tells the story of a second attempt to get the rid of rebellion leader John Connor, this time targeting the boy himself. However, the rebellion has sent a reprogrammed terminator to protect Connor.','col',606,280,'tt0103064','/5M0j0B18abtBI5gi2RhfjjurTqb.jpg','/8UERCtJeV1nhnZZXvdWeg8WlYhW.jpg');
INSERT INTO movies VALUES('18547','Round-Up, The',1966,'["Hungary"]','["History","Drama","War"]',90,'After the failure of the Kossuth''s revolution of 1848, people suspected of supporting the revolution are sent to prison camps. Years later, partisans led by outlaw Sándor Rózsa still run rampant. Although the authorities do not know the identities of the partisans, they round up suspects and try to root them out by any means necessary.','bw',607,94663,'tt0059776','/7dCBle7ZTLXxvXLhVP96fmyE3wA.jpg','/nzKVpW9wYxdsQZroLaOBxuQ9GoU.jpg');
INSERT INTO movies VALUES('23154','As I Was Moving Ahead Occasionally I Saw Brief Glimpses of Beauty',2000,'["USA"]','["Documentary","Biography"]',288,'A compilation of over 30 years of private home movie footage shot by Lithuanian-American avant-garde director Jonas Mekas, assembled by Mekas "purely by chance", without concern for chronological order.','col',608,130824,'tt0262240','/zOql09HNG3VQNRrCNrpJ84JCQ59.jpg','/1DBPorIH0OTQo3WooIXXvS80sGW.jpg');
INSERT INTO movies VALUES('15467','Full Metal Jacket',1987,'["USA"]','["War","Drama","Action"]',116,'A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.','col',609,600,'tt0093058','/kMKyx1k8hWWscYFnPbnxxN4Eqo4.jpg','/3k2TRmqMjgt7tcwkYwZQdctnty3.jpg');
INSERT INTO movies VALUES('20383','Amélie',2001,'["France","Germany"]','["Romance","Comedy"]',122,'At a tiny Parisian café, the adorable yet painfully shy Amélie accidentally discovers a gift for helping others. Soon Amelie is spending her days as a matchmaker, guardian angel, and all-around do-gooder. But when she bumps into a handsome stranger, will she find the courage to become the star of her very own love story?','col-bw',610,194,'tt0211915','/nSxDa3M9aMvGVLoItzWTepQ5h5d.jpg','/4tqNNLAUY525N5rKGwNQVcuGNzX.jpg');
INSERT INTO movies VALUES('11230','Devils, The',1971,'["UK"]','["History","Drama","Horror"]',109,'In 17th-century France, Father Urbain Grandier seeks to protect the city of Loudun from the corrupt establishment of Cardinal Richelieu. Hysteria occurs within the city when he is accused of witchcraft by a sexually repressed nun.','col',611,31767,'tt0066993','/y1k7eiOFc6fzm8XeTa1kNGx6JIs.jpg','/brA5IjnrSX2ElMgK1s0weiyDtrl.jpg');
INSERT INTO movies VALUES('1881','Amants du Pont-Neuf, Les',1991,'["France"]','["Drama"]',126,'Set against Paris'' oldest bridge, the Pont Neuf, while it was closed for repairs, this film is a love story between two young vagrants: Alex, a would be circus performer addicted to alcohol and sedatives and Michele, a painter driven to a life on the streets because of a failed relationship and an affliction which is slowly turning her blind.','col',612,2767,'tt0101318','/un81oln6mAv66sqnkgPSpWONUqP.jpg','/edaW476pWD9l8t77dFjmnAtWUmR.jpg');
INSERT INTO movies VALUES('17261','Forrest Gump',1994,'["USA"]','["Drama","Comedy"]',142,'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.','col',613,13,'tt0109830','/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg','/qdIMHd4sEfJSckfVJfKQvisL02a.jpg');
INSERT INTO movies VALUES('21851','Edvard Munch [TV]',1974,'["Sweden","Norway"]','["Drama","Biography"]',210,'Edvard Munch''s childhood is overshadowed by death: he suffers the loss of his sister and mother, while enduring serious illness himself, almost dying. At university, Munch discovers his talent as a painter. As he immerses himself in the art world, he becomes part of a cultural revolution lead by the likes of nihilist Hans Jæger.','col',614,50254,'tt0074462','/aXAkJld5UTIa0nijWvDm7DcyBe0.jpg','/myKJ6PaZTzK4IWE5yifXvnfMkUT.jpg');
INSERT INTO movies VALUES('170','Boudu Saved from Drowning',1932,'["France"]','["Comedy"]',87,'Michel Simon gives one of the most memorable performances in screen history as Boudu, a Parisian tramp who takes a suicidal plunge into the Seine and is rescued by a well-to-do bookseller, Edouard Lestingois. The Lestingois family decides to take in the irrepressible bum, and he shows his gratitude by shaking the household to its foundations. With Boudu Saved from Drowning, legendary director Jean Renoir takes advantage of a host of Parisian locations and the anarchic charms of his lead actor to create an effervescent satire of the bourgeoisie.','bw',615,48365,'tt0022718','/hCRUtli9TCrekxSysHJ15QhMk44.jpg','/f2xs9gITz87n72jm6b04o6SZPqr.jpg');
INSERT INTO movies VALUES('8446','Ladies Man, The',1961,'["USA"]','["Comedy"]',95,'After his girl leaves him for someone else, Herbert gets really depressed and starts searching for a job. He finally finds one in a big house which is inhabited by many, many women. Can he live in the same home with all these females?','col',616,28333,'tt0055069','/c15TotHYrXPZSzjZCBfbup3fz4V.jpg','/vH5yM2yod8DZqCk713zyWQWcKjc.jpg');
INSERT INTO movies VALUES('19788','Scorpio Rising',1963,'["USA"]','["Short","Avant","Garde","Music"]',28,'A gang of Nazi bikers prepares for a race as sexual, sadistic, and occult images are cut together.','col',617,46787,'tt0058555','/fs9QDvOzOpZCaa2rv1U57jAFfYU.jpg','/5d6liBnNjxhU2s4GnwBXF3JkeWX.jpg');
INSERT INTO movies VALUES('1876','Red Circle, The',1970,'["France","Italy"]','["Thriller","Crime"]',150,'When French criminal Corey gets released from prison, he resolves to never return. He is quickly pulled back into the underworld, however, after a chance encounter with escaped murderer Vogel. Along with former policeman and current alcoholic Jansen, they plot an intricate jewel heist. All the while, quirky Police Commissioner Mattei, who was the one to lose custody of Vogel, is determined to find him.','col',618,11657,'tt0065531','/w56La43IJnGpLepgqfGCAZsbQPp.jpg','/nfSaFuQkLqnCrwf300wM3xIY5sT.jpg');
INSERT INTO movies VALUES('8238','Shadows',1959,'["USA"]','["Drama"]',87,'The relationship between Lelia, a light-skinned black woman, and Tony, a white man is put in jeopardy when Tony meets Lelia’s darker-skinned jazz singer brother, Hugh, and discovers that her racial heritage is not what he thought it was.','bw',619,15484,'tt0053270','/zR1gHOGVruoROCdHS7Tc5TSZqED.jpg','/vBywNMAiQTNn3PxlOWslgYcwcpN.jpg');
INSERT INTO movies VALUES('11163','Deliverance',1972,'["USA"]','["Adventure","Thriller","Drama"]',109,'Intent on seeing the Cahulawassee River before it''s turned into one huge lake, outdoor fanatic Lewis Medlock takes his friends on a river-rafting trip they''ll never forget into the dangerous American back-country.','col',620,10669,'tt0068473','/2TrAzNJlHyNYYSkQf6asg3rs2Xr.jpg','/aAU15YKA5s64hKzzf12DZyH1DL4.jpg');
INSERT INTO movies VALUES('18533','My Friend Ivan Lapshin',1985,'["USSR"]','["Drama"]',100,'Russian provincial town in the middle of the 1930s Stalin''s Great Purge. Ivan Lapshin, the head of the local police, does what he has to do. And he does it well.','col-bw',621,83491,'tt0084345','/49Zsthyq7YelBRPhxMJ7rXomWSD.jpg','/9oOX4acZZhEJAliPWCDnIC44WDs.jpg');
INSERT INTO movies VALUES('11506','Pink Flamingos',1972,'["USA"]','["Comedy","Crime"]',92,'Notorious Baltimore criminal and underground figure Divine goes up against Connie & Raymond Marble, a sleazy married couple who make a passionate attempt to humiliate her and seize her tabloid-given title as "The Filthiest Person Alive".','col',622,692,'tt0069089','/71IwGRZmEds1yuD2xbaExAofoLS.jpg','/uh1zf6Q0UcHaqWQXZXu1qOOSCRg.jpg');
INSERT INTO movies VALUES('27515','Synecdoche, New York',2008,'["USA"]','["Drama"]',124,'A theater director struggles with his work, and the women in his life, as he attempts to create a life-size replica of New York inside a warehouse as part of his new play.','col',623,4960,'tt0383028','/ZLNHDNSnBzQlCEjHMsQ7mJU0sX.jpg','/z49xfB5s3A7G8vnXDfzFWJup046.jpg');
INSERT INTO movies VALUES('9275','Loves of a Blonde',1965,'["Czechoslovakia"]','["Drama","Comedy"]',88,'Andula, an innocent Czech girl from a factory town, is desperately in search of love. She believes she''s found it when she beds Milda, a charming young musician visiting from Prague. Milda, however, is only looking for a casual encounter, and leaves town assuming he''ll never see Andula again. But when Andula doesn''t hear from him, she packs up and heads to Prague, to the surprise of Milda and his parents.','bw',624,39387,'tt0059415','/fyRg6Qh4oN1KRfkx8Q3DFzA642P.jpg','/jGwZRoK9wRJyufcx9qIQnsTxoyu.jpg');
INSERT INTO movies VALUES('25084','Zodiac',2007,'["USA"]','["Crime","Drama","Thriller"]',158,'A cartoonist teams up with an ace reporter and a law enforcement officer to track down an elusive serial killer.','col',625,1949,'tt0443706','/6YmeO4pB7XTh8P8F960O1uA14JO.jpg','/cYU5msaAPbHRZ3Qm4Y36Fz8wkqX.jpg');
INSERT INTO movies VALUES('10078','Portrait of Jason',1967,'["USA"]','["Documentary","Biography"]',105,'Interview with Jason Holliday aka Aaron Payne. House-boy, would-be cabaret performer, and self-proclaimed hustler giving one man''s gin-soaked, pill-popped view of what it was like to be coloured and gay in 1960s Unites States.  Preserved by the Academy Film Archive in 2013.','bw',626,83232,'tt0062144','/12nFoie5pN3hH8kPBKQcYOtS8MX.jpg','/zfP4WCWXtepBQjj5wvcfZAdp19X.jpg');
INSERT INTO movies VALUES('23500','Symbiopsychotaxiplasm: Take One',1968,'["USA"]','["Documentary"]',75,'In Manhattan''s Central Park, a film crew directed by William Greaves is shooting a screen test with various pairs of actors. It''s a confrontation between a couple: he demands to know what''s wrong, she challenges his sexual orientation. Cameras shoot the exchange, and another camera records Greaves and his crew. Sometimes we watch the crew discussing this scene, its language, and the process of making a movie. Is there such a thing as natural language? Are all things related to sex? The camera records distractions - a woman rides horseback past them; a garrulous homeless vet who sleeps in the park chats them up. What''s the nature of making a movie?','col-bw',627,44783,'tt0296881','/wMRtQ3A4pOmG2dXKOxx9tTerFi6.jpg','/uYo84MtnPcECYvmNUtEBv2wUrE0.jpg');
INSERT INTO movies VALUES('11873','Wicker Man, The',1973,'["UK"]','["Mystery","Horror"]',103,'Police sergeant Neil Howie is called to an island village in search of a missing girl whom the locals claim never existed. Stranger still, however, are the rituals that take place there.','col',628,16307,'tt0070917','/wwtrXRL8SiOWxhwLEvw7iBgYh0g.jpg','/hfAChqTPPEOkvP6YDdFMaZFLZUg.jpg');
INSERT INTO movies VALUES('18686','Harakiri',1962,'["Japan"]','["Drama","Action","History"]',133,'Down-on-his-luck veteran Tsugumo Hanshirō enters the courtyard of the prosperous House of Iyi. Unemployed, and with no family, he hopes to find a place to commit seppuku—and a worthy second to deliver the coup de grâce in his suicide ritual. The senior counselor for the Iyi clan questions the ronin’s resolve and integrity, suspecting Hanshirō of seeking charity rather than an honorable end. What follows is a pair of interlocking stories which lay bare the difference between honor and respect, and promises to examine the legendary foundations of the Samurai code.','bw',629,14537,'tt0056058','/5konZnIbcAxZjP616Cz5o9bKEfW.jpg','/nC3IjYhUgZWgfKfFX0ygMigFwgc.jpg');
INSERT INTO movies VALUES('12586','3 Women',1977,'["USA"]','["Drama"]',125,'Two co-workers, one a vain woman and the other an awkward teenager, share an increasingly bizarre relationship after becoming roommates.','col',630,41662,'tt0075612','/uL5Yg8MEgHGXymTaJBYXn9g0xsH.jpg','/pTmMEIW2cyOkcSRkWTCDEbd5if0.jpg');
INSERT INTO movies VALUES('9158','Alphaville',1965,'["France"]','["Science Fiction","Mystery","Drama"]',95,'An American private-eye arrives in Alphaville, a futuristic city on another planet which is ruled by an evil scientist named Von Braun, who has outlawed love and self-expression.','bw',631,8072,'tt0058898','/fFJP3D5fJDFxN7ChqSye1DZ0fTL.jpg','/iOUhnp01rP9Xr5QG66LMAKSDkYv.jpg');
INSERT INTO movies VALUES('5382','Golden Coach, The',1952,'["Italy","France"]','["Drama","Comedy","Romance"]',100,'A viceroy, a nobleman and a bullfighter court a comedy-troupe actress in 18th-century Peru.','col',632,56167,'tt0044487','/cDlxLnLMboEfdDcPelodOs71GVs.jpg','/sCFbxavogjcE6xTnT71nZxTV5ia.jpg');
INSERT INTO movies VALUES('4644','Asphalt Jungle, The',1950,'["USA"]','["Thriller","Crime"]',112,'Recently paroled from prison, legendary burglar "Doc" Riedenschneider, with funding from Alonzo Emmerich, a crooked lawyer, gathers a small group of veteran criminals together in the Midwest for a big jewel heist.','bw',633,16958,'tt0042208','/gECEOjjLjuHi9DDHeDLj28SXLHE.jpg','/gnu0rtxbrmhgjob4TXvIH8DHxB9.jpg');
INSERT INTO movies VALUES('9969','Don''t Look Back',1967,'["USA"]','["Documentary","Music"]',96,'In this wildly entertaining vision of one of the twentieth century’s greatest artists, Bob Dylan is surrounded by teen fans, gets into heated philosophical jousts with journalists, and kicks back with fellow musicians Joan Baez, Donovan, and Alan Price.','bw',634,135,'tt0061589','/faUMi5nkUw8zPojjOHpKKzEyiyS.jpg','/5dJ8t6CljwZ1NUXwW1nsmEpMf8x.jpg');
INSERT INTO movies VALUES('10287','Hour of the Wolf',1968,'["Sweden"]','["Horror","Drama"]',88,'While vacationing on a remote German island with his pregnant wife, an artist has an emotional breakdown while confronting his repressed desires.','bw',635,18333,'tt0063759','/jSqTnEP1x1OcOglqrInYvGSF1tL.jpg','/cQUL28jjk7ILCx4i8WGjgooQLfx.jpg');
INSERT INTO movies VALUES('11790','Pat Garrett and Billy the Kid',1973,'["USA"]','["Western"]',122,'Pat Garrett is hired as a lawman on behalf of a group of wealthy New Mexico cattle barons to bring down his old friend Billy the Kid.','col',636,11577,'tt0070518','/vRDvPypWsjGs7spo7G5bz1cSacC.jpg','/mEEJC1tHmxJZ49L0Gc7jsFlvQXJ.jpg');
INSERT INTO movies VALUES('19089','Hana-bi',1997,'["Japan"]','["Drama","Crime"]',103,'Detective Nishi is relieved from a stakeout to visit his sick wife in hospital. He is informed that she is terminally ill, and is advised to take her home. During his visit, a suspect shoots one detective dead and leaves Nishi''s partner, Horibe, paralyzed. Nishi leaves the police force to spend time with his wife at home, and must find a way to pay off his debts to the yakuza.','col',637,5910,'tt0119250','/bWIo1nDJnSyGJvVt8bRw8PHBqo4.jpg','/vO8lMKIBbPH7B48XCkmrhqDs9ad.jpg');
INSERT INTO movies VALUES('429','Dr. Mabuse, the Gambler',1922,'["Germany"]','["Thriller","Mystery","Crime"]',270,'Dr. Mabuse and his organization of criminals are in the process of completing their latest scheme, a theft of information that will allow Mabuse to make huge profits on the stock exchange. Afterwards, Mabuse disguises himself and attends the Folies Bergères show, where Cara Carozza, the main attraction of the show, passes him information on Mabuse''s next intended victim, the young millionaire Edgar Hull. Mabuse then uses psychic manipulation to lure Hull into a card game where he loses heavily. When Police Commissioner von Wenk begins an investigation of this mysterious crime spree, he has little to go on, and he needs to find someone who can help him.','bw',638,5998,'tt0013086','/ysHJDo9do2USU1BhWxcT0WO9WTO.jpg','/oWWPGLmIgQ3pyXNwOOkdGpjXX61.jpg');
INSERT INTO movies VALUES('17403','Hoop Dreams',1994,'["USA"]','["Documentary","Drama","Sport"]',170,'Every school day, African-American teenagers William Gates and Arthur Agee travel 90 minutes each way from inner-city Chicago to St. Joseph High School in Westchester, Illinois, a predominately white suburban school well-known for the excellence of its basketball program. Gates and Agee dream of NBA stardom, and with the support of their close-knit families, they battle the social and physical obstacles that stand in their way. This acclaimed documentary was shot over the course of five years.','col',639,14275,'tt0110057','/7qHwh3mFJs7ldwzGSWsBLmgecfj.jpg','/dLZ6XJP5VpeifymHkobzT5s5s1L.jpg');
INSERT INTO movies VALUES('17785','My Own Private Idaho',1991,'["USA"]','["Drama"]',102,'In this loose adaptation of Shakespeare''s "Henry IV," Mike Waters is a hustler afflicted with narcolepsy. Scott Favor is the rebellious son of a mayor. Together, the two travel from Portland, Oregon to Idaho and finally to the coast of Italy in a quest to find Mike''s estranged mother. Along the way they turn tricks for money and drugs, eventually attracting the attention of a wealthy benefactor and sexual deviant.','col',640,468,'tt0102494','/hiFGxsq7Mzss536Rc1cahaNWCJe.jpg','/cb1EitFMhoxCSw1065vXWWSh06C.jpg');
INSERT INTO movies VALUES('12532','Rocky',1976,'["USA"]','["Sport","Drama"]',119,'An uneducated collector for a Philadelphia loan shark is given a once-in-a-lifetime opportunity to fight against the world heavyweight boxing champion.','col',641,1366,'tt0075148','/cqxg1CihGR5ge0i1wYXr4Rdeppu.jpg','/yPgAHVzCF0yJGhxupwVwknOHdJj.jpg');
INSERT INTO movies VALUES('4604','They Live by Night',1948,'["USA"]','["Drama","Crime"]',95,'An escaped convict, injured during a robbery, falls in love with the woman who nurses him back to health, but their relationship seems doomed from the beginning.','bw',642,44190,'tt0040872','/9EI0n0ESp1DZJd7PI7LENk9PO2e.jpg','/qqFBAnhQh9to2zg2GmP3oBUvJk4.jpg');
INSERT INTO movies VALUES('11058','Walkabout',1971,'["UK","Australia"]','["Drama","Adventure"]',100,'Under the pretense of having a picnic, a geologist takes his teenage daughter and 6-year-old son into the Australian outback and attempts to shoot them. When he fails, he turns the gun on himself, and the two city-bred children must contend with harsh wilderness alone. They are saved by a chance encounter with an Aboriginal boy who shows them how to survive, and in the process underscores the disharmony between nature and modern life.','col',643,36040,'tt0067959','/24vooYt5StgtgcQObVr1GHuM5gy.jpg','/nVwpCNwMsg7WZSOlw6IJOamv99r.jpg');
INSERT INTO movies VALUES('2314','Rebecca',1940,'["USA"]','["Mystery","Romance","Drama"]',130,'Story of a young woman who marries a fascinating widower only to find out that she must live in the shadow of his former wife, Rebecca, who died mysteriously several years earlier. The young wife must come to grips with the terrible secret of her handsome, cold husband, Max De Winter. She must also deal with the jealous, obsessed Mrs. Danvers, the housekeeper, who will not accept her as the mistress of the house.','bw',644,223,'tt0032976','/1qz3qUOHnVy7dL7M7G8jSErxE4b.jpg','/jKgLVAhoq4fXBs1C9Gjvap93fxd.jpg');
INSERT INTO movies VALUES('11911','Bring Me the Head of Alfredo Garcia',1974,'["USA"]','["Crime","Thriller","Action"]',112,'An American bartender and his prostitute girlfriend go on a road trip through the Mexican underworld to collect a $1 million bounty on the head of a dead gigolo.','col',645,11942,'tt0071249','/gRWVf3InNlIlFT3WB9MnFdOwcYQ.jpg','/uGNsUtgq0chPio3Tk0htDQu6DyP.jpg');
INSERT INTO movies VALUES('533','Frankenstein',1931,'["USA"]','["Horror","Science Fiction"]',70,'Tampering with life and death, Henry Frankenstein pieces together salvaged body parts to bring a human monster to life; the mad scientist''s dreams are shattered by his creation''s violent rage as the monster awakens to a world in which he is unwelcome.','bw',646,3035,'tt0021884','/mu6wHwH0IwCCaEYtpqujuPJYat1.jpg','/wFbPbJ9uRDpjY7micBTeolgkOA4.jpg');
INSERT INTO movies VALUES('5339','Casque d''or',1952,'["France"]','["Romance","Drama","Crime"]',96,'At the end of the 19th century, during a ball in Joinville, on the outskirts of Paris, Georges, a former delinquent working as a carpenter, meets Marie, a young woman connected to a criminal gang.','bw',647,68822,'tt0043386','/23uTiM237axFYSgbEtTh2IDrPNS.jpg','/kpqwEMYwvD1EeeJz9gkm6QJORfr.jpg');
INSERT INTO movies VALUES('18747','Titanic',1997,'["USA","Mexico"]','["Romance","Drama","History"]',194,'101-year-old Rose DeWitt Bukater tells the story of her life aboard the Titanic, 84 years later. A young Rose boards the ship with her mother and fiancé. Meanwhile, Jack Dawson and Fabrizio De Rossi win third-class tickets aboard the ship. Rose tells the whole story from Titanic''s departure through to its death—on its first and last voyage—on April 15, 1912.','col',648,597,'tt0120338','/9xjZS2rlVxm8SFx8kPC3aIGCOYQ.jpg','/sCzcYW9h55WcesOqA12cgEr9Exw.jpg');
INSERT INTO movies VALUES('1623','Top Hat',1935,'["USA"]','["Romance","Musical","Comedy"]',99,'Showman Jerry Travers is working for producer Horace Hardwick in London. Jerry demonstrates his new dance steps late one night in Horace''s hotel room, much to the annoyance of sleeping Dale Tremont below. She goes upstairs to complain and the two are immediately attracted to each other. Complications arise when Dale mistakes Jerry for Horace.','bw',649,3080,'tt0027125','/qoPBiN6PBs2NsP7BNOJGCnmwruG.jpg','/tnPgH5j3rPRajvF1iUqLH9WgWqz.jpg');
INSERT INTO movies VALUES('18553','Xala',1975,'["Senegal"]','["Comedy","Drama"]',123,'It is the dawn of Senegal''s independence from France, but as the citizens celebrate in the streets we soon become aware that only the faces have changed. White money still controls the government. One official, Aboucader Beye, known by the title "El Hadji," takes advantage of some of that money to marry his third wife, to the sorrow and chagrin of his first two wives and the resentment of his nationalist daughter. But he discovers on his wedding night that he has been struck with a "xala," a curse of impotence. El Hadji goes to comic lengths to find the cause and remove the xala, resulting in a scathing satirical ending.','col',650,76636,'tt0073915','/fe1smaFlapnToGUTwfT53MtQyah.jpg','/apnjwQu4VLaswamc0EeyQicuCMk.jpg');
INSERT INTO movies VALUES('5751','Vitelloni, I',1953,'["Italy"]','["Drama"]',104,'Five young men dream of success as they drift lazily through life in a small Italian village. Fausto, the group''s leader, is a womanizer; Riccardo craves fame; Alberto is a hopeless dreamer; Moraldo fantasizes about life in the city; and Leopoldo is an aspiring playwright. As Fausto chases a string of women, to the horror of his pregnant wife, the other four blunder their way from one uneventful experience to the next.','bw',651,12548,'tt0046521','/mkb9Y5D4bo1bELq2JtomvmZ64XU.jpg','/i83GOMrYKgt88LfTl0CzSHivWk.jpg');
INSERT INTO movies VALUES('26965','Dark Knight, The',2008,'["USA","UK"]','["Action","Crime","Thriller"]',152,'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.','col',652,155,'tt0468569','/qJ2tW6WMUDux911r6m7haRef0WH.jpg','/nMKdUUepR0i5zn0y1T4CsSB5chy.jpg');
INSERT INTO movies VALUES('15121','Down by Law',1986,'["USA"]','["Comedy"]',107,'A disc jockey, a pimp and an Italian tourist escape from jail in New Orleans.','bw',653,1554,'tt0090967','/4IyxoUQ7BB5kcSd7gASe2dTyWu7.jpg','/8kVPLOzuZ1G9EBYxcOrzaHbxCeC.jpg');
INSERT INTO movies VALUES('1500','Strike',1925,'["USSR"]','["Drama","Political","History"]',82,'Workers in a factory in pre-revolutionary Russia go on strike and are met by violent suppression.','bw',654,44967,'tt0015361','/mrDTaMxQKxWZ3uEs2G58vJWJDDL.jpg','/bMvuciIEQKzgz0Xt7cwm2oR3nVR.jpg');
INSERT INTO movies VALUES('18850','Watermelon Woman, The',1996,'["USA"]','["Comedy","Drama","Romance"]',90,'A young black lesbian filmmaker probes into the life of The Watermelon Woman, a 1930s black actress who played ''mammy'' archetypes.','col',655,44479,'tt0118125','/uZRCGzs5y5nPxvY52XkQFXmQVBY.jpg','/tMlLu6JOV2qmDfufbqSHIRVqzfG.jpg');
INSERT INTO movies VALUES('20578','Royal Tenenbaums, The',2001,'["USA"]','["Drama","Comedy"]',109,'Royal Tenenbaum and his wife Etheline had three children and then they separated. All three children are extraordinary --- all geniuses. Virtually all memory of the brilliance of the young Tenenbaums was subsequently erased by two decades of betrayal, failure, and disaster. Most of this was generally considered to be their father''s fault. "The Royal Tenenbaums" is the story of the family''s sudden, unexpected reunion one recent winter.','col',656,9428,'tt0265666','/3z2ZIhxcNmL0MhjtGCHRThn1WOi.jpg','/g2s22rGjCTCYsjI1iAflem7HjdG.jpg');
INSERT INTO movies VALUES('8000','Virgin Spring, The',1960,'["Sweden"]','["Drama"]',88,'Devout Christians Töre and Märeta send their only daughter, the virginal Karin, and their foster daughter, the unrepentant Ingeri, to deliver candles to a distant church. On their way through the woods, the girls encounter a group of savage goat herders who brutally rape and murder Karin as Ingeri remains hidden. When the killers unwittingly seek refuge in the farmhouse of Töre and Märeta, Töre plots a fitting revenge.','bw',657,11656,'tt0053976','/z70YM3Y4pNYZATMhFMKonngaeMC.jpg','/pcBIabUibUmpOBggWckkjohXtiP.jpg');
INSERT INTO movies VALUES('23278','Millennium Mambo',2001,'["Taiwan","France"]','["Drama","Romance"]',119,'The youthful Vicky is torn between two men, Hao-Hao and Jack. At night she works as a PR person at a night club to support both of them. Hao-Hao keeps vigilance over her all the time, no matter she is on or off the job. He checks her charge accounts, telephone bills, mobile phone records, and even her body odor in an attempt to trace Vicky’s activities. She cannot stand him any longer; she runs away.','col',658,11553,'tt0283283','/zaPDSAlrGKV4Bgz6vvkZxPZrrxD.jpg','/uwjLjqejN7BaVGjlOk7vFWTe2Fi.jpg');
INSERT INTO movies VALUES('1336','Scarface',1932,'["USA"]','["Crime","Drama"]',93,'In 1920s Chicago, Italian immigrant and notorious thug, Antonio "Tony" Camonte, shoots his way to the top of the mobs while trying to protect his sister from the criminal life.','bw',659,877,'tt0023427','/y4E5oRiHMTFkEB12IIcpbKbKzDW.jpg','/fX1DFPMZYsRG17BmMPJAKUaBZEz.jpg');
INSERT INTO movies VALUES('32991','Amour',2012,'["Austria","France","Germany"]','["Romance","Drama"]',127,'Georges and Anne are in their eighties. They are cultivated, retired music teachers. Their daughter, who is also a musician, lives abroad with her family. One day, Anne has a stroke, and the couple''s bond of love is severely tested.','col',660,86837,'tt1602620','/lRWvyGCmQzDT0ff5sOY0MWKRP6i.jpg','/w7Z4BVMin49voNN61IUWyN9DopV.jpg');
INSERT INTO movies VALUES('2651','Bambi',1942,'["USA"]','["Family","Animated","Drama"]',69,'Bambi''s tale unfolds from season to season as the young prince of the forest learns about life, love, and friends.','col',661,3170,'tt0034492','/wV9e2y4myJ4KMFsyFfWYcUOawyK.jpg','/1ZKHzSGJm0kvlCp4echAOtKnDTm.jpg');
INSERT INTO movies VALUES('15733','Akira',1988,'["Japan"]','["Animated","Science Fiction","Action"]',124,'A secret military project endangers Neo-Tokyo when it turns a biker gang member into a rampaging psychic psychopath that only two teenagers and a group of psychics can stop.','col',662,149,'tt0094625','/neZ0ykEsPqxamsX6o5QNUFILQrz.jpg','/fK40VGYIm7hmKrLJ26fgPQU0qRG.jpg');
INSERT INTO movies VALUES('11395','Fat City',1972,'["USA"]','["Drama","Sport"]',96,'Two men, working as professional boxers, come to blows when their careers each begin to take opposite momentum.','col',663,16993,'tt0068575','/7ag7BOMnAuDKwNyI0wc8jTeimRb.jpg','/fHKyWtxGIDQ21JcL7Le6rmX36Q1.jpg');
INSERT INTO movies VALUES('820','Lady Vanishes, The',1938,'["UK"]','["Spy","Mystery","Thriller"]',97,'On a train headed for England a group of travelers is delayed by an avalanche. Holed up in a hotel in a fictional European country, young Iris befriends elderly Miss Froy. When the train resumes, Iris suffers a bout of unconsciousness and wakes to find the old woman has disappeared. The other passengers ominously deny Miss Froy ever existed, so Iris begins to investigate with another traveler and, as the pair sleuth, romantic sparks fly.','bw',664,940,'tt0030341','/c1t9LB76LvEARPanfEzXmkm7fwY.jpg','/exVKV32K0wGNXRL5kpqSfGs4InV.jpg');
INSERT INTO movies VALUES('12938','Marriage of Maria Braun, The',1979,'["West Germany"]','["War","Drama"]',120,'Maria marries a young soldier in the last days of World War II, only for him to go missing in the war. She must rely on her beauty and ambition to navigate the difficult post-war years alone.','col',665,661,'tt0079095','/tXjZEzlf4WQwZ4Dt53gXeJVuO7p.jpg','/1m6HgWcERz3vUcNZ1FojA2q7Yiv.jpg');
INSERT INTO movies VALUES('18621','Posto, Il',1961,'["Italy"]','["Drama"]',93,'With his family mired in financial troubles, Domenico moves to Milan, Italy, from his small town to get a job in lieu of furthering his education. A lack of options forces him to take a position as a messenger at a big company, where he hopes to receive a promotion soon. There, Domenico meets Antonietta, a young woman in a similar situation as himself. The two form a tentative relationship, but the soulless nature of their jobs threatens to keep them apart.','bw',666,31742,'tt0055320','/xbAOC6mza20u2fHAVCkDn8xXluO.jpg','/dwXW7OBbkXjsVdavPHqoPf1eFo6.jpg');
INSERT INTO movies VALUES('3921','Ghost and Mrs. Muir, The',1947,'["USA"]','["Romance","Fantasy"]',104,'A young British widow rents a seaside cottage and soon becomes haunted by the ghost of its former owner.','bw',667,22292,'tt0039420','/idoD3cwfwj86BPvVoWVgWhnT2xq.jpg','/2km4LO6IRqBCcLBLSb9sgJq1hTd.jpg');
INSERT INTO movies VALUES('26555','Silent Light',2007,'["Mexico","France","Netherlands"]','["Drama"]',136,'Johan and his family are Mennonites from the north of Mexico. Against the law of God and Man, Johan falls in love with another woman.','col',668,2012,'tt0841925','/cIcpxWfq8toIQZUjagiyvruQrb6.jpg','/gdQCvXF7TpBez8F4Ud6Chw94oJ3.jpg');
INSERT INTO movies VALUES('25592','Plácido',1961,'["Spain"]','["Comedy"]',85,'In a small Spanish town, during the Christmas holidays, a group of rich old ladies organize a peculiar event that consists of inviting a homeless person to sit down to dinner at their wealthy table. Plácido, a humble worker, is hired by the organizers to participate in a parade with his three-wheeled vehicle, a seemingly simple mission that will not be easy for him to accomplish.','bw',669,51317,'tt0055310','/nbJh87YiPdxUgvZfNDpEbE0bCc9.jpg','/oZNevLcjER0NVhaAxfzLpWijti6.jpg');
INSERT INTO movies VALUES('8743','Manchurian Candidate, The',1962,'["USA"]','["Political","Thriller","Drama"]',126,'Near the end of the Korean War, a platoon of U.S. soldiers is captured by communists and brainwashed. Following the war, the platoon is returned home, and Sergeant Raymond Shaw is lauded as a hero by the rest of his platoon. However, the platoon commander, Captain Bennett Marco, finds himself plagued by strange nightmares and soon races to uncover a terrible plot.','bw',670,982,'tt0056218','/2xQ856kd9hw6bB3OnusGyTvvkwB.jpg','/7dX07NQv4p6kfzSkA9rf9LvlvVD.jpg');
INSERT INTO movies VALUES('7592','Nazarín',1958,'["Mexico"]','["Religious","Drama"]',94,'After hiding a murderer, a Catholic priest is forced into self-exile and decides to embark on a pilgrimage through the Mexican countryside.','bw',671,35124,'tt0051983','/7W2hnPt4glMnaxJU33wAjKyf7lc.jpg','/aDVlKMwtt229wweLslbgkvaHrth.jpg');
INSERT INTO movies VALUES('25596','Arrebato',1979,'["Spain"]','["Drama","Horror"]',105,'José Sirgado is a low-budget filmmaker whose heroin addiction distorts his perspective of the real world. Although he is a depressed and unstable individual, his mood improves when he receives the mysterious films of Pedro, with whom he shares his passion for cinema.','col',672,4494,'tt0078797','/rJlEhLIVsQHPi2uVM26VK0in9hG.jpg','/i9aUSqk1eaxFYfBvsRm3G6kBCnv.jpg');
INSERT INTO movies VALUES('22934','Intruder, The',2004,'["France","South Korea"]','["Drama"]',130,'An emotionally cold man leaves the safety of his Alpine home to seek a heart transplant and an estranged son.','col',673,47143,'tt0422491','/cZIrhKSEbPfK1s3YEom9cjjEiA5.jpg','/7wDjGVCKHJLEwj53gxESNs9xG6H.jpg');
INSERT INTO movies VALUES('10950','Sorrow and the Pity, The',1969,'["France","Switzerland","Germany"]','["Documentary","War","History"]',260,'An investigation into the nature, details and reasons for the collaboration between France’s Vichy government and Nazi Germany from 1940 to 1944.','bw',674,42611,'tt0066904','/eJRN6vh4hwBEITSfhNQZwVM7MDa.jpg','/cnFUiQSr2lOYuLlTtZ1bWrFQpDg.jpg');
INSERT INTO movies VALUES('1077','Navigator, The',1924,'["USA"]','["Comedy","Adventure"]',59,'The wealthy and impulsive Rollo Treadway decides to propose to his beautiful socialite neighbor, Betsy O''Brien. Although Betsy turns Rollo down, he still opts to go on the cruise that he intended as their honeymoon. When circumstances find both Rollo and Betsy on the wrong ship, they end up having adventures on the high seas.','bw',675,32318,'tt0015163','/eFIbnDnBnIi1qnz15UUiMFmjRmL.jpg','/qqybzi8MPIJxg2bSXzkkg5pEIhe.jpg');
INSERT INTO movies VALUES('17210','Farewell, My Concubine',1993,'["China","Hong Kong"]','["History","Drama","Romance"]',155,'Abandoned by his prostitute mother in 1920, Douzi was raised by a theater troupe. There he meets Shitou and over the following years the two develop an act entitled "Farewell My Concubine" that brings them fame and fortune. When Shitou marries Juxian, Douzi becomes jealous, the beginnings of the acting duo''s explosive breakup and tragic fall take root.','col',676,10997,'tt0106332','/ySf9I93w6kJiaEb2T4zpoQjY8PR.jpg','/bBiZN1epQTu3F8iFLBuMhc4TRzr.jpg');
INSERT INTO movies VALUES('21567','Hyènes',1992,'["Senegal","France","Switzerland","UK","Netherlands","Italy"]','["Drama","Comedy"]',110,'A now-rich woman returns to her poor desert hometown to propose a deal to the populace: her fortune, in exchange for the death of the man who years earlier abandoned her and left her with his child.','col',677,124085,'tt0104467','/or2P5W4SHTOYS40F2LifY8wm1e4.jpg','/y7iCuZZ8pD3u30lSpC5LkFTf8am.jpg');
INSERT INTO movies VALUES('19680','Ratcatcher',1999,'["UK","France"]','["Drama"]',94,'James Gillespie is 12 years old. The world he knew is changing. Haunted by a secret, he has become a stranger in his own family. He is drawn to the canal where he creates a world of his own. He finds an awkward tenderness with Margaret Anne, a vulnerable 14 year old expressing a need for love in all the wrong ways, and befriends Kenny, who possesses an unusual innocence in spite of the harsh surroundings.','col',678,29698,'tt0171685','/hWIkNQAjJEnkiRQISmT3OrgsYg.jpg','/qKOw1VRjt9wCyCJvbJ75mQNbos0.jpg');
INSERT INTO movies VALUES('2040','Mr. Smith Goes to Washington',1939,'["USA"]','["Political","Drama"]',129,'Naive and idealistic Jefferson Smith, leader of the Boy Rangers, is appointed to the United States Senate by the puppet governor of his state. He soon discovers, upon going to Washington, many shortcomings of the political process as his earnest goal of a national boys'' camp leads to a conflict with the state political boss.','bw',679,3083,'tt0031679','/nDjg1fbNyq15excNDl3acd2IqAk.jpg','/4HagjGPF6dMGYlmx7mEfjLV2kQ0.jpg');
INSERT INTO movies VALUES('11073','W.R.: Mysteries of the Organism',1971,'["Yugoslavia"]','["Drama","Comedy","Fantasy"]',84,'What does the energy harnessed through orgasm have to do with the state of communist Yugoslavia circa 1971? Only counterculture filmmaker extraordinaire Dušan Makavejev has the answers (or the questions). His surreal documentary-fiction collision WR: Mysteries of the Organism begins as an investigation into the life and work of controversial psychologist and philosopher Wilhelm Reich and then explodes into a free-form narrative of a beautiful young Slavic girl’s sexual liberation.','col',680,42529,'tt0067958','/gbyyHQhQSDH7PsIu1gLdpRek091.jpg','/r2Xx2cCOjB2aRnyQCfYKgWuJ8pl.jpg');
INSERT INTO movies VALUES('18295','Trainspotting',1996,'["UK"]','["Drama","Comedy"]',95,'Heroin addict Mark Renton stumbles through bad ideas and sobriety attempts with his unreliable friends -- Sick Boy, Begbie, Spud and Tommy. He also has an underage girlfriend, Diane, along for the ride. After cleaning up and moving from Edinburgh to London, Mark finds he can''t escape the life he left behind when Begbie shows up at his front door on the lam, and a scheming Sick Boy follows.','col',681,627,'tt0117951','/y0HmDV0bZDTtXWHqqYYbT9XoshB.jpg','/e9GbzPawXDFvLwSseCXpHkbCyAP.jpg');
INSERT INTO movies VALUES('8068','Chronicle of a Summer',1961,'["France"]','["Documentary"]',85,'Paris, summer 1960. Anthropologist and filmmaker Jean Rouch and sociologist and film critic Edgar Morin wander through the crowded streets asking passersby how they cope with life''s misfortunes.','bw',682,84972,'tt0054745','/cKsFs0FUJBy4b8ihPpaeyRl2SJs.jpg','/bolMHmAoPcY9CQ9IMpJPLSr4azQ.jpg');
INSERT INTO movies VALUES('9626','7 Women',1965,'["USA"]','["History","Drama"]',87,'In a mission in China in 1935, a group of women are preyed on by Mongolian bandits, led by Warlord chief Tunga Khan.','col',683,68692,'tt0060050','/cD4SUHUBDpJgFc63UjANsy1cPhl.jpg','/wXZ1B8eCiEWeQ8nlGnKgc2NwvrW.jpg');
INSERT INTO movies VALUES('14282','Local Hero',1983,'["UK"]','["Drama","Comedy"]',111,'An American oil company sends a man to Scotland to buy up an entire village where they want to build a refinery. But things don''t go as expected.','col',684,11235,'tt0085859','/sjT9330olLYuhTSacs4yHbOtRAy.jpg','/tfiFC0pw1ccJFBkYkhP9uWeQ1S1.jpg');
INSERT INTO movies VALUES('16690','Wild at Heart',1990,'["USA"]','["Romance","Drama","Crime"]',127,'After serving prison time for a self-defense killing, Sailor Ripley reunites with girlfriend Lula Fortune. Lula''s mother, Marietta, desperate to keep them apart, hires a hitman to kill Sailor. But he finds a whole new set of troubles when he and Bobby Peru, an old buddy who''s also out to get Sailor, try to rob a store. When Sailor lands in jail yet again, the young lovers appear further than ever from the shared life they covet.','col',685,483,'tt0100935','/uLUFI5sJIfWrBUWB2Y1dEuyvvVy.jpg','/gy4RzOcJsRpJXOnZ7bWJEbE9UZ2.jpg');
INSERT INTO movies VALUES('10819','Gimme Shelter',1970,'["USA"]','["Documentary","Musical","History"]',91,'A detailed chronicle of the famous 1969 tour of the United States by the British rock band The Rolling Stones, which culminated with the disastrous and tragic concert held on December 6 at the Altamont Speedway Free Festival, an event of historical significance, as it marked the end of an era: the generation of peace and love suddenly became the generation of disillusionment.','col',686,132,'tt0065780','/fFLKCqI7nfkie9V1LmBLljiNV4j.jpg','/1UZn5MA63PjaVCf470o0fz5nrbv.jpg');
INSERT INTO movies VALUES('19393','Rushmore',1998,'["USA"]','["Comedy"]',93,'When a beautiful first-grade teacher arrives at a prep school, she soon attracts the attention of an ambitious teenager named Max, who quickly falls in love with her. Max turns to the father of two of his schoolmates for advice on how to woo the teacher. However, the situation soon gets complicated when Max''s new friend becomes involved with her, setting the two pals against one another in a war for her attention.','col',687,11545,'tt0128445','/dfSdVJRvye1npQYCHMD9hKfYhhy.jpg','/yHlFaLTQi5MB2nI2z5F5rlHhUN.jpg');
INSERT INTO movies VALUES('10361','Party, The',1968,'["USA"]','["Comedy"]',99,'Hrundi V. Bakshi, an accident-prone actor from India, is accidentally put on the guest list for an upcoming party at the home of a Hollywood film producer. Unfortunately, from the moment he arrives, one thing after another goes wrong with compounding effect.','col',688,10794,'tt0063415','/pC6FB4fLIVRCpMzIbUf1xOVobmz.jpg','/a4nl1hr0Vqjw5rApJjzuJ71SmQv.jpg');
INSERT INTO movies VALUES('23093','Cure',1997,'["Japan"]','["Crime","Mystery","Horror"]',111,'A wave of gruesome murders is sweeping Tokyo. The only connection is a bloody X carved into the neck of each of the victims. In each case, the murderer is found near the victim and remembers nothing of the crime. Detective Takabe and psychologist Sakuma are called in to figure out the connection, but their investigation goes nowhere...','col',689,36095,'tt0123948','/nLZ2AJFLtMoAAAD54mbT4exj1Wp.jpg','/74ws1jjgawIl7Kwi6FCH8E4SjDd.jpg');
INSERT INTO movies VALUES('16604','Nouvelle vague',1990,'["France","Switzerland"]','["Drama"]',90,'Composed entirely of literary quotations from many different sources and from several historical periods, the loose narrative concerns a drifter found by a rich woman who soon falls in love with him. A drowning accident takes place and the drifter dies, but some time later he reappears in the woman’s life looking for a job. Or could it be the man’s twin brother?','col',690,32691,'tt0100274','/v93sqnqHsDu3tvkDYOcAYUOJKtQ.jpg','/tkvePoq5eWC426u3XmOR4J1V4b5.jpg');
INSERT INTO movies VALUES('15621','Robocop',1987,'["USA"]','["Science Fiction","Crime","Action"]',102,'In a violent, near-apocalyptic Detroit, evil corporation Omni Consumer Products wins a contract from the city government to privatize the police force. To test their crime-eradicating cyborgs, the company leads street cop Alex Murphy into an armed confrontation with crime lord Boddicker so they can use his body to support their untested RoboCop prototype. But when RoboCop learns of the company''s nefarious plans, he turns on his masters.','col',691,5548,'tt0093870','/hHtOgGb3NihlyRATHlKPaFApbrd.jpg','/vMGkly71Jm2KwHN407mxheMGUYR.jpg');
INSERT INTO movies VALUES('28827','Prophet, A',2009,'["France","Italy"]','["Drama","Crime"]',155,'Sentenced to six years in prison, Malik El Djebena is alone in the world and can neither read nor write. On his arrival at the prison, he seems younger and more brittle than the others detained there. At once he falls under the sway of a group of Corsicans who enforce their rule in the prison. As the ''missions'' go by, he toughens himself and wins the confidence of the Corsican group.','col',692,21575,'tt1235166','/x9Jb8kewBHPzjTtgCQvoQoDsy4d.jpg','/7en9qwF88VfxPXsN6azHmUxRBNy.jpg');
INSERT INTO movies VALUES('22459','Chronicle of Anna Magdalena Bach',1968,'["West Germany","Italy"]','["Drama","History","Biography"]',94,'The life and music of Johann Sebastian Bach as presented by his wife, Anna.','bw',693,95600,'tt0062804','/bABKBHPge6UHlRbTkN1hgEiuOG5.jpg','/n09tR1wlRbJ8Bh6Eqz77rI5PegO.jpg');
INSERT INTO movies VALUES('18291','Toy Story',1995,'["USA","Japan"]','["Animated","Adventure","Comedy"]',81,'Led by Woody, Andy''s toys live happily in his room until Andy''s birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andy''s heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.','col',694,862,'tt0114709','/uXDfjJbdP4ijW5hWSBrPrlKpxab.jpg','/lxD5ak7BOoinRNehOCA85CQ8ubr.jpg');
INSERT INTO movies VALUES('12124','Young Frankenstein',1974,'["USA"]','["Horror","Comedy","Science Fiction"]',105,'A young neurosurgeon inherits the castle of his grandfather, the famous Dr. Victor von Frankenstein. In the castle he finds a funny hunchback, a pretty lab assistant and the elderly housekeeper. Young Frankenstein believes that the work of his grandfather was delusional, but when he discovers the book where the mad doctor described his reanimation experiment, he suddenly changes his mind.','bw',695,3034,'tt0072431','/tQJAWbIjvvqVKLLbIZHtwGw2HTf.jpg','/hTvCGwbrpSgZ5QCZnYHM12bv7DH.jpg');
INSERT INTO movies VALUES('14727','Purple Rose of Cairo, The',1985,'["USA"]','["Fantasy","Comedy","Romance"]',82,'Cecilia is a waitress in New Jersey, living a dreary life during the Great Depression. Her only escape from her mundane reality is the movie theatre. After losing her job, Cecilia goes to see ''The Purple Rose of Cairo'' in hopes of raising her spirits, where she watches dashing archaeologist Tom Baxter time and again.','col-bw',696,10849,'tt0089853','/ccsint43E44B7NGceEhVimD93Yt.jpg','/7lHxbtHThosMRZdp9646K4zygVh.jpg');
INSERT INTO movies VALUES('18721','Salesman',1969,'["USA"]','["Documentary"]',85,'This documentary from Albert and David Maysles follows the bitter rivalry of four door-to-door salesmen working for the Mid-American Bible Company: Paul "The Badger" Brennan, Charles "The Gipper" McDevitt, James "The Rabbit" Baker and Raymond "The Bull" Martos. Times are tough for this hard-living quartet, who spend their days traveling through small-town America, trying their best to peddle gold-leaf Bibles to an apathetic crowd of lower-middle-class housewives and elderly couples.','bw',697,27375,'tt0064921','/gQhe7uWygmAiQ6HNA7Jeys4wdbk.jpg','/y9I304YATiOlL0EFCfTZ0b592kE.jpg');
INSERT INTO movies VALUES('24462','Holy Mountain, The',1973,'["Mexico","USA"]','["Adventure","Drama","Fantasy"]',114,'The Alchemist assembles together a group of people from all walks of life to represent the planets in the solar system. The occult adept''s intention is to put his recruits through strange mystical rites and divest them of their worldly baggage before embarking on a trip to Lotus Island. There they ascend the Holy Mountain to displace the immortal gods who secretly rule the universe.','col',698,8327,'tt0071615','/nvwbOcV3jJExT090Bb2m7fNjzTN.jpg','/35uGiE6AFbZBUCqcYGPANLuuoMn.jpg');
INSERT INTO movies VALUES('13398','Sauve qui peut (la vie)',1980,'["France","Switzerland"]','["Drama"]',87,'A look at the sexual and professional lives of three people — a television director, his ex-girlfriend, and a sex worker.','col',699,113479,'tt0079854','/hA69SHZQ3jixYq2wykoTlH2VgjI.jpg','/p8NHG9uNXn7MSrknNk0LbBjJxQc.jpg');
INSERT INTO movies VALUES('11342','Wake in Fright',1971,'["Australia","USA","UK"]','["Drama","Thriller"]',109,'A schoolteacher, stuck in a teaching post in an arid backwater, stops off in a mining town on his way home for Christmas. Discovering a local gambling craze that may grant him the money to move back to Sydney for good, he embarks on a five-day nightmarish odyssey of drinking, gambling, and hunting.','col',700,26405,'tt0067541','/cIzWTls4jOzZHL1WzFZY3epPlnG.jpg','/nEaL6W60fGDFBJshXE35OISDrdp.jpg');
INSERT INTO movies VALUES('18542','Lancelot du Lac',1974,'["France","Italy"]','["Fantasy","Drama"]',85,'Having failed in their quest for the Holy Grail, the knights of the Round Table return to Camelot, their number reduced to a mere handful. Seeing a rift developing between Lancelot and Mordred, Arthur urges his knights to bury their differences and become friends. However, the king is unaware that Lancelot is having an affair with his queen, Guinevere. Lancelot is torn between his duty to his king and his love for the queen, whilst Mordred is determined to use his infidelity to destroy him.','col',701,55848,'tt0071737','/mF5BQro2PC7YG4XY6i70jwXOzbl.jpg','/rM3lahhi1NnqErDb1Gt8xwCYlw7.jpg');
INSERT INTO movies VALUES('22078','Before Sunset',2004,'["USA"]','["Romance","Drama"]',80,'Nine years later, Jesse travels across Europe giving readings from a book he wrote about the night he spent in Vienna with Celine. After his reading in Paris, Celine finds him, and they spend part of the day together before Jesse has to again leave for a flight. They are both in relationships now, and Jesse has a son, but as their strong feelings for each other start to return, both confess a longing for more.','col',702,80,'tt0381681','/gycdE1ARByGQcK4fYR2mgpU6OO.jpg','/zwgDZw9dyrgkYz2RCOb2HvUDlt2.jpg');
INSERT INTO movies VALUES('20418','Piano Teacher, The',2001,'["Austria","France","Germany"]','["Drama"]',130,'Erika Kohut, a sexually repressed piano teacher living with her domineering mother, meets a young man who starts romantically pursuing her.','col',703,1791,'tt0254686','/gNHKYQnP1RnqEhkivHJzBPb4MOP.jpg','/uoW2gaHL28IyCny0U4Kqh8vxV3M.jpg');
INSERT INTO movies VALUES('44283','Roma',2018,'["Mexico","USA"]','["Drama"]',135,'In 1970s Mexico City, two domestic workers help a mother of four while her husband is away for an extended period of time.','bw',704,426426,'tt6155172','/dtIIyQyALk57ko5bjac7hi01YQ.jpg','/zl9uqCl5iUSb50sTk2BPzw6bJnU.jpg');
INSERT INTO movies VALUES('12050','Phantom of Liberty, The',1974,'["France","Italy"]','["Drama","Comedy"]',104,'This Surrealist film, with a title referencing the Communist Manifesto, strings together short incidents based on the life of director Luis Buñuel. Presented as chance encounters, these loosely related, intersecting situations, all without a consistent protagonist, reach from the 19th century to the 1970s. Touching briefly on subjects such as execution, pedophilia, incest, and sex, the film features an array of characters, including a sick father and incompetent police officers.','col',705,5558,'tt0071487','/f6cON5ebistPm6AS1XcZZMmKpIi.jpg','/Ai3fiCnWzHl3bL4CZQQ1pt2uiOU.jpg');
