INSERT INTO movies VALUES('20106','Dancer in the Dark',2000,'["Denmark","France","Sweden","Italy","Germany","Norway","Netherlands","Iceland","Finland","UK","USA"]','["Musical","Drama"]',140,'Selma, a Czech immigrant on the verge of blindness, struggles to make ends meet for herself and her son, who has inherited the same genetic disorder and will suffer the same fate without an expensive operation. When life gets too difficult, Selma learns to cope through her love of musicals, escaping life''s troubles - even if just for a moment - by dreaming up little numbers to the rhythmic beats of her surroundings.','col',713,16,'tt0168629','/uXvyCRpoTRLSEia59Yj7nAZOSej.jpg','/gs70htixF6j1oqrrwsM4lVfcgNN.jpg');
