INSERT INTO movies VALUES('18240','Thelma & Louise',1991,'["USA"]','["Drama","Comedy","Adventure"]',128,'Whilst on a short weekend getaway, Louise shoots a man who had tried to rape Thelma. Due to the incriminating circumstances, they make a run for it and thus a cross country chase ensues for the two fugitives. Along the way, both women rediscover the strength of their friendship and surprising aspects of their personalities and self-strengths in the trying times.','col',716,1541,'tt0103074','/gQSUVGR80RVHxJywtwXm2qa1ebi.jpg','/e6T00r0BO3UlgBcPKnAUbS4rPyx.jpg');
INSERT INTO movies VALUES('20279','Moulin Rouge!',2001,'["Australia","USA"]','["Musical","Romance","Drama"]',127,'A celebration of love and creative inspiration takes place in the infamous, gaudy and glamorous Parisian nightclub, at the cusp of the 20th century. A young poet, who is plunged into the heady world of Moulin Rouge, begins a passionate affair with the club''s most notorious and beautiful star.','col',717,824,'tt0203009','/2kjM5CUZRIU5yOANUowrbJcRL9L.jpg','/vvcLSgiviCIU0J0UcwLqWdU8Iup.jpg');
