INSERT INTO movies VALUES('21571','Adventures of Prince Achmed, The',1926,'["Germany"]','["Animated","Adventure","Fantasy"]',65,'Based on stories from "The Arabian Nights". A wicked sorcerer tricks Prince Achmed into riding a magical flying horse. The heroic prince is able to subdue the magical horse, which he uses to fly off to many adventures. While travelling, he falls in love with the beautiful Princess Peri Banu, and must defeat an army of demons to win her heart. The film is animated using the silhouette technique.','bw',719,19354,'tt0015532','/c3OKMlt9QxpPeSfpyViqYkYFvUz.jpg','/v9rj1QERxiEi5COZLAopyqLAK8z.jpg');
INSERT INTO movies VALUES('6760','Killing, The',1956,'["USA"]','["Crime","Thriller"]',85,'Career criminal Johnny Clay recruits a sharpshooter, a crooked police officer, a bartender and a betting teller named George, among others, for one last job before he goes straight and gets married. But when George tells his restless wife about the scheme to steal millions from the racetrack where he works, she hatches a plot of her own.','bw',720,247,'tt0049406','/A6VzUPcADZGYdGHlVdWvpMNDF5d.jpg','/dY0suaAdGpOqh7JkLeIN6lT7k9d.jpg');
