INSERT INTO movies VALUES('18529','Antonio das Mortes',1969,'["Brazil"]','["Drama","Western","Political"]',95,'A new incarnation of Cangaceiro bandits, led by Coirana, has risen in the badlands. A blind landowner hires Antônio to wipe out his old nemesis. Yet after besting Coirana and accompanying the dying man to his mountain hideout, Antônio is moved by the plight of the Cangaceiro’s followers. The troubled hitman turns revolutionary, his gun and machete aimed towards his former masters.','col',724,74349,'tt0064256','/dd8osKi87WF0ZTdlO0sOXb4DTM5.jpg','/kb3wnJV4MARi7XivGaD0EShqHHQ.jpg');
