INSERT INTO movies VALUES('7750','Ben-Hur',1959,'["USA"]','["Religious","History"]',212,'In 25 AD, Judah Ben-Hur, a Jew in ancient Judea, opposes the occupying Roman empire.  Falsely accused by a Roman childhood friend-turned-overlord of trying to kill the Roman governor, he is put into slavery and his mother and sister are taken away as prisoners.','col',728,665,'tt0052618','/m4WQ1dBIrEIHZNCoAjdpxwSKWyH.jpg','/sU3gFo7Gn67zjtKXIvzJ4omcUbH.jpg');
