INSERT INTO movies VALUES('9365','Hard Day''s Night, A',1964,'["UK"]','["Musical","Comedy"]',87,'Capturing John Lennon, Paul McCartney, George Harrison and Ringo Starr in their electrifying element, ''A Hard Day''s Night'' is a wildly irreverent journey through this pastiche of a day in the life of The Beatles during 1964. The band have to use all their guile and wit to avoid the pursuing fans and press to reach their scheduled television performance, in spite of Paul''s troublemaking grandfather and Ringo''s arrest.','bw',730,704,'tt0058182','/6Ulsccp2VkaVU5qbya3bxm9JG4x.jpg','/9hWiNbvLR3nPDanTdEWOc4EeBGp.jpg');
