INSERT INTO movies VALUES('28753','Fish Tank',2009,'["UK"]','["Drama"]',123,'Mia is a rebellious teenager on the verge of being kicked out of school. Her hard-partying mother, Joanne, neglects Mia''s welfare in favor of her own, and her younger sister hangs out with a much older crowd. Sparks fly between Mia and Connor, Joanne''s new boyfriend, and he encourages Mia to pursue her interest in dance. As the boundaries of the relationships become blurred, Mia and Joanne compete for Connor''s affection.','col',732,24469,'tt1232776','/rI3MKBDsWzQHi9PWDAMKkgmYcff.jpg','/kUa5p73cjzDXoqB6SKncfYKmMu2.jpg');
