INSERT INTO movies VALUES('42148','Oh, Sun',1967,'["France","Mauritania"]','["Drama"]',103,'The film Soleil Ô, shot over four years with a very low budget, tells the story of a black immigrant who makes his way to Paris in search of “his Gaul ancestors”. This manifesto denounces a new form of slavery: The immigrants desperately seek work, a place to live, but find themselves face to face with indifference, rejection, humiliation…until the final call for uprising. “Soleil Ô” is the title of a West Indian song that tells of the pain of the black people from Dahomey (now Benin) who were taken to the Caribbean as slaves.','bw',734,195841,'tt0062285','/ffvsrK5iYCAqgcA3X9OzspduR13.jpg','/bvDRdtBp839qFnNhMb2gMoSjRuy.jpg');
