INSERT INTO movies VALUES('5304','Bad and the Beautiful, The',1952,'["USA"]','["Drama"]',118,'Told in flashback form, the film traces the rise and fall of a tough, ambitious Hollywood producer, Jonathan Shields, as seen through the eyes of various acquaintances, including a writer, James Lee Bartlow; a star, Georgia Lorrison; and a director, Fred Amiel. He is a hard-driving, ambitious man who ruthlessly uses everyone on the way to becoming one of Hollywood''s top movie makers.','bw',739,32499,'tt0044391','/ajAXzTiPkL7JxeCRw5lQBqrKNGx.jpg','/omvyf5m1RKkZq7w8obrOEDhY5E0.jpg');
