INSERT INTO movies VALUES('21245','Subarnarekha',1965,'["India"]','["Drama"]',126,'After an old college friend offers him a job at an iron foundry, the upright and honest Ishwar leaves a shanty town on the outskirts of Calcutta where he lives with a group of refugees from East Bengal. With plans to forge a solid living for himself, sister Sita and Abhiram, an orphaned boy he offers a home to, Ishwar is accused of selling out and deserting his people.','bw',746,86303,'tt0056537','/3le6UjPH0E8ZNgdBwPysDSag5jE.jpg','/2ZWfSMeOxDQGji53pTOukgqmf2S.jpg');
