INSERT INTO movies VALUES('22073','Distant',2002,'["Turkey","Netherlands"]','["Drama"]',110,'Uzak/Distant chronicles the numbing loneliness, longing, and isolation in the lives of two men who are consumed by their own problems. Istanbul photographer Mahmut reluctantly receives his relative Yusuf, but the mingling of their lives does little to alleviate their detachment.','col',749,31026,'tt0346094','/7XKGrHh1BRnMiIRMRYRsWPQDJfh.jpg','/tCuAIg6KXy5Q2cewOyl6mKJOsnm.jpg');
