INSERT INTO movies VALUES('17557','Belle Noiseuse, La',1991,'["France"]','["Drama"]',240,'The former famous painter Frenhofer lives quietly with his wife on a countryside residence in the French Provence. When the young artist Nicolas visits him with his girlfriend Marianne, Frenhofer decides to start again the work on a painting he long ago stopped: La Belle Noiseuse. And he wants Marianne as model.','col',752,12627,'tt0101428','/n6f7I9RUdoDa9AgM9X2oAc3pk4l.jpg','/9Q8xRyPm8YRF9U2oiLlMNoPm627.jpg');
INSERT INTO movies VALUES('20766','Flaming Creatures',1963,'["USA"]','["Drama","Comedy","Horror"]',45,'Filmmaker and artist Jack Smith described his own film as a “comedy set in a haunted movie studio.” Flaming Creatures begins humorously enough with several men and women, mostly of indeterminate gender, vamping it up in front of the camera and participating in a mock advertisement for an indelible, heart-shaped brand of lipstick. However, things take a dark, nightmarish turn when a transvestite chases, catches and begins molesting a woman. Soon, all of the titular “creatures” participate in a (mostly clothed) orgy that causes a massive earthquake. After the creatures are killed in the resulting chaos, a vampire dressed like an old Hollywood starlet rises from her coffin to resurrect the dead. All ends happily enough when the now undead creatures dance with each other, even though another orgy and earthquake loom over the end title card.','bw',753,47122,'tt0054880','/agXfZnar50z6v1DrGdzjgssuth7.jpg','/bscqiQRZJqRpnX5aD79H0MNLro6.jpg');
INSERT INTO movies VALUES('17080','Dazed and Confused',1993,'["USA"]','["Comedy","Drama"]',103,'The adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a "no drugs" pledge.','col',754,9571,'tt0106677','/msG9awbLhVZwv1Eh9Ge7SofMexW.jpg','/9Vygw4sIUyMZ3kY5mUmk1ccsDJc.jpg');
