INSERT INTO movies VALUES('10720','Wild Child, The',1970,'["France"]','["Drama"]',85,'In 1798, a feral boy is discovered outside the town of Aveyron, France. Diagnosed as mentally impaired, he is relegated to an asylum. A young doctor named Jean Itard becomes convinced that the boy has normal mental capacity, but that his development was hindered by lack of contact with society. He brings the boy home and begins an arduous attempt at education over several years.','bw',756,1627,'tt0064285','/ivIyyc2VgefJK9LdAogl1BEgmeH.jpg','/iezEtU0jnEu0P2128PkBxVjJf7x.jpg');
INSERT INTO movies VALUES('23453','New World, The',2005,'["USA"]','["Drama","History","Romance"]',135,'A drama about explorer John Smith and the clash between Native Americans and English settlers in the 17th century.','col',757,11400,'tt0402399','/dPyWMlQd54r3pK17GKG3iqjvNZ7.jpg','/qSOZayrXXeK6TMiBBL6wPCQsjab.jpg');
INSERT INTO movies VALUES('14143','Veronika Voss',1982,'["West Germany"]','["Drama"]',105,'In Munich 1955, German film star Veronika Voss becomes a drug addict at the mercy of corrupt Dr. Marianne Katz, who keeps her supplied with morphine. After meeting sports writer Robert Krohn, Veronika begins to dream of a return to stardom. As the couple''s relationship escalates in intensity, Veronika begins seriously planning her return to the screen -- only to realize how debilitated she has become through her drug habit.','bw',758,2262,'tt0084654','/A09gh5oWVfincs6BbRz91HL4Rgc.jpg','/3vvdtMUakh0e6aucCstxZMT75Nl.jpg');
INSERT INTO movies VALUES('20467','Vive L''Amour',1994,'["Taiwan"]','["Drama"]',118,'Three lonely young denizens of Taipei unknowingly share an apartment: May, a real estate agent who uses it for her sexual affairs; Ah-jung, her current lover; and Hsiao-kang, who''s stolen the key and uses the apartment as a retreat.','col',759,11985,'tt0109066','/i60TuLXoZQaU9dJlClWf5kNdoKE.jpg','/zcY5MpaNI7pSnxf4IcOMQ2xKICT.jpg');
INSERT INTO movies VALUES('21014','Age of the Earth, The',1980,'["Brazil"]','["Political","Drama","Religious"]',158,'Drawing inspiration from a poem penned by Castro Alves, this film vividly captures the political, cultural, and intellectual climate of Brazil during the late 1970s. At its core, the story revolves around four distinctive embodiments of Christ''s image: a black man, a soldier, an Indian, and a guerrilla fighter. These courageous individuals, hailed as the harbingers of doom in the tupiniquim lands, valiantly combat the insatiable avarice and oppressive "civilizing" brutality propagated by the formidable John Brahms—a foreign exploiter devoid of morals.','col',760,76816,'tt0080910','/2gwt93w3M5Cmh1l8HOPfoHuxBjx.jpg','/aTmDkkL29PLZbFoIUONX7KbL1Ot.jpg');
INSERT INTO movies VALUES('28130','Born in Flames',1983,'["USA"]','["Comedy","Drama","Science Fiction"]',79,'In near-future New York, ten years after the “social-democratic war of liberation,” diverse groups of women organize a feminist uprising as equality remains unfulfilled.','col',761,36832,'tt0085267','/xAbFfFxbl47PgOC9zXhdoGZMFYx.jpg','/pC9qonwPXvvPx5kOT48X8U4sOTq.jpg');
INSERT INTO movies VALUES('21807','Good Morning',1959,'["Japan"]','["Comedy","Drama","Family"]',94,'A lighthearted take on director Yasujiro Ozu’s perennial theme of the challenges of inter­generational relationships, Good Morning tells the story of two young boys who stop speaking in protest after their parents refuse to buy a television set. Ozu weaves a wealth of subtle gags through a family portrait as rich as those of his dramatic films, mocking the foibles of the adult world through the eyes of his child protagonists. Shot in stunning color and set in a suburb of Tokyo where housewives gossip about the neighbors’ new washing machine and unemployed husbands look for work as door-to-door salesmen, this charming comedy refashions Ozu’s own silent classic I Was Born, But . . . to gently satirize consumerism in postwar Japan.','col',762,28276,'tt0053134','/dXy2LFsE0VlHlHJU3SLBdJgrzEq.jpg','/qe4JhTd6NvDimLqmoQRKi3vniTZ.jpg');
INSERT INTO movies VALUES('3678','Great Expectations',1946,'["UK"]','["Romance","Drama"]',118,'In this Dickens adaptation, orphan Pip discovers through lawyer Mr. Jaggers that a mysterious benefactor wishes to ensure that he becomes a gentleman. Reunited with his childhood patron, Miss Havisham, and his first love, the beautiful but emotionally cold Estella, he discovers that the elderly spinster has gone mad from having been left at the altar as a young woman, and has made her charge into a warped, unfeeling heartbreaker.','bw',763,14320,'tt0038574','/ynaFuVvW2jaG06pMV67dOhzMYfJ.jpg','/xhqhy73o1Hu17c2usOxSmFb0c2d.jpg');
INSERT INTO movies VALUES('2469','Hellzapoppin''',1941,'["USA"]','["Comedy"]',84,'Olsen and Johnson, a pair of stage comedians, try to turn their play into a movie and bring together a young couple in love, while breaking the fourth wall every step of the way.','bw',764,19136,'tt0033704','/O5Ta3URiRglqt1fPi2APCvnb8x.jpg','/1J9Pq4YUjLktXWtZGafrwmN3u1Z.jpg');
INSERT INTO movies VALUES('2795','Ossessione',1943,'["Italy"]','["Drama","Crime"]',140,'Gino, a drifter, begins an affair with inn-owner Giovanna as they plan to get rid of her older husband.','bw',765,5155,'tt0035160','/qgDF8yuJa9eEcfBqEQrqbJuxe5z.jpg','/7SFG8g8nwDAh7d1Phi44DeVWRxS.jpg');
INSERT INTO movies VALUES('9095','Trial, The',1962,'["France","Italy","West Germany"]','["Drama","Mystery"]',119,'Josef K wakes up in the morning and finds the police in his room. They tell him that he is on trial but nobody tells him what he is accused of. In order to find out about the reason for this accusation and to protest his innocence, he tries to look behind the façade of the judicial system. But since this remains fruitless, there seems to be no chance for him to escape from this nightmare.','bw',766,3009,'tt0057427','/2o1oe54a4doiwB4uJq9Kx1RHal0.jpg','/yhfHeIsR5Ki02b5SqBuLqAsLDCk.jpg');
INSERT INTO movies VALUES('27172','Wings',1966,'["USSR"]','["Drama"]',85,'The war ended a long time ago, but for the heroine of the film, the former pilot, only those years were filled with genuine meaning. She deeply feels discord with reality, lack of contact with her daughter. She doesn''t manage to adapt to this peaceful, everyday life, she doesn''t lose her piercing desire to fly...','bw',767,50013,'tt0061196','/sGWFjV5e86OJWxs8QYbwo9MHtyL.jpg','/ub2oe0ndOVkaPCQdfCu3kc6LjV9.jpg');
INSERT INTO movies VALUES('518','Foolish Wives',1922,'["USA"]','["Drama"]',117,'A con artist masquerades as Russian nobility and attempts to seduce the wife of an American diplomat.','bw',768,35227,'tt0013140','/q8HI0WqwLKY2O1JYyFUF9awi3br.jpg','/jQBB35mU5CdkngZODU0Sg5kYdA8.jpg');
INSERT INTO movies VALUES('18891','Mother and Son',1997,'["Russia","Germany"]','["Drama"]',73,'A man goes for a walk through the countryside with his dying mother.','col',769,44361,'tt0119711','/mOecN5ZKgNNhHhmpxrdvpzsWu8O.jpg','/htOI5Z9G4jWY9kZUUrnx1oRiMeF.jpg');
INSERT INTO movies VALUES('8728','Lolita',1962,'["UK"]','["Drama"]',152,'Humbert Humbert is a middle-aged British novelist who is both appalled by and attracted to the vulgarity of American culture. When he comes to stay at the boarding house run by Charlotte Haze, he soon becomes obsessed with Lolita, the woman''s teenaged daughter.','bw',770,802,'tt0056193','/8Puqbeh0D95DpXFWep1rmH78btu.jpg','/tUuGsAkn5SlLuAXm53f91eONClq.jpg');
INSERT INTO movies VALUES('20760','Diaries, Notes and Sketches',1969,'["USA"]','["Documentary"]',177,'An epic portrait of the New York avant-garde art scene of the 60s.','col',771,105583,'tt0196499','/3iyvGft8nwGJFX62H5RawllN6Gp.jpg','/l6pEbeeAD2spisee51dP2SN7VZP.jpg');
INSERT INTO movies VALUES('17665','Malcolm X',1992,'["USA","Japan"]','["Drama","Biography","History"]',201,'A tribute to the controversial black activist and leader of the struggle for black liberation. He hit bottom during his imprisonment in the ''50s, he became a Black Muslim and then a leader in the Nation of Islam. His assassination in 1965 left a legacy of self-determination and racial pride.','col',772,1883,'tt0104797','/o2s9ow0uRRm1BcF3teznk5twd90.jpg','/yj9VAqzlA0kasae8rK1VG3NvDZk.jpg');
INSERT INTO movies VALUES('5','39 Steps, The',1935,'["UK"]','["Spy","Thriller"]',87,'Richard Hanney has a rude awakening when a glamorous female spy falls into his bed - with a knife in her back. Having a bit of trouble explaining it all to Scotland Yard, he heads for the hills of Scotland to try to clear his name by locating the spy ring known as The 39 Steps.','bw',773,260,'tt0026029','/paI9Tmqm2cZG6xy4Tnjw3Ydjuw5.jpg','/2SCZfhWvFgjmVrpGWN24UpXZVbf.jpg');
INSERT INTO movies VALUES('14419','Zelig',1983,'["USA"]','["Comedy"]',79,'Fictional documentary about the life of human chameleon Leonard Zelig, a man who becomes a celebrity in the 1920s due to his ability to look and act like whoever is around him. Clever editing places Zelig in real newsreel footage of Woodrow Wilson, Babe Ruth, and others.','col-bw',774,11030,'tt0086637','/3NTSeyMXSTOIJjqBqwavMLvrGjy.jpg','/oCC3rSccbJV9bxMDRedtqI6pnla.jpg');
INSERT INTO movies VALUES('20747','Cairo Station',1958,'["Egypt"]','["Crime","Drama"]',76,'Qinawi, a physically challenged peddler who makes his living selling newspapers in the central Cairo train station, is obsessed with Hanuma, an attractive young woman who sells drinks. While she jokes with him about a possible relationship, she is actually in love with Abu Siri, a strong and respected porter at the station who is struggling to unionize his fellow workers to combat their boss'' exploitative and abusive treatment.','bw',775,47324,'tt0051390','/zm8ET6PSfPT6pozgvjR7htaZFjy.jpg','/8Tz26ZvhOEHl9HY9PH8lTldrrA6.jpg');
INSERT INTO movies VALUES('13630','American Werewolf in London, An',1981,'["USA"]','["Horror","Comedy"]',97,'American tourists David and Jack are savaged by an unidentified vicious animal whilst hiking on the Yorkshire Moors. Retiring to the home of a beautiful nurse to recuperate, David soon experiences disturbing changes to his mind and body.','col',776,814,'tt0082010','/hVEqUASJmCQaolkKFEySCHZ8uKG.jpg','/pmrDpyXvzC74kbB820uqfx4VkXz.jpg');
INSERT INTO movies VALUES('12254','Man Who Would Be King, The',1975,'["UK","USA"]','["Adventure","War"]',129,'A robust adventure about two British adventurers who take over primitive Kafiristan as "godlike" rulers, meeting a tragic end through their desire for a native girl. Based on a short story by Rudyard Kipling.','col',777,983,'tt0073341','/21BANIzXEKyZDUFOr9NdUEgP4EA.jpg','/1Jgefbg5cKfCrppNbP0nPJm2TdR.jpg');
INSERT INTO movies VALUES('18495','Chant d''amour, Un',1950,'["France"]','["Drama","Short","Fantasy"]',26,'Two prisoners in complete isolation, separated by the thick brick walls, and desperately in need of human contact, devise a most unusual kind of communication.','bw',778,87561,'tt0043084','/sHUMbfUqG58qykJPRVhhH6ryD8j.jpg','/vvoPAjCl3R6GkxWrfkvTTVYHQA8.jpg');
INSERT INTO movies VALUES('9704','Faster, Pussycat! Kill! Kill!',1965,'["USA"]','["Drama","Comedy","Action"]',83,'Three strippers seeking thrills encounter a young couple in the desert. After dispatching the boyfriend, they take the girl hostage and begin scheming on a crippled old man living with his two sons in the desert, reputedly hiding a tidy sum of cash. They become house guests of the old man and try and seduce the sons in an attempt to locate the money, not realizing that the old man has a few sinister intentions of his own.','bw',779,315,'tt0059170','/4mld2L1vWqgqFQmKa7KU4HzLKPi.jpg','/kEYzCALqaU8cMMRPtghjAjcLRQi.jpg');
INSERT INTO movies VALUES('7379','Big Deal on Madonna Street',1958,'["Italy"]','["Crime","Comedy"]',91,'Best friends Peppe and Mario are thieves, but they''re not very good at it. Still, Peppe thinks that he''s finally devised a master heist that will make them rich. With the help of some fellow criminals, he plans to dig a tunnel from a rented apartment to the pawnshop next door, where they can rob the safe. But his plan is far from foolproof, and the fact that no one in the group has any experience digging tunnels proves to be the least of their problems.','bw',780,24382,'tt0052216','/f5OxD8Nl0pR3DcYHtYhHRfpsmjl.jpg','/ryoWP1kvNcwPif6uNbuZwQfrJPy.jpg');
INSERT INTO movies VALUES('16127','Cook, the Thief, His Wife & Her Lover, The',1989,'["UK","Netherlands","France"]','["Drama","Crime","Comedy"]',124,'The wife of an abusive criminal finds solace in the arms of a kind regular guest in her husband''s restaurant.','col',781,7452,'tt0097108','/32iU6yyYzlHRgeOqL4RPVxotwU4.jpg','/o1NHZdJufI6ObLO6Xvbm8Gma93h.jpg');
INSERT INTO movies VALUES('18512','Taipei Story',1985,'["Taiwan"]','["Drama"]',119,'A young woman urgently seeks to navigate the maze of contemporary Taipei and find a future. She hopes that her boyfriend Lung is the key to the future, but Lung is stuck in a past that combines baseball and traditional loyalty that leads him to squander his nest egg bailing her father out of financial trouble.','col',782,106380,'tt0089866','/4PwUsMHGFuuqUhLQT9cq3ot1CB.jpg','/5K2fuinltM5TlVWHDXazC0XazHW.jpg');
INSERT INTO movies VALUES('20266','Code Unknown',2000,'["France","Germany","Romania"]','["Drama"]',118,'A series of events unfold like a chain reaction, all stemming from a minor event that brings the film''s five characters together. Set in Paris, France, Anne is an actress whose boyfriend Georges photographs the war in Kosovo. Georges'' brother, Jean, is looking for the entry code to Georges'' apartment. These characters'' lives interconnect with a Romanian immigrant and a deaf teacher.','col',783,30970,'tt0216625','/kJJx2FNmiaep8WT21uMPY9qPzxL.jpg','/bTUBuFR25xvTiFel7q6pq0ejacY.jpg');
INSERT INTO movies VALUES('23251','Blissfully Yours',2002,'["Thailand","France"]','["Romance","Drama"]',125,'Min is an illegal Burmese immigrant living in Thailand who has contracted a mysterious painful rash covering his upper body. His girlfriend, Roong, and a middle-aged woman, Orn, take him to see a doctor. Min pretends that he cannot speak because he is not fluent in Thai and speaking would reveal him to be an illegal immigrant.','col',784,47046,'tt0317171','/30iCmKCVTuFWDh7tpBKzeAHlOAQ.jpg','/7a8FmPDj93Nq6AN633vk4RXBUeq.jpg');
INSERT INTO movies VALUES('6344','Diaboliques, Les',1955,'["France"]','["Thriller","Mystery"]',114,'The cruel and abusive headmaster of a boarding school, Michel Delassalle, is murdered by an unlikely duo -- his meek wife and the mistress he brazenly flaunts. The women become increasingly unhinged by a series of odd occurrences after Delassalle''s corpse mysteriously disappears.','bw',785,827,'tt0046911','/pNcwhz3Eyfn3KQ2XykTozbARMpr.jpg','/oMpX8thZFDVZNS4j240HYSMMvyg.jpg');
INSERT INTO movies VALUES('1030','Morocco',1930,'["USA"]','["Romance","Drama"]',92,'The Foreign Legion marches in to Mogador with booze and women in mind just as singer Amy Jolly arrives from Paris to work at Lo Tinto''s cabaret. That night, insouciant legionnaire Tom Brown catches her inimitably seductive, tuxedo-clad act. Both bruised by their past lives, the two edge cautiously into a no-strings relationship while being pursued by others. But Tom must leave on a perilous mission: is it too late for them?','bw',786,42641,'tt0021156','/jDqZsxyv35iyJWW0mANk1RhxhJp.jpg','/14LmfWZtU3PgbOCpPoP0IcsJyaz.jpg');
INSERT INTO movies VALUES('9782','Mamma Roma',1962,'["Italy"]','["Drama"]',110,'After years spent working as a prostitute in her Italian village, middle-aged Mamma Roma has saved enough money to buy herself a fruit stand so that she can have a respectable middle-class life and reestablish contact with the 16-year-old son she abandoned when he was an infant. But her former pimp threatens to expose her sordid past, and her troubled son seems destined to fall into a life of crime and violence.','bw',787,47796,'tt0056215','/8MysuFQesbESkulqAlsLHs8RXBz.jpg','/vEtMkoZvDa7tNAQpP78ofxMIxIi.jpg');
INSERT INTO movies VALUES('14171','Ballad of Narayama, The',1983,'["Japan"]','["Drama"]',130,'In a small village in a valley everyone who reaches the age of 70 must leave the village and go to a certain mountain top to die. If anyone should refuse they would disgrace their family. Old Orin is 69. This winter it is her turn to go to the mountain. But first she must make sure that her eldest son Tatsuhei finds a wife.','col',788,42113,'tt0084390','/ewYZmeoqzE5XsL0Jlcorlu9iwGe.jpg','/vqNhqCC3hNk7k5HsGHW59r6B3qE.jpg');
INSERT INTO movies VALUES('11580','Two English Girls',1971,'["France"]','["Drama"]',108,'At the beginning of the 20th century, Claude Roc, a young middle-class Frenchman, befriends Ann, an Englishwoman. While spending time in England with Ann’s family, Claude falls in love with her sister Muriel, but both families lay down a year-long separation without contact before they may marry.','col',789,42513,'tt0066989','/o2tntCTn32P9Q1qk98NLivqN1D2.jpg','/tXoYHLjqZYNIWeLc6g8QCaMNsG8.jpg');
INSERT INTO movies VALUES('4169','Fort Apache',1948,'["USA"]','["Western","War"]',127,'Owen Thursday sees his new posting to the desolate Fort Apache as a chance to claim the military honour which he believes is rightfully his. Arrogant, obsessed with military form and ultimately self-destructive, he attempts to destroy the Apache chief Cochise after luring him across the border from Mexico, against the advice of his subordinates.','bw',790,37347,'tt0040369','/5PqKsWVlyIFuMeV1UkK6Q9Q8y9k.jpg','/lJyDK0shCLOVa7OZQrcYkM9MKmq.jpg');
INSERT INTO movies VALUES('6504','Rebel Without a Cause',1955,'["USA"]','["Drama"]',111,'After moving to a new town, troublemaking teen Jim Stark is supposed to have a clean slate, although being the new kid in town brings its own problems. While searching for some stability, Stark forms a bond with a disturbed classmate, Plato, and falls for local girl Judy. However, Judy is the girlfriend of neighborhood tough, Buzz. When Buzz violently confronts Jim and challenges him to a drag race, the new kid''s real troubles begin.','col',791,221,'tt0048545','/n0oJB5fhcUth9ZbHziwsFuR38gT.jpg','/oflZDGEo8rZqMIH98WmLRPPmqKY.jpg');
INSERT INTO movies VALUES('15135','Ferris Bueller''s Day Off',1986,'["USA"]','["Comedy"]',103,'After high school slacker Ferris Bueller successfully fakes an illness in order to skip school for the day, he goes on a series of adventures throughout Chicago with his girlfriend Sloane and best friend Cameron, all the while trying to outwit his wily school principal and fed-up sister.','col',792,9377,'tt0091042','/9LTQNCvoLsKXP0LtaKAaYVtRaQL.jpg','/lU0v9ULZJ9A5145nLGUF8ZNZnPj.jpg');
INSERT INTO movies VALUES('21043','Trouble Every Day',2001,'["France","Germany","Japan","Luxembourg"]','["Drama","Horror"]',101,'Shane and June Brown are an American couple honeymooning in Paris in an effort to nurture their new life together, a life complicated by Shane’s mysterious and frequent visits to a medical clinic where cutting edge studies of the human libido are undertaken.','col',793,40723,'tt0204700','/lKcd0DESrI965qjT3L9dRmkhHWJ.jpg','/2bWPyLKJV1H6AvlkrB75am55E7D.jpg');
INSERT INTO movies VALUES('16582','Miller''s Crossing',1990,'["USA"]','["Crime","Drama"]',115,'Set in 1929, a political boss and his advisor have a parting of the ways when they both fall for the same woman.','col',794,379,'tt0100150','/ab3pnsTKp3BgcAFy0FgWBFBg9FL.jpg','/xeLOCSy9YIpGFYjcHiDTQ7ac65t.jpg');
INSERT INTO movies VALUES('10369','Producers, The',1968,'["USA"]','["Comedy","Music"]',88,'Broadway producer, Max Bialystock and his accountant, Leo Bloom plan to make money by charming little old ladies to invest in a production many times over what it will actually cost, and then put on a sure-fire flop, so nobody will ask for their money back – and what can be a more certain flop than a tasteless musical celebrating Hitler.','col',795,30197,'tt0063462','/5TYUsAygWKtufAC78ep2AiohEiR.jpg','/kzxSkAGUWUA1niS9uHfby5aMFAv.jpg');
INSERT INTO movies VALUES('28556','35 Shots of Rum',2008,'["France","Germany"]','["Drama"]',101,'A widower and her daughter witness the retirement of a colleague of his and the closing of her department at her university.','col',796,26191,'tt1100048','/fvoUX74RTx6KU9Fc9jtVrj7ArBJ.jpg','/xLkjp2bgKXVJe3tKfvJ4mihc7zv.jpg');
INSERT INTO movies VALUES('20094','Memento',2000,'["USA"]','["Thriller","Mystery","Drama"]',113,'Leonard Shelby is tracking down the man who raped and murdered his wife. The difficulty of locating his wife''s killer, however, is compounded by the fact that he suffers from a rare, untreatable form of short-term memory loss. Although he can recall details of life before his accident, Leonard cannot remember what happened fifteen minutes ago, where he''s going, or why.','col',797,77,'tt0209144','/yuNs09hvpHVU1cBTCAk9zxsL2oW.jpg','/q2CtXYjp9IlnfBcPktNkBPsuAEO.jpg');
INSERT INTO movies VALUES('20960','Duck Amuck',1953,'["USA"]','["Animated","Comedy","Short"]',7,'The short-tempered Daffy Duck must improvise madly as the backgrounds, his costumes, the soundtrack, even his physical form, shifts and changes at the whim of the animator.','col',798,53210,'tt0045708','/gRZYLCncLa2mzE59qY38McDlFdN.jpg','/oIeJMpbaBnGwSncb4ErjGcgsG2b.jpg');
INSERT INTO movies VALUES('5031','Forbidden Games',1952,'["France"]','["War","Drama"]',87,'Orphaned after a Nazi air raid, Paulette, a young Parisian girl, runs into Michel, an older peasant boy, and the two quickly become close. Together, they try to make sense of the chaotic and crumbling world around them, attempting to cope with death as they create a burial ground for Paulette''s deceased pet dog. Eventually, however, Paulette''s stay with Michel''s family is threatened by the harsh realities of wartime.','bw',799,5000,'tt0043686','/nby91GNVXQAv1NmKvqlpEEdhcMQ.jpg','/iNkgF4uBzcFTrY3NN6JrlCD5Ho.jpg');
INSERT INTO movies VALUES('19812','Dog Star Man',1964,'["USA"]','["Documentary","Avant","Garde"]',75,'Experimental film following a cycle of seasons as well as the stretch of a single day as a man and his dog slowly ascend a mountain.','col',800,420240,'tt5896468','/o4gK7JCugdDIcrhqZ1cu52iAMOe.jpg','/yM2UfbcVD0aym1zNa8acIL6Ci0M.jpg');
INSERT INTO movies VALUES('20159','Requiem for a Dream',2000,'["USA"]','["Drama"]',100,'The hopes and dreams of four ambitious people are shattered when their drug addictions begin spiraling out of control. A look into addiction and how it overcomes the mind and body.','col',801,641,'tt0180093','/nOd6vjEmzCT0k4VYqsA2hwyi87C.jpg','/s5R6kTMfOxkGit96A8lqcDL4uVk.jpg');
INSERT INTO movies VALUES('19505','Idiots, The',1998,'["Denmark","Spain","Sweden","France","Netherlands","Italy"]','["Drama","Comedy"]',117,'With his first Dogma-95 film director Lars von Trier opens up a completely new film platform. With a mix of home-video and documentary styles the film tells the story of a group of young people who have decided to get to know their “inner-idiots” and thus not only facing and breaking their outer appearance but also their inner.','col',802,452,'tt0154421','/zICUj2GCVubqp6p9BgpmudNVfvR.jpg','/16UEQo8TSAJoAMNdoEJm7lJIABf.jpg');
INSERT INTO movies VALUES('18612','Mädchen in Uniform',1931,'["Germany"]','["Drama"]',87,'A sensitive girl is sent to an all-girls boarding school and develops a romantic attachment to one of her teachers.','bw',803,9653,'tt0022183','/fB6dY210yjB9YRLkY38zt0ScXBi.jpg','/aT8W0LKkt8pxoQ4VF1NnYnalJcy.jpg');
INSERT INTO movies VALUES('37','All Quiet on the Western Front',1930,'["USA"]','["War","Drama"]',133,'When a group of idealistic young men join the German Army during World War I, they are assigned to the Western Front, where their patriotism is destroyed by the harsh realities of combat.','bw',804,143,'tt0020629','/1wZUB08igw8iLUgF1r4T6aJD65b.jpg','/yeQGyB8MjpX8KR7rUrP0E3gaviC.jpg');
INSERT INTO movies VALUES('18719','Rose Hobart',1936,'["USA"]','["Short"]',20,'Cornell employs clips from 1931''s jungle melodrama East of Borneo – more specifically, clips of its lead actress, Rose Hobart – to disquieting effect. Through Cornell''s collage editing, Hobart becomes a singular object of desire and dread, trapped in an exotic paradise.','col',805,105552,'tt0138758','/3PykCY8op3AYwTvzw3Zx9Utq6OU.jpg','/eqTnRm7QqVxRwxrDhc7NUL7qqO2.jpg');
INSERT INTO movies VALUES('19291','Funny Games',1997,'["Austria"]','["Thriller","Drama"]',108,'Two psychotic young men take a mother, father, and son hostage in their vacation cabin and force them to play sadistic "games" with one another for their own amusement.','col',806,10234,'tt0119167','/vUJxLlRGM6KfXQDeAHqyMyhrI59.jpg','/79SBe1bU30Dy6QPwJ2KQ3LTr1lr.jpg');
INSERT INTO movies VALUES('17503','JFK',1991,'["USA","France"]','["History","Drama"]',189,'Follows the investigation into the assassination of President John F. Kennedy led by New Orleans district attorney Jim Garrison.','col-bw',807,820,'tt0102138','/r0VWVTYlqdRCK5ZoOdNnHdqM2gt.jpg','/lGJxJQCiEeaoXAoQUvBcv6lRa7U.jpg');
INSERT INTO movies VALUES('14076','Passion',1982,'["France","Switzerland"]','["Drama"]',87,'While shooting a film, the director becomes interested in the unfolding struggle of a young factory worker that has been laid off by a boss who did not like her union activities.','col',808,32692,'tt0084481','/hQ1zhDRbuNkN63eWTSKuHLKM6gs.jpg','/vYK9XjsqFL4z92J1lhXsLzx16iY.jpg');
INSERT INTO movies VALUES('15405','Broadcast News',1987,'["USA"]','["Romance","Comedy","Drama"]',133,'Basket-case network news producer Jane Craig falls for new reporter Tom Grunnick, a pretty boy who represents the trend towards entertainment news she despises. Aaron Altman, a talented but plain correspondent, carries an unrequited torch for Jane. Sparks fly between the three as the network prepares for big changes, and both the news and Jane must decide between style and substance.','col',809,12626,'tt0092699','/8YhpZz85umXsa4cH5U7a0hJ2Vuu.jpg','/mRtwZCRIIRni9CkpNvQgYSe8F3V.jpg');
INSERT INTO movies VALUES('15455','Evil Dead II',1987,'["USA"]','["Horror","Comedy"]',84,'Ash Williams and his girlfriend Linda find a log cabin in the woods with a voice recording from an archeologist who had recorded himself reciting ancient chants from "The Book of the Dead." As they play the recording an evil power is unleashed taking over Linda''s body.','col',810,765,'tt0092991','/4zqCKJVHUolGs6C5AZwAZqLWixW.jpg','/jyRk8ykqLOXaVadZ0aWRDd89gMP.jpg');
INSERT INTO movies VALUES('24985','Still Life',2006,'["China","Hong Kong"]','["Drama"]',113,'A town in Fengjie county is gradually being demolished and flooded to make way for the Three Gorges Dam. A man and woman visit the town to locate their estranged spouses, and become witness to the societal changes.','col',811,2346,'tt0859765','/pJYBqUk9zZ3lotYo4711HqWh8QE.jpg','/8TIRO8lxg3yGRqQNIAE11FFfWZS.jpg');
INSERT INTO movies VALUES('19707','Abraham''s Valley',1993,'["Portugal","France","Switzerland"]','["Drama"]',187,'Ema is a very attractive but innocent girl, so pretty that cars crash in her presence. Young marries Dr. Carlos Paiva, a father''s friend, to whom she is not attracted. They move to the Valley of Abraham. Carlos loves her, but decides to sleep in a separate room to avoid waking Ema when he has to return late at night. With time she begins to feel unhappy about her marriage, so she finds a lover.','col',812,107693,'tt0108471','/jXeKLrgYVAYEffQ2Gv4zh3ib0ti.jpg','/p4vyexQRP4QcmReoaEH204stIoI.jpg');
INSERT INTO movies VALUES('9524','Red Beard',1965,'["Japan"]','["Drama"]',185,'Aspiring to an easy job as personal physician to a wealthy family, Noboru Yasumoto is disappointed when his first post after medical school takes him to a small country clinic under the gruff doctor Red Beard. Yasumoto rebels in numerous ways, but Red Beard proves a wise and patient teacher. He gradually introduces his student to the unglamorous side of the profession, ultimately assigning him to care for a prostitute rescued from a local brothel.','bw',813,3780,'tt0058888','/fo800fRcWtl3Zhs6tPHfXP4KBak.jpg','/i4XlRFhNi61C2SZwgEuw8QgN59Q.jpg');
INSERT INTO movies VALUES('14925','My Life as a Dog',1985,'["Sweden"]','["Drama","Comedy"]',101,'A boy, obsessed with comparing himself with those less fortunate, experiences a different life at the home of his aunt and uncle in 1959 Sweden.','col',814,8816,'tt0089606','/eVg9IsX2HtR1BNYH0UAhF4JPHi7.jpg','/zKqzUT0ZAljEYPLceye6ZT4H9By.jpg');
INSERT INTO movies VALUES('16060','Women on the Verge of a Nervous Breakdown',1988,'["Spain"]','["Comedy","Drama"]',88,'Pepa resolves to kill herself with a batch of sleeping-pill-laced gazpacho after her lover leaves her. Fortunately, she is interrupted by a deliciously chaotic series of events.','col',815,4203,'tt0095675','/8C5FJlUo96pj1xAs2BKnB58PYzi.jpg','/mR96bAZpoyaez87HWGgZqH4A8VQ.jpg');
INSERT INTO movies VALUES('9061','Shock Corridor',1963,'["USA"]','["Drama","Mystery"]',101,'With the help of his girlfriend Cathy and Dr. Fong, a psychiatrist, ambitious journalist Johnny Barrett poses as a madman in order to be admitted to a mental institution where a bloody murder has been committed.','bw',816,25504,'tt0057495','/7jFI7GdduTss2SdgApcsiWtU5gA.jpg','/5JfXNdjitnpFoWxfARzD9IDYnyA.jpg');
INSERT INTO movies VALUES('6020','Chikamatsu monogatari',1954,'["Japan"]','["Drama","Romance"]',100,'In 17th century Kyoto, Osan is married to Ishun, a wealthy miserly scroll-maker. When Osan is falsely accused of having an affair with the best worker, Mohei, the pair flee the city and declare their love for each other. Ishun orders his men to find them, and separate them to avoid public humiliation.','bw',817,35861,'tt0046851','/2MTXDMxzFmbZ7Jf27DdTUeJdxJC.jpg','/aiEMx1ND6Gq5uFYWRHektj5CrSs.jpg');
INSERT INTO movies VALUES('18362','Van Gogh',1991,'["France"]','["Drama","Biography"]',158,'In late spring, 1890, Vincent moves to Auvers-sur-Oise, near Paris, under the care of Dr. Gachet, living in a humble inn. Fewer than 70 days later, Vincent dies from a self-inflicted gunshot wound. We see Vincent at work, painting landscapes and portraits. His brother Theo, wife Johanna, and their baby visit Auvers. Vincent is playful and charming, engaging the attentions of Gachet''s daughter Marguerite (who''s half Vincent''s age), a young maid at the inn, Cathy a Parisian prostitute, and Johanna. Shortly before his death, Vincent visits Paris, quarrels with Theo, disparages his own art and accomplishments, dances at a brothel, and is warm then cold toward Marguerite.','col',818,4734,'tt0103190','/qzQeNyfMUsFpFzqzmvNYUsQxm7.jpg','/2ISaysmOQceYV44eLchDgzb1vXo.jpg');
INSERT INTO movies VALUES('11778','O Lucky Man!',1973,'["UK","USA"]','["Drama","Comedy","Fantasy"]',178,'This sprawling, surrealist comedy serves as an allegory for the pitfalls of capitalism, as it follows the adventures of a young coffee salesman in modern Britain.','col',819,42464,'tt0070464','/2xlzrpQF76OCgcKpQZvP6WtlpJy.jpg','/sLtdQeSXmOUI6twrrbIEfUfXAx9.jpg');
INSERT INTO movies VALUES('1764','Woman of Paris, A',1923,'["USA"]','["Drama","Romance"]',78,'When Marie St. Clair believes she has been jilted by her artist fiance Jean, she decides to leave for Paris on her own. After spending a year in the city as a mistress of the wealthy Pierre Revel, she is reunited with Jean by chance. This leaves her with the choice between a glamorous life in Paris, and the true love she left behind.','bw',820,28974,'tt0014624','/s24VgyvJliT7fUA909ZHJpoBx1D.jpg','/y8WOKk49VdiA4RZ1UeFCt8xPVTF.jpg');
INSERT INTO movies VALUES('10257','Firemen''s Ball, The',1967,'["Czechoslovakia","Italy"]','["Comedy","Drama"]',73,'The firemen of a provincial Czechoslovakian town throw a ball in honor of the old chief''s retirement. There will be music and dancing, a beauty pageant and a raffle. The whole town will be in attendance. However, the proceedings are dogged by difficulty at every step. Workplace injuries, stolen prizes, a shortage of pretty girls... and fire.','col',821,38442,'tt0061781','/yylEjPttmTDar0o92StlrO5ghmw.jpg','/7ncgCjyUgL9EsRfbHVjl25jDHQa.jpg');
INSERT INTO movies VALUES('4573','She Wore a Yellow Ribbon',1949,'["USA"]','["Western","War"]',103,'After Custer and the 7th Cavalry are wiped out by Native Americans, everyone expects the worst. Capt. Nathan Brittles is ordered out on patrol but he''s also required to take along Abby Allshard, wife of the Fort''s commanding officer, and her niece Olivia Dandridge, who are being evacuated. Brittles is only a few days away from retirement and Olivia has caught the eye of two of the young officers in the Company. She''s taken to wearing a yellow ribbon in her hair, a sign that she has a beau in the Cavalry, but refuses to say for whom she is wearing it.','col',822,13909,'tt0041866','/u6vBfRXAUfoNfQ7RT2vDBP71XUe.jpg','/45tJCXfr3S08qb5fVP86duFUUzx.jpg');
INSERT INTO movies VALUES('14042','Losing Ground',1982,'["USA"]','["Comedy","Drama"]',86,'Sara, a cold college professor, and her husband, an ecstatic painter, spend a summer away from the city, straining their rocky relationship.','col',823,273896,'tt0084269','/zSZT7ndjNUsskQq9IWosW3a9cbk.jpg','/6tAH0LR2DJUlfznqlEkoSAjQVHi.jpg');
INSERT INTO movies VALUES('10792','Dodes''ka-den',1970,'["Japan"]','["Fantasy","Drama"]',140,'This film follows the daily lives of a group of people barely scraping by in a slum on the outskirts of Tokyo. Yet as desperate as their circumstances are, each of them—the homeless father and son envisioning their dream house; the young woman abused by her uncle; the boy who imagines himself a trolley conductor—finds reasons to carry on.','col',824,33205,'tt0065649','/gP9pM94ATcZGfKQ3faKy0a3dVIi.jpg','/6CsuEnJUbrHb2xVLgkB4zxb1Kta.jpg');
