INSERT INTO movies VALUES('16472','Edward Scissorhands',1990,'["USA"]','["Romance","Fantasy"]',105,'A small suburban town receives a visit from a castaway unfinished science experiment named Edward.','col',826,162,'tt0099487','/e0FqKFvGPdQNWG8tF9cZBtev9Em.jpg','/3Nn5BOM1EVw1IYrv6MsbOS6N1Ol.jpg');
INSERT INTO movies VALUES('2351','Thief of Bagdad, The',1940,'["UK","USA"]','["Fantasy","Family","Adventure"]',106,'When Prince Ahmad is blinded and cast out of Bagdad by the nefarious Jaffar, he joins forces with the scrappy thief Abu to win back his royal place, as well as the heart of a beautiful princess.','col',827,12232,'tt0033152','/8Fs29JYTOkDluTXgbvLRIaps6PO.jpg','/oaSBgbi0czdGjtXllTTIMj1H3th.jpg');
INSERT INTO movies VALUES('2447','Dumbo',1941,'["USA"]','["Animated","Adventure","Family"]',64,'Dumbo is a baby elephant born with over-sized ears and a supreme lack of confidence. But thanks to his even more diminutive buddy Timothy the Mouse,  the pint-sized pachyderm learns to surmount all obstacles.','col',828,11360,'tt0033563','/xElwvLH9stNdduVnx9hx5UqEUwv.jpg','/aRVQ1EgTx3vbhK6qls2O834bPQc.jpg');
INSERT INTO movies VALUES('48733','Petite Maman',2021,'["France"]','["Drama","Fantasy"]',73,'After the death of her beloved grandmother, eight-year-old Nelly meets a strangely familiar girl her own age in the woods. Instantly forming a connection with this mysterious new friend, Nelly embarks on a fantastical journey of discovery which helps her come to terms with this newfound loss.','col',829,749004,'tt13204490','/3TPkB08SMeLbg5WwC0lkw1b1DyG.jpg','/yuXZXuS4RCTnCYScrRWBCNz2ywB.jpg');
INSERT INTO movies VALUES('10787','Deep End',1970,'["UK","West Germany"]','["Drama","Comedy","Romance"]',88,'London, England. Mike, a fifteen-year-old boy, gets a job in a bathhouse, where he meets Susan, an attractive young woman who works there as an attendant.','col',830,59408,'tt0066122','/8pZxUJTgjerjxuifSU13B8pXAJB.jpg','/zZ0bs8rPbd0FppyJq5ukaATh745.jpg');
INSERT INTO movies VALUES('6531','Smiles of a Summer Night',1955,'["Sweden"]','["Romance","Comedy"]',108,'Early in the 20th century, middle-aged lawyer Fredrik Egerman and his young wife, Anne, have still not consummated their marriage, while Fredrik''s son finds himself increasingly attracted to his new stepmother. To make matters worse, Fredrik''s old flame Desiree makes a public bet that she can seduce him at a romantic weekend retreat where four couples convene, swapping partners and pairing off in unexpected ways.','bw',831,11700,'tt0048641','/wKeV8lKz8k9DDBCw6MJ9MkhvhqF.jpg','/mPpEL0P0JSw8AdjB2fx4NzIUIFZ.jpg');
INSERT INTO movies VALUES('25158','Sur, El',1983,'["Spain","France"]','["Drama"]',95,'A woman recalls her childhood growing up in the North of Spain, focusing on her relationship with her father.','col',832,48139,'tt0084740','/bAyghNTLIwHIxoQOha6kHfwmxS6.jpg','/gsv7SunY5Gn8766So6znOzVIKNC.jpg');
INSERT INTO movies VALUES('33244','Funeral Parade of Roses',1969,'["Japan"]','["Drama"]',105,'In late 60s Tokyo,  Eddie, a young drag queen, is the favourite of Gonda, the owner of the bar where she works. This relationship provokes the jealousy of Gonda''s mistress, Leda, the bar''s matron. Eddie and Gonda decide to get rid of her...','bw',833,1556,'tt0064068','/7cRQ6rSGajW2soWDr3voEN2rgYO.jpg','/zTPOzxjdezfzC3l82gbeCtIloRt.jpg');
