INSERT INTO movies VALUES('22491','Naked Island, The',1960,'["Japan"]','["Drama"]',96,'A family of four are the sole inhabitants of a small island, where they struggle each day to irrigate their crops.','bw',835,3764,'tt0056049','/rHpQyPBuFyofx5D5UC95ec2sFgV.jpg','/fet6ORPwa6HZy2ZMbAAS3wdIhtl.jpg');
INSERT INTO movies VALUES('23095','Commune (Paris, 1871), La',2000,'["France"]','["Drama","History","War"]',345,'We are in the year 1871. A journalist for Versailles Television broadcasts a soothing and official view of events while a Commune television is set up to provide the perspectives of the Paris rebels. On a stage-like set, more than 200 actors interpret characters of the Commune, especially the Popincourt neighbourhood in the XIth arrondissement. They voice their own thoughts and feelings concerning the social and political reforms. The scenes consist mainly of long camera takes.','bw',836,63195,'tt0257497','/rz39nFOxbeHAHx56ac4ao27OJbw.jpg','/58z49mkRuLe0B1qa76dseITXGs8.jpg');
INSERT INTO movies VALUES('31784','Margaret',2011,'["USA"]','["Drama"]',150,'A young woman witnesses a bus accident, and is caught up in the aftermath, where the question of whether or not it was intentional affects many people''s lives.','col',837,44754,'tt0466893','/zqBao8uRH6TQAJd13tqC22vPB76.jpg','/6xdwVuwNeMtAa8AQgXvE39aQB1V.jpg');
INSERT INTO movies VALUES('21084','Son, The',2002,'["Belgium","France"]','["Drama"]',103,'A joinery instructor at a rehab center refuses to take a new teen as his apprentice, but then begins to follow the boy through the hallways and streets.','col',838,35172,'tt0291172','/mbAG0JOVgcOIH8LVVynw87ONgej.jpg','/sMyrnUx8P6nZQ70lJnCipigD8hn.jpg');
INSERT INTO movies VALUES('18587','Female Trouble',1974,'["USA"]','["Crime","Comedy"]',98,'Dawn Davenport progresses from a teenage nightmare hell-bent on getting cha-cha heels for Christmas to a fame monster whose egomaniacal impulses land her in the electric chair.','col',839,14267,'tt0072979','/cqhIufhoORDMuFKEinV1IIYUBxD.jpg','/r0bOolx0Ok6CYXSjk5fnr1au88Q.jpg');
INSERT INTO movies VALUES('13538','Hitler: A Film from Germany',1977,'["West Germany","France","UK"]','["Biography","Drama","History"]',442,'This inventive, exhaustive seven-hour film looks at the rise, reign and demise of Adolf Hitler. German director Hans Jürgen Syberberg, who was a child during World War II, doesn''t try to recreate history to the letter. Instead, he places his actors -- many of whom play several roles -- on a stage and has them reenact events based on and inspired by Hitler''s life. The action combines traditional narration and historical characters, but also idiosyncratic tweaks, like the use of puppets.','col',840,58435,'tt0076147','/gNI82AHWfQJrlL0NpvnLPrNmUZn.jpg','/7gVYaJxnC5a8i4y2k8x4hJEwAV0.jpg');
INSERT INTO movies VALUES('4626','White Heat',1949,'["USA"]','["Crime","Action","Drama"]',114,'A psychopathic criminal with a mother complex makes a daring break from prison and then leads his old gang in a chemical plant payroll heist. After the heist, events take a crazy turn.','bw',841,15794,'tt0042041','/4ekAK25fz1FDzRUHuJs171uiVaI.jpg','/cap8458wFeRCJSKxL758dI82TRK.jpg');
INSERT INTO movies VALUES('14340','Right Stuff, The',1983,'["USA"]','["Drama","Biography","Adventure"]',193,'As the Space Race ensues, seven pilots set off on a path to become the first American astronauts to enter space. However, the road to making history brings forth momentous challenges.','col',842,9549,'tt0086197','/kFR1p46HXJVVMpmOil8bNWnAQ50.jpg','/w2KUVzeOC1u6cQwvUV0qqi7QYxs.jpg');
INSERT INTO movies VALUES('14347','Scarface',1983,'["USA"]','["Crime","Drama"]',170,'After getting a green card in exchange for assassinating a Cuban government official, Tony Montana stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.','col',843,111,'tt0086250','/iQ5ztdjvteGeboxtmRdXEChJOHh.jpg','/cCvp5Sni75agCtyJkNOMapORUQV.jpg');
INSERT INTO movies VALUES('3553','They Were Expendable',1945,'["USA"]','["War","Drama"]',135,'Shortly after Pearl Harbor, a squadron of PT-boat crews in the Philippines must battle the Navy brass between skirmishes with the Japanese. The title says it all about the Navy''s attitude towards the PT-boats and their crews.','bw',844,18771,'tt0038160','/ejzJHdvEtUVbiLrDE55DRQskYyf.jpg','/iHDx1MZr0BsbT7rigPccuXxNWTX.jpg');
INSERT INTO movies VALUES('45098','Once Upon a Time... in Hollywood',2019,'["USA","UK","China"]','["Comedy","Drama"]',161,'Los Angeles, 1969. TV star Rick Dalton, a struggling actor specializing in westerns, and stuntman Cliff Booth, his best friend, try to survive in a constantly changing movie industry. Dalton is the neighbor of the young and promising actress and model Sharon Tate, who has just married the prestigious Polish director Roman Polanski…','col-bw',845,466272,'tt7131622','/8j58iEBw9pOXFD2L0nt0ZXeHviB.jpg','/oRiUKwDpcqDdoLwPoA4FIRh3hqY.jpg');
INSERT INTO movies VALUES('22672','Sicilia!',1999,'["Italy","France","Germany"]','["Drama"]',66,'A man returns to visit his native Sicily after living in New York for a long time. He learns about the Sicilian way of life from stylized conversations with an orange picker, his fellow train passengers, his mother, and a knife-sharpener.','bw',846,104871,'tt0200135','/2rRVggagAjpXBF6NDTe918FIifZ.jpg','/rac2rurGSht4QRkykCpOpeZ6xBC.jpg');
INSERT INTO movies VALUES('25850','Persepolis',2007,'["France","USA"]','["Animated","Biography","Drama"]',96,'In 1970s Iran, Marjane ''Marji'' Statrapi watches events through her young eyes and her idealistic family of a long dream being fulfilled of the hated Shah''s defeat in the Iranian Revolution of 1979. However as Marji grows up, she witnesses first hand how the new Iran, now ruled by Islamic fundamentalists, has become a repressive tyranny on its own.','col-bw',847,2011,'tt0808417','/aU8i2QAdTyRR1nYb36Gq51xXP8p.jpg','/6kqybERm5qi2jGpu8I7DaQPxpSU.jpg');
INSERT INTO movies VALUES('23142','Grizzly Man',2005,'["USA"]','["Documentary"]',103,'Werner Herzog''s documentary film about the "Grizzly Man" Timothy Treadwell and what the thirteen summers in a National Park in Alaska were like in one man''s attempt to protect the grizzly bears. The film is full of unique images and a look into the spirit of a man who sacrificed himself for nature.','col',848,501,'tt0427312','/nXIV2qGK9KkdkaOTzrpK87CuAGC.jpg','/hAlB9MaamrP1eDhGA4AkjSAPxAf.jpg');
INSERT INTO movies VALUES('22045','My Little Loves',1974,'["France"]','["Drama"]',123,'Daniel lives with his grandmother and, after a year of high school, goes to live with his mother in the south of France; a harsher environment which rapidly changes his perception of friends, work, and women.','col',849,64296,'tt0071833','/nueQTPSsCorjhKYavTuUDCruhGG.jpg','/9e8ICxIqdPnjA0jyy2MOp9mU2Dd.jpg');
INSERT INTO movies VALUES('21016','Too Early, Too Late',1981,'["France","Egypt"]','["Documentary"]',100,'Inspired by a letter by Friedrich Engels and a 1974 account of two militant Marxist writers who had been imprisoned by the Nasser regime, Straub-Huillet filmed this film in France and Egypt during 1980. They reflect on Egypt’s history of peasant struggle and liberation from Western colonization, and link it to class tensions in France shortly before the Revolution of 1789, quoting texts by Engels as well as the pioneering nonfiction film Workers Leaving the Lumière Factory (1895).','col-bw',850,97032,'tt0083230','/z5rox0Nys65RiWAI3FKBXK5If60.jpg','/myaJXaFqaQQ9KVcSbiuTaf1KhJN.jpg');
INSERT INTO movies VALUES('10392','Shame',1968,'["Sweden"]','["War","Drama"]',103,'In the midst of a civil war, former violinists Jan and Eva Rosenberg, who have a tempestuous marriage, run a farm on a rural island. In spite of their best efforts to escape their homeland, the war impinges on every aspect of their lives.','bw',851,26372,'tt0063611','/cRJFOadujA7COrBV4HqB6bWcpLs.jpg','/mq8Vguqv4GjHfpSVIWFkIsOS6YK.jpg');
INSERT INTO movies VALUES('28222','Inglourious Basterds',2009,'["USA","Germany"]','["Action","Drama","War"]',153,'In Nazi-occupied France during World War II, a group of Jewish-American soldiers known as "The Basterds" are chosen specifically to spread fear throughout the Third Reich by scalping and brutally killing Nazis. The Basterds, lead by Lt. Aldo Raine soon cross paths with a French-Jewish teenage girl who runs a movie theater in Paris which is targeted by the soldiers.','col',852,16869,'tt0361748','/7sfbEnaARXDDhKm0CZ7D7uc2sbo.jpg','/hg0MTIFs49ef179C9Y1HRtzqbbK.jpg');
INSERT INTO movies VALUES('13296','Tin Drum, The',1979,'["West Germany","France","Poland","Yugoslavia"]','["War","Drama"]',142,'Oskar Matzerath is a very unusual boy. Refusing to leave the womb until promised a tin drum by his mother, Agnes, Oskar is reluctant to enter a world he sees as filled with hypocrisy and injustice, and vows on his third birthday to never grow up. Miraculously, he gets his wish. As the Nazis rise to power in Danzig, Oskar wills himself to remain a child, beating his tin drum incessantly and screaming in protest at the chaos surrounding him.','col',853,659,'tt0078875','/tm408GMyQqfqFJ7MKCkwc5uQ3wi.jpg','/uZJjc4hMgckb3H3tVkTmbmcBhIT.jpg');
INSERT INTO movies VALUES('6748','Invasion of the Body Snatchers',1956,'["USA"]','["Science Fiction","Horror"]',80,'A small-town doctor learns that the population of his community is being replaced by emotionless alien duplicates.','bw',854,11549,'tt0049366','/8BrMQmgwGzIHSyBjCDOLOdi79fJ.jpg','/1qG8TfiE5mCMdaqrFioaGmhBrpY.jpg');
INSERT INTO movies VALUES('1457','Spione',1928,'["Germany"]','["Spy","Thriller"]',90,'The mastermind behind a ubiquitous spy operation learns of a dangerous romance between a Russian lady in his employ and a dashing agent from the government''s secret service.','bw',855,78507,'tt0019415','/o3LyvAp0u6aepncoYyCmFSbSiKX.jpg','/h749gsHjvzST11avCDHp1fCkyNQ.jpg');
INSERT INTO movies VALUES('17906','Point Break',1991,'["USA","Japan"]','["Thriller","Action","Crime"]',122,'In Los Angeles, a gang of bank robbers who call themselves The Ex-Presidents commit their crimes while wearing masks of Reagan, Carter, Nixon and Johnson. Believing that the members of the gang could be surfers, the F.B.I. sends young agent Johnny Utah to the beach undercover to mix with the surfers and gather information.','col',856,1089,'tt0102685','/tlbERIghrQ4oofqlbF7H0K0EYnx.jpg','/3PQLohxgvjUQgF94sY5SEgVKSS6.jpg');
INSERT INTO movies VALUES('20497','Toute une nuit',1982,'["Belgium","France","Netherlands","Canada"]','["Drama"]',90,'Following over two dozen different people in the almost wordless atmosphere of a dark night in a Brussels town, Akerman examines acceptance and rejection in the realm of romance.','col',857,63215,'tt0084808','/ruXSiqpZCWeq1KBNxAWPC0OrnAt.jpg','/3gSqZ9cKFibs60gXrZNoiXAizsO.jpg');
INSERT INTO movies VALUES('8355','Breakfast at Tiffany''s',1961,'["USA"]','["Romance","Drama","Comedy"]',115,'Holly Golightly is an eccentric New York City playgirl determined to marry a Brazilian millionaire. But when young writer Paul Varjak moves into her apartment building, her past threatens to get in their way.','col',858,164,'tt0054698','/79xm4gXw4l7A5D0XukUOJRocFYQ.jpg','/ntZAoOP02Y7Ufu3CLVMKGRiAxww.jpg');
INSERT INTO movies VALUES('1363','Shanghai Express',1932,'["USA"]','["Drama","Adventure"]',82,'A beautiful temptress re-kindles an old romance while trying to escape her past during a tension-packed train journey.','bw',859,875,'tt0023458','/l59j7Mdfry4Mbxvpo68qTG8Y4GY.jpg','/yW9OHnJKeHzo7OP1t8E1hvyInmt.jpg');
INSERT INTO movies VALUES('21079','Irréversible',2002,'["France"]','["Crime","Drama","Horror"]',97,'A woman’s lover and her ex-boyfriend take justice into their own hands after she becomes the victim of a rapist. Because some acts can’t be undone. Because man is an animal. Because the desire for vengeance is a natural impulse. Because most crimes remain unpunished.','col',860,979,'tt0290673','/rxeDxo8FvZpLu6iplNpxdtAVnfu.jpg','/xV1EfNSEg6id6juJPr1vM6p9x5X.jpg');
INSERT INTO movies VALUES('18760','Starship Troopers',1997,'["USA"]','["Science Fiction","Action","Adventure"]',129,'Set in the future, the story follows a young soldier named Johnny Rico and his exploits in the Mobile Infantry. Rico''s military career progresses from recruit to non-commissioned officer and finally to officer against the backdrop of an interstellar war between mankind and an arachnoid species known as "the Bugs".','col',861,563,'tt0120201','/cxCmv23O7p3hyHwqoktHYkZcGsY.jpg','/9qokUngA9fAgBy7skSyZj2irOfR.jpg');
INSERT INTO movies VALUES('20259','Amores perros',2000,'["Mexico"]','["Drama"]',153,'A fatalistic car crash in Mexico city sets off a chain of events in the lives of three people: a supermodel, a young man wanting to run off with his sister-in-law, and a homeless man. Their lives are catapulted into unforeseen situations instigated by the seemingly inconsequential destiny of a dog.','col',862,55,'tt0245712','/vV4vlD4ool5JSsS1rB82qjCF6z8.jpg','/qNQOEzm6xJ2hgWDImzkIox27aiV.jpg');
INSERT INTO movies VALUES('21652','Asthenic Syndrome, The',1989,'["USSR"]','["Drama"]',153,'In the old days it was called hypochrondria, or black melancholia. Now, apparently, it''s termed the Asthenic Syndrome. Whatever it is, Nikolai, a teacher of epicly indifferent pupils, has got it, and it''s not much fun.','col-bw',863,97039,'tt0096841','/kE0HAjG6Awe0nOta9uvnzVKVgsH.jpg','/gdPjWCc96pMtazkrkw9EIaeEUle.jpg');
