INSERT INTO movies VALUES('16356','Time of the Gypsies',1988,'["Yugoslavia","Italy","UK"]','["Drama","Comedy","Crime"]',142,'In this luminous tale set in the former Yugoslavia, Perhan, an engaging young Romany with telekinetic powers, is seduced by the quick-cash world of petty crime that threatens to destroy him and those he loves.','col',865,20123,'tt0097223','/fF9kWNMjiXC6f4YrdVFA0ScnWgQ.jpg','/s3HMQkcWOBnP1OHIikpbhRCtKea.jpg');
INSERT INTO movies VALUES('34738','Blue is the Warmest Colour',2013,'["France","Belgium","Spain"]','["Drama","Romance"]',179,'Adèle''s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire, to assert herself as a woman and as an adult. In front of others, Adele grows, seeks herself, loses herself, finds herself.','col',866,152584,'tt2278871','/kgUk1wti2cvrptIgUz0VTAtSF6w.jpg','/uKFqdRcJ3Oe2qZscCLCZVKo1nml.jpg');
INSERT INTO movies VALUES('17008','Clueless',1995,'["USA"]','["Comedy"]',97,'Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school''s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.','col',867,9603,'tt0112697','/8AwVTcgpTnmeOs4TdTWqcFDXEsA.jpg','/2FonLz0RPxbBriOlZ9mWhYdlqCp.jpg');
INSERT INTO movies VALUES('18711','Outskirts',1933,'["USSR"]','["War","Drama"]',98,'Outskirts is an internationally renowned masterpiece of early sound cinema. In a remote Russian village during World War I, colorful and nuanced characters experience divided loyalties: family loyalty vs. personal desire, nationalism vs. transcendent humanism.','bw',868,94638,'tt0024402','/xM237sYuNtPq3VnmBsPzlyF9yAV.jpg','/3yAckThEiCiMa1E5fVaUgRjpQeX.jpg');
