INSERT INTO movies VALUES('12261','Monty Python and the Holy Grail',1975,'["UK"]','["History","Comedy"]',90,'King Arthur, accompanied by his squire, recruits his Knights of the Round Table, including Sir Bedevere the Wise, Sir Lancelot the Brave, Sir Robin the Not-Quite-So-Brave-As-Sir-Lancelot and Sir Galahad the Pure. On the way, Arthur battles the Black Knight who, despite having had all his limbs chopped off, insists he can still fight. They reach Camelot, but Arthur decides not  to enter, as "it is a silly place".','col',875,762,'tt0071853','/hWx1ANiWEWWyzKPN0us35HCGnhQ.jpg','/1KgXxv6tHXOnakqYvMPvFwYKWiw.jpg');
