INSERT INTO movies VALUES('8473','Misfits, The',1961,'["USA"]','["Western","Romance","Drama"]',124,'While filing for a divorce, beautiful ex-stripper Roslyn Taber ends up meeting aging cowboy-turned-gambler Gay Langland and former World War II aviator Guido Racanelli. The two men instantly become infatuated with Roslyn and, on a whim, the three decide to move into Guido''s half-finished desert home together. When grizzled ex-rodeo rider Perce Howland arrives, the unlikely foursome strike up a business capturing wild horses.','bw',878,11536,'tt0055184','/2lzWxT6HIvZMWSQHzk9eCpv3guQ.jpg','/zts98k3uBQ3qEZKQFwBliW2jlpf.jpg');
INSERT INTO movies VALUES('8963','Great Escape, The',1963,'["USA"]','["War","Prison","Adventure"]',172,'The Nazis, exasperated at the number of escapes from their prison camps by a relatively small number of Allied prisoners, relocate them to a high-security ''escape-proof'' camp to sit out the remainder of the war. Undaunted, the prisoners plan one of the most ambitious escape attempts of World War II. Based on a true story.','col',879,5925,'tt0057115','/gBH4H8UMFxl139HaLz6lRuvsel8.jpg','/zlg0d4pnq1xDOU4cQxqGG8bX5l0.jpg');
