INSERT INTO movies VALUES('30907','Mysteries of Lisbon',2010,'["Portugal","France"]','["Drama","Mystery"]',272,'The tragic story of the many lives of Father Dinis, his dark origins and his pious works, and the different fates of all those who, trapped in a sinister web of love, hate and crime, cross paths with him through years of adventure and misfortune in the convulsed Europe of the late 18th and early 19th centuries.','col',881,57403,'tt1236371','/AbwNQglY8PcqeKkYgSx3CBdpfTF.jpg','/nAD6wh7toJvNMYxYZzrtrK5ORa0.jpg');
