INSERT INTO movies VALUES('18707','Night of Counting the Years, The',1969,'["Egypt"]','["Drama"]',102,'Set in 1881, a year before the start of British colonial rule, it is based on the true story of the Abd el-Rasuls, an Upper-Egyptian clan that had been robbing a cache of mummies they have discovered at tomb DB320 near the village of Kurna, and selling the artifacts on the black market. After a conflict within the clan, one of its members made a crucial decision when the Antiquities Service arrived.','col',886,46707,'tt0064703','/cARoZOcGuao531ZSXKukDlVcFbL.jpg','/aRJV56OqkO7i27UXcrKH43yfGPi.jpg');
