INSERT INTO movies VALUES('9255','Juliet of the Spirits',1965,'["Italy"]','["Fantasy","Drama"]',148,'Middle-aged Giulietta grows suspicious of her husband, Giorgio, when his behavior grows increasingly questionable. One night when Giorgio initiates a seance amongst his friends, Giulietta gets in touch with spirits and learns more about herself and her painful past. Slightly skeptical, but intrigued, she visits a mystic who gives her more information -- and nudges her toward the realization that her husband is indeed a philanderer.','col',888,19120,'tt0059229','/p27vgTv3KD1S5tZT7iHm9DzFB8I.jpg','/tVAvXBQP0bgfy5JdvqrFJHiBRc9.jpg');
