INSERT INTO movies VALUES('13903','Woman Next Door, The',1981,'["France"]','["Romance","Drama"]',106,'Madame Jouve, the narrator, tells the tragedy of Bernard and Mathilde. Bernard was living happily with his wife Arlette and his son Thomas. One day, a couple, Philippe and Mathilde Bauchard, moves into the next house. This is the accidental reunion of Bernard and Mathilde, who had a passionate love affair years ago. The relationship revives... A somber study of human feelings.','col',890,12579,'tt0082370','/nxBf3Y7Q9XVuKvUl0df8MW2IsQ7.jpg','/tPVxib37w37iEYTJBCTsmsrD5Lx.jpg');
INSERT INTO movies VALUES('745','It''s a Gift',1934,'["USA"]','["Comedy"]',73,'After he inherits some money, Harold Bissonette ("pronounced bis-on-ay") decides to give up the grocery business, move to California and run an orange grove. Despite his family''s objections and the news that the land he bought is worthless, Bissonette packs up and drives out to California with his nagging wife Amelia and children.','bw',891,28001,'tt0025318','/3DlYiSh3S7A9GO15gUu7zg92bD0.jpg','/cefq3RSFslyEr9VXQwDGrBtzqPQ.jpg');
INSERT INTO movies VALUES('12783','Stroszek',1977,'["West Germany"]','["Drama","Comedy"]',115,'Bruno Stroszek is released from prison and warned to stop drinking. He has few skills and fewer expectations: with a glockenspiel and an accordion, he ekes out a living as a street musician. He befriends Eva, a prostitute down on her luck and they join his neighbor, Scheitz, an elderly eccentric, when he leaves Germany to live in Wisconsin.','col',893,11698,'tt0075276','/wDq9ytRxoVpICRcx1BvagmXhd4t.jpg','/eM3Kbzk9v03wJc0yoSC0QGEOU9C.jpg');
