INSERT INTO movies VALUES('17192','Exotica',1994,'["Canada"]','["Drama"]',104,'In the upscale Toronto strip club Exotica, dancer Christina is visited nightly by the obsessive Francis, a depressed tax auditor. Her ex-boyfriend, the club''s MC, Eric, still jealously pines for her even as he introduces her onstage, but Eric is having his own relationship problems with the club''s female owner. Thomas, a mysterious pet-shop owner, is about to become unexpectedly involved in their lives.','col',896,20156,'tt0109759','/3pibvRQK3A1E8cyhX8IQPIAU2J8.jpg','/sdgWn2YmR2h0HWFUGXmvbCerQCR.jpg');
