INSERT INTO movies VALUES('45386','Atlantics',2019,'["France","Senegal","Belgium"]','["Drama"]',106,'Arranged to marry a rich man, young Ada is crushed when her true love goes missing at sea during a migration attempt — until a miracle reunites them.','col',912,496967,'tt10199586','/8lvXZaJ1Lq1RRxSxwkKo0uepvX7.jpg','/sopMsXMsgGLP3PnDwAO5NLuUKeO.jpg');
INSERT INTO movies VALUES('27523','Let the Right One In',2008,'["Sweden","Norway"]','["Drama","Horror","Romance"]',114,'Set in 1982 in the suburb of Blackeberg, Stockholm, twelve-year-old Oskar is a lonely outsider, bullied at school by his classmates; at home, Oskar dreams of revenge against a trio of bullies. He befriends his twelve-year-old, next-door neighbor Eli, who only appears at night in the snow-covered playground outside their building.','col',913,13310,'tt1139797','/4hezTKTuZMp0l2ufihKwPgLmfLg.jpg','/2l7T1uDcOkivwUq3wDO8gGL5JAi.jpg');
INSERT INTO movies VALUES('10595','Boucher, Le',1970,'["France","Italy"]','["Thriller","Drama"]',94,'An unlikely friendship between a dour, working class butcher and a repressed schoolteacher coincides with a grisly series of Ripper-type murders in a provincial French town.','col',914,2912,'tt0064106','/An2gkXn5TATag9Adul2Zbq5Ndrv.jpg','/eglf9YfrgCDlupodENN8qPtN5vC.jpg');
INSERT INTO movies VALUES('16027','They Live',1988,'["USA"]','["Science Fiction","Thriller","Action"]',93,'Nada, a wanderer without meaning in his life, discovers a pair of sunglasses capable of showing the world the way it truly is. As he walks the streets of Los Angeles, Nada notices that both the media and the government are comprised of subliminal messages meant to keep the population subdued, and that most of the social elite are skull-faced aliens bent on world domination. With this shocking discovery, Nada fights to free humanity from the mind-controlling aliens.','col',915,8337,'tt0096256','/ngnybFTuopfbfmmEeX9jjBQQmF6.jpg','/ybQY0GgRrSx8hvH97MxOydQlfp1.jpg');
INSERT INTO movies VALUES('4943','American in Paris, An',1951,'["USA"]','["Musical","Dance"]',115,'Jerry Mulligan is an exuberant American expatriate in Paris trying to make a reputation as a painter. His friend Adam is a struggling concert pianist who''s a long time associate of a famous French singer, Henri Baurel. A lonely society woman, Milo Roberts, takes Jerry under her wing and supports him, but is interested in more than his art.','col',916,2769,'tt0043278','/lyDXkvG53ldz6Cf7dbjJl7TaoP5.jpg','/k6Unnx1OCgVteDDzWJLXTw05VGZ.jpg');
INSERT INTO movies VALUES('18473','Night of the Demon',1957,'["UK","USA"]','["Horror","Mystery"]',95,'American professor John Holden arrives in London for a conference on parapsychology only to discover that the colleague he was supposed to meet was killed in a freak accident the day before. It turns out that the deceased had been investigating a cult lead by Dr. Julian Karswell. Though a skeptic, Holden is suspicious of the devil-worshiping Karswell. Following a trail of mysterious manuscripts, Holden enters a world that makes him question his faith in science.','bw',917,25103,'tt0050766','/ePAjGAhynpwEI5HbpIrB28ML6lg.jpg','/63BiKcpXpEbpUcTWlZe5vronU9E.jpg');
INSERT INTO movies VALUES('19785','Zorns Lemma',1970,'["USA"]','["Avant","Garde"]',60,'Zorns Lemma is a 1970 American structuralist film by Hollis Frampton. It is named after Zorn''s lemma (also known as the Kuratowski–Zorn lemma), a proposition of set theory formulated by mathematician Max Zorn in 1935.  Zorns Lemma is prefaced with a reading from an early grammar textbook. The remainder of the film, largely silent, shows the viewer an evolving 24-part "alphabet" (where i & j and u & v are interchanged) which is cycled through, replaced and expanded upon. The film''s conclusion shows a man, woman and dog walking through snow as several voices read passages from On Light, or the Ingression of Forms by Robert Grosseteste.','col',918,88276,'tt0131149','/4WNIR5z62ulM2cMxc3bon5TPV7f.jpg',NULL);
INSERT INTO movies VALUES('6334','Criminal Life of Archibaldo de la Cruz, The',1955,'["Mexico"]','["Drama","Crime"]',91,'A bizarre black comedy about a man whose overwhelming ambition in life is to be a renowned serial killer of women, and will stop at nothing to achieve it - but not everything goes according to plan...','bw',919,37628,'tt0048037','/fahN78aK53M7mPNLcbDzezBJc6H.jpg','/lgNnEQCRGVibL8NYW5pKZFwdQLI.jpg');
INSERT INTO movies VALUES('19246','Tongues Untied',1989,'["USA"]','["Documentary"]',55,'Marlon Riggs, with assistance from other gay Black men, especially poet Essex Hemphill, celebrates Black men loving Black men as a revolutionary act. The film intercuts footage of Hemphill reciting his poetry, Riggs telling the story of his growing up, scenes of men in social intercourse and dance, and various comic riffs, including a visit to the "Institute of Snap!thology," where men take lessons in how to snap their fingers: the sling snap, the point snap, the diva snap.','col',920,97049,'tt0103099','/wbrcRd695aB8D6pkWh0hSurKRbO.jpg','/g6bRrjGqjtcntqf5WMRULce7ebt.jpg');
INSERT INTO movies VALUES('15896','Last Temptation of Christ, The',1988,'["USA","Canada"]','["Religious","Drama"]',164,'Jesus, a humble Judean carpenter beginning to see that he is the son of God, is drawn into revolutionary action against the Roman occupiers by Judas -- despite his protestations that love, not violence, is the path to salvation. The burden of being the savior of mankind torments Jesus throughout his life, leading him to doubt.','col',921,11051,'tt0095497','/7L4qwrC1mipZXJfU5oRgQWChLv1.jpg','/r76RjsexxdOM5GAhTRo7FRxdm3c.jpg');
INSERT INTO movies VALUES('7734','Anatomy of a Murder',1959,'["USA"]','["Drama"]',160,'Semi-retired Michigan lawyer Paul Biegler takes the case of Army Lt. Manion, who murdered a local innkeeper after his wife claimed that he raped her. Over the course of an extensive trial, Biegler parries with District Attorney Lodwick and out-of-town prosecutor Claude Dancer to set his client free, but his case rests on the victim''s mysterious business partner, who''s hiding a dark secret.','bw',922,93,'tt0052561','/zMxLbSPpToTCc6yK2Gddhx6nHNN.jpg','/jtCNu6f3MCFuEQ4cyHcNdI1QUjI.jpg');
INSERT INTO movies VALUES('39426','Cemetery of Splendour',2015,'["Thailand","UK","Germany","France","Malaysia","South Korea","Mexico","USA","Norway"]','["Drama","Fantasy"]',122,'In a hospital, ten soldiers are being treated for a mysterious sleeping sickness. In a story in which dreams can be experienced by others, and in which goddesses can sit casually with mortals, a nurse learns the reason why the patients will never be cured, and forms a telepathic bond with one of them.','col',923,298721,'tt2818654','/pK5y82ISbaBWa87R5neub8qojDk.jpg','/kY6SdYpsvyaGletzZSEljzPeAWM.jpg');
INSERT INTO movies VALUES('12391','Cría cuervos',1976,'["Spain"]','["Drama","Crime","Mystery"]',110,'Ana, an eight-year-old girl living in Madrid with her grandmother and two sisters, mourns the death of her mother.','col',924,51857,'tt0074360','/hueMt6pkaV8nwVGwKP2uuiqF5DJ.jpg','/sc600L1efonWcAm1HDA6WMAAmn0.jpg');
INSERT INTO movies VALUES('13842','Reds',1981,'["USA"]','["History","Drama","Biography"]',200,'An account of the revolutionary years of the legendary American journalist John Reed, who shared his adventurous professional life with his radical commitment to the socialist revolution in Russia, his dream of spreading its principles among the members of the American working class, and his troubled romantic relationship with the writer Louise Bryant.','col',925,18254,'tt0082979','/3jOs4aWI7XSVIEaF8KMojNre7A7.jpg','/y4CB2Bu0XGU2C94zbhCP9Y1bNCa.jpg');
INSERT INTO movies VALUES('12537','Seven Beauties',1975,'["Italy"]','["Drama","Comedy","War"]',116,'Pasqualino Frafuso, known in Naples as "Pasqualino Seven Beauties" is a petty thief who lives off of the profits of his seven sisters while claiming to protect their honor at any cost, Pasqualino is arrested for murder and later sent to fight in the army after committing sexual assault. The Germans capture him and he gets sent to a concentration camp where he plots to make his escape by seducing a German officer.','col',926,37550,'tt0075040','/i0ZLApe4mIQWopELhEPxOQziDBh.jpg','/4ilXtC261Kzam3DxriDAlPQJH2K.jpg');
INSERT INTO movies VALUES('16224','Killer, The',1989,'["Hong Kong"]','["Thriller","Crime","Action"]',110,'Mob assassin Jeffrey is no ordinary hired gun; the best in his business, he views his chosen profession as a calling rather than simply a job. So, when beautiful nightclub chanteuse Jennie is blinded in the crossfire of his most recent hit, Jeffrey chooses to retire after one last job to pay for his unintended victim''s sight-restoring operation. But when Jeffrey is double-crossed, he reluctantly joins forces with a rogue policeman to make things right.','col',927,10835,'tt0097202','/8hTxlSqMAHBXAh1eB69ir0BXhzE.jpg','/z8zZouMO4vvRNVAwexgMbaIgxYe.jpg');
INSERT INTO movies VALUES('30766','Meek''s Cutoff',2010,'["USA"]','["Western","Drama"]',104,'Set in 1845, this drama follows a group of settlers as they embark on a punishing journey along the Oregon Trail. When their guide leads them astray, the expedition is forced to contend with the unforgiving conditions of the high plain desert.','col',928,57120,'tt1518812','/jxjLpZseFdzMBvGfTscTTpM94Yk.jpg','/r5OcDVvL5NSRZ7JOZTpZDTVmzIE.jpg');
INSERT INTO movies VALUES('21401','Mothlight',1963,'["USA"]','["Short"]',4,'Seemingly at random, the wings and other bits of moths and insects move rapidly across the screen. Most are brown or sepia; up close, we can see patterns within wings, similar to the veins in a leaf. Sometimes the images look like paper cutouts, like Matisse. Green objects occasionally appear. Most wings are translucent. The technique makes them appear to be stuck directly to the film.','col',929,97514,'tt0057324','/8sD8P2j72XGF1PLPaC5wihp4oHN.jpg','/wVDOoeErw4xPMtPnXvKwObAj2EG.jpg');
INSERT INTO movies VALUES('21864','From the Clouds to the Resistance',1979,'["Italy","West Germany","UK","France"]','["Drama"]',104,'''Dalla nube alla resistenza (From the Cloud to the Resistance ) (1978), based on two works by Cesare Pavese, falls into the category of History Lessons and Too Early, Too Late as well. It, too, has two parts—a twentieth-century text and a text regarding the myths of antiquity, each set in the appropriate landscape. Pavese''s The Moon and the Bonfires looks back on the violent deaths of Italian anti-Fascist resistance fighters; Dialogues with Leucò is a series of dialogues between heroes and gods, connecting myth and history and returning to an ambiguous stage in the creation of distinctions, such as that between animal and human, which are fundamental to grammar and language itself. Such a juxtaposition of political engagement with profoundly contemplative issues such as myth, nature, and meaning points to the characters of Empedocles and Antigone in the Hölderlin films.''  (From "Landscapes of resistance. The German Films of Danièle Huillet and Jean-Marie Straub" by Barton Byg)','col',930,87415,'tt0079023','/h1A5chyYVo4bej5g9qVsU3vjOYU.jpg','/psS2AwPl8Aat9Qn293319e4X9gF.jpg');
INSERT INTO movies VALUES('11232','Dirty Harry',1971,'["USA"]','["Crime","Action"]',102,'When a madman dubbed ''Scorpio'' terrorizes San Francisco, hard-nosed cop, Harry Callahan – famous for his take-no-prisoners approach to law enforcement – is tasked with hunting down the psychopath. Harry eventually collars Scorpio in the process of rescuing a kidnap victim, only to see him walk on technicalities. Now, the maverick detective is determined to nail the maniac himself.','col',931,984,'tt0066999','/UHxxkYe9tRdiPu0JFgcEL5hmQ4.jpg','/ezrb56YdkoG59fZj50IxE9OnADx.jpg');
INSERT INTO movies VALUES('5863','Roman Holiday',1953,'["USA"]','["Romance","Comedy","Drama"]',118,'Overwhelmed by her suffocating schedule, touring European princess Ann takes off for a night while in Rome. When a sedative she took from her doctor kicks in, however, she falls asleep on a park bench and is found by an American reporter, Joe Bradley, who takes her back to his apartment for safety. At work the next morning, Joe finds out Ann''s regal identity and bets his editor he can get exclusive interview with her, but romance soon gets in the way.','bw',932,804,'tt0046250','/8lI9dmz1RH20FAqltkGelY1v4BE.jpg','/2H9B5SGxgFoXWzMBcXYEI8WCUBB.jpg');
INSERT INTO movies VALUES('1359','7th Heaven',1927,'["USA"]','["Romance","Drama","War"]',119,'A dejected Parisian sewer worker feels his prayers have been answered when he falls in love with a street waif.','bw',933,82474,'tt0018379','/wdSn5awvsTklNxwDlEoYKLpeYnl.jpg','/ebgjvr2dwubTYzOfa419bAzumQ0.jpg');
INSERT INTO movies VALUES('13511','Mon oncle d''Amérique',1980,'["France"]','["Drama","Comedy"]',123,'Prof. Henri Laborit uses the stories of the lives of three people to discuss behaviorist theories of survival, combat, rewards and punishment, and anxiety. René is a technical manager at a textile factory and must face the anxiety caused by corporate downsizing. Janine is a self-educated actress/stylist who learns that the wife of her lover is dying and must decide to let them reunite. Jean is a controversial career-climbing writer/politician at a crossroads in life.','col',934,39543,'tt0081176','/e9gbeslzPIav8ELEPRrKB1EzonF.jpg','/fvUj0nF6u5iigfzZpGfAmTxWozi.jpg');
INSERT INTO movies VALUES('4263','Portrait of Jennie',1948,'["USA"]','["Romance","Fantasy","Mystery"]',86,'A mysterious girl inspires a struggling artist.','bw',935,32558,'tt0040705','/AuZVFoCOxKKwC6eKWol4NkAFpWi.jpg','/n9Hbq2PRv3nhbFbLQkgWb7nP8Ck.jpg');
INSERT INTO movies VALUES('18577','Enfance nue, L''',1968,'["France"]','["Drama"]',80,'Handed over to foster care by his mother—who''s unwilling to give up permanent custody—the now-adolescent François understands that nothing in life is permanent, and his increasingly erratic actions reflect this knowledge.','col',936,31345,'tt0065695','/2cD6WpamMeCdMoinljqnj5c6YrF.jpg','/kfcUXzhIwEbNVVYikQWZXc1FRW1.jpg');
INSERT INTO movies VALUES('21495','People on Sunday',1930,'["Germany"]','["Romance","Comedy","Drama"]',74,'A semi-documentary experimental 1930 German silent film created by amateurs with a small budget. With authentic scenes of the metropolis city of Berlin, it''s the first film from the later famous screenwriters/directors Billy Wilder and Fred Zinnemann.','bw',937,347,'tt0020163','/gWIkCmYaRDlA78WMIfRUlURuLCZ.jpg','/9Ldf2rbtTpIvars9mf896XhFMvq.jpg');
