INSERT INTO movies VALUES('14449','Blood Simple',1984,'["USA"]','["Thriller","Drama","Crime"]',97,'The owner of a seedy small-town Texas bar discovers that one of his employees is having an affair with his wife. A chaotic chain of misunderstandings, lies and mischief ensues after he devises a plot to have them murdered.','col',939,11368,'tt0086979','/n8D1gVXUgmW4kkDzUzzoezAmUUa.jpg','/1SXmeSZMAztwQuo6QirDfUApcsC.jpg');
