INSERT INTO movies VALUES('15531','Last Emperor, The',1987,'["China","Italy","UK","France"]','["History","Biography","Drama"]',163,'A dramatic history of Pu Yi, the last of the Emperors of China, from his lofty birth and brief reign in the Forbidden City, the object of worship by half a billion people; through his abdication, his decline and dissolute lifestyle; his exploitation by the invading Japanese, and finally to his obscure existence as just another peasant worker in the People''s Republic.','col',944,746,'tt0093389','/7TILJhdeJAaEyDiwvJZMo9SQBoe.jpg','/mTw4n5MYQMftHuGsSmBrgMu7C1H.jpg');
