INSERT INTO movies VALUES('33369','Tabu',2012,'["Portugal","Germany","Brazil","France"]','["Drama","Romance"]',118,'Lisbon, Portugal, 2010. Pilar, a pious woman devoted to social causes, maintains a peculiar relationship with her neighbor Aurora, a temperamental old woman obsessed with gambling who lives tormented by a mysterious past.','bw',949,93858,'tt2153963','/mtr1ztUkJs6jsYdzK3gBLsuffr4.jpg','/gQl49yeF5obPM4V0jaAZjBcxMgc.jpg');
INSERT INTO movies VALUES('802','Chienne, La',1931,'["France"]','["Drama","Crime"]',95,'Cashier Maurice Legrand is married to Adele, a terror. By chance, he meets Lucienne, "Lulu", and make her his mistress. He thinks he finally met love, but Lulu is nothing but a streetwalker, in love with Dede, her pimp. She only accepts Legrand to satisfy Dede''s needs of money.','bw',950,26614,'tt0021739','/oX2W3mkHCrG9VRlbzB0MD8GeAcB.jpg','/hiaZPun8bezhRcY8rFJEtRE8PG.jpg');
INSERT INTO movies VALUES('12740','Perfumed Nightmare',1977,'["Philippines"]','["Drama","Comedy"]',93,'Kidlat, a Filipino jeepney driver, is fascinated by the idea of the American space programme and by Western society as a whole. When he moves to Paris, disillusionment sets in as his dreams are gradually shattered.','col',951,84765,'tt0076341','/fdIFmlnSbadQn4AQor4ktOzuPU.jpg','/m03eY6KEXabaqXklt6IGSBdUq6T.jpg');
INSERT INTO movies VALUES('5875','Sawdust and Tinsel',1953,'["Sweden"]','["Drama"]',92,'The complicated relationships between a circus ringmaster, his estranged wife and his lover.','bw',952,47721,'tt0045848','/pwP5zPHG5xMPQbs9JarjDD8icUl.jpg','/fMYjzQAqTlz8kWAcSmjSH9s7QIN.jpg');
INSERT INTO movies VALUES('12196','Fox and His Friends',1975,'["West Germany"]','["Drama"]',123,'Fox, a former circus performer, wins the lottery of DM 500,000 and can now have the life and things that he has always wanted. While he wants to climb up the social ladder, it isn''t without turmoil, and being torn between his old working class roots, and the shiny new facade of middle class consciousness.','col',953,42254,'tt0072976','/uYHNK7VycMOcD9Jv5qgjIdvDwgG.jpg','/shIMqYeRZArmAsUe3FYGhHgWAkM.jpg');
