INSERT INTO movies VALUES('1118','Olympia',1938,'["Germany"]','["Documentary","Sport"]',201,'The First part of Olympia, a documentary about the 1936 Olympic games in Berlin by German Director Leni Riefenstahl. The film played in theaters in 1938 and again in 1952 after the fall of the Nazi Regime.','bw',955,677,'tt0030522','/49KaePhxdoM3TkJHo8zaoCFEJ6X.jpg','/uXuxoktT74hcMqNvbf6dPKPCPHD.jpg');
INSERT INTO movies VALUES('1647','True Heart Susie',1919,'["USA"]','["Drama","Comedy","Romance"]',87,'Susie secretly loves her neighbor, William Jenkins, but neither, it seems, can confess their feelings for each other.','bw',956,36106,'tt0010806','/nY7RlPEAlziE9mgiXeOFLXGklEh.jpg','/aJdYFBDSDZxACp2QMtvTTAGIgpK.jpg');
