INSERT INTO movies VALUES('17936','Léon',1994,'["France"]','["Thriller","Crime"]',119,'Léon, the top hit man in New York, has earned a rep as an effective "cleaner". But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathilda''s thoughts turn to revenge, and she considers following in Léon''s footsteps.','col',958,101,'tt0110413','/yI6X2cCM5YPJtxMhUd3dPGqDAhw.jpg','/jynfI114q3kOAbIiVjVfFFmttU2.jpg');
INSERT INTO movies VALUES('18700','Moi, un Noir',1958,'["France"]','["Drama"]',70,'Winner of the prestigious Prix Louis Delluc in 1958, "Moi, un noir" marked Jean Rouch''s break with traditional ethnography, and his embrace of the collaborative and improvisatory strategies he called "shared ethnography" and "ethnofiction". The film depicts an ordinary week in the lives of men and women from Niger who have migrated to Abidjan, Côte d''Ivoire for work.','col',959,64299,'tt0051942','/6Zz3rVvm8vjXMy9UWkbPGN3cL9v.jpg','/892QHrkOrg3mGJT3YtPwJ2xA11L.jpg');
INSERT INTO movies VALUES('7671','Tarnished Angels, The',1957,'["USA"]','["Drama"]',91,'In the 1930s, once-great World War I pilot Roger Shumann performs as a daredevil barnstorming pilot at aerial stunt shows while his wife, LaVerne, works as a parachutist. When newspaper reporter Burke Devlin arrives to do a story on the Shumanns’ act, he quickly falls in love with the beautiful--and neglected--LaVerne.','bw',960,38432,'tt0051055','/ild53BRNQKP6IhNaqW0Ccjn1h6O.jpg','/bcIZAbwH4iPEeJ1hYcGyU4Fsv69.jpg');
INSERT INTO movies VALUES('5485','Othello',1951,'["Italy","Morocco","USA"]','["Drama"]',90,'When a secret marriage is planned between Othello, a Moorish general, and Desdemona, the daughter of Senator Brabantio, her old suitor Roderigo takes it hard. He allies himself with Iago, who has his own grudge against Othello, and the two conspire to bring Othello down. When their first plan, to have him accused of witchcraft, fails, they plant evidence intended to make him believe Desdemona is unfaithful.','bw',961,47697,'tt0045251','/2IS8i2FVKV9kD9KS3QJaEWcwHpx.jpg','/kHbwWLE4mFVoC4wFCXsZ2HioRuf.jpg');
INSERT INTO movies VALUES('1213','Port of Shadows',1938,'["France"]','["Drama","Romance","Crime"]',91,'Down a foggy, desolate road to the port city of Le Havre travels Jean, an army deserter looking for another chance to make good on life. Fate, however, has a different plan for him, as acts of both revenge and kindness render him front-page news.','bw',962,46326,'tt0030643','/6uDVpuGN20qaBfGkP1qhnzB4CvX.jpg','/fyzuCjPlIFqRCQwAMXRM55mlY7o.jpg');
INSERT INTO movies VALUES('22008','Shaun of the Dead',2004,'["UK","USA","France"]','["Action","Comedy","Horror"]',99,'Shaun lives a supremely uneventful life, which revolves around his girlfriend, his mother, and, above all, his local pub. This gentle routine is threatened when the dead return to life and make strenuous attempts to snack on ordinary Londoners.','col',963,747,'tt0365748','/dgXPhzNJH8HFTBjXPB177yNx6RI.jpg','/mrdHbaCp3ysDrzUHle5eQlY9Vzu.jpg');
INSERT INTO movies VALUES('4456','Gun Crazy',1950,'["USA"]','["Drama","Crime"]',86,'Bart Tare is an ex-Army man who has a lifelong fixation with guns, he meets a kindred spirit in sharpshooter Annie Starr and goes to work at a carnival. After upsetting the carnival owner who lusts after Starr, they both get fired. Soon, on Starr''s behest, they embark on a crime spree for cash.','bw',964,18671,'tt0042530','/kC1IIitCJTZLwZyuQnKw4zaOaXc.jpg','/eR9S6iMbk4ycV7DcqvVxFp8lNFV.jpg');
INSERT INTO movies VALUES('22104','Return, The',2003,'["Russia"]','["Drama"]',110,'The relationships among two pre-pubescent brothers and their estranged father are tested on a trip into the Russian wilderness.','col',965,11190,'tt0376968','/7V8iHBs34cPYw7ohpLqliF9x8Gv.jpg','/mn1YEB7D9JLIevqD0ktR1byrVMO.jpg');
INSERT INTO movies VALUES('5561','Summer with Monika',1953,'["Sweden"]','["Drama","Romance"]',96,'Monika from Stockholm falls in love with Harry, a young man on holiday. When she becomes pregnant they are forced into a marriage, which begins to fall apart soon after they take up residence in a cramped little flat.','bw',966,47735,'tt0046345','/82hLsn67V9TjgrLOZCFL7247pJd.jpg','/kF5UhtIbadVqR0sfhzBBmwq8ToG.jpg');
INSERT INTO movies VALUES('4279','Rope',1948,'["USA"]','["Drama","Crime","Thriller"]',80,'Two men murder a man in cold blood for the thrill and invite his parents over for a celebration to prove they have committed the perfect crime, but they also have to deal with their former schoolmaster, who becomes suspicious.','col',967,1580,'tt0040746','/b26XeLSqZpC807rPvAvGgQM2c3c.jpg','/81LX4wktTXWEXjLNlkHTmJm7tRu.jpg');
INSERT INTO movies VALUES('8792','Ride the High Country',1962,'["USA"]','["Western"]',94,'An ex-lawman is hired to transport gold from a mining community through dangerous territory. But what he doesn''t realize is that his partner and old friend is plotting to double-cross him.','col',968,36206,'tt0056412','/oBdJliz2o88ZLPulL5KLdbRsQuf.jpg','/vxVpk2tULLGvWNQMTEbotxbyrpI.jpg');
INSERT INTO movies VALUES('5623','Anatahan',1953,'["Japan"]','["War","Drama"]',92,'During WWII, a group of Japanese soldiers are stranded on the remote Pacific island of Anatahan.','bw',969,104776,'tt0046712','/hfut8CVv8VlTH0DnIE2pI0Zlv7z.jpg','/rRIjR9twAGBrO2SF4Rp1oo54042.jpg');
INSERT INTO movies VALUES('25738','I Am Twenty',1965,'["USSR"]','["Drama"]',189,'Having returned from the army, 20-year-old Sergei settles down at the thermal power station and merges into ordinary life. Every day he meets and spends time with childhood friends — the young family man Slava and the merry fellow Nikolai, and once at first sight he falls in love with a stranger on the bus. A lyrical story about a generation of young people entering adulthood, a reappraisal of values, life principles, traditions in culture and art.','bw',970,148782,'tt0058361','/mvGm5MyJeKe8DPks3rOLsNFuwmD.jpg','/5oMDcgFJW75JU4aI4caZbViPjbm.jpg');
INSERT INTO movies VALUES('21486','Lord of the Rings: The Return of the King, The',2003,'["New Zealand","USA"]','["Fantasy","Adventure","Action"]',201,'Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron''s forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord''s realm.','col',971,122,'tt0167260','/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg','/2u7zbn8EudG6kLlBzUYqP8RyFU4.jpg');
INSERT INTO movies VALUES('800','Bête humaine, La',1938,'["France"]','["Drama","Crime"]',100,'Returning by train to the French port of Le Havre, Jacques Lantier, a tormented railwayman, meets by chance the impulsive stationmaster Roubard and Séverine, his wife.','bw',972,29415,'tt0029957','/yB8UpOKAz4yorzBqLWXtc6hO3O4.jpg','/jS9W4jk2vPtq8PIZppYwYAPZpUP.jpg');
INSERT INTO movies VALUES('21585','Page of Madness, A',1926,'["Japan"]','["Drama"]',70,'A man takes a job at an asylum with hopes of freeing his imprisoned wife.','bw',973,94525,'tt0017048','/jHKDJ9mqHUYIgS4jajofy0Jpx97.jpg','/bi2wo3a2ncjbnaGARBCZh3Vfn8v.jpg');
INSERT INTO movies VALUES('1868','Duel',1971,'["USA"]','["Thriller","Action"]',90,'Traveling businessman David Mann angers the driver of a rusty tanker while crossing the California desert. A simple trip turns deadly, as Mann struggles to stay on the road while the tanker plays cat and mouse with his life.','col',974,839,'tt0067023','/w9Vk1Txx14vWvACELFYFlixrsfr.jpg','/nVl6SKKzuweWqDo56Iipov2tqm0.jpg');
INSERT INTO movies VALUES('10726','Z',1969,'["France","Algeria"]','["Political","Thriller","Drama"]',127,'Amidst a heated political climate, the opposition leader is killed in what appears to be a traffic accident. When a magistrate finds evidence of a government cover-up, witnesses start to get targeted. A thinly-fictionalized account of the events surrounding the assassination of Greek politician Grigoris Lambrakis in 1963, Z captures the outrage about the military junta that ruled Greece at the time.','col',975,2721,'tt0065234','/dFAJyFNgvOv24f2RQyI9KDxjGr3.jpg','/Ru4YeA6BpROEJkIwayqfBHkQ7O.jpg');
INSERT INTO movies VALUES('3674','Gilda',1946,'["USA"]','["Thriller","Drama"]',110,'A gambler discovers an old flame while in Argentina, but she''s married to his new boss.','bw',976,3767,'tt0038559','/46eKPjoWEyNBAQKDoXEcDFBcaUw.jpg','/ykN6BZ6UW8ooqH8TN4C0ttfhpuO.jpg');
INSERT INTO movies VALUES('10751','Beyond the Valley of the Dolls',1970,'["USA"]','["Drama","Comedy"]',109,'An all-female rock group finds fame, love, and drama when they move to LA in order to claim the lead singer’s inheritance.','col',977,5722,'tt0065466','/kmGOF3T35Q6zM1PMmp4Gf0VNX65.jpg','/4ms1JNHHpW4rwEXnjyhLN7IP0PZ.jpg');
INSERT INTO movies VALUES('14766','Breakfast Club, The',1985,'["USA"]','["Drama","Comedy"]',97,'Five high school students from different walks of life endure a Saturday detention under a power-hungry principal. The disparate group includes rebel John, princess Claire, outcast Allison, brainy Brian and Andrew, the jock. Each has a chance to tell his or her story, making the others see them a little differently -- and when the day ends, they question whether school will ever be the same.','col',978,2108,'tt0088847','/vSqk5BeQ1HvP9wq0rWZyWqiwXeF.jpg','/qpPFF8Sed5lkXngWraJdN8WkwDG.jpg');
INSERT INTO movies VALUES('4551','Reckless Moment, The',1949,'["USA"]','["Drama","Crime"]',82,'After discovering the dead body of her teenage daughter''s lover, a housewife takes desperate measures to protect her family from scandal.','bw',979,28007,'tt0041786','/8IuAjOKH6EIUfE4UWf7ooQUL9xl.jpg','/c0gCHnvEqurJAbmp4Pk2kuUH2a6.jpg');
INSERT INTO movies VALUES('27120','Avatar',2009,'["USA","UK"]','["Action","Science Fiction","Adventure"]',161,'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.','col',980,19995,'tt0499549','/kyeqWdyUXW608qlYkRqosgbbJyK.jpg','/vL5LR6WdxWPjLPFRLe133jXWsh5.jpg');
INSERT INTO movies VALUES('8248','Spartacus',1960,'["USA"]','["Adventure","History","Drama"]',197,'The rebellious Thracian Spartacus, born and raised a slave, is sold to Gladiator trainer Batiatus. After weeks of being trained to kill for the arena, Spartacus turns on his owners and leads the other slaves in rebellion. As the rebels move from town to town, their numbers swell as escaped slaves join their ranks. Under the leadership of Spartacus, they make their way to southern Italy, where they will cross the sea and return to their homes.','col',981,967,'tt0054331','/xLPpQlFWE12cbqNJQ5Vf4eJU8ij.jpg','/9caD0fGCrp96JTFFeGyI0CGNj7.jpg');
INSERT INTO movies VALUES('1859','Trou, Le',1960,'["France","Italy"]','["Prison","Drama","Crime"]',131,'Four prison inmates have been hatching a plan to literally dig out of jail when another prisoner, Claude Gaspard, is moved into their cell. They take a risk and share their plan with the newcomer. Over the course of three days, the prisoners and friends break through the concrete floor using a bed post and begin to make their way through the sewer system -- yet their escape is anything but assured.','bw',982,29259,'tt0054407','/8kxtOm7D992iAaOzUoWmNQwbXjs.jpg','/f72GEQF2lKsdmEULSI9bWCbQylH.jpg');
INSERT INTO movies VALUES('18595','Handsworth Songs',1986,'["UK"]','["Documentary"]',61,'The Black Audio Film Collective’s acclaimed essay film, ''Handsworth Songs'', examines the 1985 race riots in Handsworth and London. Interweaving archival photographs, newsreel clips, and home movie footage, the film is both an exploration of documentary aesthetics and a broad meditation social and cultural oppression through Britain’s intertwined narratives of racism and economic decline.','col-bw',983,124027,'tt0251113','/xyw4V9MbUGujMunBj4latxLSVya.jpg','/p0ojJ5mAVF1GZmtLp7vuxNtxZU6.jpg');
INSERT INTO movies VALUES('16748','Carlito''s Way',1993,'["USA"]','["Drama","Crime"]',144,'A Puerto-Rican ex-con, just released from prison, pledges to stay away from drugs and violence despite the pressure around him, and lead a better life outside NYC.','col',984,6075,'tt0106519','/g6D7mjQtndu768cusGmoEQY9fTB.jpg','/tqlCsB6AFjQ9dpAOHkd3sEdFS13.jpg');
INSERT INTO movies VALUES('16346','Sweetie',1989,'["Australia"]','["Comedy","Drama"]',97,'The buttoned-down, superstitious Kay is attempting to lead a normal existence with her new boyfriend Louis. That’s until Sweetie, her rampaging, devil-may-care sister, returns home after an absence, exposing the rotten roots of their family and placing a strain on Kay and Louis’ relationship.','col',985,65015,'tt0098725','/25lpQtxNWXzOimnXmbwF0Y0GYej.jpg','/16idNRmOLHtNymKpsn0TnxltbQr.jpg');
INSERT INTO movies VALUES('12269','Numéro deux',1975,'["France"]','["Drama"]',88,'Jean-Luc Godard mixes video and film in his Grenoble studio, discussing how he secured funding for the film. The action unfolds on two monitors, as a young working-class couple lives in a claustrophobic, high-rise apartment complex and marital discord is set off by the wife’s infidelity.','col',986,112823,'tt0073471','/mlcOoKproGk1zvwIb8Qx3eOJhMx.jpg','/8iAiIqaUa3uwOQYxslgIib4pz0x.jpg');
INSERT INTO movies VALUES('20827','Sholay',1975,'["India"]','["Action","Adventure","Comedy"]',162,'After his family is murdered by a notorious and ruthless bandit, a former police officer enlists the services of two outlaws to capture the bandit.','col',987,12259,'tt0073707','/ya9bwgqA4eNl5bQ9QqS0jcmRoBS.jpg','/8aYAfAPolsRFrHbP1rafeSgg2Ew.jpg');
INSERT INTO movies VALUES('24795','Host, The',2006,'["South Korea","Japan"]','["Action","Comedy","Horror"]',119,'A teenage girl is captured by a giant mutated squid-like creature that appears from Seoul''s Han River after toxic waste was dumped in it, prompting her family into a frantic search for her.','col',988,1255,'tt0468492','/dEDLY3KeghKFzks5nTDWdigVikr.jpg','/f8lQnoUG0UVK6xXOvfoP0alVJrW.jpg');
INSERT INTO movies VALUES('20526','Berlin: Symphony of a Great City',1927,'["Germany"]','["Documentary"]',65,'A train speeds through the country on its way to Berlin, then gradually slows down as it pulls into the station. It is very early in the morning, about 5:00 AM, and the great city is mostly quiet. But before long there are some signs of activity, and a few early risers are to be seen on the streets. Soon the new day is well underway. It''s just a typical day in Berlin, but a day full of life and energy.','bw',989,222,'tt0017668','/aP8MDztGU8W1I5qhrHXmv1fbIdj.jpg','/oJhrCtF4CbFPvAn7hGdT6QyFu8R.jpg');
INSERT INTO movies VALUES('8941','Sorpasso, Il',1962,'["Italy"]','["Drama","Comedy"]',105,'Roberto, a shy law student in Rome, meets Bruno, a forty-year-old exuberant, capricious man, who takes him for a drive through the Roman and Tuscany countries in the summer. When their journey starts to blend into their daily lives though, the pair’s newfound friendship is tested.','bw',990,24188,'tt0056512','/4h1ckrJQVcQYjeOkqS8i9BqZ9MI.jpg','/uUrV5KSjnZx47Dq7e6STr73iN4N.jpg');
INSERT INTO movies VALUES('17157','Ed Wood',1994,'["USA"]','["Drama","Comedy","Biography"]',124,'The mostly true story of the legendary "worst director of all time", who, with the help of his strange friends, filmed countless B-movies without ever becoming famous or successful.','bw',991,522,'tt0109707','/n8SrO3WbyuY2b6KazogqbQF348C.jpg','/71ChKjpKYwrO0Zv1NSw6ntbJ368.jpg');
INSERT INTO movies VALUES('11895','Arabian Nights',1974,'["Italy","France"]','["Fantasy","Adventure","Drama"]',130,'The final part of Pasolini''s Trilogy of Life series is rich with exotic tales of slaves and kings, potions, betrayals, demons and, most of all, love and lovemaking in all its myriad forms. Mysterious and liberating, this is an exquisitely dreamlike and adult interpretation of the original folk tales.','col',992,47406,'tt0071502','/zDrAREfrNvq5O10lHDDh529i143.jpg','/fp315t2MuJs3jOPPsoY2Jv7ZdPQ.jpg');
INSERT INTO movies VALUES('8890','America, America',1963,'["USA"]','["Drama"]',168,'A young Anatolian Greek, entrusted with his family''s fortune, loses it en route to Istanbul and dreams of going to America.','bw',993,47249,'tt0056825','/76RffKrNPrfA4TWYkx5wIIOzOlV.jpg','/igFjSTMsZOPDcY54utYWxvgM96Q.jpg');
INSERT INTO movies VALUES('16499','Godfather Part III, The',1990,'["USA"]','["Drama","Crime"]',161,'In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don, Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.','col',994,242,'tt0099674','/lm3pQ2QoQ16pextRsmnUbG2onES.jpg','/zNnjHLDtV8Ti3aworltaeaLMov4.jpg');
INSERT INTO movies VALUES('9679','Cul-de-sac',1966,'["UK"]','["Thriller","Drama"]',111,'A wounded criminal and his dying partner take refuge at an old beachfront fortress. The owner of the fortress and his young wife, initially unwilling hosts, quickly experience their relationship with the criminal shift in a humorous and bizarre fashion.','bw',995,4772,'tt0060268','/jxNATC8t1rmrVMCMVMEAp41bgVm.jpg','/vrC3Zb6FpAkWWOtjkmdVWeUkxW5.jpg');
INSERT INTO movies VALUES('9386','Kwaidan',1964,'["Japan"]','["Horror","Fantasy","Drama"]',183,'Taking its title from an archaic Japanese word meaning "ghost story," this anthology adapts four folk tales. A penniless samurai marries for money with tragic results. A man stranded in a blizzard is saved by Yuki the Snow Maiden, but his rescue comes at a cost. Blind musician Hoichi is forced to perform for an audience of ghosts. An author relates the story of a samurai who sees another warrior''s reflection in his teacup.','col',996,30959,'tt0058279','/cfcIjq4V8GxtMN6GU3WnufTM9cD.jpg','/y8G11KP4qNY2251ufNezKF92EAR.jpg');
INSERT INTO movies VALUES('3483','Mildred Pierce',1945,'["USA"]','["Drama"]',109,'A hard-working mother inches towards disaster as she divorces her husband and starts a successful restaurant business to support her spoiled daughter.','bw',997,3309,'tt0037913','/iSXi0xvPUPwEI2xxWZrcKJXpUYc.jpg','/iWAijx2874J0QgNVXwqW24IMRai.jpg');
INSERT INTO movies VALUES('9418','Naked Kiss, The',1964,'["USA"]','["Drama","Crime"]',90,'A former prostitute works to create a new life for herself in a small town, but a shocking discovery could threaten everything.','bw',998,26031,'tt0058390','/vCiyhwDwJGLX9Y1kzdNkgIWEM3l.jpg','/oRNdJ70UnEwzn5sJ6MR6hh1AayB.jpg');
INSERT INTO movies VALUES('11737','Last Detail, The',1973,'["USA"]','["Drama"]',105,'Two Navy men are ordered to bring a young offender to prison, but decide to show him one last good time along the way.','col',999,14886,'tt0070290','/zQoNkO99qfaBjh5aoA0pKau1prp.jpg','/kyDesXA3VEx74ua1ZGAoYmzvjCc.jpg');
INSERT INTO movies VALUES('18692','Lady Windermere''s Fan',1925,'["USA"]','["Comedy","Drama"]',120,'A society woman believes her husband is having an affair, a misconception which may have dire personal consequences for all involved.','bw',1000,121379,'tt0016004','/fpDPAhrWuLiF28KMwDhYAj5ofTk.jpg','/vsHDZeBBXMJGyWSZ3nagKkpMg6B.jpg');
